(66, 66, 'Commerce', 'PORTFOLIO', 'Assessment 2 â€“ Portfolioâ€“ 80% of Module Marks \r\nThroughout the period of work experience you are to compile a portfolio that reflects on and evaluates experience.  You are to collect evidence to demonstrate how you have met the specific requirements/objectives of your experience. \r\nPART 1\r\nThis section should include a comprehensive introduction and overview of your work-based learning environment. Demonstrating an in depth understanding of current issues and challenges. \r\nYou should also include a comprehensive record of the work experience period with key skills well identified and fully summarised. \r\nPART 2\r\nDuring the course of the module and through your work-based learning experiences, you will have come up against a variety of situations which will have challenged you and where you will find a variety of learning has occurred.  You are to critically analyse and evaluate six learning situations with full consideration of academic reflective theory.  The situations you choose could be related to the work for your client, employer, internship, working as part of a team, developing your own skills etc.  You should include the following:\r\n1)	Briefly describe the situation;\r\n2)	Explain how you handled/responded to the situation;\r\n3)	Analyse (by referring back to your learning style from your PAR) how you handled the situation â€“ what you did well, and what you might do differently if you had to handle that situation again;\r\n4)	Evidence the learning that has taken place as appropriate.\r\nThe evidence you collect to demonstrate your level of competence/learning, presented in your appendices, could include:\r\n1)	Formal appraisal forms completed by your supervisor;\r\n2)	Letters of commendation;\r\n3)	Documents from work that illustrate the work you have been doing and your level of expertise, for example computer printouts of Microsoft office documents.\r\nNB: the 80 hours of experience must be evidenced in the portfolio in the appendices\r\nThe learning and development that has taken place is about you as an individual however you should ensure you refer back to the work experience you have planned throughout the portfolio.\r\nA word-count 4,000 words +/- 10%, is specified and submissions which fall outside the limit set will incur a penalty which will be a deduction of 10%.\r\nPlease state clearly the word count of your assignment (minus the administrative sections) on the front page of your assignment (Title Page, Contents, Reference List and Appendices are excluded from the word count).\r\n', 'INTERNATIONAL EVENT MANAGEMENT ', 'Masters', '[\"Other\"]', '[\"Hospitality and Tourism,Hospitality management,Hospitality marketing,Hospitality studies,Hospitality,Hospitality English\"]', '2022-02-14 09:00', '4000 RUPEE', 'Assessment 2 â€“ Portfolio â€“ 4,000 words (80% of Module Marks ).epub_$_', '2023-05-22 18:42:19', '', '9', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(68, 68, 'Engineering', 'LEAVE MANAGEMENT SYSTEM IN JAVA', 'LEAVE MANAGEMENT SYSTEM IN JAVA\r\nMODULE\r\nFaculty Module: The members of faculty first need to get themselves registered into the app. Then the registered members of faculty can utilize the services of this System to specify request for leaves according to their leave types like annual, medical,casual. They also have privileges to track the status of their leaves and cancel their leave application. \r\nHOD Module: The HOD makes use of this System to check the leave requests generated by the members of faculty of his/her department. By considering the details specified, he can accept or reject the leave application thereby resulting in the update of leave status. HOD can also utilize the services of this app to apply, track and cancel a leave application.\r\nPrincipal Module: The Principal makes use of this System to check the leave requests generated by the HOD. By considering the details specified, he can accept or reject the leave application thereby resulting in the update of leave status. The principal is also authorized to view reports.', 'COMPUTER ENGINEERING', 'Bachelors', '[\"Report Writing\",\"Literature Review\",\"PPT Making\"]', '[\"Web Application development\"]', '2022-02-10 10:00', '2000', 'LMS.txt_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(69, 69, 'Commerce', 'CREDIT MANAGEMENT', 'a) Background of the case\r\nb) The underlying issues discussed in the case \r\nc) Key facts related to the case \r\nd) Relation with the credit policy\r\ne) Impact assessment of the issue discussed in the case \r\nf) Alternative course of action \r\ng) Existence of evidences\r\nh) Recommend the best solution \r\n\r\nEvaluation parameters (each parameter comprise of 5 Marks ) :\r\ni) Problem identification\r\nii) Analysis of key issues & Observations \r\niii) clarity of thoughts, flow of contents  and presentation skills\r\niv) Solutions recommended \r\n\r\n', 'MBA IN Finance', 'Masters', '[\"Case Studies\"]', '[\"FINANCE,Working Capital Management\"]', '2022-02-10 08:00', '500', 'credit management.pdf_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 1, 0, NULL, NULL, NULL, NULL, NULL),
