(91, 91, 'Commerce', 'A study on influence of entrepreneurship education at school level on entrepreneurial attitude of students.', 'The field selected for the research project is entrepreneurship and to be more specific, we intend to study the influence of entrepreneurship education at school level on entrepreneurial attitude of students. Need for this study arises because there are approximately 50-55 higher secondary educational institutions in Vadodara and only 2 schools offer Entrepreneurship as an elective subject. I personally believe that entrepreneurship is a very strong and empowering course and it benefits everyone. Even if we donâ€™t master\r\nthis course, everyone should at-least have a basic understanding of this subject. ', 'Bachelors in Business Administration ', 'Bachelors', '[\"Literature Review\",\"Thesis Writing\"]', '[\"Research method\"]', '2022-02-25 17:00', 'â‚¹2000', 'Business Resarch Project Guidelines.pdf_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
