(98, 98, 'Engineering', 'Computer science application', 'Defining The Problem: \r\n\r\nMy client Mr. Rajendra Agarwal is the sole owner of a company called Paolo \r\n\r\nScali which is a wholesaling business of ready-made male garments. My \r\n\r\nclient buys the fabric from a third party and give it to manufacturers who have \r\n\r\nbeen informed by us about the design required and then after the garments \r\n\r\nare manufactured and sold to retailers. The client is facing problems with the \r\n\r\nthe inventory of garments. The client has lost many transactions over the years as \r\n\r\nwell as the name of the retailers he sold them to all over the country which makes it difficult to contact those retailers for potential business opportunities. As the client is in the wholesaling business, he deals with quantities in the high hundreds and sometimes even thousands for a particular garment, and as the client has no digital framework to keep track of these garments it makes it difficult to know as to how much of a particular colour or a sample of a garment is remaining. The client also cannot keep track of whether or not only the designated person has entered the details in the book containing inventory and garments. And does not know if any details have been falsified. The client also has trouble recording the attendance of his employees, the clientâ€™s employees are only entitled to 8 days of holidays apart from festive seasons and they are subject to lose their salary if they exceed the 8-day limit.\r\n\r\nRationale â€“ The major \r\n\r\nproblems Mr. Rajendra and his company was facing was the attendance \r\n\r\nrecord of his employees and the amount of garments that were sold in which \r\n\r\nsize and colour. I have decided to make a software that will enable him to keep track of all these things such as customer names, garments sold, colour of garment sold and the size. The software will also include a feature where Mr. Rajendra can mark the attendance of an employee. \r\n\r\nTo create the following project, I will utilise NetBeans (Java OOP). Java \r\nprogrammes are interoperable with any operating system, making them easy to run on my client\'s computer. NetBeans will let me import both built-in and third-party libraries, which will speed up the development process. Encapsulation, inheritance, and polymorphism are all ideas that Java will allow me to use which will further enhance the software. Java also includes a number of features that will allow me to integrate my product with other software, such as the MySQL Database Management System (DBMS). Because it is a free application that runs on every OS and is exceptionally compatible with NetBeans, this is the best database administration software.\r\n\r\n', 'Computer science ', 'Diploma', '[\"Programming / Coding Assignment\"]', '[\"Computer Science IB board\"]', '2022-02-27 00:00', '20000 rs ', 'Criterion A.docx.pdf_$_', '2023-05-22 18:42:19', '', '8', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
