(107, 107, 'Engineering', 'Depression Detection System', 'So, our project is a application - It detects the depression and other mental issues through quiz.\r\nFeatures to be added: \r\nImage /Video detection \r\nA home page - Here the user will be able to register themself or if already registered, then login into the app directly.\r\n\r\nWorkbook/journal - The journal feature is a great way to practice self-care by reflecting on the day, noting any distressing thoughts, and documenting how you overcame them. \r\nThe app also provides a workbook/journal, where the user can write their thoughts or his schedule to clear their mind. The app will also provide the nearby IPH centers through its GPS for easy tracking and need.\r\n\r\n\r\n  An Information tab - It will help you to know your issue more accurately,it includes of what it is? reason behind it, symptoms,how to get rid of it,etc. (The information is verified by specialist.No internet information)\r\n\r\nVarious meditations, stress relieving exercises - It helps you learn how to change how you think, and develop self-awareness and healthy attitudes.Think of this feature as the cheerleader in your pocket, encouraging you to take charge of your life, ride out intense emotions, and face challenging situations\r\nContact tab - Incase of any help, you can use this app and learn about us.\r\n\r\nMachine learning models for this features.\r\n\r\n\r\n\r\nDrive link of code and datasets.(Quizofknowledge is the main code.Other one is extra)\r\nhttps://drive.google.com/drive/u/0/folders/1tIMdbrnYX7tLsO_pbyDG8XTH0oWZAqhR', 'Engineering', 'Bachelors', '[\"Programming / Coding Assignment\"]', '[\" Android development, Web development,Machine Learning,Deep Learning\"]', '2022-03-05 09:00', '7000 - 8000', '_$_', '2023-05-22 18:42:19', '', '2', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
