(109, 109, 'Commerce', 'Research and present product launch failing to comply to regulations or standards.', 'Research - Product launch failing to comply to regulations or standards_ minimum 2 pages. Brief product description, company description, detailed explanation of situation and which regulations were in question. why did the product fail to meet regulations? What can you learn from this? What was the outcome and did the company face fines or worse?\r\n1\" margins, double spaced, 12\r\npt font. Cite all references', 'International business', 'Diploma', '[\"Other\"]', '[\"development-of-products-and-services-for-an-international-market\"]', '2022-03-10 18:27', '600', '_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(110, 110, 'Commerce', 'financial review of potential market ', 'Assignment Criteria\r\n1.\r\nBuilding on your previous assignment 1, prepare a brief analysis of your target country on the basis of economic, financial and political considerations.\r\n2. Graphs and tables are great ways to present quantitative data. Look at current situation, trends and forecasts that are available on the internet. Government sites, NGO\'s and other international publications are available for free.\r\n\r\nItâ€™s the continuation of meat assignment. \r\nTotal word count -1000 , 1.5 word spacing and cite references also. ', 'International Business', 'Diploma', '[\"Other\"]', '[\"International-Trade-Finance\"]', '2022-03-12 20:39', '1200', 'D05429FB-F1C0-423D-98DA-8BC7D0383361.jpeg_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(111, 111, 'Commerce', 'Assignment ', 'Assgnmnt topic- \r\nYou have just joined Watt industries ( a manufacturer of cold drinks ) in Canada as VP, Product Development. Your boss, the CEO Charlie Watt is looking to develop many new products so he can take on Coke an pepsi in various INTERNATIONAL MARKETS and wants you to write a report to coach him on what you think he should do ( and why) to prepare for and execute his new product development initiatives.\r\n\r\nfont size-12 , double spaced and cite all the references. ', 'International business', 'Diploma', '[\"Report Writing\"]', '[\"Development-of-product-and-services-for-an-international-market\"]', '2022-02-27 09:00', '1100', '_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(112, 112, 'Engineering', 'Simulation of vehicle path  for autonomous vehicles for different scenarios. ', '\r\nScenarios to be simulated - \r\n1. Longitudinal and lateral control of the vehicle along with acceleration and braking. \r\n2. Highway conditions like lane changing and maintaining speed. \r\n3. Analysing and reaction to the situation of a traffic signal or sudden stop. \r\n4. Condition when it comes in contact or when it\'s about to come in contact with a pedestrian. \r\n\r\nSoftware: \r\nCARLA - Open source Simulation software. \r\n\r\nMain outcomes  \r\n1. Create a map (environment for the vehicle to operate) of a known location in Road Runner software by vector zero \r\n2. Gathering sensor data from the various sensors in the above mentioned scenarios. \r\n3. Sensors used should include camera, lidar \r\n4). The sensors should be able to be manipulated as per user needs', 'B.Tech in Automobile Engineering ', 'Bachelors', '[\"Blackbook\",\"Research Paper\"]', '[\"Simulation and Modeling,Sensors and Actuators,Machine Learning,Machine Learning\"]', '2022-03-12 11:00', '10,000', 'guidelines for report MU.pdf_$_BE PROJECT (2).pptx_$_', '2023-05-22 18:42:19', '', '', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
