(116, 116, 'Commerce', 'Financial Modeling Project (EIC, Forecasting, Valuation) of BAJAJ-AUTO', 'PART A: (15 Marks)\r\nEconomic, Industry and Company analysis on BAJAJ-AUTO \r\n\r\nPart B: Forecasting Financial Statements (15 marks)\r\nâ€¢ Forecast Income statement: With the help of historical 5-year data, forecast revenue and other key income & expenses on an appropriate and reasonable basis. The growth rate for each key component should capture & consider the forecast made for E, I and C\r\nâ€¢ Forecast Balance Sheet: With the help of historical 5-year data, forecast Capex, Working capital components, Debt structure, revenue and other key assets and liabilities on an appropriate and reasonable basis. The growth rate for each key component should capture & consider the forecast made for E, I and C\r\nâ€¢ Forecast Cash Flow statement: On the basis of the forecasts of Income statement & Balance sheet, prepare the forecasted cash flow statement\r\n\r\nPart C: Valuation & Analysis (10 marks)\r\nâ€¢ With the aid of appropriate analytical and valuation tools assess the companyâ€™s intrinsic value\r\nâ€¢ Conclude with a buy, hold or sell call\r\n\r\n\r\nPlease check attached documents for more details on the project and some sample projects', 'BBA - Finance', 'Bachelors', '[\"Other\"]', '[\"Financial Modeling\"]', '2022-03-06 23:59', '3000', 'TYBBA_F_Group-7-Star Paper Mills Ltd..xlsx_$_Sample PPT for ICA Project.pptx_$_Project_TYBBA_FinMod_21-22.pdf_$_Financial Modeling Sample project 2- Unlocked.xlsx_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
