(128, 128, 'Commerce', 'Women Empowerment in India', 'I have completed the introduction and literature review part of my research and I have a proposed methodology in mind. I need you to complete the rest of it, like methodology, data analysis, research gap/conclusion. For methodology you have to calculate - Human Development Index, Gender Development Index and Gender Empowerment Measure for the year 2017-2018. I have uploaded my current research paper below.', 'BSc. Economics ', 'Bachelors', '[\"Research Paper\"]', '[\"Economics and Finance\"]', '2022-03-22 13:30', 'Around 3000rs.', 'TYC041Research Paper.docx_$_', '2023-05-22 18:42:19', '', '9', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
