(133, 133, 'Commerce', 'Present key research focus on technological interventions  and management functions for hospitalty industry ', 'Chose a 5 start hotel brand like marriot, ITC , oberoi , 4 seasons and talk about the technology they utilise in order to increase guest satisfaction. Also mention how the technology in those hotels help to improve management functions like planning , control, etc in 2000 words\r\n', 'Hotel management', 'Bachelors', '[\"Essay Writing\"]', '[\"Management-of-hospitality-organization\"]', '2022-03-04 10:30', '3000', 'IMG-20220302-WA0008.jpg_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
