(141, 141, 'Engineering', 'Final Year Project : Online interactive textbook creation and viewing', '- o make an online web application / website for teaching, learning and sharing notes.\r\n- Teachers can share / publish their notes, diagrams, videos and research with students.\r\n- Students could interactively engage in learning through various ways by reading, watching videos, quizzes etc.\r\n- Our Project will have two MAIN users:\r\n1. Authorised Faculty (Create Mode)\r\n2. Students (View Mode)\r\n- **View Mode:**\r\n- Students cannot Publish Content only view it.\r\n\r\n**Create Mode:** Authorised Faculty will be able to publish notes.There will be a specific Format that will be followed to design a page:\r\n\r\nImages and Videos embedding procedure,Paragraph block,Text Highlighting,Title(size, font style),Other related links.\r\n\r\nWe are planning to make the creation of notes a little easier for teachers.By using Markdown formatting language and Content Management System.Markdown is a good formatting language which easy to understand. Formatting text with markdown is easy: like Bold, Italic, head1, head2. It enables all the text formatting features that are possible through html. Also embedding of images and videos is possible through markdown.Second way is we can use a CMS i.e. Content Management System. In which we will have to link our database and make available the feature of adding different blocks for paragraphs, title, images, videos etc.', 'Egineering', 'Bachelors', '[\"Other\"]', '[\"Final year project\"]', '2022-03-28 14:01', '10k', 'Project task 1 (1).docx_$_lofi wireframe textbook webapp main.pdf_$_document format database.pdf_$_', '2023-05-22 18:42:19', '', '', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
