(192, 192, 'Engineering', 'Final year project(Automatic Waste Segregation)', 'The process starts with customer or user placing waste object in a slot provided in the front \r\nface of the machine and then waste object is sensed with help of sensors and categorized using \r\nflaps which rotate using servomotor. These motors are operated using Arduino which takes input \r\nfrom sensors used for detecting various waste materials one at a time. the sensors used in this \r\nproject are inductive proximity sensors for metal detection and moisture sensor for classification \r\nin dry and wet waste category \r\n When consumer puts waste in the AWS, the sensor gives information to Arduino about \r\npresence of waste in sensing region. Arduino then turns on inductive proximity sensor which \r\nidentifies If the waste is made up of metallic material then sends positive or negative input to \r\nArduino. When a metal target enters the magnetic field created by coil, eddy current circulates \r\nwithin the target. This causes load on the sensor which decreases the oscillatorâ€™s amplitude. As \r\nthe target reaches close to the sensor further the oscillatorâ€™s amplitude decreases, this fluctuation \r\nof oscillator is detected in inductive proximity sensors. If the waste is not detected as metallic \r\nthen another sensor is activated which is moisture sensor, used for sensing moisture content in \r\nthe material to classify waste object as dry & wet waste. Sensor measures moisture content in \r\nthe waste, if the moisture content is above a pre-set threshold value set by manufacturer, then \r\nthe waste is declared as wet waste else it is classified as dry waste. After classification of \r\nwaste as dry, wet & metallic, the input is given to Arduino which is giving input to servomotors \r\nwhich are operating simultaneously to send waste in proper bin assigned for it using two flaps. \r\nOne flap will rotate in X-Y plane and other will rotate in Y-Z plane. Each flap eliminates one \r\nbin at a time, two flaps will eventually eliminate two bins and finally object will be properly \r\nsent to preassigned bin for it. Both flaps will rotate simultaneously with certain time delay to \r\navoid collision between both flaps or to prevent waste from going in the wrong bucket. Time \r\ndelay will be pre mentioned in the coding of Arduino, angle of rotation of each flap will also be \r\nnoted in code. All these values will be calculated pre-fabrication, so that we can design compact \r\nand sophisticated machine. After waste is collected in the bin assigned for it, the ultrasonic \r\nsensors is applied in the bins for detection of level of bins. Ultrasonic sensors work by sending \r\nout a sound wave at a frequency above the range of human hearing. The transducer of the sensor \r\nacts as a microphone to receive and send the ultrasonic sound. Ultrasonic sensors like many \r\nothers, use a single transducer to send a pulse and to receive the echo. The sensor determines \r\nthe distance to a target by measuring time lapses between the sending and receiving of the \r\n22 / 29\r\nultrasonic pulse. If the distance is less than the threshold distance mentioned by programmer, \r\nthe buzzer will ring notifying the operator that bin is full. Fully filled bins are then removed by \r\noperator and then sent to municipal corporations for further processing such as disposal, recycle \r\nor reuse based on the composition and properties of material used for that particular object, then\r\nempty bins are again placed in the AWS. Same process will take place every time.', 'Engineering', 'Bachelors', '[\"Programming / Coding Assignment\"]', '[\"Arduino\"]', '2022-04-07 12:44', '3000', 'Screenshot (1122).png_$_Screenshot (1121).png_$_', '2023-05-22 18:42:19', '', '8', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
