(223, 223, 'Commerce', 'A Financial Feasibility Simulation in a Food and Beverage Enterprise: A case study on ___________________(F & B Enterprise)', 'In Section 1, for 20% of the assignment, the student would have (A) tabulated the projected financial statements for three years: \r\n(1) Profit and Loss Account (2) Balance Sheet and (3) Funds Flow and Cash Flow Statement and (B) calculated the breakeven point in revenue and covers.\r\n\r\nIn Section 2, for 40% of the assignment, the student would have (A) established the theoretical aspect of the financial plan, in 250-300 words; (B) demonstrated the alternate finance plans: debt-equity mix, using simulation.\r\n\r\nIn Section 3, for 40% of the assignment, the student would have (A) discussed the theoretical overview of the capital budgeting decisions, in 250-300 words; (B) demonstrated the viability of the investments numerically using techniques based on time value of money: (1) Net Present Value  (2) Internal Rate of Return  (3) Pay-back Period and (4) Profitability Index.', 'culinary management', 'Bachelors', '[\"Essay Writing\"]', '[\"Business Finance\"]', '2022-04-02 09:00', '5000', 'BII-2050 BUSINESS FINANCE Alternative Assessment  2021.xlsx_$_', '2023-05-22 18:42:19', '', '7', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
