(357, 357, 'Engineering', 'Automatic Number Plate Detection of Moving Vehicles using Machine Learning Python', 'Automatic Number Plate Detection detects the number plate characters of moving vehicle videos using ML Python. In this project, models have to be trained (please don\'t use/clone pre-trained models for the same) using a training dataset. The resulting accuracy should be between 80 and 90 percent. The GUI of the project has to be made using Python where you can upload the videos so that the model would be able to detect the number plate characters and display them to the user.', 'Engineering IT', 'Bachelors', '[\"Programming / Coding Assignment\",\"Other\"]', '[\"Mini-Project-using-Machine-Learning\"]', '2022-05-08 19:00', '2.7k', 'ANPR DOC.pdf_$_', '2023-05-22 18:42:19', '', '3', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL);
