(358, 358, 'Commerce', 'Masters Research Project', '4.1	Assessment Summary\r\nAssessment 1 (100% of Module Marks)\r\nAssessment Method: 	Masters Research Project	Re-assessment Method: 	Revised Masters Research Project\r\nWord Count 	14,000 words	Word Count	14,000 words\r\nAssessment Date and Time: 	Research Project Start Date	Submission Date	Re-assessment Date and Time: 	Make good work\r\nDates TBC\r\n	October 2021	12pm Midday January 28th 2022		\r\n	January 2022	12pm Midday May 13th 2022		\r\n	June \r\n2022	12pm Midday 7th October 2022		\r\n	NB: Part-time students have the opportunity to study the module over two semesters 		\r\nFeedback Method:	On request from supervisor	Feedback Method:	On request from supervisor following exam board\r\nFeedback Date:	Following publication of results	Feedback Date:	Following publication of results\r\nLearning Outcomes Assessed:	1 and 2\r\n\r\n\r\n\r\n\r\n \r\n4.2	Assessment Details \r\n4.2.1	Essential Guidance for the Events Masters Research Project \r\nIt is important to initially select the type of project you will be conducting. This will be one of three broad types:\r\nA.	A primary research based empirical study; \r\nFor this type of project your starting point will typically be from a gap or problem that arises from academic theory.  Your rationale will identify the gap or problem in the theory; your intended audience is likely to be academic and the conclusions will have a more academic and theoretical focus.  \r\nB.	A desk-based project to include a literature review along with further analysis of secondary data;\r\nThis will require you to have access to a suitable existing data set but will not involve the collection of primary data.\r\nC.	An organisation-based research project.\r\nThis type of project has a more practical focus similar to a consultancy type of research.  The research could be for an organisation that you have approached, or could be for the organisation that you work for.  In the past some students have used their research project to undertake research as a foundation for a business enterprise or venture that they are planning.  Your rationale will identify the practical issue or problem which needs addressing and your introduction will provide the context to your organisation. Your intended audience will be practitioners and the conclusions will focus on practical recommendations rather than theoretical developments.  \r\nWhichever form is selected the Research Project report must include a critical review of relevant literature and a critical appraisal of the methodology selected.  \r\nYou will be advised on the most suitable type of project for your topic area during the research methods module and in the initial discussions with your supervisor.\r\n	The structure and style of the project submitted should be appropriate to its intended outcomes. Outlined below are the key stages of tackling a large project.  Your work should include these stages but, depending on the topic of study and the research design, the emphasis between them may vary. \r\nBefore looking at each of the stages in more detail it is vital not to deal with too wide a subject. The more closely the investigation can be defined the better will be the chance of achieving the learning outcomes (and a good mark).  \r\nYou should also note that you are expected to analyse and explain issues associated with the phenomenon being studied, rather than merely describing them. \r\nNormally, the project is written in an impersonal style (ie not using the first person, â€˜Iâ€™). However, where you use certain methodologies it may be permissible to refer to yourself in the first person.\r\n	Aim and Objectives \r\n	State the aim and objectives of your study i.e. what is the purpose of the project. \r\n	State your objectives in such a way that you can measure the extent to which they have been achieved. You may have a proposal (hypothesis) that is capable of being tested or you may have identified a research problem to investigate or a research question to answer. \r\n	Also it is very important to ensure that the aim and objectives defined are achievable within the scope of the research project (timescale, data availability and number of words).\r\n	Introduction and Approach\r\n	The introduction sets the context for the study. This covers the rationale behind the choice of topic and the overall approach to the work and how it is structured.  In other words it includes the justification for your aim and objectives and an overview of how you go about achieving them.  Decide what information is needed to achieve the aim and objectives and how you are going to collect it. Do not include areas that are not related to the topic. \r\n	Review of Theory and Literature Survey\r\n	This stage requires an investigation and discussion of past and current research/literature on your topic. To do this you should read and summarise relevant information on the topic. This literature review must be used to develop a theoretical framework for your work. It will vary according to the type of study that you are undertaking. However, an apparent lack of literature probably means that the topic is unsuitable for a research project. \r\n	The role of the literature survey can be summarised as follows:\r\nâ€¢	To help further clarify the purpose of your research and contribute to a rationale for the work.\r\nâ€¢	Provide a thorough examination of the relevant literature, so giving you a full understanding of the topic.\r\nâ€¢	Clearly identify and define the theoretical concepts and/or frameworks to be used in the work.\r\nâ€¢	To provide a context for your research by placing your specific topic in the literature and showing how your work relates to that already existing.\r\nâ€¢	Identify and analyse the relationships between ideas that make up the framework for your study.\r\nâ€¢	Provide a basis for your methodological choices\r\n\r\nIn order to do this it is necessary to look for and summarise areas of agreement and disagreement and contradictory evidence and analyse and evaluate theory and evidence with reference to the objectives of your study. \r\nA literature review should be comprehensive, current, critical and clearly focused on your objectives. It should cover the full range of literature available that relates to your topic. It is a requirement of a literature review that you use academic and research literature from journals, books, papers and government publications. Online research databases such as â€˜Discoverâ€™ provided by the library will enable you to search a wide variety of sources relatively easily.\r\nFollow the guidelines on referencing for the Leeds Beckett Harvard system. Also, wherever possible, you should refer to work read rather than overuse direct quotations (ask your supervisor if you are still unsure about the difference between direct and indirect quoting or paraphrasing). Also see the section on referencing below.\r\nAt this stage of the process your objectives will probably undergo some refinement or your research problem/question(s) will become more precise.\r\nOne of the key challenges of the research project is to produce a coherent and holistic piece of work in which all the sections link together and are clearly focused on the aim and objectives. This is obviously important throughout but especially so in establishing the relationship between the literature review and any primary research or secondary data analysis undertaken.\r\nThis should be discussed in detail with your supervisor but the basic principles are that:\r\nâ€¢	Your literature review is concluded effectively and you are clear about the findings and how they relate to the aims and objectives.\r\nâ€¢	The findings of your literature review are clearly and explicitly used to inform the methodology and, hence, the primary research.\r\nâ€¢	The data sought from the primary research is properly identified and is derived from and related to the literature review findings. \r\nâ€¢	The methods used to carry out the research are appropriate and relevant to the findings of the literature review and the data sought. \r\n\r\nResearch Design and Methodology\r\nIt is important to develop an effective methodology and to understand why your methodology is appropriate to this particular study. Consideration should therefore be given to the best methods to use to address the research problem or question that you have identified.\r\nYour method will vary with the type of study, but you will probably need to collect or locate data and analyse them.  This may well involve you in primary research (collecting data for the specific purposes of your project).  It does not, however, have to take this form. It may be possible to use existing data in a way that is new to this study.\r\nIt is expected that you will deal with the following elements in this stage of the research project:\r\nâ€¢	The specific purpose of this part of the process and how it contributes to the overall aims and objectives of the work.\r\nâ€¢	The choice of research approach (primary/secondary â€“ qualitative/quantitative).\r\nâ€¢	The choice of sample â€“ size, characteristics and selection method.\r\nâ€¢	If using primary data the methods used to collect the data and the precise design of any instruments used (interview schedules, questionnaires, observation checklists etc.).\r\nâ€¢	If using secondary data a critique of the collection method and awareness of any limitations\r\nâ€¢	Techniques used to analyse the data (again qualitative or quantitative).\r\nâ€¢	Critical evaluation of each of these factors.\r\nThe research methods module will have introduced a variety of data gathering techniques and associated means of analysis.  It is important that you are able to honestly criticise the methodology you have used, in the light of the outcomes and your original objectives. For example, how reliable and/or valid are the results? Are the measurements accurate? Is there any bias? etc. No research is perfect and the ability to reflect on your own research practice is an important part of becoming a good researcher.\r\n\r\nWHATEVER METHOD YOU ADOPT, YOU MUST NOT APPROACH ANY OUTSIDE BODY OR SEND OUT ANY POSTAL QUESTIONNAIRES UNLESS THE ETHICS COORDINATOR AND YOUR SUPERVISOR HAVE GIVEN PERMISSION AND YOU HAVE COMPLETED ALL THE NECESSARY ETHICS FORMS (AVAILABLE VIA Leeds Beckett Ethics Online). \r\nThis requirement applies equally to interviews with members of the public (such as street interviews) as to any other form of data gathering. These individuals may be contacted by tutors, as a means of verifying the data you attribute to them.  If potential participants wish to retain anonymity, you must explain to them that their identity will only be shared with tutors.\r\nPrimary Research Requirements\r\nPast experience has shown that the majority of students elect to undertake some form of primary research. This helps to support/test the findings of their reading and to draw effective and realistic conclusions for their work. \r\nWhen carrying out research it is vital that you conduct it professionally and ethically. \r\nVerification: In the past we have had some students who have been unable to verify the source(s) of their data or the way in which it was collected. As a result of this you MUST meet the requirements outlined below. \r\nAlthough this detail may not be presented in your research project due to issues of confidentiality and anonymity you must make sure that you keep records of the following in line with the Universityâ€™s research ethics policy. \r\n\r\n1.	Records of all sources of data.\r\n2.	Identify your sources including as much of the following information as possible;\r\nâ€¢	Name and addresses of individuals contacted.\r\nâ€¢	Their position within the organisation.\r\nâ€¢	The address of the organisation head office\r\nâ€¢	Dates & times of contacts.\r\n3.	Signed consent forms\r\n4.	The use of questionnaires carried out on a random basis in the street is usually discouraged in the project. Your supervisor is likely to ask you to look for alternative methods if you are considering this as an approach. If you do use this approach you must still collect as much of the data as possible from each respondent.\r\n\r\nIt is the intention of staff involved in the research project to follow up a random sample of primary research to confirm the information presented is accurate.\r\nEthics: the Universityâ€™s policy on research ethics is quite clear. All research should conform to some basic principles:\r\n1.	Beneficence â€“ â€˜do positive goodâ€™ and\r\n2.	Non-maleficence â€“ â€˜do no harmâ€™\r\n	The research should be assessed for potential risks concerning participants â€“ the interests of subjects and participants in the research should always come before those of the research itself.\r\n3.	Informed consent of participants\r\n	All participants should be given full and accurate information in order for them to decide whether to take part in the research or not. Example of Information sheet can be found on MyBeckett. \r\n4.	Confidentiality & anonymity\r\n	Explicit consent must be gained from participants in order to publish any information that may enable them to be identified. Examples of Consent forms can be found on MyBeckett. \r\n	(if the research involves a questionnaire then the consent form can be built into this, rather than requiring  a separate consent form)\r\nPlease refer to the separate guidance on â€œEthical clearance for research undertaken by studentsâ€ and submit the appropriate forms online as indicated via your MyBeckett module. \r\nClick here to submit your research ethics forms online https://researchethics.leedsbeckett.ac.uk/auth?redirect=%2F \r\nETHICS FORMS MUST BE SUBMITTED AND APPROVED BEFORE ANY PRIMARY RESEARCH IS UNDERTAKEN. WE RECOMMEND THIS IS DONE AT LEAST EIGHT WEEKS BEFORE YOUR SUBMISSION DATE.\r\nAny student without final ethics approval performing primary research or submitting work that includes primary research will be subject to investigation for unfair practice under the University Academic Regulations Section 10: Academic Integrity.\r\nBefore you begin your research; whether using primary sources (human subjects such as consumers, event managers, company employees etc.) or secondary sources (TripAdvisor comments, newspapers or company websites etc.) you must complete your Research Ethics forms online, have your Research Ethics forms approved by your supervisor and then approved by the Local Research Ethics Coordinator\r\nPlease read the Leeds Beckett University Research Policy https://www.leedsbeckett.ac.uk/-/media/files/policies/research-and-enterprise/upre_research_ethics_policy.pdf\r\nData Presentation, Analysis and Discussion\r\nPresent the data professionally, logically and clearly. There are two different methods suggested for this; either present your main findings separate from any analysis or discussion, or present your findings and discussion together. \r\nAs a general guideline it is likely that the former will be more appropriate for quantitative data and the latter for qualitative data. This is a guide not a rule you must follow, there will always be instances when either approach is appropriate. Make sure you discuss this with your supervisor.\r\nThe form of data analysis undertaken will vary according to how the project has been approached. Thus some research projects may involve highly quantitative analysis whereas others may utilise qualitative methods.  The research methods programme will introduce you to various data analysis techniques.  \r\nThe analysis needs to be appropriate for the study. For example, simple descriptive analysis may be acceptable in some instances but more sophisticated inferential analysis may be more appropriate and improve the quality of your findings. However you need to plan this in advance as collection of the wrong or insufficient data will make it difficult or impossible to conduct the required level of analysis. \r\nDiscussion of the significance of your results should consider:\r\nâ€¢	comparisons with similar research and findings in the literature;\r\nâ€¢	to what extent the data confirms or detracts from any theoretical framework developed in the literature review and/or used in your research;\r\nâ€¢	whether your data collection methods may have affected the results;\r\nâ€¢	practical and theoretical implications for firms, management, government bodies etc.\r\nThis section gives you the opportunity to evaluate your findings in context and thereby demonstrate your skills of evaluation, analysis and synthesis.\r\nConclusions and Recommendations\r\nConclusions (and possibly recommendations) are the final part of your work. They should follow naturally from the work done to this point and should summarise the key issues emerging from your work and set it in a wider context.  Is it possible, for example, to generalise on the basis of your findings? You conclusion should do this without bringing in any new arguments. Keep it concise and focused on the implications of your findings. \r\nDepending on the nature of the subject matter, you may wish to offer recommendations. These may be for the industry in terms of future action or for researchers considering a similar topic. \r\nIt is appropriate for you to suggest other, related, avenues for further consideration. This is not an afterthought to be tacked on to the end of the research project; it is a key element of the work that should not be left to the last minute. \r\nReferences \r\nAll sources of information to which you refer must be cited using the Harvard referencing convention. You should already be fully conversant with this style; if not full guidelines are available in the library or on the intranet.  \r\nThe reference list should not be a general list of publications on the topic. Only include those references to which you refer in the text, do not include sources read but not directly referred to.\r\nLast word\r\nThe better projects do not merely follow a linear process and are not a â€˜diaryâ€™ of what you did. The finished written work represents a completed solution to (or recommendations for) an identified problem. This means that you will revisit all sections of the written work throughout the module possibly revising your aim and objectives at the end of the process. With this in mind do not use the future tense but write as though you have completed the work. Past or present tense is appropriate.\r\n4.2.2	Further Assessment Details\r\nAssessment for the research project is based on the final completed thesis.\r\nYou will have had guidance about how to write your proposal for the Project within Research Methods. \r\nOnce proposals have been submitted they will usually be reviewed by the Course Research Project Co-ordinator and any appropriate colleagues for context specific elements. After reviewing your proposal you will be allocated a supervisor.\r\nYou must make arrangements to discuss with them immediately to start the research process. Where the proposal has not been passed you may be required to make changes before you start on your research. \r\nThe proposed title may change during the course of the work as might the methods employed or even the specific objectives. \r\nChanging topics part way through will severely limit the time available and you are unlikely to achieve the necessary standard of work.  Any request for alteration of the topic must be channelled through your Supervisor to the Course Research Project Co-ordinator.\r\nAssessment of the research project will be based on the criteria listed later in this section.  Each project will be double marked (supervisor plus one other member of staff) and the final mark may be the subject of scrutiny by the external examiner. \r\nThere may also be a confirmatory viva voce (interview) if necessary.\r\n\r\n4.2.3	Guidance on formatting your Masters Research Project\r\n\r\nâ€¢	Typing should be one and a half line-spaced, except for extended quotations, which should be single-spaced and indented. \r\nâ€¢	The left-hand margin should be a minimum of 40mm, and the remaining margins should be at least 20mm. \r\nâ€¢	The font should be 12 point except for headings and titles. \r\nâ€¢	Typing can be double sided.  \r\nâ€¢	All pages should be numbered.\r\n\r\nAt the front of the project there should be:\r\na)	a title page giving: \r\nï±	the title of the research project, which should give a clear indication of the content\r\nï±	your name\r\nï±	the name of your course, for example  â€œMSc International Events Management\" \r\nï±	the words â€œLeeds Beckett Universityâ€\r\nï±	the month and year of submission\r\n\r\n\r\nExample: 					   Title\r\nName\r\nPresented as part of the requirement for the award of the\r\nMSc/MA in â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦.\r\nLeeds Beckett University\r\nMonth, Year\r\n\r\na)	a declaration page with the wording:\r\nI, â€”â€”â€”â€”â€”â€” confirm that the work contained in this research project is my own work. It has not been previously published or submitted for assessment elsewhere.\r\nI confirm that all other sources of information have been acknowledged in line with the regulations for referencing.\r\nI confirm that I have fully complied with all University regulations regarding plagiarism and unfair practice.\r\nI confirm that the word count for the dissertation is XXXX\r\nName:    \r\nSignature:    ____________________ Date: ____________\r\n\r\nb)	an acknowledgements/dedications page (if desired).\r\nc)	an abstract of approximately 250 words outlining the main arguments\r\nd)	a contents page listing the page numbers of all sections/chapters \r\nand including , if appropriate\r\n-	a list of tables \r\n-	a list of figures, including maps, diagrams, photographs, etc.\r\ne)	a list of appendices (to include evidence of ethical approval).\r\n\r\nThe nature of the content will inevitably vary depending upon the individual study.  However, each project should normally include:\r\nï±	a background to the issue, explaining why it is important;\r\nï±	a clear statement of the research problem;\r\nï±	a review of relevant literature;\r\nï±	details of the methodology used;\r\nï±	the findings;\r\nï±	analysis and interpretation;\r\nï±	conclusions and recommendations or implications (possibly for theory, practice, policy, further research)\r\nï±	A bibliography of references (in Harvard style and only those you have referred to in the text.)\r\n\r\n	Numbering of pages begins with the Introduction to the report itself and not with the Title page, Acknowledgements and Contents. These pages are known as â€œPrelimsâ€ and if numbered should be given a different numbering from the main text e.g. (i) (ii) (iii) etc.  (The title page should not be numbered.) Numbering should be at the bottom centre of each page.\r\nThe length of the research project should be a maximum of 14,000 words (excluding appendices). The word count starts at your introduction and finishes after your recommendations\r\n\r\n	It is considered part of the discipline of the Research Project to work within this word limit.  Please pay attention to the maximum word-length for your assignment. You will not be penalised if you go slightly over the limit (up to 10%) but learning to write concisely is part of the discipline of producing a good, focussed essay or report. If your assignment is over-long we will not mark it and your work will be recorded as a non-submission.  Appendices should be used sparingly, essential information should be included within the word count as content in the appendices is not assessed.  The word limit excludes the list of references, appendices and assignment cover sheets.â€\r\n\r\nThe criteria for assessing the project are identified in Appendix B.  Your research project will, therefore, be assessed on the extent to which it demonstrates:\r\nâ€¢	The clarity of the rationale and focus. The level of internal consistency and the logical development of information to sustain arguments linking the research rationale, literature and findings indicating a high level of critical awareness of strengths and limitations of the research. Clarity of analysis and evaluation;\r\nâ€¢	A comprehensive literature research and/or study of background information consistent with the stated aim of the research project;\r\nâ€¢	An advanced understanding of the conceptual and theoretical perspectives and appreciation of methodological issues related to the research topic and has constructively criticised all major viewpoints illustrating awareness of strengths and limitations;\r\nâ€¢	That the analysis and/or discussion of the collected data or information is logically sound and is relevant to an evaluation of any hypothesis offered and the degree to which the aims have been fulfilled;\r\nâ€¢	That the presentation of the research project is in the approved manner with reference to format, argument, statistical information and analysis, appendices and referencing;\r\nâ€¢	The project is demonstrably the student\'s own work.\r\n\r\nKeeping in contact with your supervisor provides you with an opportunity to ensure that you are approaching your project in a manner that will increase your likelihood of meeting the assessment criteria.\r\n\r\nStudent Instructions for Submission of Coursework \r\nThis module requires you to submit your work online.\r\nYou MUST submit your work through MyBeckett using the link set up by the tutor. Receipt of your work will be recorded.\r\nYour \"Turnitin assignments\" in MyBeckett can be set up so that you can check your assignment yourself as you submit it. This checking is done by creating a \"Similarity Report\".  If this report shows that there are some problems with your work, such as un-cited quotations, you should be able to make corrections and re-submit the work again before the due date. More information about Turnitin is available online here: http://libguides.leedsbeckett.ac.uk/mybeckett/turnitin\r\n\r\nPlease note: Tutors will follow up any suspected breach of academic integrity found after the submission date as per University policy. Late penalties will apply as per University Regulations.\r\n\r\nParticular Instructions to Students\r\nPlease read carefully the assessment and grade/marking descriptors overleaf:\r\n \r\nCourse Title(s): 	MSc International Events Management / MSc Sports Events Management / MSc Responsible Tourism Management / MSc Experiential Event Marketing\r\nModule Title:	Masters Research Project	Level:	7\r\nAssessment Title:	Masters Research Project	Weighting: 	100%\r\n\r\nCriteria and Weighting	100-70\r\nExcellent	69-60 \r\nGood	59-50\r\nSatisfactory	49-40\r\nPoor	39-0\r\nFail\r\nRationale, aims and objectives\r\n\r\n	Excellently articulated and evidenced rationale, background & context.\r\nA novel and legitimate aim with appropriate objectives detailing what will be achieved	Rationale, background & context very clear and evidenced through reference to a range of sources.\r\nA clear aim and appropriate objectives 	Rationale, background & context clear and evidenced through reference to a range of sources.\r\nAim detailed with achievable objectives	Rationale, background & context included but lacking clarity/purpose. Some evidence provided through reference to sources.\r\nAim and objectives presented but with issues of clarity and/or appropriateness 	Major deficiencies in rationale, background & context. Little or no evidence/justification provided.\r\nMissing, unclear or inappropriate aim and objectives\r\nLiterature review	Extremely thorough & critical discussion of literature relevant to the area of study.\r\nBuilds a strong basis for the methodology and creates a theoretical or conceptual framework for the research  	Thorough & appropriate selection of up-to-date source material. All material presented relevant & appropriate to the study with a very good level of critique. \r\nA very good basis for the methodology A very good theoretical underpinning for the research 	Appropriate selection of up-to-date source material. Most material presented is relevant & appropriate to the study with a good level of critique. \r\nA good basis for the methodology and a sound theoretical underpinning for the research	Appropriate selection of source material. Material presented is mostly relevant to the study with some level of critique. \r\nSome basis for the methodology developed from previous research and secondary data 	Very little previous research presented that is relevant. Little or no critical discussion\r\nLittle or no basis for the methodology and a poor attempt at providing a theoretical underpinning for the research\r\n\r\nMethodology	Excellent explanation of methodology and methods appropriate to the aims & objectives & fully explained & justified through reference to the literature review.\r\nExcellent philosophical approach and research strategy designed to meet the aims & objectives of the study.\r\n Development of suitable research instruments drawing upon previous research.\r\nCritical evaluation of the research methods used, and an awareness of the strengths & weaknesses of the study design & methods\r\nVery clear explanation of the sampling method used. Critique of the validity of this and the sample size.\r\nInsightful consideration of ethical issues\r\n	Very good explanation of methodology and methods appropriate to the aims & objectives. Well explained & justified through reference to the literature review.\r\nCredible philosophical approach & research strategy designed to meet the aims & objectives of the study.\r\n Development of suitable research instruments drawing upon previous research.\r\nCritical evaluation of the research methods used, and an awareness of the strengths & weaknesses of the study design & methods\r\nClear explanation and critique of the sampling method & sample size.\r\nconsideration of ethical issues	Good explanation of methodology and methods appropriate to the aims & objectives. Explained & justified through reference to the literature review.\r\nPhilosophical approach & research strategy discussed to meet the aims & objectives of the study.\r\n Development of suitable research instruments \r\nSome critical evaluation of the research methods used, \r\nExplanation of the sampling method & sample size appropriate for the study\r\nconsideration of ethical issues	Explanation of methodology and methods appropriate to the aims & objectives. \r\nPhilosophical approach & research strategy presented .\r\n Development of suitable research instruments \r\nSampling method and sample size detailed.\r\nEthical issues and limitations considered	Little or no explanation of methodology and methods. Methods inappropriate to the aims & objectives. \r\nPoor discussion of philosophical approach & research strategy .\r\n Suitable research instruments not developed and/or explained\r\nInappropriate sampling method and sample size \r\nEthical issues and limitations not considered appropriately\r\nDiscussion of results	Excellent reliable data obtained that is of sufficient quality and quantity for the study. Highly structured and focused analysis High level of critical discussion of the findings  answering the aims & objectives.\r\nExcellent integration of results & literature review including the application of theory from the literature & evaluation of results	Very good data obtained that is of sufficient quality and quantity for the study. Very well structured and focused analysis. Very good level of critical discussion of the findings  answering the aims & objectives.\r\nVery good integration of results & literature review including the application of theory from the literature & evaluation of results	Sufficient data obtained for the study. Well structured and focused analysis. Good level of critical discussion of the findings  answering the aims & objectives.\r\nGood integration of results & literature review including the application of theory from the literature & evaluation of results	Data obtained for the study that has value but is limited in quantity and/or quality. A structured  analysis of the data with some  critical discussion of the findings  largely answering the aims & objectives.\r\nSome  integration of results & literature review including the application of theory from the literature & evaluation of results	Insufficient and/or inappropriate data\r\nLittle or no analysis \r\nUnfocused or unsubstantiated discussion of the results, \r\nLittle or no integration of results & literature review \r\nConclusions and recommendations	Speaks to the target audience(s) (academic and/or practitioner) \r\nExcellent drawing together of conclusions supported by the study methods used, the data collected, analysis & results.\r\nPragmatic, realistic recommendations firmly grounded in findings & conclusions.\r\nHighly meaningful discussion of further research and limitations	Very good drawing together of conclusions supported by the study methods used, the data collected, analysis & results.\r\nRecommendations firmly grounded in findings & conclusions.\r\nVery good discussion of further research and limitations	Good drawing together of conclusions supported by the study methods used, the data collected, analysis & results.\r\nMost recommendations grounded in findings & conclusions.\r\nGood discussion of further research and limitations	Some attempt at drawing together of conclusions supported by the study methods used, the data collected, analysis & results.\r\nSome recommendations grounded in findings & conclusions.\r\nSome discussion of further research and limitations	Little or no attempt at drawing together of conclusions supported by the study methods used, the data collected, analysis & results.\r\nUnsubstantiated or missing recommendations Little or no discussion of further research and limitations\r\nPresentation, style and structure	Highly professional and a pleasure to read. Extremely clear, easy to follow & logical flow with relevant links between sections.\r\nConforms exactly to specifications for referencing, font, headings etc.\r\nExcellent attention to detail with very few spelling or grammar errors	Professionally written in style. Very clear, easy to follow & logical flow with relevant links between sections.\r\nConforms to specifications for referencing, font, headings etc.\r\nVery good attention to detail with few spelling or grammar errors	Well written in a flowing style. Clear, easy to follow & logical flow with relevant links between sections.\r\nLargely conforms to specifications for referencing, font, headings etc.\r\nGood attention to detail with few spelling or grammar errors	Writing style not always clear, easy to follow. Mainly logical flow with relevant links between sections.\r\nSome errors in  conforming to specifications for referencing, font, headings etc.\r\nNeeds greater attention to detail. Several spelling or grammar errors\r\n	Poor writing style not  clear or easy to follow. Little flow between sections \r\nMany errors in  conforming to specifications for referencing, font, headings etc.\r\nMany spelling or grammar errors\r\n\r\nReferencing\r\nReferencing is an important part of academic work and we expect you to reference your work correctly. If your work is not referenced correctly, you will have marks deducted for this. The penalty for this is up to 10 marks for every piece of work. If you have more than 6 marks deducted for poor referencing your work will be reviewed for a suspected breach of academic integrity (see Section 5: Understanding Your Assessment Responsibilities and Section 10 of the Academic Regulations).\r\n\r\nWord Counts\r\nWhere a word count is appropriate to the assessment, a rule of +/- 10% is imposed and submissions which fall outside the limit set will incur a penalty which will be a deduction of 10% (Title Page, Contents, Reference List and Appendices are excluded from the word count).\r\nStudent name: 				\r\nCriteria and Weighting\r\nWeighting for type of project	100-70	69-60	59-50	49-40	39-0\r\n	Primary research project	Secondary research project	Organization based project	Excellent	Good	Satisfactory	Poor	Very poor\r\nRationale, aims and objectives\r\n1. Rationale, background & context clear and evidenced through reference to a range of sources.\r\n2. Purpose & objectives clear, precise & focused on outcomes not process. Objectives clearly fulfilled.\r\n3. Range & scope of study appropriate & achievable within the constraints of the module.	\r\n\r\n\r\n15%	\r\n\r\n\r\n15%	\r\n\r\n\r\n15%					\r\nMark range and comments	\r\nLiterature review\r\n1. Thorough & appropriate selection of up-to-date source material. All material presented relevant & appropriate to the study. \r\n2. Suitable range of sources used including research-based & academic sources. \r\n3. Identification & discussion of relevant theories, conceptual frameworks or pragmatic studies.\r\n4. Critical evaluation of the literature providing a basis on which to develop research methods and discuss the findings.	\r\n\r\n\r\n\r\n\r\n25%	\r\n\r\n\r\n\r\n\r\n25%	\r\n\r\n\r\n\r\n\r\n15%	\r\n\r\n\r\n	\r\n\r\n\r\n	\r\n\r\n\r\n\r\n	\r\n\r\n\r\n	\r\n\r\n\r\n\r\nMark range and comments\r\n	\r\nResearch design and methodology\r\n1. Methodology and methods appropriate to the aims & objectives & fully explained & justified.\r\n2. Development of suitable research instruments, sampling method and size.\r\n3. Collection of sufficient data relevant to the aims & objectives of the study.\r\n4. Critical evaluation of the research methods used and an awareness of the strengths & weaknesses of the study design & methods.\r\n5. Discussion of ethical issues 	\r\n\r\n\r\n\r\n20%	\r\n\r\n\r\n\r\n15%	\r\n\r\n\r\n\r\n15%	\r\n\r\n\r\n\r\n	\r\n\r\n\r\n\r\n	\r\n\r\n\r\n\r\n	\r\n\r\n\r\n\r\n	\r\n\r\n\r\n\r\n\r\nMark Range and comments\r\n	\r\nCriteria an