(584, 584, 'Commerce', 'Research Proposal- Experiential Marketing', 'he proposal is an explanation of your topic and the gap in knowledge that your marketing research project will fill. There are three\r\nmain components to a research proposal:\r\nIn this section, you will be expected to explain the importance and implications of your chosen research topic. For example, if you are studying the impact of brands on consumer choice then you should discuss why brands are an important area of study and how you feel your research can improve our knowledge of the topic. Normally\r\nthis section will be reasonably short.\r\nYour literature review should build on the introduction to critically analyse what research currently exists about your topic. What is the gap your research will fill? Why is it an important topic? It should not just describe other relevant research but analyse and integrate existing work to help you frame and justify your topic, your research question, or the issue you want to explore, or the hypothesis you want to test. The literature review enables you to demonstrate your knowledge and understanding of the topic and should make up a significant chunk of your\r\nproposal. It also allows you to explain some of the key concepts and related studies in more depth.\r\nThe methodology section discusses how you wish to answer your research questions and hypotheses if applicable. If doing a qualitative research project, you will be identifying the phenomenon or issue you wish to investigate. You should discuss and justify the different methods you wish to employ for collecting and analysing data. Information about the sample being used and why you feel this is a good sample should also be included. Additional marks are available for examples of research instruments such as a sample questionnaire or set of interview questions, as well as some basic understanding of what analysis techniques may be useful. The key to this section is an appreciation for how you wish to go about your research and why you feel this is the best\r\napproach.\r\nNB! We do not expect you to collect any primary data as part of the research proposal! The proposal part is just\r\n that â€“ a proposal to how and why you want to conduct the proposed research project.\r\n ', 'Msc in Marketing', 'Masters', '[\"Other\"]', '[\"Marketing\"]', '2022-06-30 14:30', '2000-2500', '_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
