(615, 615, 'Arts', 'Norm of reciprocity discussion ', 'typical scientific paper has 4 parts.\r\n\r\nIntro\r\nMethod\r\nResults\r\nDiscussion\r\nThe intro discusses the theory and builds an argument for a specific alternative hypothesis. The method describes the variables, operational definitions, and procedures used in the study. The results talk about the statistics. The discussion interprets the results in words and discusses some interpretations of the findings.\r\n\r\nFor this assignment, I want you to write a two page (double spaced) discussion section of a paper. A discussion section typically has the parts listed below, and I expect to see these parts in your two page paper. Use these headings in your paper.\r\n\r\nSummary of hypothesis and results. State hypothesis and whether it was supported or not\r\nSummary of the theoretical implications. How does this advance the theory of norm of reciprocity?\r\nTheoretical implications help us answer questions such as \"how does this extend our understanding of the theory\" or \"does this suggest that the theory can be expanded or changed based on the research findings?\"  The theoretical implications often go a step further than simply stating that the research supports/doesn\'t support the theory (because that\'s why the research was being conducted in the first place) and instead, might also suggest new pieces of the theory revealed by the evidence, confounding variables, or contexts in which the theory does not hold up.\r\nSummary of practical implications. What kind of practical advice would you be able to give someone based off of the study results?\r\nPractical implications help us answer questions such as \"what does this research mean in the real-world?\" or \"how would I apply this to an every day situation?\"\r\nLimitations. What are some things in the study that you would do differently if you could do the study again? \r\nFuture Directions. Suggest a study or a direction that future researchers could pursue to build on your work \r\n', 'Psychology ', 'Bachelors', '[\"Research Paper\"]', '[\"Psychology (Cambridge)\"]', '2022-06-20 08:00', '800', '4B85E5A7-7905-4848-AAE1-72B535C1745A.png_$_6CEBFF3A-D5A9-4752-A400-BE80F2057453.png_$_22E70EAA-6260-4870-9397-C0D71A31D206.png_$_33D996C6-E3E8-4638-A9BD-0DDD801F89F1.png_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 1, 0, NULL, NULL, NULL, NULL, NULL),
