(648, 648, 'Arts', 'Ekman Model review ', 'This learning activity will implement Paul Ekmanâ€™s model for the seven basic emotions.  As you may recall, studies have shown similar facial expression patterns for basic emotions across many cultures, genders, and parts of the world. \r\n\r\nFor this activity, you will be asked to take pictures of individuals expressing four of the seven basic emotions. Specifically, we will focus on fear, happiness, anger, and sadness. \r\n\r\nChoose an individual and, with their consent, have them take four selfiesâ€“ one selfie for each of the aforementioned facial expressions. Do this with two other individuals. In total,  this will give you 12 photos for the assignment, three for each of the four mentioned emotions.\r\n\r\nLink to the model : \r\n\r\nThis learning activity will implement Paul Ekmanâ€™s model for the seven basic emotions.  As you may recall, studies have shown similar facial expression patterns for basic emotions across many cultures, genders, and parts of the world. \r\n\r\nFor this activity, you will be asked to take pictures of individuals expressing four of the seven basic emotions. Specifically, we will focus on fear, happiness, anger, and sadness. \r\n\r\nChoose an individual and, with their consent, have them take four selfiesâ€“ one selfie for each of the aforementioned facial expressions. Do this with two other individuals. In total,  this will give you 12 photos for the assignment, three for each of the four mentioned emotions.\r\n\r\n\r\nhttps://learn-to-read-emotions.com/theory/?p=0 ', 'Psychology', 'Bachelors', '[\"Research Paper\"]', '[\"Psychology (Cambridge)\"]', '2022-07-04 08:00', '1200', 'Rubric+Ekmans+Assignment.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
