(685, 685, 'Commerce', 'Audience research proposal ', 'Drawing upon everything that you have learnt across the course of the module, you are required to DESIGN a proposal for a HYPOTHETICAL PIECE OF QUALITATIVE audience research (N.B. you will not be conducting the actual research and you should not be using theories of the passive audience which will be discussed in Week 2). \r\n\r\nThe proposal should include the following sections:\r\n\r\nâ€¢	Introduction (approx. 200 words)\r\nâ€¢	Contextualisation of the project within existing theories, definitions and trends of media audience research as well as a critical justification of why the theory you have chosen is best suited to your project (approx. 700 words).\r\nâ€¢	A clear statement of the proposed projectâ€™s aims and research question(s).\r\nâ€¢	An academically informed explanation of the audience research method you have selected which discusses why this approach has been chosen and the methodâ€™s strengths and weaknesses in relation to the proposed studyâ€™s aims (approx. 500 words).\r\nâ€¢	Reflection upon the ethical concerns that you may encounter in relation to the study and what you will do to address these (approx. 300 words).\r\nâ€¢	Reflection upon which groups (e.g. academic, industrial, audience) will benefit from the insights that your proposed research will produce. (approx. 500 words)\r\nâ€¢	Conclusions (approx. 300 words) \r\n\r\nThe following marking criteria will be used:\r\n\r\ni)	Level of detailed understanding of theories and methodologies relating to media audiences demonstrated throughout the proposal.\r\nii)	Ability to plan, develop and self-critique an original idea for a qualitative empirical audience study that demonstrates sensitivity to a variety of contextual (e.g. ethical, environmental, etc.) concerns. \r\niii)	Ability to locate the study within both academic and industrial contexts and to reflect upon the insights that the proposal will potentially provide to interested stakeholders.\r\niv)	Production of a well-balanced proposal that dedicates appropriate length towards each of the sections feeding in to the study. \r\nv)	Adherence to University Guidelines concerning Harvard referencing and presentation of material (e.g. proof-read; correct grammar and punctuation etc.)\r\n', 'media and communication', 'Bachelors', '[\"Research Paper\"]', '[\"introduction-to-media-audiences,Representation Theory\"]', '2022-08-02 15:15', '700', 'audience reasearch project proposal.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
