(696, 696, 'Commerce', 'business in practice modulee', 'so there was a business in practice module where in all of us were assigned roles. I was the innovation director. so I have to give a reflective essay and write about two incidents. now this may seem easy as you can also fake it a bit but the important part is to give analysis as to why which approach we chose and what we should have with supporting evidence and research. the analysation part is very important .\r\nI have written personal small notes during the course of this module I\' ll share them. you can include info from their and give me a call for more detailed explanation.\r\nwe are provided a set of reading lists for every module which are additional so I ll attach a ss of how they are for this module. other than this research you ll need a bit of additional research to support every decision and analyses. \r\n', 'masters in marketing and strategy ', 'Masters', '[\"Essay Writing\"]', '[\"Marketing,Strategy for successful business\"]', '2022-08-03 21:00', '2000', 'BIP PART. 1.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
