(701, 701, 'Commerce', 'Kautuk Haria- Literature review metaverse', 'Research Paper Topic: Metaverse: Another Marketing Tool for Brands & Businesses\r\n\r\nPages: 10-12 or 2500 to 2700 words (excluding references, cover page & contents)\r\n\r\nFormat: \r\nLiterature Review Core Content\r\nAll core content divided between 5-6 themes for literature review\r\nConclusion (that leads to conducting the research)\r\nReferences\r\nPrimary Research Question (this could be tweaked later): Will metaverse just be another tool for brands and advertisers to promote their products/services for purchase in the physical world?\r\n\r\nNote: We\'re largely looking at (Facebook) Meta\'s Metaverse and also looking at other metaverse experiences that large-corp brands have delved themselves into\r\n\r\nOther possible questions that will be answered by this research:\r\nHow would metaverse shape the next future of brand marketing and advertising?\r\nWould multiple metaverses run by brands individually?\r\nWould metaverse move away from traditional marketing methods like pop-up ads and promo videos, instead targeting us in far more natural ways, injecting promotional objects and activities into our world that look and feel real?\r\nWhat could be the potential ad-measurement indicators & revenue models adopted by metaverse companies?\r\nKey Authors (in this field): Mathew Ball - Literature; Cathy Hackl - Professionally\r\n\r\nCore Themes (other themes can also be explored and suggested by the writer)\r\nPrinciples of Marketing (across Advertising, Branding & PR - connect these to the next theme) \r\nEmergence of Web3, Metaverse & Cryptocurrencies\r\nBuilding blocks of Metaverse in relation to marketing\r\nAI Personalization - a key to digital & immersive marketing experiences\r\nBranded NFTs as a digital token\r\nCurrent limitations & challenges for brands in the metaverse (summary of this can be taken from the last essay research paper)\r\nMandates:\r\nAll references should be Google Scholar or by any published journals/research papers across valid databases (Access to some papers might require University details, if you or the writer do not have that, then I\'ll provide my University login credentials)', 'MBA', 'Masters', '[\"Essay Writing\",\"Literature Review\"]', '[\"Business & Accounting Studies,Management\"]', '2022-08-05 21:00', '3350', '_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
