(753, 753, 'Arts', 'Quantitative report ', 'For this assignment, you are required to analyse a small study and write up a research report. The word count for this assignment is 3000 words. \r\n\r\nIn this study, you are going to investigate one of the most interesting and significant psychological tests, the Emotional Stroop Test. This test aims to measure how emotional content can impact the time taken to select the colour (ink) of a word.\r\n\r\nBefore you get started on your assignment, you may wish to take part in an example Stroop Test that does not include any emotional words. This should help you to understand and become familiar with the basics of this experiment. \r\n\r\nA Stroop Test example showing a list of colours where participants would need to say the colour of the word, not what the word says.  \r\n\r\nAll students will be given a series of pre-collected participant responses and asked to analyse the data and write up the research report in the basis of the APA style. Please follow the next steps for completing the assignment.\r\n\r\nAnalysing the Experiment:\r\nThe Psychology Department has provided you with a summary report of scores, which you need to use for this assignment. These results have been gathered from an online Emotional Stroop Test where participants were shown a series of words and asked to select the colour of the word (ink) that appeared on their screen. \r\n\r\nParticipant	Age	Sex	Trial 1: \r\nNeutral 1 Response	Trial 2: Neutral 2 Response	Trial 3: Snake	Trial 4: Social	Trial 5: Death	Trial 6: Eating	Trial 7: Pain	Trial 8: Public	Trial 9: Defeat\r\n1	31	Female	9.970	7.542	12.620	12.640	11.520	7.847	8.636	6.314	11.973\r\n2	23	Male	8.878	9.929	9.033	6.947	7.829	7.127	6.809	6.809	6.329\r\n3	37	Female	8.196	6.735	8.935	8.455	7.758	8.234	12.020	9.300	9.359\r\n4	45	Male	10.040	8.838	9.974	11.130	11.130	14.630	14.684	11.820	9.446\r\n5	53	Male	10.350	12.910	15.090	12.080	12.080	14.900	13.230	13.760	11.410\r\n6	25	Female	6.588	6.887	7.309	6.937	6.937	7.171	9.752	9.752	6.059\r\n7	35	Male	9.191	9.871	9.963	9.460	9.460	8.126	8.686	8.686	11.530\r\n8	47	Female	12.410	11.830	11.190	13.640	13.640	11.680	14.820	14.820	13.930\r\n9	33	Female	10.690	8.516	8.549	7.385	7.385	12.830	11.780	11.780	14.970\r\n10	39	Female	7.531	6.332	9.425	8.887	8.887	8.750	12.400	12.400	11.231\r\nThe experiment was made up of nine trials that consisted of 12 words each. The first two trials contained \'Neutral Responses\' (e.g. Chair, Desk, Umbrella) and the remaining trials were divided into seven themes. For example, Trial 3: Snake included words such as \'Poison\' and \'Cobra\'. Likewise, Trial 7: Pain included words such as \'Headache\' and \'Bleeding\'. \r\n\r\nOnce a word appeared on the screen, participants were asked to select the colour of the word (ink) by using the R, B, G and Y keys of their keyboard. \'R\' stood for red, \'B\' for blue, \'G\' for green, and \'Y\' for yellow. Once each trial was completed, the average time taken (seconds) to select the colour of the words in the list was recorded.\r\n\r\nDemographic data about the participants, as well as the average time taken to complete each trial, has been provided above. \r\n\r\nTo begin, you should review all of the results you are going to use and open an SPSS file. Next, you will need to input the data from the above table into a new dataset.\r\nYou will need to organise your data on the basis of their type (such as ordinal, nominal, etc.) and process your data accordingly and on the basis of what you have learned in the units.\r\nAnalyse your data by checking your Distribution and run any necessary Normality Tests.\r\nAnalyse Descriptive Statistics for all Trials.\r\nCompare the means between the following Trials using the appropriate t-test:\r\nA. Neutral (Trial 1) and Snake (Trial 3)\r\nB. Neutral (Trial 1) and Pain (Trial 7)\r\nC. Neutral (Trial 1) and Defeat (Trial 9)\r\nReport all your data on the basis of the APA style.\r\nReview the literature on the Emotional Stroop Test and start thinking about your own findings.\r\nInterpret your findings.\r\nWrite up your research report.\r\nWhat should I include in my report? \r\nYou will write up your findings in the conventional scientific report style with American Psychological Association referencing. Details of how these reports should be written can be found here. \r\n\r\nThe research report should reflect the following parts:\r\n\r\nAbstract â€“ approx 150 words\r\nIntroduction â€“ approx 1000 words which addressed the background theory and research on the Emotional Stroop test, the aim and the hypotheses of the study.\r\nMethods on the basis of the APA style. Please include any ethical considerations for this study. \r\nResults â€“ tables should be included using APA style â€“ the data should then be reported\r\nDiscussion - approx 1000 words which explains conclusions regarding the Emotional Stroop Test based on the research and the results of the t-test. The discussion should also suggest what could be done to further this study and explain why your suggestions would be valuable in the field.\r\nReferences â€“ use APA style\r\nAppendices â€“ include SPSS outputs\r\nAll sources should be cited using the APA style, and you should remember to discuss the theory and research of the Emotional Stroop Test, as well as describe and evaluate your findings in relationship to the theory and studies on the Emotional Stroop Test.\r\n\r\nPlease fully state and justify any other assumptions or choices that you make using the suggested resources of this unit, as well as your own research. Don\'t forget to include references to the sources that you have found yourself!', 'Psychology ', 'Bachelors', '[\"Essay Writing\",\"Report Writing\"]', '[\"u2018\"]', '2022-09-04 13:56', '4000', '_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
