(816, 816, 'Arts', 'Assignment- Reading Reflection', 'Students will write two reading reflections over the course of the semester (between 500 and 800 words). Each reading reflection should engage critically with the required reading for the selected\r\nweek; as well as one additional reading from the weekly list. This should not be a summary; students should develop their own argument from the readings that discusses the main arguments of the\r\nreadings, the points found to be convincing, and those that are unconvincing, with reasons. Additional research is not required, but students should be very careful to stick to the topic and avoid\r\nunsubstantiated statements. The reflection will be submitted on Brightspace before the start of class, and presented in small groups each week. The schedule for reading reflections will be arranged in the first class. Official citations, bibliography and page numbers are not required unless you draw on work outside the assigned readings. You may not use extensive quotes in your reflections. You are\r\nexpected however to acknowledge the author to demonstrate you are engaging with their work (i.e. â€œas Murphy argued, market power...â€). Include 2-4 probing discussion questions to stimulate\r\ndiscussion in class.\r\n\r\nWord Count Required: 750 words \r\n\r\nBibliography: APA\r\n', 'Social Science', 'Bachelors', '[\"Essay Writing\"]', '[\"Social Science\"]', '2022-10-11 12:00', '2000', 'Example reading reflection #1.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
