(845, 845, 'Engineering', 'Stock price prediction using Arima forecasting and lstm based forecasting, compatitive analysis', 'Stock market is characterized as dynamic, unpredictable and non-linear in nature. Predicting stock prices is a\r\nchallenging task as it depends on various factors including but not limited to political conditions, global economy,\r\ncompanyâ€™s financial reports and performance etc. Thus, to maximize the profit and minimize the losses, techniques to\r\npredict values of the stock in advance by analyzing the trend over the last few years, could prove to be highly useful\r\nfor making stock market movements [1] [2]. Traditionally, two main approaches have been proposed for predicting\r\nthe stock price of an organization. Technical analysis method uses historical price of stocks like closing and opening\r\nprice, volume traded, adjacent close values etc. of the stock for predicting the future price of the stock. The second type\r\nof analysis is qualitative, which is performed on the basis of external factors like company profile, market situation,\r\npolitical and economic factors, textual information in the form of financial new articles, social media and even blogs by\r\neconomic analyst [3]. Now a days, advanced intelligent techniques based on either technical or fundamental analysis\r\nare used for predicting stock prices. Particularly, for stock market analysis, the data size is huge and also non-linear.\r\nTo deal with this variety of data efficient model is needed that can identify the hidden patterns and complex relations\r\nin this large data set. Machine learning techniques in this area have proved to improve efficiencies by 60-86 percent\r\nas compared to the past methods', 'it engineering', 'Bachelors', '[\"Research Paper\"]', '[\"ML DL Neural Networks and OpenCV in Python\"]', '2022-11-05 12:00', '6000', '_$_', '2023-05-22 18:42:19', '', '3', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(846, 846, 'Commerce', 'Report writing - Soumya Parekh User ID 943', 'A3 quiz (open case study)\r\n10%\r\nPronto Parking Strategic Management Case Study\r\n \r\n300 words in total (+/-10%)\r\n5 references of which at least 3 need to be academic\r\nWork: individual\r\nFormat: report\r\n \r\nRead the Pronto Parking attached PowerPoint, research the firm and answer the two questions in the PowerPoint in a total of 300 words combined. Upload your Word document report to the A3 assessment submission link.\r\n \r\nA4 Mini Project at Work (MPAW)\r\n30 Oct 2022\r\n50%\r\nFormat: Report\r\nReport length: 2000 words (Word document only)\r\nWork: individual\r\nNumber of references: 15 of which at least 10 are academic\r\n \r\nDescription:\r\n \r\nThis assessment requires that you work on either the strategic plan of tour own firm (preferred) or select another firm from anywhere in the world and select one (1) product from that firm. You will need to develop a Strategic Position Plan (SPP) for that product. To do this, you will need to apply the Ansoff Matrix and the Boston Consulting Group (BCG) matrix to this product by critically analysing the strategic actions the firm should take to allow that product to survive or to grow. The context is that you have been asked to evaluate the Strategic Plan of the firm and have been given the task of focussing, in the first instance, on the major product of the firm or any other select product (or service).\r\n \r\nSpecifically, you need to:\r\n \r\nIntroduce the firm\r\nIntroduce the product\r\nExplain and justify where the product currently â€œsitsâ€ on the Ansoff matrix\r\nExplain and justify where the product currently â€œsitsâ€ on the BCG matrix\r\nPresent a Strategic Position Plan (SPP) for the product that includes:\r\n- What the firm should do with that product in terms of geographical target markets (e.g. stay in-country, go overseas, etc.) to survive or to grow (only one) and justify your response\r\n- What the firm should do with that product in terms of pricing strategy to survive or to grow (only one) (e.g. cost leadership, differentiation, other)\r\n- A map of competitors in the chosen geographic market and price range, their strengths and setbacks, and how you will deal with them', 'Mba', 'Masters', '[\"Essay Writing\",\"Report Writing\",\"PPT Making\"]', '[\"Strategic management\"]', '2022-10-20 12:00', '3900', 'Pronto Parking Case Study for A3 Quiz.pptx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
