(872, 872, 'Engineering', 'Own choice write-up', 'Take up a couple of texts (short story, movie, case study, newspaper reports, etc.) and discuss them within the light of one of the concepts/frameworks discussed in the course.\r\n\r\nFrameworks - Gender and development, women and development, women in development\r\n\r\nExample topics - menstruation, discrimination at workplace, child marriage etc.\r\n\r\nWord limit: 1300 - 1500 words\r\nZero plagiarism tolerance. Any such instance will lead to a non-negotiable zero for the complete assignment.\r\n\r\nReadings done in class can be used for motivation (sorted by latest done):\r\n\r\n1) From THE WOMEN, GENDER AND DEVELOPMENT READER edited by Nalini Visvanathan, Lynn Duggan, Nan Wiegersma and Laurie Nisonoff. The book is readily available online.\r\nChapter 9 Gender as a social determinant of health: evidence, policies, and innovations Gita Sen and Piroska Ostlin\r\nChapter 19 Subordination and sexual control: a comparative view of the control of women Gita Sen\r\nChapter 32 Caring for people with HIV: state policies and their dependence on womenâ€™s unpaid work Anesu Makina\r\n\r\n2) \r\nhttps://www.epw.in/node/154695/pdf\r\nhttps://scroll.in/article/921679/this-election-season-indias-policymakers-would-do-well-to-read-premchands-stories-about-farmers\r\nhttps://theprint.in/india/how-caste-marital-rules-house-work-prevent-rural-women-from-eating-nutritious-diet/300683/\r\n\r\nFor the ones interested in intersectionality: \r\nhttps://www.vox.com/the-highlight/2019/5/20/18542843/intersectionality-conservatism-law-race-gender-discrimination\r\n\r\n3) Sarbani Guha Ghosal (2005). Major Trends Of Feminism In India. The Indian Journal of Political Science, 66.4, 793-812. https://www.jstor.org/stable/41856169\r\n\r\n4) Feminisms\r\nhttps://diglib.bis.uni-oldenburg.de/pub/unireden/ur97/kap1.pdf\r\nhttps://muse.jhu.edu/article/28377/pdf\r\n\r\n5) https://www.econstor.eu/bitstream/10419/148819/1/863101828.pdf\r\n\r\n6) old mail (contains repeated) Introduction to Nalini Visvanathan, Lynn Duggan, Nan Wiegersma and Laurie Nisonoff\'s \"The Women, Gender and Development Reader.\" [optional]\r\n\r\nIntroduction to  Janet Henshall Momsen\'s \"Gender and Development.\"\r\n\r\nIntroduction to  Cecile Jackson and Ruth Pearson\'s \"Feminist Visions of Development: Gender, Analysis and Policy.\"\r\n\r\nPrecisely explained: http://people.uncw.edu/ricej/theory/Varieties%20of%20Feminism.htm\r\n\r\nFeminisms: a succinct introduction -\r\nJudith Lorber The Variety of Feminisms and their Contribution to Gender Equality. https://diglib.bis.uni-oldenburg.de/pub/unireden/ur97/kap1.pdf\r\nor [one can read both as well]\r\nNancy Potter (2001) Key Concepts: Feminism, Philosophy, Psychiatry, & Psychology, 8:1, 61-71 (Article) DOI: https://doi.org/10.1353/ppp.2002.0008\r\n\r\nNaila Kabeer (2005) Gender equality and women\'s empowerment: A critical analysis of the third millennium development goal 1, Gender & Development, 13:1, 13-24, DOI: 10.1080/13552070512331332273\r\n\r\nSarbani Guha Ghosal (2005) Major Trends Of Feminism In India, The Indian Journal of Political Science, 66:4, 793-812, : https://www.jstor.org/stable/41856169', 'Gender and Development', 'Bachelors', '[\"Essay Writing\",\"Review Article\"]', '[\"Gender and Sexuality Studies,Gender and Women Studies\"]', '2022-11-07 12:00', '1200', 'gender and development notes.pdf_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
