(878, 878, 'Engineering', 'Hospital Management System', '\r\nThis is what should be done on a high level, as the Netbeans IDE is being use, interfaces (screens) could be easily made through drag and drop process.\r\n\r\nThere should be a login page based on which different people will have access to different features ( buttons can be used) and for some users some features will be disabled and hidden.\r\n\r\nafter login page there should be another page which can take to:\r\n\r\nFind Doctors\r\n\r\nEnter Records\r\n\r\nEncounter\r\n\r\nCommunity Records\r\n\r\nIn Find doctors- a table with these fields should be used:\r\n\r\nHospital, Hospital Directory, Doctor Directory, Doctor\r\n\r\nIn Enter Records- a table with these fields should be used:\r\n\r\nPatient, encounter, Encounter History, Patient directory, Hospital\r\n\r\nFor Encounter- Encounter, heart rate, BP, age, height, weight should be used.\r\n\r\nIn Community Records- a table with these fields should be used:\r\n\r\nHouse, Person, Community, City, System.\r\n\r\nNow patients can go to find doctors and look for doctors in near hospitals. Rest options are blocked for patients.\r\n\r\nDoctors can see and put records of patients and encounters.\r\n\r\nCommunity admins can access informations only for there community, and can modify it.\r\n\r\nSystem admins should have access to all functions available in GUI.', 'Information System', 'Masters', '[\"Programming / Coding Assignment\"]', '[\"Information System\"]', '2022-10-31 11:00', '7000', 'Assignment 2-1.pdf_$_', '2023-05-22 18:42:19', '', '2', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
