(883, 883, 'Commerce', 'Case study', 'This professional case study writeup requires you to analyses a real-life MCM/digital situation where problems were identified, how they were solved (or not solved), and lessons learned. Whenever possible, you should use relevant MCM concepts/framework/theory to this practical real-life digital/mcm situation; for example, apply the ideas and knowledge discussed in the coursework to the practical situation at hand. In this case study, the overall outline comprises of eight (8) sections. They are: \r\n1. Contextual Background Information and Analysis (20%)\r\nIssues and dimensions to include: \r\nâ€¢	Background information: Industry/Company (Products/services; Markets; Philosophy/Vision/Objectives, Cultural diversity etc.)\r\nâ€¢	Unit of analysis (UOA): Company (Huawei/Apple), range of product (Mobile phone/laptop), one product item (Huawei P30/P40/MacBook Pro 13â€/MacBook Pro 14â€) or specific MCM project\r\nâ€¢	Business/industry/market, cultural and social environment trends and dynamics \r\nâ€¢	Customers: B2B (Business-to-Business) and/or B2C (Business to Customer [End-User], Buying/consumption behaviour/ Cultural, ethical and social considerations\r\nâ€¢	Marketing Communication trends and dynamics/traditional and contemporary platforms\r\nâ€¢	Assessment of UOA Digital/MCM emerging problems and issues\r\n2. UOAâ€™s Digital/MCM evolution: 20%\r\n(Additional notes â€“ To examine the â€œwhenâ€, â€œhowâ€, and â€œwhyâ€ of the UOAâ€™s Digital/MCM strategies and initiatives. To use an appropriate framework (from lecture notes, journal articles, etc), accompanied by charts/tables and graphs, etc. Data and numbers presented to document the companyâ€™s evolution of MCMâ€™s strategies and initiatives) \r\nIssues and dimensions to include:\r\nâ€¢	Evolution and/or transformation of UOAâ€™s Digital Marketing/MCM objectives, strategies and initiatives\r\nâ€¢	Key strategic, people and culture, organization, customer, technology and ecosystem thrusts\r\nâ€¢	Types of communication strategies/tools/ platforms\r\nâ€¢	Timelines (Schedule) and Deliverables (KPIs) of evolution\r\n3. Digital Marketing/MCMâ€™s CSF: (20%)\r\nIssues and dimensions to include:\r\nâ€¢	Identify at least 5 CSF relating to UOAâ€™s Digital Marketing/MCMâ€™s issues and challenges. Examples: Personalising and enhancing customer service to a culturally diverse market; implementing multiple MCMâ€™s strategies; Evolving loyalty programs; converting analytics to customer value.\r\nâ€¢	Implementing, Communicating, and Monitoring these CSFs against (a) company/product [UOA] missions, goals and objectives; (b) industry/competitorâ€™s MCM? (Marketing, MCM and non-marketing factors)\r\n4. Lessons learned/Challenges Addressed: (20%)\r\nâ€¢	Digital strategy enacted, aligned with corporate & marketing strategic vision, transformation; etc.\r\nâ€¢	People Digital skills, Talent development, CIO & CTO leadership, Organizational and cultural diversity management excellence, etc.\r\nâ€¢	Customers: Value and satisfaction; participation; new products and services offered; solutions redesigned; seamless integration, etc.\r\nâ€¢	Ecosystem (channel partners, producers, relationship and network management with partners, etc); \r\nâ€¢	Investments in Technology and Innovation: Digital processes, Customer data management, Application interfaces, Big Data and AI, etc.\r\n5. Clarity of communication: referencing and paraphrasing (harvard style referencing) (5%)\r\n6. Clarity of communication: Report structure, format and flow of logic (5%)\r\n\r\n7. How did the UOAâ€™s MCM/Digital marketing strategies targeted people of different cultural backgrounds, in terms of their differences in lifestyles, habits, preferences and needs?  [No more than 100 words: 5%]. Support your position.\r\n \r\n8. What are the implications of targeting people of different cultural backgrounds on the UOAâ€™s choice of (a) media consumption habits (i.e. smartphone, tablets, PCs), and (b) online advertising (e.g. Google, Facebook, Instagram advertising etc)? [No more than 100 words: 5%]Support your position.\r\n', 'Masters', 'Masters', '[\"Other\"]', '[\"Multichannel markerting\"]', '2022-11-06 18:00', '$35', '_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
