(901, 901, 'Arts', 'HOM MODULE based on camping grounds', 'Font- Arial 14 bold (Headers)\r\nFor inner matter- Arial 11\r\nLine spacing- 1.5\r\n2500 words + 10% more\r\nTotal word count = 2700 words\r\nCitations & References- 50\r\n[Report must include a few points related to sustainability, & all points from the indicative answer must be covered in the report]\r\n\r\nResearch must be done from academic sources only.\r\nHarvard style of referencing.\r\nThe module [REPORT] basically is about camping grounds & their operational challenges & how they are resolved, challenges need to be related to a theory that talks about the solution and give egs from India.\r\n\r\nIntroduction-250 words\r\nBasic intro to the concept & report, if definition mentioned needs to be cited.\r\nThe later part of the intro will have sign posting approx. (60-75 words), in that you will have to explain in your own words what is going to be there in the overall report. [Theories which are used or others imp details mentioned needs to be addressed in sign posting it can be abit elaborative]\r\n\r\nMain Body- 2000words\r\nThe main body will first include 500 words to explain concept which will talk about the definition of camping grounds, types of camping grounds, background, regulatory bodies controlling camping grounds (Control body/assessment body/approval body), how & where the concept of camping grounds started, later link it to how it came to India[The history of 2-3 continents can be discussed in 2-4 lines with citations for each one]\r\nU also have to talk about the Benefits/pros of camping grounds for the company, campers/tourists, locals, government/host, environment \r\nAnd then you can link to the next part by saying although it has various benefits there are few challenges as well (But here u have to convince the management dat inspite of problems it is a a profitable business)\r\n\r\nAnd go on to the next concept of challenges \r\nSo here \r\n200 words-challenge [must be supported with an eg]\r\n100- theory\r\n200- soln [must be supported with an eg]\r\n\r\nThe challenges must be operational\r\nU have relate it wid a theory- such as \r\n1)SerVqual\r\n2)Total Quality Management\r\n3) Strategic Huma. Resource\r\n4) Effective crisis management\r\n5) Ethical management of business\r\n6) Recovery measures\r\n\r\n Need to use different theories for each challenge [EVEN 2 THEORIES CAN BE USED FOR 1 PROBLEM IF ITâ€™S RELATABLE, IT WILL INCREASE MARKS]\r\nSo I wanted u to use \r\n1) SerVqual (cuz it\'s compulsory)\r\n2) Strategic Human Resource\r\n3) Crisis management to be used in the challenges\r\n\r\nHe has asked us to use Max citations while explaining the theories as itâ€™s easier to find.\r\n\r\nFor eg- U can give a problem from 1 region related to staffing, then relate it to Strategic human resource theory & give soln to it from another region which had the same problem, and both challenge & soln needs to be supported with an eg. After application of d soln they were able to overcome d problem, u need to mention the area from where u have picked the soln & problem\r\n[The challenges can be taken from anywhere in the world & they can be generic for eg which are applicable for both hotels or camping grounds for eg. Staffing comes under both but the examples must be from INDIA]\r\n\r\nConclusion & Recommendations- 250 words\r\nConclusion will be related to what have you found out in the report(IN PARAGRAPH), & 5 Recommendations (IN POINTERS) \r\n3 will come from your 3 solutions itself & other 2 will be related to sustainability & revenue management.\r\n\r\nAs it is a report, it is compulsory to add charts/ graphs/ diagrams/ statistics / or reviews of guests (imp) [ All this can be related to theories, any matter said in the report which can be supported, etc.] take ss & convert dem into JPEG & add in the appendices at the end of the report.\r\nThe more appendices itâ€™s better for the evaluation.\r\n\r\n\r\n', 'BA International Hospitality And Tourism Management', 'Bachelors', '[\"Report Writing\"]', '[\"Transition\"]', '2022-11-18 18:00', '4000', 'HOM MODULE.docx_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
