(903, 903, 'Arts', 'Strategic Leadership', 'Font- Arial 14 for title\r\nFor inner matter- Arial 11\r\nLine spacing- 1.5\r\n2500 words + 10% more\r\nTotal word count = 2700 words\r\n Citations & References- 35\r\nResearch must be done from academic sources only.\r\nHarvard style of referencing.\r\n\r\nSo our topic is Rising costs and demand of energy in the hospitality sector. [Focus on energy issues with specific reference to the hospitality sector]\r\n\r\nThe question asked here is to find an issue related to sustainability (any 1 pillar from 3) & to relate it to the hospitality/ tourism industry, for eg carbon, footprint then look for a leadership approach (1 leadership style) say eg Innovative leader & then give 4 egs only from hospitality & tourism industry 2national, 2 international or 1 national & 3- international\r\n\r\nEg \r\nIssue - carbon footprint\r\nU take up- Airlines for eg\r\n1 leadership approach which resolved the issue\r\n4egs- 1) Lufthansa 2) Indigo....etc.\r\nOr \r\n4egs- u can keep in general so that the scope of discussion is more \r\n1) eg related to airlines \r\n2) eg related to roadways\r\n\r\n', 'BA International Hospitality And Tourism Management', 'Bachelors', '[\"Essay Writing\"]', '[\"Transition\"]', '2022-11-15 18:00', '4000', 'SL MODULE.docx_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
