(919, 919, 'Commerce', 'International Business Plan', 'For my final dissertation, I have asked to develop a new business Idea and justify why this business idea might be worthy of investment.\r\nI have to generate the idea, conduct secondary market research and provide a business justification as to the viability of your idea.', 'International Business Plan project', 'Masters', '[\"Report Writing\",\"Dissertation Writing\"]', '[\"International business\"]', '2022-11-30 12:00', '10000 Words', 'BEMM384 Business Plan Template- Outline.docx_$_Philadelphia.pdf_$_BEMM384 Business Plan Template.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(920, 920, 'Engineering', 'Decision making for information science ', 'Submit your assignment by uploading the actual R file where please include your R codes and write the five answers as comments (e.g., # Q1: The dataset has -- rows and -- columns) under the respective codes. [It is assumed that you are familiar with at least R basics. If not, please feel free to watch the optional videos on ELMS or online resources at your convenience. If you face any issues with that, please reach out to the instructional team].\r\n', 'Information science ', 'Bachelors', '[\"Other\"]', '[\"Decision analysis and modelling\"]', '2022-11-13 17:30', '1500', 'C3FF69AF-BF28-4007-BED4-3D51660BFBBB.png_$_8772B26B-B73A-4CE5-8255-2A6145ED022A.png_$_D9C0A1EA-8411-4499-A242-D0018246C32C.png_$_CCFF8A9E-AC97-4488-B169-3C1458FC93B2.png_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(921, 921, 'Commerce', 'Is  hosting a world sport event like Olympics and fifa World Cup beneficial for the nation in the long run ', 'I need a literature review of 20 sources( research papers) minimum on the above topic \r\nStuff like how does hosting a world cup/ olympics has benefited the host and whatâ€™s their status now etc. Taking examples of different fifa world cups etc all this to be done in APA FORMAT ', 'B.Sc. Economics ', 'Bachelors', '[\"Literature Review\"]', '[\"Economic Growth and Development\"]', '2022-11-13 23:00', '1500', '_$_', '2023-05-22 18:42:19', '', '13', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
(922, 922, 'Arts', 'PR Campaign Analysis', 'For this assessment you write a 1000 word analyses, selecting a campaigns and in each case focusing on a PR text as your object of study in each case. The campaign could be for any entity â€“ an individual, group, company, political party, charity/NGO, government, etc. The texts can be a press release, a press conference, a series of media articles that draw heavily on a press release, an event, interview, or even a series of tweets.\r\nUse one or more of the existing critical/theoretical approaches to public relations and apply it/them to your object of study. It is important to provide a critical analysis of your objects of study, rather than simply describe them. You ought to explain how the object of study attempts to persuade or to set the agenda, using the techniques of public relations.\r\n\r\nYou must write your analysis drawing on relevant academic sources to offer depth to your argument.', 'MA Media and PR', 'Masters', '[\"Essay Writing\"]', '[\"Public Relations\"]', '2022-11-16 22:00', 'INR 2000', '_$_', '2023-05-22 18:42:19', '', '4', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
(923, 923, 'Commerce', 'Strategic management ', 'Streaming Video on Demand (SVoD) is a challenging industry with multiple competitors emerging over the \r\ncourse of the last few years. . You will produce a report for a SVoD company of your choice  (for example, you \r\ncould choose one of the following companies: Netflix, Disney+, Apple TV+, Amazon Prime Video, ...).  \r\nFocus on a particular geographic market (this could be Global, or the UK, US or any other market). \r\nYou are a management consultant for the chosen company. You need to produce an industry analysis report for \r\nthe top managers of the company. \r\nReport needs to answer the following questions: \r\nQ1 â€“ Perform PESTEL analysis of the wider macro environment.  \r\nQ2 â€“ Perform Five forces analysis of the industry. \r\nQ3 â€“ Perform internal analysis of the company. Use VRIO framework to assess its internal capabilities. \r\nQ4 â€“ Summarize main strengths, weaknesses, opportunities and threats your chosen company is facing in a \r\nSWOT matrix. Advise the companyâ€™s leadership what they can do to exploit opportunities and counter threats. In \r\nother words, provide strategic advice for the future. ', 'BBA Honours ', 'Bachelors', '[\"Essay Writing\"]', '[\"Strategic Business Management\"]', '2022-11-23 00:00', '2500', 'BS6201 Strategic management - Industry analysis assignment brief 2022-23.pdf_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(924, 924, 'Engineering', 'Assignments ', 'I want my assignments to be written on one sided A4 sheets with blue and black pen with necessary diagrams. Iâ€™ll be providing you the content of assignments and want it to be done til 21st november.', 'Chemical engineering ', 'Bachelors', '[\"Essay Writing\"]', '[\"Process dynamics and control,Petroleum and refinery,Chemical Process Equipment Design,Plant Utility\"]', '2022-11-21 22:00', 'Nil', '_$_', '2023-05-22 18:42:19', '', '11', NULL, 1, 1, 1, 1, 1, 1, 0, NULL, NULL, NULL, NULL, NULL),
(925, 925, 'Arts', 'Assignment- Reading Reflection', 'Students will write one reading reflection over the course of the semester (800 words). Each reading reflection should engage critically with the required reading for the selected week; as well as one additional reading from the weekly list. This should not be a summary; students should develop their own argument from the readings that discusses the main arguments of the readings, the points found to be convincing, and those that are unconvincing, with reasons. Additional research is not required, but students should be very careful to stick to the topic and avoid unsubstantiated statements. The reflection will be submitted on Brightspace before the start of class, and presented in small groups each week. The schedule for reading reflections will be arranged in the first class. Official citations, bibliography and page numbers are not required unless you draw on work outside the assigned readings. You may not use extensive quotes in your reflections. You are expected however to acknowledge the author to demonstrate you are engaging with their work (i.e.â€œas Murphy argued, market power...â€). Include 2-4 probing discussion questions to stimulate discussion in class.\r\n\r\nAPA bibliography ', 'Social Science', 'Bachelors', '[\"Other\"]', '[\"Social Science\"]', '2022-11-21 12:00', '2000', '_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(926, 926, 'Engineering', 'Java Exam Questionnaire ', 'There are only 2 questions to be done that are based on the java data structure. There are specific guidelines and hints in the assignment which will help to understand how much and what is needed in order to get full marks. ', 'Computer Science', 'Bachelors', '[\"Question and Answer Based\"]', '[\"Computer science & applications\"]', '2022-11-18 22:00', '1200', 'EECS 2011 Exam.docx_$_', '2023-05-22 18:42:19', '', '2', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(927, 927, 'Commerce', 'Financial statements analysis ', 'Hi,\r\n\r\nI have attached the course work brief, that will guide you how to write the report. Company allocated to me is Reckitt benckiser. I have all the financial statements of this company for last 15 years. And ratios as well. \r\nPlease allocate one of the best talent of yours on this assignment.\r\nThanks ', 'MSc Finance and Investment Banking ', 'Masters', '[\"Report Writing\"]', '[\"Financial Accounting,Finance and Banking,Financial Accountancy,Financial Accounting and Reporting\"]', '2022-11-21 23:00', '4000', 'Credit Analysis of Premier Foods PLC - Sample 1.docx_$_Equity Investment - PZ Cusson Plc - Sample 4.docx_$_Credit Analysis of Pearson Plc - Sample 5.docx_$_FSA coursework brief.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL);
