(952, 952, 'Engineering', 'dissertation project', 'I wanted to ask you if you would be interested in helping me with my  dissertation project. (NO DEADLINE)\r\n\r\nFor a bit of background of the project: \r\n\r\nI built a UML diagram (class diagram) using a UML modelling tool called papyrus. The cool thing is papyrus can automatically convert the UML diagram into an XML file.\r\n\r\nThis is where I need your help:\r\n\r\nI have a java package called JAST. JAST is a package used to analyze/process the XML file. \r\n\r\nJAST has things to help me process/analyze XML files such as DOM parsing and XPath query.\r\n \r\nI will have to write a program in java that reads the XMI file that then uses the XPath search (found in JAST) to pluck out all of the elements/nodes of interest.\r\n\r\nXPath search is like Query strings in SQL but instead for XML files.\r\n\r\nHere is the website to the JAST package website: (please note we will only be interested in two sections of the JAST which is DOM-parsing and XPath query so only look at those parts): \r\nhttp://staffwww.dcs.shef.ac.uk/people/A.Simons/jast/domguide.html', 'Computer Science', 'Bachelors', '[\"Dissertation Writing\"]', '[\"JAVA,Java Developer\"]', '2022-11-24 11:36', '2000', 'AdvancedComputerGraphics_Fall2022_Project1_386902732 (1).pdf_$_ray_tracer_kent (1) (1).zip_$_', '2023-05-22 18:42:19', '', '3', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
