(969, 969, 'Arts', 'Stata Economic Data Analysis', 'For my project, I seek to test if there exists any relationship between health expenditure and the growth rate of an economy. The chosen country is Germany and the time period of this study is 1980 to 2021. The Independent variable is GDP per capita and the dependent variable is health expenditure per capita.  As it is a time series data, a Basic stationary test of ADF is employed. It is followed by a bound cointegration to find if there is a long-term relationship between the two variables. The results were not statically significant, hence ARDL model is employed. Tests of robustness and stability are too performed.\r\n\r\nAs it is an independent project and my first time using Stata, I am struggling with interpretation as well as doubting the models if they are the right way to approach my research question. I wanted to test the causality too but as the ARDL model was statistically insignificant and there was no long-run relationship too as proven by the cointegration, I had my doubts about whether to extend the analysis further.', 'MSc Economics', 'Masters', '[\"Programming / Coding Assignment\"]', '[\"STATA for Econometrics,Data analysis\"]', '2022-12-15 12:40', '2000 - 5000 rs', 'Germany.dta_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(970, 970, 'Engineering', 'Library management system ', 'Gathering, Scraping, Munging, and Cleaning Data\r\n\r\nIn this assignment, you will be populating your database with real-world data. This process is often called data munging or data wrangling. All of your database tables must be populated with real-world data. Any substitution of simulated data for real-world data must be pre-approved by me.\r\n\r\nThe process is as follows:\r\n\r\nYou must find sources of data. (This can be downloads, XML files, JSON, HTML pages, data repositories, etc.) (10 points)\r\n\r\nYou must download and reformat the data to fit your database schema. (This involves using web scrapers, web APIâ€™s, formatting scripts, parsing files, etc.) (10 points)\r\n\r\nYou must audit the quality and estimate the amount of data youâ€™ll gather. This involves auditing (i.e. testing to evaluate quality/accuracy - a systematic and independent examination of data). You will need to audit the following:\r\n\r\nAudit Validity/ Accuracy (10 points)\r\n\r\nAudit Completeness (10 points)\r\n\r\nAudit Consistency/Uniformity (10 points)\r\n\r\n \r\n\r\nThis site is very useful https://datavizcatalogue.com/\r\n\r\n \r\n\r\nYou must clean and insert the data into your database. (10 points)\r\n\r\nEach team member must come up with 5 more use-cases that involve a join between at least two tables. (10 points)\r\n\r\nYou must test that you can retrieve your data by implementing all of the use-cases in that you created in all of the assignments so far. (10 points)\r\n\r\nIn addition, you must:\r\n\r\nRespond to any feedback you received in assignment 2. (10 points)\r\n\r\nA brief README document explaining all of the files, the tests and their results and code. (10 points)\r\n\r\nDesign Requirements\r\n\r\nYour submission must include:\r\n\r\nSample data from every table.\r\nSQL for all of your inserts and queries\r\nAny code and scripts you used\r\nA brief README document explaining all of the files, the tests and their results and code.\r\nScoring Rubric\r\n\r\n(10 points) You must find sources of data.\r\n(10 points) You must download and reformat the data to fit your database schema\r\n(10 points) Audit validity/ accuracy\r\n(10 points) Audit completeness\r\n(10 points) Audit consistency/uniformity\r\n(10 points) SQL to insert the data into your database. Scripts to clean your data.\r\n(10 points) Each team member must come up with 5 more use cases that involve a join between at least two tables.\r\n(10 points) You must test that you can retrieve your data by implementing all of the use cases in that you created in all of the assignments so far.\r\n(10 points) Respond to any feedback you received in assignment 2.\r\n(10 points) A brief README document explaining all of the files, the tests, and their results and code.\r\nTables should be in normalized forms.\r\nData visualization should be there.\r\nSceipts should be in python', 'Database management ', 'Masters', '[\"Programming / Coding Assignment\"]', '[\"Database management\"]', '2022-12-03 13:15', '10000', '_$_', '2023-05-22 18:42:19', '', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(971, 971, 'Engineering', 'Lab 10', 'Just like before, I recommend that you walk through some examples first. They are provided in this R_notebook_lab10 (which opens in R studio) using the email_lab10 dataset.  This will give you examples of the code that you need to answer the questions below. Lines 1-148 are what you need for this assignment. Please give yourself plenty of time to troubleshoot errors in R as you complete the lab.\r\n', 'Decision making for information science ', 'Bachelors', '[\"Other\"]', '[\"Decision analysis and modelling\"]', '2022-12-05 09:00', '1000', 'AB002B10-E423-460B-AAA3-F289646E19DA.png_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(972, 972, 'Arts', 'Assignment', 'Are policy making and intervention design based on the security-development nexus beneficial to conflict response? Use research to collect evidence (case studies, reports, literature, assessments etc.) and construct an argument for if, when, under what conditions, etc. the security-development nexus makes conflict interventions more or less effective and/or sustainable.\r\n\r\nYour paper should include an introduction; a clear and compelling thesis statement (argumentative, not just a statement of purpose); an evidence-based argument in support of your thesis that is well-structured; a conclusion that summarizes your argument and is forward looking (suggest avenues for further inquiry, suggest changes to organizational and institutional structures to support more effective interventions, suggest pathways for alternative intervention\r\napproaches, etc.).\r\n\r\nPlease refer to the Academic Writing Conventions, Essay Writing, and Citation documents available on Brightspace under Content, sub-heading Academic Resources.\r\n\r\nWord Count: 2500 (Without Bibliography)', 'Social Science', 'Bachelors', '[\"Research Paper\"]', '[\"Social Science\"]', '2022-12-13 12:00', '3000', '_$_', '2023-05-22 18:42:19', '', '13', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(973, 973, 'Engineering', ' Implement a program that computes and prints out the JPD value of any combination of events. If the executable is called bnet', 'For the Bayesian network of Figure 1, implement a program that computes and prints out the JPD value of any combination of events. If the executable is called bnet, here is an example invocation of the program\r\n\r\nTo print out the probability P(Burglary=true and Earthquake=false and Alarm=false and MaryCalls=false and JohnCalls=true\r\n\r\nbnet Bt Ef Af Mf Jt\r\n\r\nThe implementation should not contain hardcoded values for all combinations of arguments. Instead, your code should use the tables shown in Figure 1 and the appropriate formulas to evaluate the probability of the specified event. It is OK to hardcode values from the tables in Figure 1 in your code, but it is not OK to hardcode values for all possible command arguments. More specifically, for full credit, the code should include and use a Bayesian network class. The class should include a member function called compute probability(b, e, a, j, m), where each argument is a boolean, specifying if the corresponding event (burglary, earthquake, alarm, john-calls, mary-calls) is true or false. This function should return the joint probability of the five events.', 'Computer Science ', 'Masters', '[\"Programming / Coding Assignment\"]', '[\"Artificial intelligence\"]', '2022-12-09 17:00', '8,000', 'Ai Assignment 2.pdf_$_', '2023-05-22 18:42:19', '', '11', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
