(980, 980, 'Arts', 'Research Paper', 'This is a full length essay of 1500 words (not more!), excluding bibliography or endnotes. It can be on any topic relevant to course themes - it is recommended that you discuss the topic in class, or by email with the Prof, before writing the paper. Submit it electronically on Brightspace. Deadline: December 15th (midnight).\r\n\r\nThe paper should:\r\nPresent a research problem or thesis statement that is explored using at least SIX peer-\r\nreviewed sources as a minimum (no maximum).\r\n1. Use at least THREE sources from the courseâ€™s required or optional readings.\r\n2. Provide at least THREE peer-reviewed (journal) sources of your own.\r\nInclude an Introduction (that outlines the theoretical framework for understanding the topic) and use examples or a case study to present and analyze the topic. The Analysis section must reflect your own critical understanding of the problem, and not simply describe it or summarize the analysis of others. The Conclusion should relate the research to at least some of the broader themes of the course and explore implications for policy, activism, or future research.\r\nAPA is the preferred style for citations and references.', 'Environment', 'Bachelors', '[\"Research Paper\"]', '[\"Environmental Impact Assessment\"]', '2022-12-15 12:00', '3000', '_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
