(982, 982, 'Commerce', 'Marketing Strategy', 'This assignment is an individual assignment.\r\n\r\nThis assignment requires you to use contemporary marketing strategy theory/concept in order to enhance you strategic marketing plan developed in CW1 or X-Culture. Your assignment should firstly follow the following structure;\r\n\r\nPart 1 â€“ Introduce and critically analyse your choosen contemporary marketing strategy theory/concept.\r\nPart 2 â€“ Apply the choosen contemporary marketing strategy theory/concept to your CW1 marketing plan.\r\n', 'Faculty of Business and Law', 'Masters', '[\"Report Writing\"]', '[\"Marketing management\"]', '2022-12-14 00:00', '-', 'a274b1c6e9c90df7ba53d0f70df0bc9ccw2_6011mkt_3000mkt.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
