(1023, 1023, 'Engineering', 'Leadership and management of project risk', 'Projects present challenges to the Project Manager, not just in their planning and operation, but alsoin terms of effective leadership, management of all interested parties. There are key areas whichneed to be considered when evaluating the success of a project. These can involve variousperspectives depending on experience, knowledge, cultural values, and self-interest. Managing toinitiate a project and maintain progress and required quality to completion can be difficult for theProject Manager.\r\nFor this assessment you are to choose a past project where it is no more than 6 years since projectclosure. You are to write a critical review of the literature in which you should consider thefollowing areas.\r\nKey issues in managing people in projects including leadership and teamwork,and how leadership can be used to improve team performance.\r\nThe factors that can impact on the quality of a project or engineering activity\r\nThe impact of leadership style and team performance on quality issues in your chosen project', 'MSc in project Management', 'Masters', '[\"Essay Writing\",\"Report Writing\",\"PPT Making\",\"Question and Answer Based\"]', '[\"Leadership-and-the-Management-of-Project-Risk,Quality-and-People\"]', '2023-01-05 23:19', '4000', 'ENGM116 Assignment 1-1.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1024, 1024, 'Engineering', 'Leadership and management of project risk2 First solar case study', 'Read and analyse the First Solar Case Study (provided) \r\nTask 1: 50% \r\nIdentify three key risks that could impact on quality outcomes. \r\nJustify and support your choice of risks by reference to the literature. For each risk: \r\n1. Build up the relevant risk specifications (see that attached template as a reminder of the field \r\nincluded in this) \r\n2. For each risk \r\na. Justify your choice of impact and probability ratings. \r\nb. Explore the potential mitigation and contingency plans and consider the budgetary \r\nimplications of these plans. \r\nTask 2: 35% \r\nUse two of the techniques covered in the module to explore one or more of these risks in more \r\ndetail. Choose from: Pareto analysis, Riskit Analysis Graph, or the Ishikawa diagram. \r\nJustify your choice of techniques considering their relevance and identifying at which part of the \r\nrisk management lifecycle they are of most value. Support your argument by making reference to \r\nrelevant risk literature. \r\nN.B. for this assignment you must explicitly state and justify any assumptions you have made in \r\naddition to the information provided in the case study. \r\nThe assignment should be submitted in report form with major sections matching the two tasks and \r\nminor sections matching the sub-tasks identified.', 'MSc in project Management', 'Masters', '[\"Essay Writing\",\"Report Writing\",\"PPT Making\"]', '[\"Leadership and Management\"]', '2023-01-05 23:29', '4000', 'ENGM116 Assignment 2-1.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
