(1068, 1068, 'Engineering', 'Leadership and the Management of Project Risk, Quality and People', 'Projects present challenges to the Project Manager, not just in their planning and operation, but also \r\nin terms of effective leadership, management of all interested parties. There are key areas which \r\nneed to be considered when evaluating the success of a project. These can involve various \r\nperspectives depending on experience, knowledge, cultural values, and self-interest. Managing to \r\ninitiate a project and maintain progress and required quality to completion can be difficult for the \r\nProject Manager. \r\n \r\nFor this assessment you are to choose a past project where it is no more than 6 years since project \r\nclosure. You are to write a critical review of the literature in which you should consider the \r\nfollowing areas. \r\n \r\nâ€¢ Key issues in managing people in projects including leadership and teamwork, and how \r\nleadership can be used to improve team performance. \r\n \r\nâ€¢ The factors that can impact on the quality of a project or engineering activity \r\n \r\nâ€¢ The impact of leadership style and team performance on quality issues in your chosen \r\nproject', 'Msc in Project Management', 'Masters', '[\"Report Writing\"]', '[\"Project Management\"]', '2023-01-25 17:00', '5000 ', 'ENGM116 Assignment 1-1.pdf_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL);
