(1069, 1069, 'Medical', 'Research Analysis (Autumn Semester). -- VARUN', 'Aim and objectives of your research, which should be clearly stated. Please \r\nnumber the objectives (please see Session 2-Research Motivation).\r\no Explanation of your research topic motivation supported by factual data about the \r\nsignificance of that research (please see Session 2-Research Motivation). Any \r\nfunding opportunity, statistics, roadmaps, governmental report, etc. can be used to \r\nsupport the research significance.\r\no Narrative of the literature review, which should be explained in detail (see Lecture \r\n4-Performing a Comprehensive Literature Review). What would be the steps \r\n(the pathway) that will be later taken to explain the related state-of-the-art to your \r\nown research topic. Note that this section is not a about conducting literature \r\nreview, but to explain that how you will do this later on.\r\no The possible methods (modelling approaches), which should be first identified \r\n(please see Lecture 5-Choosing a Methodology). Then, in respect to your \r\nselected research plan, you should explain how your method is aligned with the \r\nproposed objectives. And, how you would be able to reach to the goal (aim).\r\n', 'Sustainable energy', 'Masters', '[\"Research Paper\"]', '[\"Sustainable-energy\"]', '2023-01-25 16:25', '6000', 'Report Guideline_A_2022.pdf_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
