(1072, 1072, 'Commerce', 'TLD - Ethical Poster - HSBC', 'Identify an occasion where an institution has been unethical in the last 5 years.  Using this example as a case study prepare a poster presentation on the following topics:\r\n \r\n1.	Identify and explain the ethical implications that have arisen and how these could be avoided with reference to your choice of ethical codes, i.e safeguards related to codes of conduct in profession.\r\n \r\n2.	Using two or three of the UN Global Goals for Sustainable Development consider how this company could embed these into their best practice.\r\n\r\n', 'MSc Finance and Investment Banking', 'Masters', '[\"Other\"]', '[\"Leadership & Organizational Behavior,Ethics in banking\"]', '2023-01-26 23:59', '5000', 'Proposal for Poster Presentation - HSBC - Anush N1122074.docx_$_Exemplar TLD Poster Handout 1.docx_$_Exemplar References 3.pdf_$_Exemplar References 2.pdf_$_Exemplar Poster Presentation.pdf_$_Exemplar Poster 3.pdf_$_Exemplar Poster 2.pdf_$_Ethical poster Breif.jpeg_$_Designing a Poster Presentation.ppt_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1076, 1076, 'Engineering', 'Admiring gift web application ', 'Project is related to raising fund and providing stuff which provides help to\r\npoorer needy people. Any person can become a supporter of the system by\r\nfilling a prescribed form. They can get the reward, so that other can get\r\nmotivated and inspired to help needy people. In recent years, charities and non profit organizations have faced increased\r\npressure from a number of sources â€“ governments at all levels have cut back\r\non the funding of social services, the number of non profit organizations has\r\ngrown, and the scope of services provided by charities, non profits and non- governmental organizations has expanded .The limited amount of\r\ngovernment funding that is available has become more restrictive in terms of\r\nhow it may be used, with a marked preference for project-related costs and\r\nfewer opportunities to cover administrative or capital costs , new funding\r\nsources must be sought.', 'Engineering ', 'Bachelors', '[\"Programming / Coding Assignment\",\"Other\"]', '[\"Web application\"]', '2023-03-04 11:00', 'NA', 'Admire Gift-1.pptx_$_', '2023-05-22 18:42:19', '', '14', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
