(1086, 1086, 'Engineering', 'Organisations and Systems Assignment ', 'The tools and techniques covered within the module organisations and systems are aimed at investigating, understanding and modelling of organisations and systems.\r\n\r\nYou are therefore required to critique each of the following tools and techniques (please note each tool and technique has an equal weighting) and critically discuss how each of the tools/techniques might be used in analysing the Volvo Self-Driving (Autonomous) Car Project. See below for further information.\r\nTools:\r\n1.	SWOT Analysis\r\n2.	PESTEL\r\n3.	Porters Five Forces analysis\r\n4.	Data Modelling\r\n5.	Process Modelling\r\nTechniques:\r\n1.	Interviewing (as part of an investigatory study)\r\n2.	Questionnaires (as part of an investigatory study)\r\n\r\nAppendices\r\nIn addition, you are required to submit appendices which represent evidence of the practical application to the tools to the given case study, which you should also refer to in the main body of the appraisal. Please note that each appendix submitted must have been clearly developed by yourself.\r\n(Please note appendices do not count towards the word count)\r\n\r\nPart 2 (20%) â€“ Organisational and Systems analysis â€“ Tools/Techniques applied (600 words + - 10%)\r\n \r\n\r\n\r\nPart 2 of the assignment is split into two parts (part 2a and part 2b) and can be based on (in) an automotive manufacturing organisation of your choice:\r\n\r\nPart 2a. â€“ Soft Systems - Rich Picture (10%)\r\nChoose an automotive organisation / business and generate a â€˜Rich Pictureâ€™ which portrays the customer/supplier/manufacturer relationship e.g. Innoson Motors. Your analysis should be drawn from the perspective (viewpoint) of the customer who is using the products or services and should consider points of potential conflict and inter connectivity between the different parties, customer / supplier /Manufacturer.\r\nPlease state any assumptions you make when producing the model.\r\n\r\nPart 2b. â€“ Workshop Planning (10%)\r\nYou have been asked to plan a 90 minute workshop involving staff from the organisation of your choice. This workshop aims to develop a better working relationship between the management and staff within the organisation, prior to the introduction of new working practices. You are therefore required to set out a plan and briefly discuss how you would run this workshop, from the opening introductions to facilitating the discussion and finally to how it would be concluded. This can be submitted bullet point form and a maximum of three pages long.\r\n', 'Msc in Project Management', 'Masters', '[\"Report Writing\"]', '[\"Project Management\"]', '2023-01-31 17:00', '5000', 'VOLVO-Fortune.pdf_$_ENGM115 Assignment 112022.docx_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1087, 1087, 'Commerce', 'Ethical Poster ', 'Identify an occasion where an institution has been unethical in the last 5 years.  Using this example as a case study prepare a poster presentation on the following topics:\r\n \r\nIdentify and explain the ethical implications that have arisen and how these could be avoided with reference to your choice of ethical codes, i.e safeguards related to codes of conduct in profession.\r\n \r\nUsing two or three of the UN Global Goals for Sustainable Development consider how this company could embed these into their best practice.\r\n \r\n \r\nA1 Individual submission of a Poster and supportive references.\r\n \r\nThe PDF format of the A1 to be submitted to the dropbox by February 1st 2023, 11pm\r\n \r\nA Word Document supporting your PDF Poster submission listing all academic references (linked to the in-text citations listed on your Poster) to be submitted by at same time as your Poster submission.\r\n \r\nSubmission Arrangements\r\n \r\nPlease ensure the format is PDF as any other format cannot be retrieved for viewing.\r\nPlease ensure the poster is within the set boarder (margins) of an A1 Poster to ensure content fits\r\nPlease check the supporting list of references in the supporting Word Document align to the in-text citations listed in the Poster presentation.', 'Finance', 'Masters', '[\"Report Writing\",\"Research Paper\",\"Case Studies\",\"Other\"]', '[\"Finance and Banking\"]', '2023-02-01 16:00', '5000', '_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1088, 1088, 'Arts', 'Traditional practice of Fishing community in Mumbai', 'As the original inhabitants of Mumbai, they are spread across a number of\r\n  historic fishing villages on the cityâ€™s coast. Fishing community have steadily been\r\n  marginalised. Mumbaiâ€™s\r\nofficial development plan\r\nignores the role of the Koli community\r\n and the environmental impact on their traditional fishing practices, leading to threatening of\r\n their livelihoods and traditional fishing practices.', 'Ba political science ', 'Bachelors', '[\"Dissertation Writing\"]', '[\"Political Science,Fishing practice in mumbai\"]', '2023-02-01 14:35', '4k', 'D0498E69-40B9-49D3-9754-524B8871C141.png_$_CED29BEA-5BB4-477F-9A5C-C7B1416AF20E.png_$_3DE9A9F3-C2D4-448D-BBEB-7D2641783D8D.jpeg_$_C5AC454D-8147-4E25-A969-0F3585EB73F5.png_$_38193E5D-DFF1-4972-9B52-00E5C6C24F27.jpeg_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
