(1090, 1090, 'Commerce', 'Sahara Group India (company)      Ethical Poster ', 'The assessment has been designed as an opportunity to demonstrate your ability to analyse and apply to your chosen profession the ethical code of conduct, best practice & safeguards, via capturing and analysing an ethical issue, whilst demonstrating your understanding of how UN Global Goals for sustainable development align to ethics.\r\n\r\n The assessors will want you to evidence the following learning outcomes (b)(c) and (f): That youâ€¦\r\n\r\nUnderstand and explore how aspects of their discipline contribute to one or more of the UN Global Goals for Sustainable Development.\r\n\r\nDemonstrate a critical awareness of professional body ethical guidelines and how these apply in practice.\r\n\r\n Develop the capacity to reflect on action so as to engage in a process of continuous learning.\r\n\r\nIdentify an occasion where an institution has been unethical in the last 5 years.  Using this example as a case study prepare a poster presentation on the following topics:\r\n\r\n \r\n\r\nIdentify and explain the ethical implications that have arisen and how these could be avoided with reference to your choice of ethical codes, i.e safeguards related to codes of conduct in profession.\r\n \r\n\r\nUsing two or three of the UN Global Goals for Sustainable Development consider how this company could embed these into their best practice.\r\n \r\nA1 Individual submission of a Poster and supportive references.\r\n\r\nA Word Document supporting your PDF Poster submission listing all academic references (linked to the in-text citations listed on your Poster) to be submitted by at same time as your Poster submission.\r\n\r\n\r\nSubmission Arrangements\r\n\r\n Please ensure the format is PDF as any other format cannot be retrieved for viewing.\r\nPlease ensure the poster is within the set boarder (margins) of an A1 Poster to ensure content fits\r\nPlease check the supporting list of references in the supporting Word Document align to the in-text citations listed in the Poster presentation.\r\n   \r\n\r\nPlease go through all the references provided thoroughly.\r\nThe poster should be plagiarism free.\r\nMake proper citations of references used.\r\nRead all the instructions provided above and do it accordingly.\r\n', 'Finance and Investment Banking', 'Masters', '[\"Other\"]', '[\"Finance\"]', '2023-02-01 09:30', '4500', '_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
