(1102, 1102, 'Commerce', 'Reflective statement ', 'Element 1 â€“ Company Briefing Paper\r\nYou should choose one of the topics below as the subject of 2,000 words (maximum) fully-referenced Company Briefing Paper. Your chosen topic designates you as an â€œExpertâ€ at the relevant Roundtable Experts & Novices workshop sessions (see Element 3 below).\r\nPlease note that a limited number of places will be available for each topic, therefore you should choose a secondary topic as a back-up. A topic sign-up list will be available on Canvas closer to the time.\r\nÂ· Brand placement\r\nÂ· Sponsorship\r\nÂ· Ethics in Marketing Communications\r\nÂ· Customer Journey Communications\r\n  \r\nÂ· Interactive/Digital & mobile communications\r\nThe Company Briefing Paper must be written in the 3rd person and provide the Marketing Director of a fictitious company (see below for choice of companies) with the following:\r\nÂ§ Anup-to-date,criticalreviewoftheacademicliteratureinyourchosentopic area\r\ndrawing on an absolute minimum of two carefully selected academic journal\r\narticles and on a range of at least ten diverse sources.\r\nÂ§ Integrateintoyourdiscussionatleasttwoexamplesofhowtheacademic\r\ntheory reviewed is used/ applied by brands/ companies in current practice. Here, you should draw on practitioner sources such as the trade press (e.g. Marketing Week), newspaper articles (e.g. The Guardian) and news sources (e.g. BBC), and blogs, articles and websites written by credible industry commentators and experts.\r\nÂ§ Recommendations for how the fictitious company should take the issues\r\nraised in your briefing paper into account in their future marketing\r\ncommunications.\r\nIn this way, your Company Briefing Paper will pull together the academic literature on a topic with examples drawn from marketing practice. Employers put a high value on candidates who can demonstrate skills in critical thinking, synthesising (bringing together) material from different sources, and analysing complex material.\r\nYou should choose any ONE of the fictitious companies shown below as the focal company for your Company Briefing Paper.\r\nCompany A: Get Fit Now is a new pay-as-you go gym, targeting consumers who have become disillusioned by high joining and membership fees of health clubs. As a newcomer they need to build awareness very quickly and ensure that potential customers understand their position in the market place.\r\nCompany B: Bio-gloss is a brand of shampoo and hair care products targeted at a young teenage female audience. The products are positioned as fun, stylish, â€œmust-\r\n\r\nhaveâ€ items aimed at encouraging young girls (12-17 years old) to get into a regular hair care routine.\r\nCompany C: Nice Ice is a chain of ice cream cafes targeted at teenagers and their parents. Positioned as a trendy place to hang out with friends, the chain plans to open 25 outlets in large towns within a year.\r\nCompany D: Green-Phone is a new brand of smart phone positioned as sustainable. It is targeted at consumers who need to replace their phone whilst reducing their impact on the environment. The companyâ€™s marketing objective is to seize a 10% market share in the mobile phone market in year 1 by building awareness and trial rapidly.\r\nKey elements of a Company Briefing Paper\r\nPlease note that this is an indicative list only of what should be included in your work, it is nota running order or list of contents: thus, the logic and flow of material is up to you to decide.\r\nÂ§ Introduction to the paper (what is the purpose of the paper and what it will cover?)\r\nÂ§ Criticalanalysisanddiscussionofacademictheoryinyourchosentopicarea. You should aim to focus your discussion on any issue that you consider to be of relevance/ importance/ interest â€“ but â€“ be careful to scope it in. Do not be tempted to cover too many issues. Remember, your aim is to offer a critical discussion, not to simply describe one article after another â€“ thus, you should aim to go for depth rather than breadth. For example, is there an area of controversy or divided opinion in the subject area, e.g. where researchers have found different or conflicting results?\r\nÂ§ Examplesâ€“integratepractitionersourcestodemonstratehowtheissues raised in your review of the academic literature are used /applied in the case of at least two companies/ organisations/ brands in their marketing communications\r\nÂ§ Conclusions and recommendations: what conclusion do you draw from the review of the academic literature? Based on this, what recommendations would you make to the Marketing Director of your chosen fictitious company?\r\nÂ§ References: ALL sources used in the work must be shown in accurate Harvard style, including the in-text citations and the Reference list at the end of the work.\r\n   \r\nÂ§ Appendices are optional and should be used only if there is a need to include any supporting information.\r\nÂ§ Presentation style â€“ your paper must be presented to professional standards and demonstrate a coherent structure. It should include a title page, contents page, page numbers, and a clear system of appropriate headings and sub- headings.\r\nElement 2 â€“ Reflective statement on the research process\r\nThe Company Briefing Paper requires you to find, evaluate and use information drawn from a range of academic and practitioner sources. The ability to carry out information search and demonstrate reflective professional practice are important skills that employers are looking for.\r\nFor the reflective statement, therefore, you should write 200 words reflecting on your research process and the trustworthiness of the sources you have used. You should address:\r\nÂ§ How did you judge whether your sources were credible and reliable?\r\nÂ§ What did you learn from the research process in undertaking this assignment?\r\nÂ§ How might you take this learning forward into your professional life?\r\nThe reflective statement should be inserted in a separate section at the very end of your Company Briefing Paper, after the references and any appendices, and NOT as\r\na separate document.\r\n\r\nFor more read file attached below', 'Bba', 'Bachelors', '[\"Report Writing\",\"Research Paper\"]', '[\"Marketing Communication\"]', '2023-02-12 03:01', '4000', 'Marketing communication final assignment.pdf_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1103, 1103, 'Commerce', 'PROPOSAL ', 'It is a proposal of 3000-4000 words. A proposal is to be made on  \r\n-WHAT IS THE IMPACT OF CHANGE IN NIFTY 50 ON FINANCIAL SERVICES AND THE FMCG SECTOR?\r\n-WHAT WAS THE REASON BEHIND THE CHANGE?\r\n Ten years of data (2011 to 2021) for Nifty 50\r\nFinancial services and the FMCG sector will be considered for the analysis.\r\ncompare the NIFTY 50 to the financial services and FMCG sectors. Any price change in NIFTY 50 will affect the stock price of these sectors.  also, work on the events which occurred in the past 10 years which affected the price of INDEX.\r\n \r\n ', 'MSc INVESTMENT AND RISK FINANCE ', 'Masters', '[\"Other\"]', '[\"Finance\"]', '2023-02-16 01:00', '5000', 'topic_form_2021-2022_-_Tagged.docx_$_referencing-your-work.pdf_$_Proposal.pptx_$_Proposal Marksheet with assessment criteria.pdf_$_Proposal Guideline.docx_$_Proposal Example4(2).pdf_$_ABS2021 (1).csv_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
