(1106, 1106, 'Engineering', 'Prosthetic arm using EMG sensor ', 'Build a 3D printed prosthetic arm which can be controlled using an Arduino and EMG sensor.\r\nThe EMG sensor is supposed to be connected to a human arm in parallel and the prosthetic\r\narm is expected to mimic the action of the human arm. The human arm would have EMG\r\nsensors attached to it which streams sensor signals to an Arduino which is processed using a\r\nfirmware written for Arduino. Later Arduino controls the actuation of servo motors that are\r\nattached to prosthetic arm, with this the 3D printed prosthetic arm tries to mimic the motions\r\nof the human arm.', 'Etrx', 'Bachelors', '[\"IOT/Hardware Projects\"]', '[\"IOT\"]', '2023-02-28 12:58', '7000', '_$_', '2023-05-22 18:42:19', '', '14', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
