(1134, 1134, 'Commerce', 'Report ', 'Read in the attachment for full details\r\n\r\nThis is an individual assignment. Students are expected: a)to elicit and critically analyse the current Business Model Canvas of ONE of the pre-selected SMEs below and b) to propose future recommendations for a Hockey Stick Growth strategy. \r\nSelect three classes from TB 1 AND three classes from TB 2 that you have attended and CONTRIBUTED in real time. a) Critically reflect on your active contribution (e.g. What did you comment? What did you ask and why?). b) Critically reflect on your lessons learned and how these new learnings can improve your entrepreneurial mindset and your employability skills\r\n', 'BBA', 'Bachelors', '[\"Report Writing\"]', '[\"Entrepreneurial Management\"]', '2023-03-07 20:43', '3000', '1D238EC2-92D7-4739-9D3F-BD832C61DBC5.png_$_0796FA5D-077A-4B51-906C-F8BC1B72660C.png_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL);
