(1135, 1135, 'Commerce', 'Report ', 'Q1. You can choose any international company, who has faced any one of the country risks: political, economic, operational or competitive, in the last 12 months in one of the following regions: 1) South America, 2) Africa, 3) Central Asia, and 4) Middle East. Identify, analyse and manage the risk as if you were employed as a consultant by your chosen company. Any risk management technique which has already been adopted and used by the chosen company will NOT be accepted in your answer. (500 words)\r\n \r\nQ2. You have been promoted to HR Director in the Swedish company which manufactures and sells the medical equipment (MRI scanner). Being very hi-tech, the equipment has until now been made in Sweden by the companyâ€™s skilled team. Your employer has just purchased a factory in Mexico for the manufacture of medical equipment that have been selling well in the USA. There is a budget for three expatriate managers to be sent to manage its operation in Mexico for four years. The CEO has asked you to recommend the job title for three expatriates with your justification for each job title and prepare a plan to help these expatriatesâ€™ early settlement in Mexico. (500 words)\r\n \r\nQ3. Choose any international company who has outsourced one of its business functions to a local company in their international operation (For example:  DHLâ€™s use of local Indian company for its inbound freight distribution in India) and critically discuss the benefits and drawbacks of its outsourcing arrangement with the local company. An outsourcing arrangement between the two companies should be post 2010. (500 words)\r\n \r\nQ4. Recently, a notion of â€˜Industry 4.0â€™ or â€˜Fourth Industrial Revolutionâ€™ has become of a centre of attention in the business world. Some associated technologies, such as additive manufacturing, advanced robotics, Drones, IoT, Blockchain, and AI, have been rapidly developing and many firms are contemplating different ways to exploit these technologies. Choose any international company\r\n ', 'Bba', 'Bachelors', '[\"Report Writing\"]', '[\"International business\"]', '2023-03-15 20:49', '3000', 'BO6203+International+Business+Operations+Individual+Assignment+2+Briefing+22-23.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1136, 1136, 'Commerce', 'Reflective essay', 'Write a reflective essay about your personal learning journey in this module. Describe how activities in this module (simulation, case discussions, readings, guest lectures, ...) helped you to understand what strategy is about. Try also to identify gaps in your knowledge and what you still have to learn.\r\n\r\n\r\n2,000 words (+/-10%) excluding references.\r\nDeadline \r\n', 'Bba', 'Bachelors', '[\"Essay Writing\"]', '[\"Strategic Business Management\"]', '2023-03-20 20:54', '3000', 'critical+thinking+toolkit.pdf_$_What+i+have+learned+about+strategic+management.pptx_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
