(1190, 1190, 'Commerce', 'Report wrtinf ', 'Tag sheet is already done. \r\nTopic sponsorship \r\nArticles are attached below. \r\n\r\nOverview\r\n\r\nYou will choose one Marketing Communication topic out of a list of five, topic in which you will become an â€˜expertâ€™ by researching a range of sources. You will write up an up-to-date, critical review of the academic literature in your chosen topic area, as well as some recommendations to a fictitious company (to be chosen from a list of four) on how this company should take the issues raised in your briefing paper into account in their \r\nfuture marketing communications.\r\n\r\nThe individual assignment comprises of three elements:\r\n\r\n1.    A fully-referenced Company Briefing Paper (2,000 words maximum)\r\n\r\n2.    A reflective statement on the research process (200 words maximum)\r\n\r\n3.    Preparation for and contribution to five â€œExperts and Novicesâ€ roundtables, including a TAG (Thematic Analysis Grid). \r\n\r\n The task\r\n\r\nElement 1 â€“ Company Briefing Paper\r\n\r\nYou should choose one of the topics below as the subject of 2,000 words (maximum) fully-referenced Company Briefing Paper.  Your chosen topic designates you as an â€œExpertâ€ at the relevant Roundtable Experts & Novices workshop sessions (see Element 3 below).\r\n\r\nPlease note that a limited number of places will be available for each topic, therefore you should choose a secondary topic as a back-up. A topic sign-up list will be available on Canvas closer to the time.\r\n\r\nÂ·       Brand placement\r\n\r\nÂ·       Sponsorship\r\n\r\nÂ·       Ethics in Marketing Communications\r\n\r\nÂ·       Customer Journey Communications\r\n\r\nÂ·       Interactive/Digital & mobile communications\r\n\r\n \r\n\r\nThe Company Briefing Paper must be written in the 3rd person and provide the Marketing Director of a fictitious company (see below for choice of companies) with the following:\r\n\r\nAn up-to-date, critical review of the academic literature in your chosen topic area\r\ndrawing on an absolute minimum of two carefully selected academic journal \r\narticles and on a range of at least ten diverse sources.  \r\nIntegrate into your discussion at least two examples of how the academic theory reviewed is used/ applied by brands/ companies in current practice. Here, you should draw on practitioner sources such as the trade press (e.g. Marketing Week), newspaper articles (e.g. The Guardian) and news sources (e.g. BBC), and blogs, articles and websites written by credible industry commentators and experts. \r\nRecommendations for how the fictitious company should take the issues raised in your briefing paper into account in their future marketing communications.\r\nIn this way, your Company Briefing Paper will pull together the academic literature on a topic with examples drawn from marketing practice. Employers put a high value on candidates who can demonstrate skills in critical thinking, synthesising (bringing together) material from different sources, and analysing complex material.\r\n\r\n \r\n\r\nYou should choose any ONE of the fictitious companies shown below as the focal company for your Company Briefing Paper. \r\n\r\nCompany A: Get Fit Now is a new pay-as-you go gym, targeting consumers who have become disillusioned by high joining and membership fees of health clubs. As a newcomer they need to build awareness very quickly and ensure that potential customers understand their position in the market place.  \r\n\r\nCompany B: Bio-gloss is a brand of shampoo and hair care products targeted at a young teenage female audience. The products are positioned as fun, stylish, â€œmust-haveâ€ items aimed at encouraging young girls (12-17 years old) to get into a regular hair care routine.\r\n\r\nCompany C:  Nice Ice is a chain of ice cream cafes targeted at teenagers and their parents. Positioned as a trendy place to hang out with friends, the chain plans to open 25 outlets in large towns within a year.\r\n\r\nCompany D:  Green-Phone is a new brand of smart phone positioned as sustainable. It is targeted at consumers who need to replace their phone whilst reducing their impact on the environment. The companyâ€™s marketing objective is to seize a 10% market share in the mobile phone market in year 1 by building awareness and trial rapidly.\r\n\r\nKey elements of a Company Briefing Paper\r\n\r\nPlease note that this is an indicative list only of what should be included in your work, it is not a running order or list of contents: thus, the logic and flow of material is up to you to decide.\r\n\r\nIntroduction to the paper (what is the purpose of the paper and what it will cover?)\r\nCritical analysis and discussion of academic theory in your chosen topic area. You should aim to focus your discussion on any issue that you consider to be of relevance/ importance/ interest â€“ but â€“ be careful to scope it in. Do not be tempted to cover too many issues.  Remember, your aim is to offer a critical discussion, not to simply describe one article after another â€“ thus, you should aim to go for depth rather than breadth. For example, is there an area of controversy or divided opinion in the subject area, e.g. where researchers have found different or conflicting results?\r\nExamples â€“ integrate practitioner sources to demonstrate how the issues raised in your review of the academic literature are used /applied in the case of at least two companies/ organisations/ brands in their marketing communications\r\nConclusions and recommendations: what conclusion do you draw from the review of the academic literature?  Based on this, what recommendations would you make to the Marketing Director of your chosen fictitious company?\r\nReferences: ALL sources used in the work must be shown in accurate Harvard style, including the in-text citations and the Reference list at the end of the work.\r\nAppendices are optional and should be used only if there is a need to include any supporting information.\r\nPresentation style â€“ your paper must be presented to professional standards and demonstrate a coherent structure.  It should include a title page, contents page, page numbers, and a clear system of appropriate headings and sub-headings.\r\n \r\n\r\nElement 2 â€“ Reflective statement on the research process\r\n\r\nThe Company Briefing Paper requires you to find, evaluate and use information drawn from a range of academic and practitioner sources. The ability to carry out information search and demonstrate reflective professional practice are important skills that employers are looking for.\r\n\r\nFor the reflective statement, therefore, you should write 200 words reflecting on your research process and the trustworthiness of the sources you have used. You should address:\r\n\r\nHow did you judge whether your sources were credible and reliable?\r\nWhat did you learn from the research process in undertaking this assignment?\r\nHow might you take this learning forward into your professional life?\r\n The reflective statement should be inserted in a separate section at the very end of your Company Briefing Paper, after the references and any appendices, and NOT as a separate document.\r\n\r\n \r\n\r\nElement 3 â€“Experts and Novices Roundtable Sessions\r\n\r\nFive Roundtable Experts & Novices sessions in Teaching Block 2 take the form of expert and student-led, co-created workshops, where students take on the role of either an â€œExpertâ€ or a â€œNoviceâ€ and work together to share and develop knowledge about the topics for the Company Briefing Paper.\r\n\r\nFollowing from Element 1 above, your chosen literature review topic designates you as an â€œExpertâ€ at the relevant roundtable session.  For the roundtable sessions where the topic is not your chosen literature review topic, you are a â€œNoviceâ€.  Everyone will therefore be an â€œExpertâ€ at one session and a â€œNoviceâ€ at the other four sessions.\r\n\r\nAttendance at the Roundtable Expert and Novices workshop sessions is mandatory.\r\n\r\nThe purpose of the workshops is to develop subject knowledge and help you prepare for the assignment. You will also develop your research skills as well as gain confidence in your ability to explain the results of your research to others. Employers place high importance on communication and listening skills, and the Experts and Novices sessions will enable you to practice and hone your talents in both areas.  \r\n\r\nIn preparation for the workshops you are required to find and read at least four academic journal papers on your chosen literature review topic and prepare a written summary of your findings in the form of a Thematic Analysis Grid (TAG). \r\n\r\nThe Critical Thinking module on Canvas provides resources to help you produce your TAG, and enrolment on the module is recommended:  https://canvas.kingston.ac.uk/courses/7439\r\n\r\nGiven the co-created nature of these sessions, their success depends entirely on everyone taking responsibility for their part in the sessions and the impact of this on others. This means actively participating in the workshops and coming prepared, i.e. having done the reading and produced the required TAG preparation paper. Specifically:\r\n\r\nExperts must find and read at least four academic journal articles* in their chosen topic area and prepare a written summary of these articles in the form of a fully-referenced Thematic Analysis Grid (TAG). In your designated Expert workshop session, you will use your TAG paper as the basis for your explanation about your topic to a small group of Novices.\r\nExperts must also find examples of how brands/companies have used/ applied the theory in practice, to illustrate your findings to your Novices.\r\nNovices must read the relevant content in Fill & Turnbull (2019) or at least ONE academic journal article in order to gain a basic understanding of the topic AND find examples to discuss in class. Be ready to ask questions of your Expert.\r\nDuring the roundtable sessions, after the Experts have shared their findings with the Novices, Experts and Novices will work together to apply the theory to a practical scenario and produce recommendations for practice.\r\nAt the end of every roundtable both Experts and Novices are required to complete a Contribution Sheet that reflects on your input into the sessions and what you got out of them. You must submit a satisfactory Contribution Sheet in order to gain your marks for each workshop roundtable.\r\n \r\n', 'BBA', 'Bachelors', '[\"Report Writing\"]', '[\"Marketing Communication\"]', '2023-03-30 09:00', '4000', 'Measuring ambush marketing and sponsorship effects a football consumer response approach.pdf_$_Less Sponsorship As Advertising and More Sponsorship Linked Marketing As Authentic Engagement.pdf_$_Sponsorship-linked_marketing_ (1).pdf_$_Sponsorship-linked_marketing_.pdf_$_Tax sheet for Adarsh.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1191, 1191, 'Commerce', 'risk and crisis management ', 'BUSM117 2023 Coursework assignment Instructions and guidance\r\nThe coursework assignment is worth 40% of the total mark for this module.\r\nSources\r\nFor both the coursework assignment and for the examination, you must ONLY use the literature listed in the reading lists in this module handbook for all conceptual and theoretical points.\r\nFor your case studies, however, you may use other peer-reviewed sources or other reputable, well-researched sources.\r\nDo not use practitioner web sites as sources for your assessments.\r\nWord limit\r\nMarks may be deducted if you overshoot the word limit. For the sake of clarity, unlike on some modules there is no percentage allowance for excess words: the limit is 2000 words exactly. (For the sake of clarity, unlike on some modules there is no percentage allowance for excess words: the limit is 2000 words exactly.)\r\nThis does not include reference lists and bibliographies although citations in the main body of your assignment do count. The words in the question itself, which will be your title, do not count against the word limit.\r\nDo not include a summary at the beginning of the essay, as well as your introduction: that would count against the word limit, and you would risk a deduction of marks for repetition.\r\nDo not use appendices: they would also count against the word limit and in any case the evidence supporting your argument should be in the main body of your essay.\r\nGuidance on the coursework assignments\r\n1. To answer any of the coursework questions, you will need to draw upon your learning from the seminars. You should expect to use examples which you examined in preparatory study for and in discussion during the seminars for this module.\r\n2. Use and compare two or three case studies to illustrate and support your arguments. You can draw cases from the articles and books suggested in the reading lists, in particular from the reading lists for the seminar tasks. Supplement the information on these cases by searching using the QMUL library, to find additional peer reviewed articles and also look for major investigative reports.\r\n3. Donâ€™t just describe. Focus your answer on causal processes which explain the outcomes for risk management which you want to argue in, in response to the specific question set.\r\n4. Ensure that your answer draws on material covered week 1-8 of the module.\r\nCoursework questions\r\nSelect one of the following three questions and write an essay of not more than 2000 words in answer to it.\r\n1. Enterprise risk management: Assess the evidence for and the limitations of the main arguments made by at least three advocates and by at least three critics of enterprise risk management (ERM). In particular, assess the evidence for their rival claims about its\r\n\r\npracticality in implementation, effectiveness and capacity to limit the effect of bias, for different kinds of businesses and organisations, for different kinds of risks, and for different phases of the business cycle.\r\nSupport your analysis of the strengths and weakness of the advocatesâ€™ and the criticsâ€™ cases by comparing either cases of attempts to implement ERM either in (a) two contrasting industries or (b) in two firms of very different sizes.\r\n2. Risk perception / communication: Under what conditions and with what risk communication strategies, if any, can companies succeed in reassuring consumers who are sceptical of the safety of a companyâ€™s products or services and local residents living or working near a companyâ€™s hazardous site or plant or operations?\r\nSupport your analysis by comparing evidence about conditions for success and strategies from two industries, one of which should be concerned with risk communication to consumers about product or service safety and the other with risk communication to local residents about operational safety. Both cases should concern routine business work, not crisis or post-crisis conditions. Identify key differences and similarities between these contexts.\r\n3. Project risk in mega-projects: Why does the implementation of project risk management procedures so often fail to reduce project risks in mega-projects? Review empirical evidence from research and assess the relative importance of at least four different factors.\r\nSupport your analysis by comparing cases of more and less successful mega-projects, where risk management procedures were implemented in each case, even in the less successful project.\r\nGeneral advice\r\n- Answer the exact question set.\r\n- Structure your essay carefully, with a clear introduction that â€˜signpostsâ€™ the sequence of the argument to be made out, a main body of argument, and a conclusion which integrates the whole argument.\r\n- Support your answer with carefully marshalled, ordered and sequenced presentations of empirical evidence, setting out your reasons for answer to the question in full.\r\n- Use empirical cases and evidence to illustrate your argument.\r\n- Use the literature in the field critically.\r\n- Define and explain key concepts when you introduce them.\r\nCommon mistakes to avoid\r\n1. Being vague â€“ e.g., failing to define key terms, writing obscurely, failing to be clear and unambiguous.\r\n2. Over-claiming â€“ claiming too much, claiming more than your evidence really supports.\r\n3. Asserting rather than arguing â€“ failing to support your claims with empirical evidence\r\nand logically related reasons.\r\n4. Swithering â€“ arguing for one answer to the question set in one part of the essay and\r\nthen arguing for a quite different or even opposite answer in another part of the essay.\r\n5. Being indecisive â€“ writing a â€˜on the one hand ... and on the other ...â€™ answer to the\r\nquestion set that does not come down clearly in favour of one answer to it.\r\n6. Not considering the limitations of at least one opposing case, if only briefly.\r\n\r\n7. Presenting a conclusion that does not follow from the argument or the evidence.\r\n8. Trying to rely on knowledge drawn from other modules.\r\n9. Writing without a well-thought out structure â€“ e.g., no evident and logical sequence of\r\npoints that build up to a step-by-step argument to a conclusion.\r\n10. Being uncritical and not being thoughtful â€“ e.g., taking the conventional â€˜textbookâ€™\r\nwisdom for granted, without interrogating it, without examining whether the evidence\r\nsupports it.\r\n11. Summarising â€“ just summarising what leading authors have written, without making an\r\nargument of your own.\r\n12. Writing about the topic rather than answering the exact question set.\r\n13. Being too simple â€“ e.g., assuming practice will mechanically follow rules set in laws or\r\nobjectives of programmes, taking simple abstract and theoretical differences between\r\nindustries for granted, over-generalising about fields.\r\n14. Presenting your essay poorly â€“ e.g., writing illegibly, not making your paragraph breaks clear and\r\nobvious, not numbering and indenting key points in those cases where this would be helpful to the reader in understanding some steps in your argument.\r\nFormat\r\nâ–ª All work must be typed and submitted in MS Word or Adobe PDF format\r\nâ–ª Font size should be 12 point (unless otherwise specified)\r\nâ–ª Font style should be Arial\r\nâ–ª Lines should be double-spaced\r\nâ–ª Leave margins for comment Insert page numbers\r\nâ–ª Use a header containing your student ID number, the module code to which your work\r\napplies, and the date\r\nâ–ª Always spell-check and proof read your work before handing it in (once you have\r\nsubmitted your work you will not be permitted to retrieve it)\r\nâ–ª Keep your own electronic back-up copy of your work and if possible save on two\r\ndevices\r\nâ–ª Avoid plagiarism\r\nâ–ª Submit your work on time\r\nLate submissions\r\n1. Coursework submitted late (and there are no extenuating circumstances) will incur a late penalty. Five per cent of the total marks available shall be deducted for every period of 24 hours, or part thereof, that an assignment is overdue there shall be a deduction of five per cent of the total marks available (i.e. five marks for an assessment marked out of 100). After seven calendar days (168 hours or more late) the mark shall be reduced to zero, and recorded as 0FL (zero, fail, late).\r\n2. Each module has word limits for coursework assignments; however, the decision about whether to impose a penalty mark for exceeding the word limit is made by each module organiser. You must check the module handbook and the assignment briefing documents to see whether the particular module organiser has adopted a penalty system. It is your responsibility to read the handbook and assignment briefing carefully. If no penalty is specified then the module organiser will take into account the word length under the standard marking conventions. For example, if you have exceeded the word limit then it might be that you have not been sufficiently succinct or focused in your assignment and therefore might be penalised for these weaknesses. Please note that word limits do NOT\r\n\r\n3. 4.\r\n5.\r\n6. 7.\r\n8.\r\ninclude references or appendices. However if excessive material is included on appendices then this too will be judged accordingly and you may be awarded a lower mark.\r\nYou should ensure that your submission is in either Microsoft Word or PDF format. Failure to submit in either one of these formats will result in a mark of 0 being awarded for the particular assessment. It is therefore your responsibility to ensure that the file format is correct and it can be opened by the receiving party.\r\nYou should ensure that the correct piece of assignment is uploaded as the document downloaded on the due date by the module organiser will be marked regardless of content. You will not have another opportunity to submit the work again if you mistakenly uploaded the wrong document.\r\nALLOW YOURSELF PLENTY OF TIME TO SUBMIT YOUR COURSEWORK. DO NOT LEAVE IT UNTIL THE LAST MINUTE\r\nComputer problems, such as computer viruses, failure to make a back-up copy or temporary internet access problems, will NOT be viewed as a valid reason for late submission.\r\nCheck that your assignment submission has been successful, and print a copy of the confirmation screen.\r\nIf you\r\nvia QMplus however you will be penalised for late submission, the only exception to this is if you have an approved extension due to extenuating circumstances.\r\nsubmit your assignment after the deadline, you will still be able to submit your coursework\r\nSubmission deadline\r\nDate\r\nTime\r\nQMplus Link/Page\r\nEstimated 29th March 2023\r\nEstimated 1600pm\r\nTbc â€“ Assessment information tab in BUSM117 QMPlus page\r\n\r\n                Marking criteria for both the coursework assignment and the examination\r\nThe marking criteria for the coursework assignment and for the examination are the same. They are set out in the following table, which you will also see used to provide feedback on your assignment and to explain the mark given. For both the coursework assignment and for the examination, you must ONLY use the literature listed in the reading lists in this module handbook for all conceptual and theoretical points. For your case studies, however, you may use other peer-reviewed sources or other reputable, well-researched sources. Do not use practitioner web sites as sources for your assessments.\r\nMarking criteria by grade\r\nband\r\nEvidence of learning from\r\nlectures, seminars, module\r\nmaterials and guidance from\r\nteaching staff\r\nNOT % of mark but\r\ncondition for pass\r\n18%: Argument from\r\npremise to conclusion, focus\r\non explanation / evaluation\r\n(as appropriate to the\r\nquestion set) not just\r\ndescription\r\n18%: Analysis, synthesis and\r\ncritical thinking\r\n18%: Answers the precise\r\nquestion set\r\n18%: Knowledge and\r\nunderstanding of the\r\nsubject, showing wide\r\nreading\r\n80-100 70-79.9 Strong distinction Distinction\r\n60-69.9 Merit Present\r\nArgument structure clear and strong Principally explanatory / evaluative\r\nVery good analysis, synthesis and critique\r\nAnswers the precise question set, even if some irrelevant material\r\nCompetent\r\nknowledge of the\r\nsubject\r\nEvidence of\r\nreading, mainly\r\nrelevant\r\n50-59.9 Pass Present\r\nArgument structure either clear or strong but not both Largely descriptive\r\nGood analysis, synthesis and critique\r\nLargely answers the precise question, even if some irrelevant material, and lacking some relevant material Some weaknesses in knowledge of the subject Insufficient reading, or some irrelevant items\r\n45-49.9 Bare fail Present\r\nArgument structure lacking in clarity and / or strength Mainly descriptive\r\nWeak analysis, synthesis and critique Answers a closely related question but not the precise question set\r\nSerious weaknesses in knowledge of the subject Severely insufficient reading, or significant number of irrelevant items\r\n40-44.9 Weak fail Present\r\nArgument poorly structured Purely descriptive\r\nPoor analysis, synthesis and critique Fails to answer the precise question set\r\nVery severe weaknesses in knowledge of the subject Lack of reading, or lack of relevant items\r\n0-39 Very poor fail Absent\r\nNo clear argument Purely descriptive, perhaps vague even in description\r\nVery poor analysis, synthesis and critique Fails to answer a clear question\r\nLack of knowledge of subject Little evidence of reading, or irrelevant items Fundamental misunderstandings\r\nPresent\r\nArgument structure\r\nvery clear and\r\nstrong, high level of\r\nrigour in inference\r\nFocused exclusively\r\non explanation /\r\nevaluation\r\nExceptional\r\nanalysis, synthesis\r\nand critique\r\nAnswers the precise\r\nquestion set, no\r\nirrelevant material\r\nExceptional\r\nknowledge of the\r\nsubject\r\nVery wide reading\r\nof strongly relevant\r\nitems\r\nPresent\r\nArgument structure very clear and strong Focused exclusively on explanation / evaluation\r\nExcellent analysis,\r\nsynthesis and\r\ncritique\r\nAnswers the precise\r\nquestion set, no\r\nirrelevant material\r\nStrong knowledge\r\nof subject\r\nWide reading of\r\nrelevant items\r\nShows no\r\nmisunderstandings\r\n\r\n        18%: Comparative, structured analysis of cases to support the argument, based on a clear principle of case selection\r\n10%: Essay clearly and well\r\nstructured, logically ordered\r\nwith sub-headings reflecting\r\nclear principles\r\nShows no misunderstandings\r\nExceptionally clear, well presented with structured case Exceptionally strong, appropriate, well-presented and defended principle for selecting cases analysis format Powerfully analytical structure of comparison among cases\r\nVery strongly,\r\nclearly logically\r\nstructured,\r\nheadings grounded\r\nin clear principles of\r\ninference from\r\nevidence to\r\nconclusion\r\nClear, well presented with structured case analysis format Strong, appropriate, well-presented and defended principle for selecting cases Good analytical structure of comparison among cases\r\nStrongly, clearly logically structured, headings grounded\r\nin clear principles of inference from evidence to conclusion\r\nShows no or very few and only minor misunderstandings\r\nClear cases well presented, an appropriate, well- presented principle for selecting cases Competent analytical structure of comparison among cases\r\nCompetently structured, headings grounded in some principles of inference from evidence to conclusion\r\nSome misunderstandings\r\nCases presented, but some weaknesses in clarity of presentation Case selection principle stated but either not quite appropriate or not well presented Mainly adequate analytical structure of comparison among cases but with weaknesses in organisation Adequately structured, with headings bearing some relationship with logic of argument\r\nSignificant misunderstandings\r\nExamples presented, but weakly organised into case format Fails to set out case selection principle precisely Poorly structured analytical structure of comparison among cases\r\nWeaknesses in structuring and/or in subheadings\r\nMany or serious misunderstandings\r\nExamples mentioned casually, not structured as cases No case selection principle No analytical structure of comparison among cases\r\nSerious weaknesses in organisation and structure of the essay\r\nNo clear cases used Either no case selection principle or serious misunderstanding of case selection No comparison of cases\r\nNo clear organisation or structure to the essay\r\n', 'msc management ', 'Masters', '[\"Essay Writing\"]', '[\"risk-and-crisis-management\"]', '2023-03-27 19:58', '5000', 'BUSM117-guidance-on-how-to-read-articles-and-chapters-when-preparing-for-your-coursework-assignment.pdf_$_BUSM117---coursework-assignment---suggestions-dr-10.pptx_$_BUSM117-2023-Coursework-assignment-Instructions-and-guidance-dr2.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
