(1207, 1207, 'Arts', 'Range Architecture For Women\'s Youth Fashion Brand', 'Project details- Range Architecture of Reliance Trends brand RIO. There are two sub-brands: RIO Girls (kidswear & teenage girls) , RIO (Women\'s wear). We have selected 2-2 product categories from both the sub-brands. From RIO Girls- Tops & Bottoms (Denim Jeans) and from RIO - Tops & Bottoms (Denim Jeans). The biggest competitor of RIO brand is MAX Fashion. There are 2 inspirational brand of RIO, i.e., HnM & Zara. \r\nNow, we have to do a survey regarding brand RIO. Questionnaire and its responses are ready. Only the conclusion needs to be made out from the survey responses with charts and graphs. I\'ll be attaching the questionnaire and responses for your reference.\r\nNext, we need to do a in-depth analysis of brand RIO (including sub-brands) and MAX Fashion (basically a in-depth competitor analysis) with figures, charts and graphs. And analysis of inspirational brand also.\r\nThen, we have to do a in-depth product analysis of both these brands (products chosen mentioned above) including the fabric, style, fit, trim, embroidery, silhouette, etc.\r\nMention the product range for both the brand (RIO &MAX) with product images.\r\nNext, we have to do a gap analysis for these brands ( like what MAX Fashion is doing which brand RIO is not) and to find the recommendation and solutions. What all we can incorporate in brand RIO so that the structure of the brand is improved and its sales increases.', 'Bachelor of Fashion Technology (B.F.Tech)', 'Bachelors', '[\"Dissertation Writing\"]', '[\"Supply chain management,range-architecture,price-points,product-analysis,comparative-analysis,gap-finding,Sales,range-planning,Retail Management,Sales and marketing\"]', '2023-04-03 10:00', '8k-10k', 'Survey form.pdf_$_objective and methodology.pdf_$_', '2023-05-22 18:42:19', '', '', NULL, 1, 1, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
