(1235, 1235, 'Arts', 'People Planet Profit', 'PEOPLE PLANET PROFIT [Report]\r\nMinimum word count: 3000 [extra 10% allowed]\r\nMinimum references: 30\r\nArial: 11, line spacing: 1.5 \r\nTable of content required \r\nSources for references: Hub(Proquest, Ebsco), UNWTO, Tourism site of the destination.\r\n\r\nAccording to the UNWTO (2021), â€œthe future resilience of tourism will depend on the sectorâ€™s ability to embrace a low carbon pathway and cut emissions by 50% by 2030â€.\r\n\r\nQuestion: Critically discuss this statement and evaluate the main challenges of such a significant reduction in emissions by 2030 from a destination perspective.\r\n\r\nIPCC Report Climate Change 2021: The Physical Science Basis - https://www.ipcc.ch/report/ar6/wg1/ \r\n\r\n\r\nINDICATIVE ANSWER 1\r\n\r\n1 INTRODUCTION \r\n1.1 Definition (1 or 2 max), History and Evolution of Sustainability \r\n1.2 Definition (1 or 2 max), Overview of Sustainable Tourism Development [can add few points from SDG]\r\n(Total 300 words) \r\n\r\n2 DESTINATION- for eg. Mumbai, Maharashtra, India. [Can be any destination but preferably from a developing or Asian country, or Islands, Tip- Write the entire official name of the place eg. Republic of India] [You can add maps of the destination in the appendices]\r\n2.1 Introduce the choice of your tourism destination, and history in 1/2 lines. [Mention the statistics of GDP from tourism, their graphs can go in the appendices.]\r\n2.2 What are carbon emissions. Highlight the sources of carbon emission in tourism with relation to your choice of destination. Then which industry in that particular destination emits the maximum carbon? [Greenhouse gases other than CO2 can be mentioned if global warming is being discussed as a larger picture but in 1-2 sentences]\r\nFor example, in a country; the destination could be a tourist attraction such as a heritage site, place of interest that tourists visit for: \r\n1. landscape and culture and/or events\r\n 2. architecture,\r\n 3. gastronomy, \r\n4. infrastructure development and transport, \r\n5. lodging (accommodation),\r\n 6. shopping \r\nChoose any 2 of the above-stated components which will be common for all the 3 pillars.\r\n2.3 Short introduction about the two components [Also mention how the components are creating an impact on the destination]\r\n (Total 300 words)\r\n\r\n 3 THREE PILLARS OF SUSTAINABILITY [Definition of each pillar must be given, and then both the components need to be mentioned with reference to the pillar, it can be mentioned 1 after another or combined whatever is suitable, and positive as well as negative impacts for both components must be discussed related to the particular pillar] \r\n3.1 Economic Sustainability â€“ Concept, definition (1/2 max) (300 words) \r\n3.1.1 Two Positive Aspects/Impact (Should be discussed in the context of carbon emissions) â€“ Related to the 2 components which you have selected. [Support it with statistics regarding emissions]\r\n3.1.2 Two Negative Aspects/Impact (Should be discussed in the context of carbon emissions) â€“ Related to the 2 components which you have selected.\r\nThis is to be linked and integrated with the chosen destination \r\n3.1.3 Barriers that impact its practical implementation \r\nAdd examples under each 3.1.1; 3.1.2; 3.1.3. [Another countryâ€™s data can be used in examples for your 3 pillars like how they reduced emissions and their technique can be used as a solution in our case]\r\nTheory (for eg. Ice burg, product life cycle, Maslowâ€™s hierarchy) / Processes / Models should be added which contribute to the sustainable development of the chosen destination. For eg., If an accommodation component is taken then processes such as 3R can be used, or rainwater harvesting, faucets, and nozzles which save water. [At least in 2 pillars theories needs to be added and link the theory to one of the components of the pillar and related images can go in the appendices]\r\n(500 words) \r\n\r\n3.2 Social Sustainability (300 words) \r\n3.2.1 Positive aspect/impact\r\n 3.2.2 Negative aspect/impact \r\n3.2.3 Barriers that impact its practical implementation \r\n(500 words)\r\n\r\n 3.3 Environmental Sustainability (300 words) \r\n3.3.1 Positive aspect/impact\r\n 3.3.2 Negative aspect/impact \r\n3.3.3 Barriers that impact its practical implementation\r\n (500 words)\r\n\r\n 4 CONCLUSION AND RECOMMENDATIONS FOR THE TOURISM INDUSTRY \r\n[Minimum 3 recommendations without citations and reference list and it has to be unique]\r\n\r\n5 REFERENCE LIST\r\n 6 APPENDICES - images related to statistics mentioned or theories/processes used, maps of selected destination [With citations and reference list]\r\n', 'Hotel Managemenet', 'Bachelors', '[\"Report Writing\"]', '[\"module\"]', '2023-04-16 12:00', '5000', 'PPP doc.pdf_$_PEOPLE PLANET PROFIT.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1236, 1236, 'Arts', 'Organizational behaviour', 'Organizational Behaviour [Literature review]\r\n\r\n3000 words + 10% extra is allowed.\r\nMinimum references: 30, Books, as well as peer-reviewed journal articles, can be referred to. \r\nAnt theme can be taken but it should relate to workplace culture, an external or internal factor which affects/impacts workplace culture in any way positive or negative.\r\n\r\nKEYWORDS for topics \r\nConflict\r\nCognitive dissonance\r\nBehaviour\r\nIndividual behaviour\r\nPersonality\r\nWorkplace relationship\r\nSocial loafing\r\nCultural intelligence\r\nEmotion\r\nAttitude\r\nChanged behaviour\r\nValues\r\nDiversity\r\nCommunication\r\nIndividual difference\r\n\r\nAdd sub-headings for better scores, no need to number them.\r\nFor eg. \r\nTopic:         Negative emotions\r\nSubtopic:  Negative emotions at the workplace \r\n                    The impact that it creates\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nWe will need this chart for approval. [Minimum 30 sources]\r\n\r\n\r\n\r\n\r\n\r\n\r\nAcademic source	Author\r\n\r\n	Title and year of journal article or book \r\n	Volume	Purpose of study\r\n	Method	Sample	Findings\r\n	Viewpoint of the author 	Accessed date and link	Remarks/\r\ncomments\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										\r\n\r\n\r\n \r\nModule Descriptor\r\n\r\nTitle 	Organisational Behaviour	Code (if known)\r\n		B3137\r\nSHE Level	3	Semester & Mode of Study	1\r\nFull-time and Part-Time	Credit Rating \r\nSCQF   20\r\nECTS   10\r\nSCQF Level	9			\r\nModule Co-ordinator	Virginia Elliot\r\nModule Team	Virginia Elliot \r\nPre-requisites 	None\r\nCo-requisites	None\r\nProhibited Combinations	None\r\nAims\r\nThe module is designed to enable students to engage with the essential aspects of organisations and organisational behaviour. It will explore important contemporary issues of organisational life across a range of organisational contexts.\r\nLearning Outcomes \r\nOn successful completion of the module the student will be able to:	Assessed in this module	A	B	C	D\r\nL1	Demonstrate an appropriate understanding of the main concepts, theories and issues surrounding organisations and organisational behaviour	Yes	X	X		X\r\nL2	Engage critically with the main contemporary issues, challenges and difficulties facing organisations and the members and managers of organisations	Yes	X	X		X\r\nL3	Demonstrate an appropriate understanding of the important aspects of organisational life, at the individual, group and systemic levels	Yes	X	X	X	X\r\nL4\r\n	Demonstrate an understanding of the critical importance to organisations of issues of structure and culture	Yes	X	X	X	X\r\n\r\nA â€“ Knowledge and Understanding; B â€“ Intellectual Skills; C â€“ Practical Skills; D â€“ Transferable Skills\r\n\r\nLearning Experiences  \r\nThe module will engage the student in the following types of learning experiences:\r\nâ€¢	Formal lecture contact  (10 hours)\r\nâ€¢	Formal seminar contact  (20 hours)\r\nâ€¢	Directed study  (40 hours)\r\nâ€¢	Independent learning  (130 hours)\r\n\r\nWithin the formal contact time, students will experience the following learning approaches:\r\nâ€¢	Individual and group-based work\r\nâ€¢	Class discussion around the main topics\r\nâ€¢	Group presentation\r\nâ€¢	Class preparation: directed and independent reading\r\n\r\nAssessment Pattern\r\n\r\nâ€¢	Individual literature review (3,000 words) â€“ 100%\r\nCan this Module be Anonymously marked?        Yes/No                If No please provide an explanation.\r\n\r\nYes\r\nContent\r\nA short paragraph to summarise the module content which will be held in ISIS\r\nThe module will cover the important contemporary subjects within the study and practice of organisational behaviour, focusing on individual behaviour, group and team behaviour, and the main systemic issues facing todayâ€™s organisations â€“ organisational structure, organisational culture and the management of organisational change\r\nMain Texts\r\nCross, C., and Carbery, R. (eds.). 2021. Organisational Behaviour: An Introduction.  2nd Edition. London: Macmillan Education Limited\r\nRobbins, S., and Judge, T. 2017. Organizational Behaviour. 17th Edition.  Essex: Pearson.\r\nBratton, J. 2015. An Introduction to Work and Organizational Behaviour.  3rd Edition. Basingstoke: Palgrave Macmillan.\r\nBrooks, I. 2018.  Organizational Behaviour: Individuals, Groups and Organization.  Essex: Pearson.\r\nBuchanan, D., and Hucynski, A. 2016.  Organizational Behaviour.  9th Edition.  Essex: Pearson.\r\nMullins, L. and Christy, G. 2016. Management and Organizational Behaviour.  11th Edition.  Essex: Pearson.\r\nKing, D., and Lawley, S. 2019. Organizational Behaviour. Oxford: Oxford University Press.\r\n\r\n\r\nThese texts will be further supplemented by way of additional recommended reading to which students will be alerted throughout the course of the module. This reading will be taken from such sources as academic journals, periodicals and other relevant publications\r\nOther relevant details\r\n\r\nCompleted by Virginia Elliot	Date:  13/7/22\r\n\r\n\r\n', 'Hotel Managemenet', 'Bachelors', '[\"Literature Review\"]', '[\"Modules\"]', '2023-04-16 12:00', '5000', 'Organizational Behaviour....docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
