(1246, 1246, 'Engineering', 'Auction DApp', 'I made a project on e-auction based on blockchain. It is T a decentralized app used for simulating an auction house.\r\nThe app contains functionalities for:\r\n\r\nCreating auction\r\nParticipating in active auctions\r\nPlace private bids and reveal them after bidding time closes\r\nClosing the auction by the organizer\r\nConfirming the bids placed and declaring the winner\r\nDelivering the item to the winner with confirmation\r\nThere are 4 types of auctions supported:\r\n\r\nMarket listing: A normal listing that remains public and active till the organizer closes the auction. The winner is the highest bidder.\r\nBlind Auction: A type of sealed bid auction where the bids are private and the winner is the highest bidder.\r\nVickrey Auction: A type of sealed bid auction where the bids are private. The winner is the highest bidder but the price paid is the second-highest bid.\r\nAverage Price Auction: A type of sealed bid auction where the bids are private. The winner is the highest bidder but the price paid is the average of all bids.\r\nThe auctions are conducted through smart contracts written in Solidity and Metamask is used for client-side communication.\r\n\r\nActually, I have completed the smart contracts and web application but the transactions through MetaMask are not working this is one of the issues(the integration part to be precise).\r\nAnd currently, the project is for random stuff and I want to make it specific for the auction of paintings for that I need to upload and preview painting images on the web app.\r\nThe compiler version is 0.6.12\r\n\r\nTo start app follow commands :\r\n1) in a new terminal type \r\n      a) truffle develop\r\n      b) migrate --reset\r\n2) in a new terminal \r\n      a) cd client \r\n      b) npm install\r\n  Â Â Â Â c)Â npmÂ start', 'Computer Engineer', 'Bachelors', '[\"Programming / Coding Assignment\"]', '[\"Solidity Programming,ReactJS\"]', '2023-03-27 20:00', '1000-1200', 'ss.png_$_github repo link.txt_$_', '2023-05-22 18:42:19', '', '', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
