(1250, 1250, 'Commerce', 'Strategic Brand Management assignment for Msc. Marketing course', 'So, they are asking you to look at Royce Lingerie, a family-\r\nowned British business, which is one of the organisations that recently approached OBBC.\r\nRoyce Lingerie is specialised in manufacturing wire-free bras that provide comfort and support \r\nfor all women â€“ whether they are buying for their teenage daughter, are pregnant or nursing, \r\nare looking for larger cup sizes, or have undergone breast or chest surgery. Royce is also \r\ncommitted to supporting the LGBTQ+ community by manufacturing bras, for example, for \r\npeople who identify as transgender.\r\nThey never want to stand still because their markets are permanently evolving and changing. \r\nThey always aim to be ahead of the competition and know what the â€˜big pictureâ€™ changes and \r\nthe important â€˜zeitgeistâ€™ trends are.\r\nTherefore, OBBC is pitching now to help Royce Lingerie prepare for a future brand positioning\r\nthat takes latest broader societal trends as well as a comprehensive market analysis into \r\naccount. Due to time constraints, OBBC decides for the initial pitch phase to focus\r\ngeographically on the UK market only. For more details, see www.royce-lingerie.co.uk\r\nOne of the key challenges is to attract new and younger target audiences without losing older \r\nloyal customers.\r\nYour report needs to cover the following elements\r\n\r\n ANALYSIS: What is this brand about? What are the key meanings, manifestations \r\nand stakeholders of the brand? What does the â€˜productâ€™ portfolio currently look like? \r\nWhat are the brandâ€™s current vision, mission and core values? What are the \r\nstrengths, weaknesses, opportunities and threats? How is the brand currently \r\npositioned? Your analysis is expected to look at a variety of elements of the brand. \r\nThis should include the brandâ€™s IDEOLOGY, CAPABILITIES, \r\nCONSUMERS/STAKEHOLDERS, COMPETITION and ENVIRONMENT. \r\nMark allocation: 30%\r\n \r\nSTRATEGY: Based on your analysis, you are expected to discuss two different \r\npotential future positioning options for the brand which could be established in the UK \r\nmarket in autumn/winter 2023. You then need to justify/evaluate which of the \r\ndiscussed positionings has the most potential, i.e. you need to choose one \r\npositioning option and justify your decision. You can extend a positioning strategy \r\nthat already exists, but you need to justify why this is the best option. Finally, you are \r\nexpected to make suggestions as to how the brand positioning idea could be \r\ntransformed into strategic frameworks that can be used to brief the clientâ€™s marketing \r\nteam who need to bring this positioning idea to life. In this context you must apply \r\none or more of the following frameworks: (a) SBM Vision, Mission & Values; (b) SBM \r\nBrand Pyramid; and/or (c) Transformation Grid. \r\nMark allocation: 30%\r\n\r\n IMPLEMENTATION: Based on your strategic framework(s), you need to develop \r\nand explain implementation activities to show how, for example, the clientâ€™s UK \r\nmarketing team could implement the core strategic idea which you have developed\r\nwith different specific stakeholders. This needs to contain an activity in terms of co-\r\ncreative new product development. One implementation activity needs to utilise \r\nsocial media-based communications or other latest digital technology. \r\nMark allocation: 30%\r\nThe remaining 10% are allocated for the quality of the presentation of the assignment. This \r\nmeans, for example, overall presentation style; standard of English; breadth, depth, and \r\nquality of sources; references list presented in Harvard Referencing Style; word count well \r\nused.\r\nYou are required to produce a report comprising the three key areas outlined above. You \r\nmust support your decisions with academic references as well as other secondary sources. \r\nTherefore, you must search for and use relevant information on the brand, but you are NOT \r\nexpected to conduct primary empirical research as part of the assignment.\r\n\r\nMust not contact the client at all.\r\nThe information shared here needs to be 100% confidential or I\'ll get in big trouble as this is an actual client not a fictional one just for the assignment.', 'Msc. Marketing', 'Masters', '[\"Report Writing\"]', '[\"Marketing,Brand Management,Brand strategy,Strategic Business Management,Strategic Business Reporting,Report preparation\"]', '2023-04-05 00:00', '4500', 'MARK7010_SBM_Brief 2023 FINAL (1).pdf_$_CONFIDENTIAL Royce answers to questions from Brookes_070323.docx_$_CONFIDENTIAL Royce OrganizationChart.pdf_$_CONFIDENTIAL Royce OrganizationChart (1).pdf_$_CONFIDENTIAL_ROY_Brand Guidelines_v5.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
