(1254, 1254, 'Commerce', 'CW1: Individual Summative Assessment 1:  Report', 'The summative report will be assessed on planning and organisation and content (structure, application of theory, relevance).  You will submit your typed answers via blackboard which will process you submission through â€˜turnitinâ€™. Your answer must be in a report format of 3000 words. You must make use of marketing literature, reference properly and use available secondary data and cases to illustrate and support your arguments.', 'Marketing for Managers ', 'Masters', '[\"Report Writing\"]', '[\"Marketing management\"]', '2023-03-29 23:59', '6000rs', 'MK7B6 Assignment Brief SEM1 2023 - T2- Spring-2.docx_$_', '2023-05-22 18:42:19', '', '15', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
