(1304, 1304, 'Commerce', 'Operation management', 'You must select one focal organisation as the subject of your assignment. Where the organisation has different divisions or a disparate product/service offer, you may have to select one specific area of the organisation for study (i.e., you will need to define the scope to be covered in your report). You may also find it appropriate to select by geographical region, or if the organisation has disparate operations, one of these.\r\n\r\nYour report must analyse and evaluate the operations management of an organisation, or of a specific business unit/division, and draw conclusions over the extent to which its operational capability supports its corporate strategy and provides competitive advantage.\r\n\r\n\r\n\r\n', 'Management and Business Analytics', 'Masters', '[\"Report Writing\"]', '[\"Operation management\"]', '2023-04-18 13:00', '30Â£', 'OM_example_70s.pdf_$_OM_example_60s.pdf_$_operation management.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1305, 1305, 'Commerce', 'Operation management ', 'You must prepare and submit an original business report addressing the tasks identified later in this section, but summarised below.\r\nYour report must analyse and evaluate the operations management of an organisation, or of a specific business unit/division, and draw conclusions over the extent to which its operational capability supports its corporate strategy and provides competitive advantage.\r\n\r\nMy Topic- Harley-Davidson Inc.\r\n\r\nYou must select one focal organisation as the subject of your assignment. Where the organisation has different divisions or a disparate product/service offer, you may have to select one specific area of the organisation for study (i.e., you will need to define the scope to be covered in your report). You may also find it appropriate to select by geographical region, or if the organisation has disparate operations, one of these.\r\n', 'International business ', 'Masters', '[\"Report Writing\"]', '[\"Operation management\"]', '2023-04-12 13:54', '4000', '_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
