(1328, 1328, 'Commerce', 'Research proposal assignment ', 'You are required to complete a 3,000 word research proposal to demonstrate your ability to identify, analyse a research problem related to business and management, and to set out a plan for a research project to investigate that problem. The aim of this assessment is to enable you to develop and demonstrate your ability to: (a) diagnose a problem in business and management, (b) formulate research questions, determine how to answer these questions by drawing on the academic literature, identify and assess the potential of appropriate research methods and (e) plan a small-scale research project.\r\nThis report is among the most challenging assignments set during your M.Sc. programme. You should note that it is quite different from, and more challenging than, writing a conventional coursework essay-style paper. You are being asked to anticipate the issues that you will have to overcome in planning, conducting and reporting a small research project. The best research proposals are usually those produced by those students who have devoted considerable thought to the assignment before even beginning to write the proposal. It is not an assignment that can be left to the last minute.\r\nYour choice of problem for the project proposal report does not commit you to that topic for your dissertation. You can just complete the report as a free-standing exercise in which you are assessed on your competences as indicated in your ability to analyse a problem, grasp the arguments and the evidence contained in the literature, devise a suitable research design and present it effectively. You are free to select a different topic for your dissertation if you so wish, although there are obvious advantages in sticking to a topic to which you have already given thought and invested some work. However, you must avoid cutting-and-pasting parts of the proposal into the dissertation. In other words, your assignment for this module and your dissertations should be different, otherwise your report might be flagged as self- plagiarism.', 'Research methods for marketing ', 'Masters', '[\"Essay Writing\",\"Literature Review\",\"Research Paper\"]', '[\"Marketing,Research Proposal\"]', '2023-04-20 15:00', 'Â£30-Â£40', 'BUSM098 Research Methods for Marketing Module Outline 2022-23.pdf_$_httpsqmplus.qmul.ac.ukpluginfile.php3527675mod_resourcecontent1Week 1-Introduction-BUSM098.pdf.png_$_Research Methods--assignment notes.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
