(1335, 1335, 'Commerce', 'Essay for Corporate Social Responsibility and Business Ethics', 'Submit an essay on 1 of the 2 assignment questions. The essay should be of 2500 words (excluding references). The questions are as follows:\r\n\r\nQuestion 1\r\nChoose one stakeholder group (shareholders, workers, consumers, suppliers, civil society organisations) and identify the main ethical issues that shape their opportunities and challenges in relation to corporate activity.\r\n\r\n\r\n[100 marks]\r\nQuestion 2                                                                                                                      	\r\nReflecting on what you have learnt over the course of this module, \r\n\r\nA. Describe how your understanding about the responsibilities of corporations to society has changed and/or been challenged. \r\n\r\n[50 marks]\r\n\r\nB. What potential solutions, if any, do you believe can ensure a more sustainable and ethical way of doing business in the future? Refer to specific case studies and examples that you have learnt in class.\r\n\r\n[50 marks]\r\n', 'Msc Management', 'Masters', '[\"Essay Writing\"]', '[\"Corporate social responsibility\"]', '2023-04-18 21:00', '4000-5000', 'BUSM175 Individual essay FAQs.docx_$_BUSM175 individual coursework questions.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1336, 1336, 'Arts', 'Research Paper', 'Topic: Identify a contemporary social event or movement and critically analyse it by answering the question: how can we re-imagine our lived realities through concepts of social sciences such as social structure, gender relations, ideology and/or oppression? Discuss the question using secondary sources of literature.\r\n \r\nMethod: Before submitting the research paper, students will be asked to share their broad themes, focus areas and research questions with the instructor from early April onwards. An excel sheet will be sent to you for putting in your responses and the topics will have to be finalized by 10th April.\r\n', 'Law', 'Bachelors', '[\"Research Paper\",\"Thesis Writing\"]', '[\"Foundation-of-Social-Sciences\"]', '2023-04-20 10:00', 'NA', 'Citations and References.pptx_$_FSS 2 Research paper details.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
