(1356, 1356, 'Commerce', 'How consumers cope with the challenge of identity loss or change due to life transitions such as retirement, divorce, or migration and how this influences their consumption of nostalgic products and experiences in the future. ', 'You can use the social-self theory to explore how consumers seek to maintain or restore their sense of belonging and identity through consumption.\r\n\r\nUsing self-identity theory, identify and evaluate a contemporary societal challenge that is influencing the consumption behaviour of consumers. Develop conclusions from your evaluation. Use these conclusions to develop a â€˜future imaginationâ€™ of how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them.\r\nYour evaluation must include a critical appraisal of self-identity theory to inform your arguments. Additionally you must include evidence of relevant changing consumption behaviours and predictions from relevant experts. You must develop your â€˜future imaginationâ€™ from your conclusions. \r\nIn addressing the above question, you are advised to make the following choices:\r\n1)	Choose a specific consumer segment who engage in a specific consumption behaviour occurring in response to a societal challenge. You can phrase this as a problem or opportunity. \r\n2)	Focus on one consumer segment pertinent to your topic and country/sector choice. You should develop a profile of this segment, providing as much pertinent information as you can, e.g. using sociodemographics, psychographics. Please present visually or in table format, fully referenced.\r\n3)	Focus on one country for your essay. Having this focus will make it a lot easier for you to identify and evaluate the evidence within the word limit specified.\r\n4)	While you are required to use self-identity theory for your essay, you MUST focus on a specific concept, model or framework within it. For example, the self-concept model, social-self, pro-environmental self-identity, pro-social self-identity, body image, etc. Choose ONE of these. Do NOT include multiple identity frameworks/ models in your essay because this will undermine the depth of analysis you can achieve within the 3000 word count limit.\r\nOnce you make the above choices, you are required to investigate research evidence from academic articles, news from legitimate sources, industry reports etc. to critically analyse how consumer behaviour has changed in response to the societal issue you have identified. Building from this appraisal, you will explain, evaluate and apply your identity framework/model to your chosen issue. This will enable you to develop evidence-based analytical conclusions, from which you can create your future imagination.\r\n\r\nYou should draw on a good range of high quality academic and expert opinion sources to construct solid arguments for your paper. You should use relevant examples and data to support your claims. Ensure you fully reference all sources of information.\r\nYou are required to write a critique of transforming/transformed consumer behaviour, informed by contextual information, evidence and relevant theory. Your critique will involve you assessing varied data, ideas and scholarship from varied sources. Be adventurous in your searching but note the advice given to you on reputable sources. \r\nYou must focus on one framework/model of identity theory in your essay. This will really help you to develop a stronger critical appraisal to show your understanding and critical thinking. \r\nYou must choose only one country and one consumer segment. Within this country and segment, try to analyse your chosen CB transformation broadly and briefly. Then narrow down again to your chosen sector/industry/segment and again articulate this transformation. You now have an explanation that is country, sector and consumer specific. Now that you have this foundation, you can begin to build your academic arguments by integrating your chosen identity theory. Continuously, apply and evaluate your theory to your country/sector/segment otherwise your context and theory risk being disconnected. Lastly, extrapolate your conclusions to a 5-10 year future in order to imagine how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them. \r\nYou must ensure the evidence you use to compile your paper relates to your choices (i.e. do not use American evidence to discuss China!). Preliminary reading will help you to make your choices. Whatever you choose to do, ensure you present your argument for your choices at the start of your paper â€“ and justify them. \r\nAssemble the evidence for your arguments, avoid unsubstantiated statements and bias - this is an objective investigation. It is essential that you critique your chosen theory and evidence, do not just describe it; evaluate the contribution it makes to our understanding of transforming/transformed consumer behaviour and how marketing to consumers (as customers or event participants) will evolve as a result in the future.\r\n\r\nGUIDELINES:\r\nPart 1: Introduction and Explanation (500-800 words): Introduce and examine your societal challenge, consumer segment and behaviour and country. Explain the issue clearly and its impact, citing supporting evidence and justify why it is worthy of exploration in your essay. Include a profile of your chosen consumer segment.\r\nPart 2: Evaluation and application of theoretical framework (1500-1800 words): Begin by giving an overview of identity theory, then focus on your chosen identity framework/model. Explain it and apply it to you challenge and context in part 1. Evaluate its contribution in explaining the CB transformation that is occurring, using scholarly research and evidence to support your arguments. Use examples throughout, pertinent to your focus. Images and illustrations can be used and add value to written arguments. \r\nPart 3: Conclusions (300-500 words): Develop conclusions based on your content in parts 1 and 2. Do not simply summarise your essay (this is not a conclusion). Your conclusions should be insightful and analytical and lead into your future appraisal. They should also demonstrate your learning from critically reviewing your chosen context and identity theory. Developing a â€˜visual mapâ€™ to illustrate this can be a useful communication tool; this is entirely up to you. Examples are discussed in the assignment briefings and clinics. Keep your writing style concise and focused. Numbering each conclusion will be helpful for cross referencing with your future appraisal. You could also consider these as a map for part 4.\r\nPart 4: The future (<500 words): This is where you get to be creative! Tell us, based on your analysis in part 1,2 and 3 your core ideas for imagining how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them. Include specific examples of your chosen issue/segment/behaviour. You can present your â€˜future imaginationâ€™ as text and visually (we are not expecting artwork from you). Visualisation is encouraged and can include multiple formats, e.g. drawing, photographs, and digital images. Infographics are useful, using free software that is readily available. Check permissions for using any images that are not your own (and reference them as instructed by the owners).   \r\nMake sure your discussion of the future is connected and builds upon what you have stated in the body of your essay and is backed by evidence.\r\nPlease note: \r\nParts 1 and 2 need to be fully and extensively referenced. \r\nPart 3 will contain some pertinent references to support your insight e.g. from futurism, but should not repeat the full range of references in your theory review. Remember conclusions represent your critical thinking built from your prior analysis which you have already referenced. \r\nPart 4 does not require references, albeit you may need to reference some futurism insights if you include them here instead of in your conclusion (either place is fine). This section is showcasing your critical and creative thinking.\r\nThe use of subheadings to break up the essay is OK, however, please ensure you donâ€™t have too many as you risk hyper-fragmenting your essay, which may hamper the flow of discussion and subsequent analysis.\r\n', 'Msc. marketing', 'Masters', '[\"Essay Writing\"]', '[\"Consumer behaviour\"]', '2023-05-05 01:00', '5000', 'MARK7013 HB S2 2022-23.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
