(1383, 1383, 'Commerce', 'Service Management ', '1.	The innovative â€˜newâ€™ services is the core/fundamental part to your report, and the beginning/start to guide your further discussion of your marketing strategies/marketing mix. Thus, highlighting the â€˜shining pointâ€™ (i.e., unique selling point) that differentiate your services from other competitors is very important, which will largely influence the quality of your whole report. \r\n\r\n2.	Be realistic, remember that you also need to propose the launch schedule.\r\n\r\n3.	Be consistent, from the motivation of the new services (why you want to invest in your project) to targeting the right segments (you think they will buy your services) to the marketing strategies (how can you realize your project), you should talk about/sell one â€˜storyâ€™.\r\n\r\n4.	With the word limit of 2,000, it is difficult and dangerous to list many points of your (small) practices, especially those could be shared with many other services/ your competitors. In other words, when you talk about the common practices (which you think is very important for your service), you could briefly mention and discuss, or could even summarize it and put it into appendix (show that you learned what was covered in the module). What you should focus and elaborate are those points that you think could show the â€˜newâ€™, â€˜differenceâ€™ and â€˜innovativeâ€™ of your services (show your creativity and innovation ability). \r\n\r\n5.	As we have discussed the Ps (process, people, and physical evidence, and promotion) which are relevant to services, I recommend you to focus on the contents covered in the module. But if you think some classical Ps (e.g., product, price, place) are very important/special/innovative in your services, you could discuss them, but please justify them. \r\n\r\n6.	Remember when you list any practice, it is better give some support (e.g., theory, statistics as reference) to justify yourself. Avoid listing any implementation without any justification or reference support. \r\n\r\n7.	Remember to propose a â€™nameâ€™ to your services', 'Masters in marketing', 'Masters', '[\"Research Paper\"]', '[\"Service management\"]', '2023-04-24 00:00', '1000', 'Individual Essay Structure.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1384, 1384, 'Commerce', 'Research Proposal', 'Link to reading material - https://drive.google.com/drive/folders/1pp6kSpoGT3g87gAPF808mavJjUpg_Ca8?usp=share_link  \r\n\r\nThe research proposal requires you to demonstrate your ability to identify, analyse a research problem related to business and management, and to set out a plan for a research project to investigate that problem. The aim of this assessment is to enable you to develop and demonstrate your ability to: (a) diagnose a problem in business and management, (b) arrive at the consequent research questions, (c) determine how to answer these questions by drawing on the academic literature, (d) assess the potential of different research methods and (e) plan a small-scale research project.  \r\nYour report is intended to form the plan for how you might use the literature (by drawing on the ideas and findings of others), design a research project and analyse the findings.  \r\nThis report is among the most challenging assignments set during the M.Sc. programmes. You are being asked to anticipate the issues that will confront you in conducting a small research project. Thus, it is quite different from and more difficult than, writing a conventional coursework paper. The best reports are usually those produced by those students who have devoted considerable thought to the assignment before even beginning to write the report.  \r\nYour choice of problem for the project proposal report does not commit you to that topic for your dissertation. You can just complete the report as a free-standing exercise in which you are assessed on your ability to analyse a problem, grasp the arguments and the evidence contained in the literature and devise a suitable research design. You are free to select a different topic for your dissertation if you so wish, although there are obvious advantages in sticking to a topic to which you have already given thought and invested some work (although you must avoid cutting and-pasting parts of the proposal into the dissertation).  \r\n', 'Msc Management', 'Masters', '[\"Dissertation Writing\"]', '[\"Research Methodology\"]', '2023-04-30 22:00', '4000-5000', 'Link to all the reading material for the research proposal.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
