(1387, 1387, 'Commerce', 'Integration of AI and automation in Human Resources', '2.	Instructions and guidance\r\n           The aim of the proposal\r\nThe research proposal requires you to demonstrate your ability to identify, analyse a research problem related to business and management, and to set out a plan for a research project to investigate that problem. The aim of this assessment is to enable you to develop and demonstrate your ability to: (a) diagnose a problem in business and management, (b) arrive at the consequent research questions, (c) determine how to answer these questions by drawing on the academic literature, (d) assess the potential of different research methods and (e) plan a small-scale research project.  \r\nYour report is intended to form the plan for how you might use the literature (by drawing on the ideas and findings of others), design a research project and analyse the findings.  \r\nThis report is among the most challenging assignments set during the M.Sc. programmes. You are being asked to anticipate the issues that will confront you in conducting a small research project. Thus, it is quite different from and more difficult than, writing a conventional coursework paper. The best reports are usually those produced by those students who have devoted considerable thought to the assignment before even beginning to write the report.  \r\nYour choice of problem for the project proposal report does not commit you to that topic for your dissertation. You can just complete the report as a free-standing exercise in which you are assessed on your ability to analyse a problem, grasp the arguments and the evidence contained in the literature and devise a suitable research design. You are free to select a different topic for your dissertation if you so wish, although there are obvious advantages in sticking to a topic to which you have already given thought and invested some work (although you must avoid cutting and-pasting parts of the proposal into the dissertation).  \r\n\r\n \r\n        The Research Proposal requirements\r\n        The report must include the following main elements: \r\n1.	Title. This can include a subtitle and should indicate what the research is essentially about. \r\n2.	Abstract. The abstract sums up the research problem/questions, research design and methods, and relation to the literature and/or practice. \r\n3.	Introduction in the form of an analysis of the problem to be addressed. This introductory material should include a clear statement of the problem, the question(s) to be researched, the importance of those questions and an indication of the potential role of business and management theories in answering the questions. The introduction should have clear labelling of the aim and objectives. \r\n4.	A summary critical review of the relevant literature, both theoretical and applied. This section should indicate what can be learnt from the current literature and will seek to identify some of the strengths and weaknesses of that literature. You are not expected to provide a comprehensive guide to the literature, but you are expected to communicate an understanding of some of the main theoretical ideas and presently available evidence relating to your topic. You must refer to the academic literature and not just to the professional literature (note that the former usually involves seeking an in-depth and critical understanding of problems while the latter is usually restricted to matters of \'how-to-do-it\'). \r\n5.	An outline of the proposed research design and methods. You should outline the research design and the likely methods, taking care to point to the strengths and weaknesses of your proposed research methods. You must outline a research project that can feasibly be done within the constraints of the M.Sc. dissertation process, indicate that you have good reason to believe that the necessary data is available and can be collected, that your choice of method(s) is appropriate and likely to produce reliable and valid results, and that you have considered any ethical questions raised by the research. \r\n6.	Conclusion. The conclusion summarizes the problem, the purposes of the study, the research question/s, and the methodology. It should also acknowledge any possible limitations of the approach \r\n(e.g. any problems of generalizability from limited number of cases). \r\n7.	Documentation: Appendix, references, and general presentation of the work. Using the Harvard approach to referencing and the references are done correctly in alphabetic order. You may include an appendix for any additional material you consider relevant, however the appendix will not be assessed. Diagrams and tables should be numbered, captioned, and presented correctly. \r\n\r\nTo pass the assignment, you must include all these key elements. However, you do not have to devote an equal number of words to each of them. In particular, the analysis of the problem is very likely to be shorter than the other elements. \r\nWhat you should NOT do (these reflect the failings of past research proposals)\r\nâ€¢	Do not write an essay about a general topic.  \r\nâ€¢	Do not just describe the application of a particular management technique or method (e.g. TQM, a project management technique), you must analyse the underlying problem and critically evaluate the alternative \'solutions\'. \r\nâ€¢	Do not write a literature review that is solely or largely dependent on pop management books or the professional rather than the academic literature. \r\nâ€¢	Do not write a literature review in the form of an annotated bibliography. \r\nâ€¢	Do not write a general essay on research methods. Instead critically evaluate those methods you are likely to use. \r\nâ€¢	Do not include lots of incidental, trivial detail about how you would actually carry out the research.  \r\nWhat makes for a good research proposal  \r\nThere are many ways to write a project proposal report, and we have no particular model answer in mind. The following are some of the points we are looking for: \r\nâ€¢	You must have a problem which you can analyse, define and for which you can devise feasible research questions. \r\nâ€¢	You should explain the main issues in your chosen topic and their wider academic and practical relevance. \r\nâ€¢	When reviewing the literature, you should communicate an awareness of the quality of the evidence on which an author draws and of the methodological issues posed by the way in which that evidence has been gathered. \r\nâ€¢	You should give a sense of how the literature has developed and identify the main themes of schools of thought in the literature. How do later articles and contributions in books build on the earlier results findings, and ideas in the literature? \r\nâ€¢	Most importantly, you should be critical and evaluative.  Do not just describe the literature you survey, explain why the authors have arrived at the conclusions they have. State whether you consider the authors have achieved their aims. Explain any weaknesses you feel there are in specific articles or books and, if possible, how those weaknesses could have been overcome. It is better to evaluate critically fewer references rather than cite many references with little critical appraisal. \r\nâ€¢	You should indicate the wider significance of your study â€“ what are the wider implications of what you have found both for the academic literature (whose approaches/viewpoints/hypotheses do your findings support?) and for practice (e.g. should people in organizations do things differently as a result?). \r\nâ€¢	Observe the usual requirements for a good presentation â€“ be grammatical, use punctuation marks correctly, try to avoid jargon etc. You should use headings and sub-headings to organise your material. \r\n \r\nFormal Requirements\r\nThe report should be no more than 3000 words in length (excluding the bibliography), with a 10% upper limit and should be organised as indicated above. \r\n The report should be double-spaced, well presented and structured. Appendices should only be used when judged to be strictly necessary to understand the project. The work should use the Harvard system of references, and all references should be included in a properly presented bibliography.  \r\n', 'MSc Management', 'Masters', '[\"Research Paper\"]', '[\"Human Resource Management\"]', '2023-04-28 15:00', '6500', 'Assessment BUSM145.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
