(1394, 1394, 'Commerce', 'Social and Sustainable Innovation', 'Students will write a 4000-word paper. The objective is to convey your expert opinion and critique on a research worthy question. Given the breadth of content covered in the course, you should find it relatively easy to link the key concepts, models, tools and issues discussed in class to any set of research questions or issues. Overall, we look for unique arguments, discussion depth and clarity of presentation. It is hoped that some of you will eventually publish your work.\r\nAs such, the paper should broadly follow the format for reputable journals such as Harvard Business Review, Research Policy, Academy of Management Journal, Journal of Management, Sloan Management Review, California Management Review, Stanford Social Innovation Review, Ivey Business Journal or other management academic or practitioner journal. I am open to the specific topic and focus of the paper and you should select a topic and question that you have an informed\r\n            4\r\nopinion about. At the same time, the paper should have a clear focus and thesis, rather than making it too general or trying to speak to all the literatures we covered.\r\nThe word limit includes all text excluding bibliography and appendix. In all cases, material used should be fully referenced and sources acknowledged in accordance with the issued guidelines on plagiarism. Please make a formal statement of the word count on your cover sheet.\r\n', 'Msc Innovation and Entrepeneurship', 'Masters', '[\"Research Paper\"]', '[\"Innovation,Social\"]', '2023-05-08 15:00', '4000', 'Social and sustainable innovation.zip_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
