(1413, 1413, 'Commerce', 'The impact of big data analytics on understanding customer needs within the retail sector\"', 'Assessment Brief â€“ Dissertation\r\nYou need to write an individual research proposal (100%). You are expected to develop a suitable and realistic research proposal, with a view to\r\nundertaking a focused piece of contemporary research with clear and tangible outcomes of interest and relevance to the work context. The\r\ntopic that you choose to study for your research is your own choice but should relate to business and management disciplines, and in particular\r\nto your specific Master programme subject. For example, if you\'re studying the MSc International Business & Marketing Management, your\r\ndissertation should focus on a marketing topic, such as digital marketing, media and advertising, brand management, etc. You will need to\r\ndecide on the area of research for your Research Proposal fairly quickly â€“ in just a few weeks.\r\nIdeally, your Research Proposal should be something novel that will have practical value to businesses or other organisations. It should have a\r\ntheoretical perspective as well as a practical purpose. One idea is to take a favourite management area (e.g., marketing) and an area of\r\npersonal interest (e.g., SMEs in the hospitality sector) and then develop a project into e.g., the marketing of SMEs in the hospitality sector.\r\nAlternatively, look for something topical in the news that has a business perspective. Some students use the project to develop their knowledge\r\nof an area within which they hope to develop a career. The lectures, seminars and your reading will help you to decide on your topic and the\r\nbest research approach to use. However, if you are really struggling, we are available to give advice.\r\nResearch Proposal Structure\r\nThe following information is a general overview of the structure and contents of a Research Proposal and additionally summarises what should\r\nbe demonstrated by the proposal and by you as a researcher. This is not a definitive structure, only a guideline that covers all the important\r\nareas in a logical manner. There is flexibility to adjust or change this structure depending on your individual needs. The following elements may\r\nform subheadings for your research proposal document. The numbers in brackets are a guide of how many words are required for each section.\r\nHowever, they are only a guide and not definitive.\r\nWorking title (maximum 12 words)\r\nThis should capture the essence of your project, and includes information which relates to the proposed study which you wish to undertake.\r\nIntroduction (approximately 300 words)\r\nâ— What are you exploring and why?\r\nâ— Put the research into context.\r\nâ— Why is it important to study this topic (rationale)?\r\n1\r\nâ— Clearly identify your research question/problem.\r\nâ— What are the specific aims and objectives of the research?\r\nLiterature review (approximately 700 words)\r\nThis section should identify and critically review the key literature that has been written on your topic. It should compare and contrast\r\nperspectives that have been gleaned from reading and investigating the subject. While this might come from textbooks, journal articles and\r\nother reports, journal articles will be your main source. The review might also include more practitioner-based studies which are of\r\nsignificance. Remember, it is important to look for themes in the literature, not just describe one article after another. Make sure you reference\r\neverything clearly and be careful not to plagiarise. Also, make sure you clearly show the importance of the literature you are writing about to\r\nyour topic. DO NOT just put slabs of unrelated literature in your literature review. Please show the reader why it is in there. What does it mean\r\nto your project?\r\nMethodology (approximately 900 words)\r\nProvide a clear and justified statement of your proposed research approach to address your research question/aim. You should provide a clear\r\nrationale for your choice of method(s), with a clear link to your research question/aim. You should also include a critical evaluation of the\r\nstrengths and limitations of your proposed approach. This section could include: (a) data collection method(s) to be used with justifications, (b)\r\nparticipants where appropriate (population, sample size, access), (c) ethical considerations and potential limitations and ways to overcome\r\nthem, (d) research philosophy which will underpin the dissertation if relevant.\r\nA feasible and detailed Action Plan (approximately 100 words)\r\nAssume you will be implementing your project plan during June-January, provide a realistic, detailed and practical action plan. You should\r\nprovide a graphical form, for example, a Gantt chart, including key milestones of your research against specific dates, i.e. research schedule\r\nshowing the target completion date for each task or activity (review of literature, data collection, data analysis, write-up, first draft to your\r\nsupervisor, etc.). You could also include the resources needed to undertake the proposed research.\r\n2\r\nReferences (excluded from word count, minimum 20 references)\r\nCreate a Reference List of only the sources you have cited in the body of your proposal. Please do not include anything that is not in the body of\r\nyour proposal. In-text citations and the reference list should use the Harvard style. Appropriate referencing is important to avoid plagiarism so\r\nplease take this seriously. Please read the guidelines and regulations provided later for more specific details.', 'MSc Management and Business Analytics', 'Masters', '[\"Report Writing\",\"Literature Review\",\"Research Paper\",\"Primary / Secondary Data Analysis\"]', '[\"Research Methods\"]', '2023-05-04 13:00', '40 pounds', 'Research module handbook.pdf_$_Research example 3.pdf_$_Research example 2.pdf_$_Research example 1.pdf_$_Research assesment.pdf_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
