(1426, 1426, 'Commerce', 'Research methods for management ', '       The report must include the following main elements:\r\n\r\n1. Title. This can include a subtitle and should indicate what the research is essentially about.\r\n2. Abstract. The abstract sums up the research problem/questions, research design and methods, and relation to the literature and/or practice.\r\n3. Introduction in the form of an analysis of the problem to be addressed. This introductory material should include a clear statement of the problem, the question(s) to be researched, the importance of those questions and an indication of the potential role of business and management theories in answering the questions. The introduction should have clear labelling of the aim and objectives.\r\n4. A summary critical review of the relevant literature, both theoretical and applied. This section should indicate what can be learnt from the current literature and will seek to identify some of the strengths and weaknesses of that literature. You are not expected to provide a comprehensive guide to the literature, but you are expected to communicate an understanding of some of the main theoretical ideas and presently available evidence relating to your topic. You must refer to the academic literature and not just to the professional literature (note that the former usually involves seeking an in-depth and critical understanding of problems while the latter is usually restricted to matters of \'how-to-do-it\').\r\n5. An outline of the proposed research design and methods. You should outline the research design and the likely methods, taking care to point to the strengths and weaknesses of your proposed research methods. You must outline a research project that can feasibly be done within the constraints of the M.Sc. dissertation process, indicate that you have good reason to believe that the necessary data is available and can be collected, that your choice of method(s) is appropriate and likely to produce reliable and valid results, and that you have considered any ethical questions raised by the research.\r\n6. Conclusion. The conclusion summarizes the problem, the purposes of the study, the research question/s, and the methodology. It should also acknowledge any possible limitations of the approach\r\n(e.g. any problems of generalizability from limited number of cases).\r\n7. Documentation: Appendix, references, and general presentation of the work. Using the Harvard approach to referencing and the references are done correctly in alphabetic order. You may include an appendix for any additional material you consider relevant, however the appendix will not be assessed. Diagrams and tables should be numbered, captioned, and presented correctly.\r\n ', 'MSc entrepreneurship and innovation assignments', 'Masters', '[\"Research Paper\"]', '[\"Research Methods\"]', '2023-05-07 12:00', '6000', 'Assessment-BUSM145.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
