(1433, 1433, 'Commerce', 'Sustainable Business Report ', 'Company chosen - Wipro \r\n\r\nThe assessment requires you to choose ANY ONE of the following themes from the UNâ€™s Sustainable Development Goals and write a 3000-word report. The UNâ€™s Sustainable Development Goals can be accessed here: https://sdgs.un.org/goals\r\n\r\nTheme 1: Affordable and Clean Energy (Goal 7)\r\nTheme 2: Decent Work and Economic Growth (Goal 8) Theme 3: Sustainable Cities and Communities (Goal 11) Theme 4: Responsible Consumption and Production (Goal 12) Theme 5: Climate Action (Goal 13)\r\nTheme 6: Life Below Water (Goal 14)', 'Business Management ', 'Bachelors', '[\"Report Writing\"]', '[\"Sustainability\"]', '2023-05-04 13:45', '1500', 'Sustainability Assignment Brief .pdf_$_Sustainable Business Assignment Checklist .pdf_$_', '2023-05-22 18:42:19', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, 88, 100, 'Distinction very much happy ', '20-12-2023 13:39:00', 'pm_16'),
