(1438, 1438, 'Commerce', 'Reflective Essay ', 'You have to write a reflective essay from 3 experiences that I have shared. You only have to use ERA (Experience, Reflection, Action) to write a reflection for all three experiences. I will also share previous semester examples that will help you to understand how we are supposed to write it. it should seem to be more personal. \r\nAlso there are feedback on failed assignment so you can understand better how to write.\r\nI have also attached a picture of ERA framework that you have to use while writing all 3 experiences ', 'MBA', 'Masters', '[\"Essay Writing\"]', '[\"Business analysis\"]', '2023-05-08 10:01', 'NA', 'stages-of-era-cycle.jpg_$_Reflective Essay on three Experences.docx_$_feedback from fail submission_Canvas - Tagged.pdf_$_Examples from previous reflective essay submissions.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
