(1440, 1440, 'Engineering', 'The effects/impact of Ecommerce on the retailers and SME\'s of Indian Market.', 'Need a proposal for the impacts or effects that e-commerce industry has on the retailers and SME\'s of India. This has to be a 3000 word proposal including the methodology. Please focus and create sections as required and mentioned in the marking criteria. Also have attached style sheet for referencing style. Please understand this is a little different from basic Harvard Referencing. At least 25 references in Literature review and 5-6 in research methodology.', 'PGT Operations Logistics and Supply Chain Management', 'Masters', '[\"Research Paper\"]', '[\"ecommerce,impacts,retailers,SMEs,Supply Chain Management & operations,india\"]', '2023-05-06 10:00', '6000', 'Cite_Them_Right_Harvard_style_sheet.pdf_$_A2 NBS8062-NBS8372 Marking criteria.pdf_$_A2 NBS8062-NBS8372 2022-23.pdf_$_', '2023-05-22 18:42:19', '', '', NULL, 1, 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
