(1451, 1451, 'Engineering', 'Human Computer Interaction', 'Interaction Techniques:\r\nInteraction techniques are methods for users to interact with computer-based systems. They include input devices, such as keyboards, mice, and touchscreens, as well as interaction modalities, such as speech, gestures, and eye movements. Recent HCI research has focused on developing new interaction techniques that are more natural and intuitive for users.\r\n\r\nInterface Design:\r\nInterface design is the process of creating interfaces that are user-friendly and effective in supporting user tasks. Recent HCI research has focused on developing new interface designs that are more intuitive and visually appealing.\r\n\r\nUser-Centered Design:\r\nUser-centered design is an approach to interface design that focuses on the needs and goals of users. Recent HCI research has emphasized the importance of involving users in the design process, through methods such as usability testing, user feedback, and participatory design.', 'MCA', 'Masters', '[\"Research Paper\"]', '[\"Computer Science and Applications\"]', '2023-07-05 09:00', '100', '_$_', '2023-05-22 18:42:19', '', '14', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
