(1755, 1755, 'Commerce', 'Analysis and valuation', 'financial analysis, peer comparison, valuations \n\n\nPossible Structure for the Project\nChapter 1 â€“ Introduction (guideline: 10% of total word count)\nThis section should provide a brief examination of the economic and financial environment in which the \ncompany operates. The UK economy will be the starting point and you should also discuss the markets in \nwhich the company operates. Then, narrowing down to the industry where the company operates, it is \nexpected to briefly review and discuss the industry. Lastly, it is expected to introduce the company and frame \nand discuss the research question of this project. \n\n\nChapter 2 â€“ Financial Performance and Position of the Company (guideline: 30% of total word count)\nIn the analysis of the financial performance and position of the company it is anticipated that various ratios \nshould be calculated to enable the profitability, liquidity, asset management and capital structure of the \ncompany to be described and analysed. By carefully reading the various statements and analyses that are \nincluded in the Annual Report, it should be possible to produce a view of the company, its performance, \nstrategy, and trends over the past five years. In this analysis, the ratios of the target company should be \ncompared with those of 3 to 5 peer companies. These peer companies will act as benchmarks for the \ncompanyâ€™s position and performance, so their selection criteria should be first set and discussed. It is \nimportant to provide a good justification of the peer group selection and outline clearly the associated \nselection criteria. Then, the ratios of the peer companies should be also calculated over the past five years \nto make comparisons across years and across companies.\n\n\n\nChapter 4 - Valuation of the company (guideline: 30% of total word count)\nThere are a number of different approaches that can be employed to estimate the value of a company. Some \nare relatively easy to implement but lack a strong theoretical basis, whereas others, such as those based on \nthe discounted cash flow approach, have a strong theoretical basis but are more difficult to implement. The \ndifferent approaches will almost certainly produce different values that may be difficult to reconcile, but may \nalso provide different insights into the factors determining the value of the company. A number of \napproaches should be employed and the different values produced should be discussed before expressing \njudgement on a range of possible values', 'Msc finance', 'Masters', '[\"Dissertation Writing\",\"Report Writing\",\"Literature Review\",\"Research Paper\",\"Dissertation Writing\",\"Report Writing\",\"Literature Review\"]', '[\"Financial investment & Analysis\",\"Valuation and securities analysis\",\"Introduction to analysis\"]', '2023-06-24 00:00', '24999', '4204Research Project Two_2023.pdf_$_4204FAQ.pdf_$_4204Emp Projs May 23 (Fin).pdf_$_4204AG943_Zawar_Rohan_202163112_Fin.pdf_$_4204AG943_Sawant_Mayur_202177256_bank.pdf_$_', '30-05-2023 16:48:08', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
