(1761, 1761, 'Commerce', 'Is Google search activity linked to higher Stock trading in the US Tech industry? Unravelling the dynamics through a comparative study with theÂ NasdaqÂ index.', 'Hi! This is a traditional research-based dissertation with traditional statistical analysis including 3 research questions and 3-4 testable hypotheses. The three RQs are; 1) Are Google trends linked to higher stock trading volume in the US Tech Industry? (here there can also be causation between stock trading volume and Google trends) 2) How information asymmetry in the market impacts the relationship between Google trends and stock trading volume? 3) Does the volatility of the Nasdaq index go hand in hand with the Google trends? \n(more on this shared in the RQ explanation word doc.)\nDuring the dissertation time, there will be three more meetings taking place with the dissertation advisor. One is for feedback on the literature review and data collection (June end), the second one is for feedback on the statistical analysis and results (July end) and the last one will be related to overall dissertation issues etc (mid-August).\nPS: for further details on the dissertation, please refer to the files shared. Thank you very much!', 'MSc Finance', 'Masters', '[\"Dissertation Writing\"]', '[\"Behavioural Finance\"]', '2023-08-15 23:59', '40000', '2152Dissertation guidelines.docx_$_2152RQ explanation.docx_$_2152The literature search.pdf_$_2152Nasdaq index proxy.docx_$_2152Google SVI.pdf_$_2152B205681-format.docx_$_2152Available meeting dates.jpg_$_21522015-16-Information Asymmetry, Online Search, and Stock trading.pdf_$_', '09-06-2023 17:39:49', '', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
