(1777, 1777, 'Medical', 'Communicable disease ', 'Explore a communicable disease of your choice* (*from the list provided). Discuss the public health challenges it poses within the geographical area you have identified under the provided headings - \n- CHOICE OF COUNTRY\n- CHOICE OF DISEASE \n- DISEASE HISTORY:\n- DISEASE PREVALENCE\n- PREVENTION AND CONTROL\n- CRITICAL REFLECTION\n- RECOMMENDATIONS/CHANGES\nFurther instructions are given for each subheading.\n', 'Public Health', 'Masters', '[\"Report Writing\"]', '[\"Public health\",\"Infectious diseases\"]', '2023-07-01 13:00', '4000', '1456COMMUNICABLE DISEASES ASSIGNMENT.docx_$_', '22-06-2023 19:30:16', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1778, 1778, 'Commerce', 'How excessive use of electronic devices affects environment', '\nLimited development of identity theory and evaluation; underdeveloped application to context \nUnderdeveloped conclusions, typically a summary only \nIncomplete essays, typically missing a future imagination\nNo/poor referencing and lack of evidence to support arguments \nSome students chose a different theory to identity. This is not allowed. You must use identity to answer the question specified under the assessment instructions.\n\nYou will find the resit question on p.2. of this document, followed by the assignment guidance provided to you for your first submission, which remains applicable to this resit assignment. Please follow it very carefully.\n\n\nAssessment instructions\nYour task is to revise your first (sit)  essay that addresses the following question in 3000 words:\nUsing self-identity theory, identify and evaluate a contemporary societal challenge that is influencing the consumption behaviour of consumers. Develop conclusions from your evaluation. Use these conclusions to develop a â€˜future imaginationâ€™ of how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them.\nYour evaluation must include a critical appraisal of self-identity theory to inform your arguments. Additionally you must include evidence of relevant changing consumption behaviours and predictions from relevant experts. You must develop your â€˜future imaginationâ€™ from your conclusions. \nIn addressing the above question, you are advised to make the following choices:\nChoose a specific consumer segment who engage in a specific consumption behaviour occurring in response to a societal challenge. You can phrase this as a problem or opportunity. Here are some suggestions to help you to develop your own ideas. You do not need to choose from any of them. You can chose any combination that addresses the assignment question. Please ask your tutor if you are unsure:\nClimate change and sustainable development, e.g. eco-tourists and climate change, millennials and consumption reduction, activists and anti-consumption. \nThe increasing interest in health and fitness is another potential area, including shifts that have occurred from the Covid-19 pandemic. Examples include a shift from in-person to online fitness classes. Growth in wearable health technology. Increasing membership of online health and wellbeing platforms.\nAdvances and benefits of artificial intelligence in consumption choices. Examples include using an AIÂ chatbot for a health care consultation. AI in agriculture (intelligent farming) to increase food availability/nutrition to mitigate food poverty and migration. AI designed to inform consumerâ€™s decision-making (e.g. online shopping â€“ getting purchasing right first time to prevent waste). Developing positive body image chatbots to promote a healthy body image among younger consumers.\nShifts in dietary choices. For example, in response to food/water insecurity, biodiversity, and animal welfare considerations, as well as advances in food science and technology. This has supported shifts to â€˜different lifestylesâ€™ and created opportunities for food innovation development and lifestyles including vegan, flexitarian, anti-meat, artificial food e.g. lab-made â€˜meatâ€™.\nEconomic constraints are also triggering CB changes, e.g. frugal consumption connected with growing poverty, consuming from â€˜foodbanksâ€™ and â€˜community fridgesâ€™. Sharing/leasing not buying, pre-owned/recycled/ repurposed are also an outcome of this, as well for ecological reasons (positive or negative depending on perspectives). \nFocus on one consumer segment pertinent to your topic and country/sector choice. You should develop a profile of this segment, providing as much pertinent information as you can, e.g. using sociodemographics, psychographics. Please present visually or in table format, fully referenced.\nFocus on one country for your essay. Having this focus will make it a lot easier for you to identify and evaluate the evidence within the word limit specified.\nWhile you are required to use self-identity theory for your essay, you MUST focus on a specific concept, model or framework within it. For example, the self-concept model, social-self, pro-environmental self-identity, pro-social self-identity, body image, etc. Choose ONE of these. Do NOT include multiple identity frameworks/ models in your essay because this will undermine the depth of analysis you can achieve within the 3000 word count limit.\n\nOnce you make the above choices, you are required to investigate research evidence from academic articles, news from legitimate sources, industry reports etc. to critically analyse how consumer behaviour has changed in response to the societal issue you have identified. Building from this appraisal, you will explain, evaluate and apply your identity framework/model to your chosen issue. This will enable you to develop evidence-based analytical conclusions, from which you can create your future imagination.\nDo not forget the marker feedback in making your revisions.\n\nGuidelines (identical to first submission)\nYou should draw on a good range of high quality academic and expert opinion sources to construct solid arguments for your paper. You should use relevant examples and data to support your claims. Ensure you fully reference all sources of information.\nYou are required to write a critique of transforming/transformed consumer behaviour, informed by contextual information, evidence and relevant theory. Your critique will involve you assessing varied data, ideas and scholarship from varied sources. Be adventurous in your searching but note the advice given to you on reputable sources. \nYou must focus on one framework/model of identity theory in your essay. This will really help you to develop a stronger critical appraisal to show your understanding and critical thinking. \nYou must choose only one country and one consumer segment. Within this country and segment, try to analyse your chosen CB transformation broadly and briefly. Then narrow down again to your chosen sector/industry/segment and again articulate this transformation. You now have an explanation that is country, sector and consumer specific. Now that you have this foundation, you can begin to build your academic arguments by integrating your chosen identity theory. Continuously, apply and evaluate your theory to your country/sector/segment otherwise your context and theory risk being disconnected. Lastly, extrapolate your conclusions to a 5-10 year future in order to imagine how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them. \nYou must ensure the evidence you use to compile your paper relates to your choices (i.e. do not use American evidence to discuss China!). Preliminary reading will help you to make your choices. Whatever you choose to do, ensure you present your argument for your choices at the start of your paper â€“ and justify them. \nAssemble the evidence for your arguments, avoid unsubstantiated statements and bias - this is an objective investigation. It is essential that you critique your chosen theory and evidence, do not just describe it; evaluate the contribution it makes to our understanding of transforming/transformed consumer behaviour and how marketing to consumers (as customers or event participants) will evolve as a result in the future.\nNot sure what to choose? Maybe this article will help: Rust, Roland T. (2020). The future of Marketing, International Journal of Research in Marketing, 37(1), 15-26. \nTo help develop your ideas and your â€˜future imaginationâ€™, refer to the academic articles published in â€œFuturesâ€ in the suggested readings at the end of this assignment briefing. This is a starting point, please source others relevant to your chosen topic.\nTo see an example of an imaginative future go to Dermody, J., Koenig-Lewis, N., Zhao, A. L., & Hanmer-Lloyd, S. (2021). Critiquing a Utopian Idea of Sustainable Consumption: A Post-Capitalism Perspective.Â Journal of Macromarketing,Â 41(4), 626â€“645.Â https://doi.org/10.1177/0276146720979148 \nFurther readings are added to Moodle, as appropriate. Please also refer to the readings attached to each topic, as these may also be relevant for your essay.\n\nPresenting coursework for assessment\nYour assignment when submitted should not include your name â€“ we use a system of anonymous marking to reduce the risk of any unconscious bias. For some authentic assessments, there may be an exception to this, so please confirm with your Module Leader.\nWe suggest the following format for your essay, which mimics the marking criteria listed in the table below, Please discuss with your seminar leader if you wish to depart from this structure: \nPart 1: Introduction and Explanation (500-800 words): Introduce and examine your societal challenge, consumer segment and behaviour and country. Explain the issue clearly and its impact, citing supporting evidence and justify why it is worthy of exploration in your essay. Include a profile of your chosen consumer segment.\nPart 2: Evaluation and application of theoretical framework (1500-1800 words): Begin by giving an overview of identity theory, then focus on your chosen identity framework/model. Explain it and apply it to you challenge and context in part 1. Evaluate its contribution in explaining the CB transformation that is occurring, using scholarly research and evidence to support your arguments. Use examples throughout, pertinent to your focus. Images and illustrations can be used and add value to written arguments. \nPart 3: Conclusions (300-500 words): Develop conclusions based on your content in parts 1 and 2. Do not simply summarise your essay (this is not a conclusion). Your conclusions should be insightful and analytical and lead into your future appraisal. They should also demonstrate your learning from critically reviewing your chosen context and identity theory. Developing a â€˜visual mapâ€™ to illustrate this can be a useful communication tool; this is entirely up to you. Examples are discussed in the assignment briefings and clinics. Keep your writing style concise and focused. Numbering each conclusion will be helpful for cross referencing with your future appraisal. You could also consider these as a map for part 4.\nPart 4: The future (<500 words): This is where you get to be creative! Tell us, based on your analysis in part 1,2 and 3 your core ideas for imagining how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them. Include specific examples of your chosen issue/segment/behaviour. You can present your â€˜future imaginationâ€™ as text and visually (we are not expecting artwork from you). Visualisation is encouraged and can include multiple formats, e.g. drawing, photographs, and digital images. Infographics are useful, using free software that is readily available. Check permissions for using any images that are not your own (and reference them as instructed by the owners).   \nMake sure your discussion of the future is connected and builds upon what you have stated in the body of your essay and is backed by evidence.\nPlease note: \nParts 1 and 2 need to be fully and extensively referenced. \nPart 3 will contain some pertinent references to support your insight e.g. from futurism, but should not repeat the full range of references in your theory review. Remember conclusions represent your critical thinking built from your prior analysis which you have already referenced. \nPart 4 does not require references, albeit you may need to reference some futurism insights if you include them here instead of in your conclusion (either place is fine). This section is showcasing your critical and creative thinking.\nThe use of subheadings to break up the essay is OK, however, please ensure you donâ€™t have too many as you risk hyper-fragmenting your essay, which may hamper the flow of discussion and subsequent analysis.\nSuggested Formatting:\nPlease provide a title page giving the title of your essay specifying your focus (necessary).\nPlease use 1.5 spacing, and insert an extra line between paragraphs. This helps the marker to insert their feedback.\nFont size 11 or 12 is preferable using Calibri, Arial, Courier or similar (do not use a mix of font types). This helps the marker with eye fatigue when they are reading multiple papers. You will also find it easier to proof-read your work, and spot errors for correction.\nEmbolden headings and subheadings. Make main and sub headings distinctive, e,g  capitals for main headings, or italics for subheadings, or underlining (choose which) and be consistent. You can also use a numbering system, e.g. 1, then 1.1. This makes it easier for you to present the logic of your arguments. It is also useful for you to check you have fully answered all parts of the essay brief. \nPlease do not use any kind of framing in your page layout as this restricts marker comments.\nUse the normal setting for page layout specified in word.\nPlease use visuals â€“ we really like to see these. We are not expecting professional graphics. They are so useful in enabling you to synthesise your thoughts from the evidence and theory you have evaluated, and then present this to us in a very succinct way. This is a great skill to carry forward.\n\n\n\nAssignment length/equivalent\nWhilst we acknowledge that learners will prepare and produce assessments in different ways and at different paces, an indication as to how much time it will take you to prepare, produce, edit and submit this assessment is detailed below.\nThe maximum word count for this assignment is 3000 words (excluding references and appendices). The minimum word count is 2800 words. We advise students to use the maximum word allowance in developing their essay.\nIt will take approximately 74 hours for students to complete this assignment. \n', 'MSc Marketing communications management ', 'Masters', '[\"Report Writing\",\"Literature Review\",\"Research Paper\",\"Primary/Secondary Data Analysis\",\"Review Article\",\"Thesis Writing\",\"Case Studies\"]', '[\"Marketing Communication\",\"Academic research\",\"masters\",\"undersatnding consumer beahviour\",\"Management\"]', '2023-07-05 12:00', '5400', '5097MARK 7013 Resit Brief June 2023.docx_$_', '23-06-2023 06:02:44', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1779, 1779, 'Commerce', 'Analysing the impact of corporate social responsibility', '10000 wordsTitle:\nâ€œAnalysing the Impact of Corporate Social Responsibility on the Competitiveness of Multinational Corporations in developed marketsâ€\n\nAim:\nThis research seeks to examine the connection between MNCs \'  CSR practises and their ability to compete in the global marketplace. It aims to learn how corporate social responsibility (CSR) projects impact multinational corporations \'  (MNCs \' ) standing in the market, the quality of their relationships with stakeholders, and their ability to compete in the global economy.\n\nObjectives:\n\nTo examine the theoretical foundations of corporate social responsibility and its relevance to multinational corporations.\nTo evaluate the relationship between CSR practices and the competitiveness of multinational corporations.\nTo analyse the challenges and opportunities faced by multinational corporations in implementing CSR initiatives.\n\nQuestions:\n\nHow do the theoretical foundations of Corporate Social Responsibility (CSR) influence its implementation and integration within the strategic operations of Multinational Corporations (MNCs)?\nHow MNCs adopt CSR practices to enhance their relationship with the stakeholders? \nHow MNCs face challenges when implementing CSR initiatives? \n\n\nResearch Gap:\nMany of the studies that have been conducted on the topic of CSR \' s effect on MNCs \'  ability to compete have relied heavily on quantitative analysis and primary data. However, secondary data and qualitative study of the connection between CSR practises and competitiveness is lacking. This research seeks to close that knowledge gap by using secondary data and qualitative approaches to explain how CSR affects the competitiveness of MNCs.\n', 'Marketing', 'Masters', '[\"Dissertation Writing\"]', '[\"Corporate social responsibility\"]', '2023-07-18 00:00', '25000', '4299BUSM100 session 1 2023-Tuesdays.pptx_$_4299Dissertation Induction Meeting LS.pptx_$_4299IMG-20230621-WA0081.jpg_$_4299Dissertation Induction Meeting LS Feb 2022. UpdatedLSpdf 1.pdf_$_4299IMG-20230621-WA0080.jpg_$_4299BUSM100 Dissertation supervision meeting 2 2023.pptx_$_4299csr multinational draft-1.docx_$_', '23-06-2023 12:51:35', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
