(1781, 1781, 'Arts', '(2000-2500 words) On the basis of the reading of the play Tempest, research and make a project on the following:The Tempest depicts not only the conflict between the colonizer and the colonized, but questions the existing ideologies of colonisation', 'Points of interest in the project should be-\n1- Prospero \' s taking over of the island\n2- Prospero \' s treatment of the natives \n3- The White Man \' s burden\n4- Caliban \' s protest against prospero as symbolic of the resistance to colonial powers \n5- Relevance of play in the modern context \n\nWrite a hypothesis ensuring that your project proves its validity \nThe assignment must have- Introduction-Explanation of the question framed- Brief explanation of how you intend to interpret the chosen text and  literary materials used in the process â€¢ Main Body - organised and well-structured treatment of the question using appropriate subheadings  - Conclusion', 'English literature ', 'Diploma', '[\"Literature Review\",\"Thesis Writing\"]', '[\"A level English Literature\"]', '2023-07-08 00:00', '500', '7158Screenshot 2023-06-23 at 9.33.27 PM.jpeg_$_', '23-06-2023 21:54:14', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1782, 1782, 'Commerce', 'Research proposal', 'There is one individual coursework; a research proposal of 2,000 words which is worth 100% of the module mark. You must use the research proposal template (on Moodle) which provides a clear structure for the research proposal.\nThe proposal plays an important role to build your dissertation/client project and outline/justify the research you wish to undertake. It develops the foundation for a substantial, independent piece of research that you will undertake within your dissertation/client project. You must  \' pass \'  this assessment by achieving at least 50%. You cannot start your capstone until you have passed your research proposal. \nThe proposed dissertation topic or clientâ€™s problem must be relevant to the subject specialism of your degree programme. How primary research will be carried out must be discussed within the proposed methodology. For example, secondary (data) analysis will not be accepted. Do not collect primary data as this is not needed in a proposal. Please seek guidance if unsure. \nFailure to follow the guidance above may result in the proposal being considered unsatisfactory, resulting in a mark of less than 50%. You are strongly advised to discuss your proposed topic or clientâ€™s problem, as well as the proposed methodology with your module leader in advance. \nPlease follow the assessment criteria (page 5) and the assessment criteria rubric (page 6/7) when developing your coursework. It is your responsibility to ensure that your work is original. Do not use any content from your original submission as this will be self-plagiarism and avoid other academic offences. Your submission will be referred to SIRT if there are concerns about academic integrity.  \nPresenting coursework for assessment\nYour coursework when submitted should not include your name â€“ we use a system of anonymous marking to reduce the risk of any unconscious bias. The authentic and essential requirements for this piece of assessed work are;\nYou must use the research proposal template (on Moodle) which provides a clear structure for the research proposal\nIt must be word-processed in 12-point Arial font \nSpacing should be set to 1.5\nIt must be black text on a white background \nPages must be appropriately numbered\nMargins must be set to Normal (all four sides set to 2.54 cm)\nAny tables/figures/diagrams should be legible, correctly captioned and clearly identified\nTitle page is not required \nDo not mention your name anywhere as marking will be anonymous \nContents page is not needed \nAn executive summary is not needed \nAppendices are not permitted\nA conclusion is not needed \nPlease write in the third person\nAvoid bias to any one source and use different sources to evidence engagement and enhance criticality\nEnsure adequate and consistent citation and a complete reference list (follow the Brookes Harvard style)\nPlease avoid high similarity and use the draft check submission box before submitting â€“ any work that has been plagiarised will not be considered when assessing your work\nYou will lose marks if you do not fulfil these requirements\nAssignment length \nWhilst we acknowledge that learners will prepare and produce assessments in different ways and at different paces, an indication as to how much time it will take you to prepare, produce, edit and submit this assessment is detailed below.\nIt is expected that you will spend approximately 34 learning hours to prepare and produce this assessment. \nThe length of this coursework is limited by a set number of 2,000 words to contribute towards the development of writing skills and to ensure all work is assessed equitably. We therefore require you to complete your coursework within the set word limit of 2,000 words. There is no leeway.   \nThe specified 2,000 word count refers to the main body of the proposal and does not include the first page of the proposal template, pre-set headings within the template or reference list. Words within tables count towards the word count. Appendices are not allowed and will not be assessed. Any diagrams or figures must be used for illustrative purposes only.\nWords that exceed the maximum allowed word count (2,000 words) will not be marked. If in doubt, please discuss this with your Module Leader before submission. \n\nUse of Turnitin\nThe new Turnitin policy effective from September 2022 can be found via this link. You are expected to be familiar with it. It is important to know that the reference list and quotations are included in the overall similarity report, and that these matches are expected and not problematic.\nFor more information on how to interpret your similarity index report, please refer to this link.\n\nSubmission instructions\nThe coursework must be submitted by 13:00 on 14th July 2023 via Turnitin using the drop-box on Moodle which can be found under Resits. All students should use this submission box. This is the absolute deadline to submit your resit. Even students with an ISP and/or any other extension must submit by this deadline. Any work submitted after this deadline will not be marked. \nName the file which you intend to upload as follows: <your student number_CW_MARK7006>. There will be a draft similarity check box which can be found under Assessment. Use this to check the similarity of your work before submitting the final coursework for assessment. This can only be used once. Please submit your coursework to the correct drop box. You can only submit once to the final submission box.  \n\nHow your work will be marked\nOnce the submission date has passed, a tutor will mark your work. Where relevant, there will be an internal moderation of grades. Following internal moderation, a sample of work may be reviewed by the External Examiner for the programme to ensure that the standards applied are comparable to those at other institutions. To read how your work is moderated, please go to your programme handbook for details.\n\nFeedback\nYou will be offered one 15-minute virtual tutorial to discuss your resit coursework with your module leader. Please use this time well. You need to email your module leader (Maheshan) to arrange this tutorial. You are advised to do this early, so that you will have enough time to work on your resit coursework. You will only receive verbal feedback. Written feedback will not be provided. Please do not email any work. Your resit mark and feedback will be released on 4th August 2023. INSERT INTO `assignment_freelance` (`id`, `assignment_id`, `stream`, `title`, `description`, `course`, `level`, `type`, `subject_tags`, `deadline`, `budget`, `files`, `submission_date`, `submitted_by`, `project_manager`, `freelancer`, `posted`, `under_process`, `assigned_to_pm`, `assigned_to_freelancer`, `completed`, `review_recieved`, `lost`, `marks_obtained`, `marks_out_of`, `feedback`, `marks_added_on`, `marks_added_by`) VALUES
(1798, 1798, 'Commerce', 'Strategic brand management ', 'Key Dates\nAssessment Component\nWeighting\nLearning Outcomes Assessed\nSubmission Date\nFeedback Date\nIndividual Coursework\n100%\n1-5 (see details in Module Guide)\n5 July 2023 (13:00)\n06 September 2023\nPlease ensure you submit your assignment no later than the deadline set above (these are fixed deadlines, but students may exceptionally secure an extension if last minute untoward circumstances affect your ability to submit on time). Please see your Programme Handbook for more details. Please note the use of this extension is monitored and restrictions in place for overuse.\nhttps://www.brookes.ac.uk/students/your-studies/exceptional-circumstances/\nIf there are circumstances preventing, you from being able to study and meet the ongoing requirements of this or other modules then please get in touch with your Academic Adviser of Student Support Coordinator for advice.\nGeneral Summative Assignment Information\nCoursework: including in-class tests â€“\n \nWord count/ length of\nexam\nLearning outcomes assessed\nWeighting %\nIndividual report focuses on the comprehensive evaluation of an organisationâ€™s contemporary brand management approach and the development of a future strategy.\n3000-3500 words\n1-5\n100%\nNote: A minimum of 50% must be achieved for the coursework in order to pass the module.\n  \nFaculty of Business, Oxford Brookes University 3\n Inclusive Support Plan (ISP) arrangements\nRecommendations for Reasonable Adjustments are made in accordance with the provisions of the Equality Act 2010. These are detailed in Inclusive Support Plans (ISPs) and need to be implemented unless there is a clear rationale for this not being possible, in which case we are accountable as a university for this decision. Students who have an extension because of an ISP, please contact your Module Leader if you are unclear about your revised deadlines.\nIf you would like to request a review of your Inclusive Support Plan (ISP) or to have your needs assessed for an ISP, contact the Inclusive Support Service on inclusivesupport@brookes.ac.uk\nThe Blue Marking Card adjustment is only available to students who have an Inclusive Support Plan (ISP) specifying this adjustment. Eligible students who wish to use this adjustment must add a blue card: https://www.brookes.ac.uk/students/inclusive- supportservice/exams-and-assessments/blue-marking-cards\nInclusive Support Plan (ISP) extensions of up to 3 weeks are applicable for some students on all assignments in this module. If you have an Inclusive Support Plan you can check the full details of the adjustments, including whether you have coursework extensions, in Student Self Service. https://generalssb-prod.ec.brookes.ac.uk/BannerExtensibility/customPage/page/student_ISP\nSummary information\n     Type of assessment:\nIndividual or group:\nComponent weighting:\nLearning outcomes assessed\nSubmission date: Feedback date:\nReport\nIndividual\nContributes 100% of the total module grade 1-5 (see details in Module Guide)\n13:00 on 5 July 2023 06 September 2023\n            The assignment is due by 13h00m on Wednesday, 5th July 2023. A softcopy of your report is to be submitted electronically to TurnItIn via the MARK7010 Strategic Brand Management Moodle site (see further details below).\n \nFaculty of Business, Oxford Brookes University 4\n Assessment Instructions: Millets Cooperative Farm Brand Positioning Project\nThe Oxford Brookes Brand Consultancy (OBBC) has acquired a good reputation in the marketing industry. This must have been the reason why within the space of just a few weeks OBBC has been approached by several organisations to pitch for a brand positioning project.\nOBBC is a new and small brand management consultancy consisting of a group of lecturers and practitioners from various marketing disciplines. Since they donâ€™t have the capacity to work on several pitches at the same time, they urgently need your help.\nThe OBBC team knows that in terms of its capacity it could only work for one more client in 2023. However, the OBBC team is not sure which of the brand positioning projects they should pitch for. This is where you come in. They decide to hire up-and-coming brand management experts on a freelance basis. So, they ask you to look at a request from the Indian Institute of Millets Research, a premier agricultural research institute engaged in basic and strategic research on sorghum and other millets. One of their current projects focuses on supporting small millets farm cooperatives throughout India with a common Brand Positioning to take up export opportunities to Europe.\nThe millets farm cooperatives have been able to bridge the urban-rural divide, increase women participation, educate the farmers, skill rural youth and spread digital solutions and facilities throughout India. Agricultural marketing cooperatives are cooperative businesses owned by farmers, to undertake transformation, packaging, distribution, and marketing of farm products (both crop and livestock.)\nOne of the focus areas of millet cooperatives is alternative farming for food security. They support women, children, and elders in deprived communities to secure semi-arid land for farming traditional millet grains. Millet is a broad term that covers many varieties of traditional grains. It is nutritious, drought-resistant, and easier to grow in the regions with little access to irrigation water. These grains were playing a very important role in sustaining health in the deprived communities. As the next step the collective is supporting their farmers to directly market and sale part of their harvest as cash crops, for domestic and export consumers.\nTheir aim is to enter the market with a competitive advantage by acknowledging the important â€˜zeitgeistâ€™ trends. For example the the United Nations has proclaimed 2023 as the International Year of Millets (IYM).\nTherefore, OBBC is pitching now to help farm cooperatives prepare for a future brand positioning that takes latest broader societal trends as well as a comprehensive market analysis into account. Due to time constraints, OBBC decides for the initial pitch phase to focus geographically on the UK market only. For more details, see\nhttps://www.millets.res.in/index.php, https://pib.gov.in/PressReleaseIframePage.aspx?PRID=1744497\nOne of the key challenges is to attract younger target audiences.\n   \nFaculty of Business, Oxford Brookes University 5\n  Your report needs to cover the following elements.\nâ€¢ ANALYSIS: Many brands (Jalpur, TRS, Manna) market and supply Millet products. Based on research on the other brands, a brand needs to be created. What is your brand about? What are the key meanings, manifestations, and stakeholders of your brand? What does the current competitorâ€™s â€˜productâ€™ portfolio look like? Based on your analysis of the client (small millets farm cooperatives) what can be the brandâ€™s vision, mission, and core values? What are the potential strengths, weaknesses, opportunities, and threats? What are the possible positioning ideas based on the competitors and extended? Your analysis is expected to look at a variety of elements of the brand.\nThis should include the brandâ€™s IDEOLOGY, CAPABILITIES, CONSUMERS/STAKEHOLDERS, COMPETITION and ENVIRONMENT. Mark allocation: 30%\nâ€¢ STRATEGY: Based on your analysis, you are expected to create a brand and discuss two different potential positioning options for the brand which could be established in the UK market in spring/summer 2025. You then need to justify/evaluate which of the discussed positionings has the most potential, i.e. you need to choose one positioning option and justify your decision. You can extend a competitorâ€™s positioning strategy that already exists, but you need to justify why this is the best option. Finally, you are expected to make suggestions as to how the brand positioning idea could be transformed into strategic frameworks that can be used to brief the clientâ€™s marketing team who need to bring this positioning idea to life. In this context you must apply one or more of the following frameworks: (a) SBM Vision, Mission & Values; (b) SBM Brand Pyramid; and/or (c) Transformation Grid.\nMark allocation: 30%\nâ€¢ IMPLEMENTATION: Based on your strategic framework(s), you need to develop and explain implementation activities to show how, for example, the clientâ€™s UK marketing team could implement the core strategic idea which you have developed\n \nFaculty of Business, Oxford Brookes University 6\n with different specific stakeholders. This needs to contain an activity in terms of cocreative new product development. One implementation activity needs to utilise social media-based communications or other latest digital technology.\nMark allocation: 30%\nMore guidance will be given during the lectures and seminars therefore attendance throughout the semester is critical.\nThe remaining 10% are allocated for the quality of the presentation of the assignment. This means, for example, overall presentation style; standard of English; breadth, depth, and quality of sources; references list presented in Harvard Referencing Style; word count well used.\nYou are required to produce a report comprising the three key areas outlined above. You must support your decisions with academic references as well as other secondary sources. Therefore, you must search for and use relevant information on the brand, but you are NOT expected to conduct primary empirical research as part of the assignment.\nIMPORTANT\nYou are NOT allowed to contact either the Indian Institute of Millets Research, the farm cooperatives or any of their competitors directly. All inquiries must go via the module leader. Breaking this rule may lead to a referral to the academic conduct officer and might lead to a deduction of marks. Furthermore, you are required to keep this live client project completely confidential. None of the client-related information provided during the course of this module should be shared with anybody else who is not enrolled on this module. Additionally, you should not share any of the ideas you develop for this work with anybody else.\nYour report should include a short introduction and conclusion and in the three main sections you need to apply relevant theory, tools and frameworks discussed in the lectures and seminars as well as the recommended core literature you have read. In this context, you are expected to use some of the key ideas of at least eight of the sources listed in the libraryâ€™s current reading list for MARK7010 within your work.\nRefer to the Individual Coursework Feedback Sheet below for more details about the marking criteria. Please make sure that you have read the criteria thoroughly before you submit your assignment.\nAssessment criteria\nPlease see the assessment grid at the back of this Coursework Brief for full details.\nPresenting coursework for assessment\nYour assignment when submitted should not include your name â€“ we use a system of anonymous marking to reduce the risk of any unconscious bias. For some authentic assessments, there may be an exception to this, so please confirm with your Module Leader.\nThe authentic and essential requirements for this piece of assessed work are;\n \nFaculty of Business, Oxford Brookes University 7\n â‘ â‘\nâ‘ â‘\nâ‘\nâ‘\nâ‘\nâ‘ â‘\nwider reading and research; for further help see http://www.citethemrightonline.com/ Assignments not complying with this format will be marked down following the detailed criteria\nin the assessment grid.\nAssignment length / equivalent\nWhilst we acknowledge that learners will prepare and produce assessments in different ways and at different paces, an indication as to how much time it will take you to prepare, produce, edit and submit this assessment is detailed below.\nIn parallel to your directed and independent studies on strategic brand management over the course of the MARK7010 module (c. 70 hours) we expect you to spend approximately 94 hours on the preparation of your individual report.\nThe length of an assignment is limited by a set number of 3000-3500 words to contribute towards the development of writing skills and to ensure all work is assessed equitably. We therefore require you to complete your assignments within the maximum number of 3500 words specified in the assignment brief.\nThe specified word count refers to the main body of the report and does not include front cover, title page, contents page, reference list, or appendices. The word count does include headings, tables and in-text citations, but not equations or diagrams.\nAppendices should be used to provide supporting evidence only and will not be marked. Furthermore, appendices are limited to 3 pages (6 sides) and inappropriate use of appendices will be taken into consideration when awarding the final mark.\nAn executive summary is NOT required.\nPlease also remember that a report can be enhanced or damaged through layout, for example, placing all tables and diagrams in appendices can hamper the flow of discussion. Decisions therefore need to be made about the most appropriate place to use tables etc, to support your\nIt must be word-processed in 11-point Arial font and 1 1â„2 or double-spaced It must be black text on a white or ivory background\nAll pages must be numbered\nMargins must be as follows: Top: 1 inch, Bottom: 1 inch (2.5 cm), Left: 1.25 inches, Right: 1.25 inches (3.2 cm)\nIt should not contain your name(s)\nThe report MUST contain your student number\nThe cover page should also contain the programme title, module number and name, title of the assignment, submission date and word count\nYour report should contain a table of contents\nUse Harvard-style citation within the text. A reference list alone is insufficient proof of\n  \nFaculty of Business, Oxford Brookes University 8\n case. Also, if you show a significant degree of creativity in your work (e.g. when it comes to mock-ups of your implementation ideas), this will not be judged on your artistic ability but your ability to choose an appropriate approach to explain, showcase, and bring your proposed ideas â€˜to lifeâ€™ which could, for example, positively affect your mark for the â€˜Overall presentation styleâ€™.\nWords that exceed the maximum allowed will not be marked. If in doubt, you should discuss this with the Module Leader before submission.\nPlease note that a REFERENCE LIST is a mandatory requirement. However, the reference list alone is insufficient proof of wider reading and research. References used in the text of the report providing evidence of reading and research will attract marks. Please acknowledge all sources using the Harvard Citation and Referencing System. For further details see www.citethemrightonline.com.\nUse of Turnitin\nThe new Turnitin policy effective from September 2022 can be found via this link. You are expected to be familiar with it. It is important to know that the reference list and quotations are included in the overall similarity report, and that these matches are expected and not problematic.\nFor more information on how to interpret your similarity index report, please refer to this link.\nSubmission instructions\nYour work must be uploaded to the Turnitin dropbox in Moodle by 13:00 on 5 July 2023 (Final Week).\nThis final report must be submitted in a single Adobe Portable Document Format (.pdf) file of no more than 40MB. No other file formats will be accepted. The filename should consist of your student number, title and the word  \' final \'  e.g. 12345678_Millet_final.pdf\nAs we operate a policy of anonymous marking, you should not reveal your name anywhere on or within your FINAL SUBMISSION.\nPlease ensure you submit your assignment no later than the deadline set above (these are fixed deadlines, but students may exceptionally secure an extension if last minute untoward circumstances affect your ability to submit on time). Please see your Programme Handbook for more details. Please note the use of this extension is monitored and restrictions in place for overuse.\nhttps://www.brookes.ac.uk/students/your-studies/exceptional-circumstances/\nThe Blue Marking Card adjustment is only available to students who have an Inclusive Support Plan (ISP) specifying this adjustment. Eligible students who wish to use this adjustment must:\n \' Add Blue Card \'  when submitting work through Moodle and Turnitin.\nRecommendations for Reasonable Adjustments are made in accordance with the provisions of the Equality Act 2010. These are detailed in Inclusive Support Plans (ISPs) and need to be implemented unless there is a clear rationale for this not being possible, in which case we are accountable as an HEI for this decision. Alternatives should be considered, and further advice\n     \nFaculty of Business, Oxford Brookes University 9\n sought from the Disability Advisory Service to ensure we are compliant, consistent, and following best practice.\nInclusive Support Plan (ISP) extensions of up to 3 weeks are applicable to all assignments in this module. If you have an Inclusive Support Plan you can check the full details of the adjustments, including whether you have coursework extensions in Student Self Service.\nIf you have a coursework extension as part of an Inclusive Support Plan, contact your module leader if you are unclear about your deadlines.\nStudents who have an extension because of an ISP or a successful exceptional circumstances application (or both) can also use an extension if the need arises.\nHow your work will be marked\nOnce the submission date has past your module tutors will begin to mark your work. There are a number of phases to this which ensure fairness is maintained across the whole team including a pre marking calibration meeting, marking and post-marking internal moderation of grades. Following internal moderation, a sample of work is reviewed by the External Examiner for the programme to ensure that the standards applied are comparable to those at other institutions. To read how your work is moderated please go to your programme handbook for details.\nFeedback\nFeedback on your work will be provided in a range of ways at various times throughout this module, and different feedback will serve slightly different purposes. Feedback is designed to support your learning and help you to improve subsequent work, so you need to engage and get the most out of the feedback provided.\nPlease note that feedback is provided throughout the module not just on formally assessed tasks. It will be provided on your work and contribution in class, on the formal assessment tasks and, in some circumstances, during student office hours.\nIf you would like further information about feedback, or how to use it, please talk to your academic tutor on this module or your Academic Adviser or Programme Lead.\nOn this module we give specific formative feedback on the progress of the coursework through two coursework clinics. Informal feedback on in-class student presentations and seminar\n     Warning: It is YOUR responsibility to ensure that you upload the correct file; that it is not corrupt; and that it can be opened and read on Brookes systems. Please be particularly careful with files that have been prepared on Macs or using â€˜unofficialâ€™ Microsoft Office software.\n  \nFaculty of Business, Oxford Brookes University 10\n exercises is provided throughout the module. Summative feedback on the coursework is provided at the end of the module.\nIn order for you to receive timely and useful feedback which you can use to enhance your future academic and professional work and skills, the publication date for this module for marks and feedback is 6 September 2023. And please note that all marks are provisional until they are ratified by an Examination Committee.\nResit coursework requirements\nDo refer to the University Resit and Retake Policy https://www.brookes.ac.uk/students/your-\nstudies/resits-and-retakes/\nFurther details regarding resit coursework will be provided to students who have not passed the assessment based on their final submission.\n  ', 'MSc Marketing communications management ', 'Masters', '[\"Literature Review\",\"Report Writing\",\"Research Paper\",\"Primary/Secondary Data Analysis\",\"Essay Writing\",\"Thesis Writing\",\"Review Article\",\"Case Studies\"]', '[\"masters\",\"Research\",\"report\"]', '2023-07-05 00:00', '4400', '5097SBM brief (1).pdf_$_', '28-06-2023 17:15:37', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1799, 1799, 'Commerce', 'Content Marketing ', 'Assessment Instructions\nEach student will work individually on this LIVE CLIENT BRIEF. You will apply key\nprinciples of content marketing management (CMM) theory to help create a strategy\nand implementation ideas for the â€˜Net Zero Solutions for the Education Sectorâ€™\nCampaign for Enistic. Enistic is an internationally leading carbon management\nsoftware company. They have already started entering the education sector\n(â€˜verticalâ€™). However, the Net Zero Solutions campaign is the first effort to enter this\nvertical in a systematic and concerted way. The campaign will start in February 2024\nand run for 6 months.\nEach student will submit a written report based on their reading, research, and\nanalysis.\nYou need to apply critically CMM principles, theories and frameworks discussed in\nclass and in the recommended literature you have read. Your work needs to critically\ndebate and synthesize theory as well as tools and techniques in contemporary\ncontent marketing management practice. In your report you need to provide a\njustification why Enistic should adopt a Content Marketing approach in the first\nplace. You are also expected to analyse the market and competitors to inform your\nstrategy and implementation ideas. The report format and assessment criteria are\nprovided below. You will write an individual report based on your work as outlined\nhere in this brief. Your primary target audience are large primary and secondary\nschools as well as higher education institutions in the UK. The budget is limited to\nÂ£50k.\nDevelop a Content Marketing Strategy and Innovative Implementation Ideas for the\nNET ZERO SOLUTIONS FOR THE EDUCATION SECTOR campaign.\nFaculty of Business, Oxford Brookes University 7\nIMPORTANT\nYou are NOT allowed to contact Enistic, any of their clients, or any of their\ncompetitors for the purpose of this coursework. You are not allowed to contact any\norganisation that operates in the education market. All inquiries regarding Enistic\nmust go via the module leader. Breaking this rule may lead to a referral to the\nacademic conduct officer/SIRT and might lead to a deduction of marks. Furthermore,\nyou are required to keep this live client project completely confidential. None of the\nclient-related or market-related information provided during the course of this\nmodule should be shared with anybody else who is not enrolled on this module.\nAdditionally, you should not share any of the ideas you develop for this work with\nanybody else.\nFaculty of Business, Oxford Brookes University 8\nAssessment Criteria\nPlease see the assessment grid at the back of this Coursework Brief for full details.\nPresenting coursework for assessment\nYour assignment when submitted should not include your name â€“ we use a system of\nanonymous marking to reduce the risk of any unconscious bias. For some authentic\nassessments, there may be an exception to this, so please confirm with your Module\nLeader.\nThe authentic and essential requirements for this piece of assessed work are;\nâ‘ It must be word-processed in 11-point Arial font and 1 Â½ or double-spaced\nâ‘ It must be black text on a white or ivory background\nâ‘ All pages must be numbered\nâ‘ Margins must be as follows: Top: 1 inch, Bottom: 1 inch (2.5 cm), Left: 1.25\ninches, Right: 1.25 inches (3.2 cm)\nâ‘ It should not contain your name(s)\nâ‘ The report MUST contain your student number\nâ‘ The cover page should also contain the programme title, module number and\nname, title of the assignment, submission date and word count\nâ‘ Your report should contain a table of contents\nâ‘ Use Harvard-style citation within the text. A reference list alone is insufficient\nproof of wider reading and research; for further help see\nhttp://www.citethemrightonline.com/\nAssignments not complying with this format will be marked down following the detailed\ncriteria in the assessment grid.\nFaculty of Business, Oxford Brookes University 9\nAssignment length / equivalent / etc.\nWhilst we acknowledge that learners will prepare and produce assessments in\ndifferent ways and at different paces, an indication as to how much time it will take you\nto prepare, produce, edit and submit this assessment is detailed below.\nIn parallel to your directed and independent studies on Content Marketing\nManagement over the course of the MARK7046 module (c. 90 hours) we expect you\nto spend approximately 74 hours on the preparation of your individual report.\nThe length of an assignment is limited by a set number of 3000-3500 words to\ncontribute towards the development of writing skills and to ensure all work is assessed\nequitably. We therefore require you to complete your assignments within the maximum\nnumber of 3500 words specified in the assignment brief.\nThe specified word count refers to the main body of the report and does not include\nfront cover, title page, contents page, reference list, or appendices. The word count\ndoes include headings, tables and in-text citations, but not equations or diagrams.\nAppendices should be used to provide supporting evidence only and will not be\nmarked. Furthermore, appendices are limited to 3 pages (6 sides) and inappropriate\nuse of appendices will be taken into consideration when awarding the final mark.\nAn executive summary is NOT required.\nPlease also remember that a report can be enhanced or damaged through layout, for\nexample, placing all tables and diagrams in appendices can hamper the flow of\ndiscussion. Decisions therefore need to be made about the most appropriate place to\nuse tables etc, to support your case. Also, if you show a significant degree of creativity\nin your work (e.g. when it comes to mock-ups of your implementation ideas), this will\nnot be judged on your artistic ability but your ability to choose an appropriate approach\nto explain, showcase, and bring your proposed ideas â€˜to lifeâ€™ which could, for example,\npositively affect your mark for the â€˜Overall presentation styleâ€™.\nWords that exceed the maximum allowed will not be marked. If in doubt, you should\ndiscuss this with the Module Leader before submission.\nFaculty of Business, Oxford Brookes University 10\nPlease note that a REFERENCE LIST is a mandatory requirement. However, the\nreference list alone is insufficient proof of wider reading and research. References\nused in the text of the report providing evidence of reading and research will attract\nmarks. Please acknowledge all sources using the Harvard Citation and Referencing\nSystem. For further details see www.citethemrightonline.com\nIn your report you need to apply relevant theory, tools and frameworks\ndiscussed in the lectures, seminars and the recommended literature you have\nread. You are expected to use some of the key ideas within your work of at least\neight of the sources we have discussed during the MARK7046 classes.\nUse of Turnitin\nThe new Turnitin policy effective from September 2022 can be found via this link. You\nare expected to be familiar with it. It is important to know that the reference list and\nquotations are included in the overall similarity report, and that these matches are\nexpected and not problematic.\nFor more information on how to interpret your similarity index report, please refer to\nthis link.\nSubmission instructions\nYour work must be uploaded to the Turnitin dropbox in Moodle by 13:00 on 14\nth July\n2023.\nThis final report must be submitted in a single Adobe Portable Document Format (.pdf)\nfile of no more than 40MB. No other file formats will be accepted. The filename should\nconsist of your student number, title and the word  \' final \'  e.g. 12345678_Enistic\nRESIT_final.pdf\nAs we operate a policy of anonymous marking, you should not reveal your name\nanywhere on or within your FINAL SUBMISSION.\nFaculty of Business, Oxford Brookes University 11\nPlease ensure you submit your RESIT assignment no later than the deadline set above\n(these are fixed deadlines, students CANNOT secure an extension if last-minute\nuntoward circumstances affect your ability to submit on time). Please see your\nProgramme Handbook for more details. Please note that you still can apply for a\ndisregard of this module if there are circumstances preventing you from being able to\nstudy and meet the requirements of this or other modules. If this applies to you, please\nget in touch with your Academic Adviser or Student Support Coordinator for advice.\nhttps://www.brookes.ac.uk/students/your-studies/exceptional-circumstances/\nThe Blue Marking Card adjustment is only available to students who have an Inclusive\nSupport Plan (ISP) specifying this adjustment. Eligible students who wish to use this\nadjustment must:\n \' Add Blue Card \'  when submitting work through Moodle and Turnitin.\nRecommendations for Reasonable Adjustments are made in accordance with the\nprovisions of the Equality Act 2010. These are detailed in Inclusive Support Plans\n(ISPs) and need to be implemented unless there is a clear rationale for this not being\npossible, in which case we are accountable as an HEI for this decision. Alternatives\nshould be considered, and further advice sought from the Disability Advisory Service\nto ensure we are compliant, consistent, and following best practice.\nPlease be aware that ISPs cannot be applied for this resit assignment in terms\nof any extension of the submission deadline.\nNo submissions will be accepted after 13:00 on 14 July 2023.\nWarning: It is YOUR responsibility to ensure that you upload the correct file; that\nit is not corrupt; and that it can be opened and read on Brookes systems. Please\nbe particularly careful with files that have been prepared on Macs or using\nâ€˜unofficialâ€™ Microsoft Office software.\nFaculty of Business, Oxford Brookes University 12\nHow your work will be marked\nOnce the submission date has past your module leader will begin to mark your work.\nThere are a number of phases to this which ensure fairness is maintained across the\nwhole team including a post-marking internal moderation of grades. Following internal\nmoderation, a sample of work is reviewed by the External Examiner for the programme\nto ensure that the standards applied are comparable to those at other institutions. To\nread how your work is moderated please go to your programme handbook for details', 'MSc Marketing communications management ', 'Masters', '[\"Essay Writing\",\"Report Writing\",\"Literature Review\",\"Primary/Secondary Data Analysis\",\"Research Paper\",\"Thesis Writing\"]', '[\"Research\",\"Content Marketing\",\"masters\",\"report\"]', '2023-07-14 00:00', '4400', '5097Resit brief CMM.pdf_$_', '28-06-2023 17:21:05', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
