(1834, 1834, 'Arts', 'Print Media Practical', 'B.J.M.C. Semester-VI, Subject code- 601\r\nCourse-Print Media Practical-Viva \r\nRead the entire guidelines very carefully.\r\nGuide lines for reporting and newspaper making. \r\nInstructions:\r\n1-Prepare the file, get it checked and then go far Hard binding.\r\n2-File must have proper Front Page, Acknowledgement, declaration, Index page, \r\nNumbering in pages.\r\n3-Print Media file must carry at least 50 pages. You may increase the no. of pages.\r\n4-It must be approved by the signatory.\r\n5-Bring the file in Spiral Binding during Internal Practical & Viva. If approved in \r\nInternal Viva, go for hard binding\r\n6-You must adhere to deadlines. Violating deadlines will be treated as indiscipline \r\nwhich will affect your final marking.\r\nNews Writing---\r\nThe students will have to write different type of news with real experiences, like \r\nthey should go to political programs, study the crime stories in newspapers and \r\nwatch TV for the reports. Thereafter they have to create their own news stories. \r\nThey have to attend the cultural programs and social programs and write news. \r\nEach story should contain photographs, charts, info graph etc. whichever is \r\nrequired in the story. Size of story should be minimum 2 columns and maximum \r\n6 columns.\nEditing-For editing part, students will have to select some news from newspapers and \r\nedit and rewrite them. They should explain the process of editing. Main Story for \r\nfront page should be 6 columns. All students must prepare all news stories in \r\ncolumn format as published in newspapers. \r\nIn the second part of the practical, every student will have to create an actual \r\nsize 4 page newspaper. \r\n(I)Reporting-Prepare five national level political news containing national \r\nproblem, government policies and parliament including one related opposition \r\nparty. Five reporting on state level and five local levels also prepare. Prepare five \r\nnews with data regarding rural and industrial development in Uttar Pradesh. \r\nWrite two news on social issues and 10 on crime. Write a feature story on \r\ncultural activities in your city. Cover any one speech of political leader in your city. \r\nSubmit a report on any seminar. Write a news feature on fashion & lifestyles.\r\nWrite news on any event of sports in your city. \r\n(ii) Editing â€“how to edit a Political news, explain with appropriate example. \r\nExplain How to edit local and foreign news and moffussil copies, including head \r\nlining. Collect 10 raw news, edit and rewrite them.\r\n(iii) Prepare of a 4-page Newspaper. It should have content, Front Page, an \r\neditorial page, Sports and a feature page. There should be proper Mast Head and \r\nPrint line in the newspaper. It can be prepared in Quark Express or In Design\r\nsoftware. Students can paste news with photographs on a full sheet chart paper. \r\nStudents must use their own created news stories and features in newspaper.', 'Bachelor of Journalism and Mass Communication ', 'Bachelors', '[\"Report Writing\"]', '[\"Print Media\"]', '2023-07-13 00:00', '500', '4832print+media+guide+line (2).pdf_$_', '10-07-2023 15:51:31', '', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1835, 1835, 'Engineering', 'Business Intelligence', 'This assignment should be presented as a professional report. Prepare your\ndocuments considering a potential client will have access to them. You should\ninclude an executive summary.\nThe first part of your report should include general information about the\nclient/company, its products, strategy, and any other aspect that you consider\nrelevant for the rest of the document.\nThis section should be followed by the problem or situation that you will tackle in\nyour report (e.g., segmenting customers, analysing demand and trends, etc.).\nYou should align this choice to the companyâ€™s decision-making processes and/or\ntheir contribution to their strategy. Hence, it is expected that you identify, justify,\nand explain its impact on the companyâ€™s functioning and elaborate on how\nimplementing different business intelligence tools can contribute to solving this\nproblem/situation. In this section, you are strongly advised to incorporate relevant\nliterature.\nFinally, you should suggest at least three strategic recommendations on how to\nimplement the business intelligence tools, highlighting their potential benefit for\nthe company or its stakeholders. These recommendations should be linked to the\nproblem/situation.\nThe company has provided you with eight datasets. You can use any of these in\nyour report. You are not expected to use all of them. With the supplied data, you\nare required to back up your arguments, showcase potential solutions, and \nBMGT7072 - Business Intelligence Sem2 2022-2023\n2\nsupport your recommendations. It is expected that you include visualizations\nusing the data.\nRemember, as a good business intelligence analyst, when using data, you should\ndetail your methodology (step-by-step), explain the rationale, and provide a\nsummary of the data and used tools. Remember that in business intelligence,\nreplication, reliability, and clarity are key', 'MSc Management and Business Analytics', 'Masters', '[\"Report Writing\"]', '[\"Business analytics\"]', '2023-07-21 13:00', '4000', '1914Example2_MarkDistinction.pdf_$_1914Example1_MarkDistinction.pdf_$_1914Assessment Instructions BMGT7072 Business Intelligence S3 2023 (1).pdf_$_1914Assesment script.docx_$_1914Assesment preparation guide.pdf_$_', '12-07-2023 20:32:51', '', '11', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
