(1846, 1846, 'Engineering', 'ARK - Data Fault Detection in Wireless Sensor Networks Using Machine Learning Techniques', 'The detection of faulty data in Wireless Sensor Network, has its scope increasing when it comes in establishing with the help of Machine Learning Algorithms. Most of the algorithms are employed are based on the Unsupervised Learning Algorithm as the labels arenâ€™t mentioned in most of the cases. Generally, these algorithms are employed in router and communication servers thereby adapting to the dynamic workforce from the different sensors connected.  Here in this proposal Reinforcement learning is chosen for couple of reasons. One to propagate and motivate researchers in this developing field and the second is that the algorithm doesnâ€™t require the prior knowledge of the working environment. The Predictor â€“ Corrector Method is combined to address the exploration process where corrector equation happens in the Exploration part and thus the exploitation doesnâ€™t need to be involved in the process through out. This increases the computational efficiency both in offline and online operations of the Machine Learning Algorithms. ', 'Masters', 'Masters', '[\"Report Writing\",\"Programming / Coding\"]', '[\"Machine Learning\"]', '2023-07-21 00:00', '5000', '6668Abstract.docx_$_', '14-07-2023 12:08:09', '', '2', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1847, 1847, 'Engineering', 'Nandini - Applying Machine Learning Techniques using Ensemble Algorithms for Fault Detection in WSN in Cyber Physical Systems', 'In this research paper, the ensemble based fusion algorithm combining Ensemble Boost Algorithm and Roccio Algorithm is implemented for fault detection. The accuracy level from normal boost algorithm was 56.72 percent and on implementing the novel technique yielded an accuracy of 99.3 percentage. Before passing through the machine learning algorithm, they were passed into feature selection method based on Conditional Mutual Information technique. On implementation it was figured out that the parameters in the dataset were mutually independant of each other and there were no mutual dependencies. Data scaling was performed initially in order to pre process the datasets.', 'Masters', 'Masters', '[\"Report Writing\",\"Programming / Coding\"]', '[\"Machine Learning\"]', '2023-07-28 00:00', '5000', '6668Project_Report_2_revised.docx_$_', '14-07-2023 12:16:03', '', '2', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
