(1856, 1856, 'Commerce', 'Brand Management Report', 'Select a British based brand that is experiencing problems and write a 3,000-word report that outlines the problem of the brand and provides a\nrepositioning plan that fixes these problems (Times New Roman/Calibri 12 font, using 1.5 line spacing). The brand should be divided into the following\nsections:\nï‚· An introduction of the brand. This should include brand positioning, identity, targeted consumers, primary benefits, and history.\nï‚· A discussion of main problems that the brand is facing. This should focus on brand issues and weakness such as positioning, identity, equity, inability\nto adapt to a changing environment, consumers, portfolio, and communication. It should not focus on financial, strategic, or marketing problems.\nStudents are advised to select three problems and use branding models taught on the module to explain the problems.\nï‚· A repositioning plan that addresses the problems given in the previous section. The changes should be structural, based on branding (and not\nmarketing) theory, and should not be superficial or propose a continuation of current strategy but in a better format. In addition to repositioning the\nbrand and altering its benefits, It can include changes to organizational and product associations, identity, use, user, packaging and design,\nattributes communication, distribution, digital strategy, portfolio, brand community, CSR and heritage. Students are advised to adopt three\nrepositioning strategies based on a core strategy and two supporting or ancillary strategies. The repositioning strategy should draw on material\ntaught in class, in the textbooks, and from the literature and articles. The repositioning plan can also be based on broader changes in the brandâ€™s\nsocial, cultural and technological environment.\nï‚· A communication campaign that clearly and strategically communicates the new brand position to targeted consumers. This should be an integrated\nbrand marketing communication campaign that uses different communication tools and channels and should use the Buyer Readiness Stage model\nto structure the different stages of the communication campaign.\nï‚· A brief auditing plan based on brand auditing techniques that checks and ensures that the brand maintains its recovery. The auditing plan should be\nfor two years following the repositioning plan. It should adopt three different brand auditing techniques based on quantitative and qualitative\nresearch approaches to ensure that the core strategies adopted in the repositioning section are working.\nThe report should be written as if it were to be presented to the Board. It must therefore be convincing, comprehensive, practical and sustainable. It should\nfully utilise teaching given in class and contain relevant theory, models and literature found in both core text books. At least six models taught in class\nshould be utilised. The report should also contain academic reading (articles and books). In addition to the two core textbooks used in class, it should\ncontain references to at least eight other academic sources. ', 'brand management', 'Bachelors', '[\"Report Writing\"]', '[\"Market Research\",\"Marketing Analytics\",\"Marketing Strategy\",\"Marketing management\"]', '2023-08-01 14:00', '7000', '1365MG3601 Coursework Brief 2022 - Tagged.pdf_$_', '17-07-2023 18:17:35', '', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
