(1859, 1859, 'Commerce', 'Vimarsh -Analysis and report', 'Requirement : implement a DCC garch model  of  equity index with commodity markets index for India  and make forecasts based on DCC garch model.The objective is to check whether volatility spillovers between equity and commodity markets exist using DCC GARCH model.The data should be daily frequency or monthly for both equity and commodity markets.Also, DCC garch equations should be mentioned and each robustness test (if any used) must be specified.Do it either in R or python and summary of results and interpretation in word file. Data period 2000-2023 preferably , else ,. minimum 12-15 years data. Report should be in word file format with analysis and discussion on results and methodology described in equation forms.', 'Finance', 'Masters', '[\"Primary/Secondary Data Analysis\"]', '[\"Finance\"]', '2023-07-18 14:00', '5500', '2913IMG-20230718-WA0006.jpg_$_2913IMG-20230718-WA0007.jpg_$_2913IMG-20230718-WA0008.jpg_$_', '18-07-2023 12:13:40', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1860, 1860, 'Commerce', 'Business Intelligence', 'You need to develop a business report based on a case study organisation (100% \nof the module mark). This is ONE assignment based on a series of case study \ntasksYou will simulate becoming a business intelligence analyst. As part of your job, \nyou will receive the case study of an organisation, including its context, a potential \nsituation to solve and available data. Your job will be to choose a \nproblem/situation, define it, and prepare a report which includes at least two parts. \nFirst, a problem diagnostic of the case, including details about the client, the \nidentified problem/situation (that you think requires more attention), its \njustification, a plan to implement business intelligence tools that contribute to \nsolving the problem/situation and strategic recommendations. Second, with the \ndata provided, you are expected to back up your arguments, showcase potential \nsolutions, and support your recommendations. This includes the performance of \nanalytics techniques and the creation of visualisations using the provided data.', 'Management and Business Analytics', 'Masters', '[\"Report Writing\"]', '[\"Busines Intelligence\"]', '2023-07-20 13:00', '9494', '9902Example1_MarkDistinction.pdf_$_9902Business intelligence handbook.pdf_$_9902Assessment Instructions BMGT7072 Business Intelligence S3 2023.pdf_$_9902assesment preparation guide.pdf_$_', '18-07-2023 12:42:49', '', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
