(1880, 1880, 'Arts', '1500 words - essay choose any one', 'Choose ONE of the following essay titles.\n\n(1) Choose one of the concepts we discussed in class and compare and contrast the evolutionary perspective with the cultural/social perspective.\nThroughout the term, we have been talking about these seemingly opposing perspectives - the biological, evolutionary, innate one, and the social, culturally-varied, learnt one. For example, in relation to interpersonal relationships, we discussed whether humans are socially constructed to be attracted to young women and wealthy men or whether this is rooted in our biology. Choose one such topic and present evidence for each of the perspectives. Conclude by providing your own insights into the debate.\n\nExample papers:\nKrebs (2008) \"Morality: An Evolutionary Account\"\nFehr and Fischbacher (2003) \"The nature of human altruism\"\n\n(2) With respect to group identity theories, discuss what strategies and conditions can facilitate or undermine human prosociality.\nWhen we learnt about altruism, we discussed factors that influence its occurrence. We also discussed ways in which prejudice can be reduced. Present three strategies or conditions, derived from the literature on the biological basis of cooperation or social determinates of it, that are known to influence rates of cooperation. At least one of these strategies should concern Social Identity, and the role group membership plays in cooperation between individuals.\n\nExample papers:\nFehr and Schurtenberger (2018) \"Normative foundations of human cooperation\"\nPettigrew and Tropp (2006) \"A meta-analytic test of intergroup contact theory\"\nCikara et al., (2014) \"Their pain gives us pleasure - How intergroup dynamics shape empathic failures and counter-empathic responses\"\n\n(3) Summarise the person-situation debate and present three examples where situational attributes affect social behaviour from various topics in the module. Present your own view of the debate with reference to research and theory.\nThe person-situation debate concerns the role personal, dispositional characteristics have in determining behaviour as opposed to contextual, situational attributes. First, present the debate in reference to the literature. Then, provide examples of situational influence relating to the topics we covered in the module (e.g., situations that influence altruism, attraction, etc.). Conclude by presenting your own insights into the debate.\n\nExample papers:\nSherman et al., (2015) \"The Independent Effects of Personality and Situations on Real-time Expressions of Behavior and Emotion\"\nThielmann et al., (2020) \"Personality and prosocial behavior: A theoretical framework and meta-analysis\"\n\n(4)  Discuss the methodological importance of including non-WEIRD samples in social psychological research.\nIn the first lecture, we discussed the problematic use of WEIRD samples in social psychology. Then, throughout the term, we brought up examples of social behaviours and attitudes that vary across cultures. In your answer, present the concept of WEIRD samples, and provide evidence for their prevailing use in social psychological research as well as research using other kinds of samples. Evaluate what cross-cultural research teaches us about our social nature.\n\nExample papers:\nHenrich et al., (2005) \"â€œEconomic manâ€ in cross-cultural perspective: Behavioral experiments in 15 small-scale societies\"\nHenrich et al., (2010) \"The weirdest people in the world?\"', 'Psychology', 'Masters', '[\"Essay Writing\"]', '[\"psychology\"]', '2023-08-04 00:00', '3500', '2733IMG-20230726-WA0027.jpg_$_', '28-07-2023 17:29:13', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
