(1898, 1898, 'Academic Writing', 'Business Intelligence: A Key to Successful Advertising and Customer Engagement\"', 'Aim:\r\nThe aim of this study is to investigate how business intelligence can make advertising more powerful and precise. This dissertation will focus on how insights about customers, collected through business intelligence, can create ads that connect better with the audience.\r\n\r\nObjectives:\r\n\r\nTo study how business intelligence helps us understand customer behavior.\r\n\r\nTo identify key tools and techniques of business intelligence that help improve ads\r\n.\r\nTo evaluate how business intelligence can make ads more successful.\r\n\r\nTo assess how business intelligence can help ads reach the right people.\r\n\r\n\r\n\r\n\r\nResearch Questions:\r\n\r\nHow does business intelligence help us learn more about customers for better ads?\r\n\r\nWhat are the essential business intelligence tools that can boost ad performance?\r\n\r\nHow can business intelligence help make ads more effective?\r\n\r\nHow does business intelligence ensure that ads reach the right audience?\r\n\nWrite a 10000 words dissertation on the above topic in critical review way type A. Secondary data and qualitative analysis to be used. Check the guidelines and follow the sample attached', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-12 00:00', '22500', '1047BUSM100 Dissertation Module Outline DRAFT2021-22 NEW - Copy (1)LSpdf Updated.pdf_$_1047BUSM100 Meeting 4 01.03.2023 (1).pptx_$_1047Dissertation Marking Criteria BUSM106.pdf_$_', '03-08-2023 20:24:00', 'team_member_1', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1899, 1899, 'Academic Writing', 'Analysing the impact of leadership on management: qualitative study of the IT sectorâ€', '\r\nThe aim of this dissertation is to use a qualitative study of secondary data to investigate the effect that leadership has on management in the IT industry.\r\n\r\n\r\nObjectives-:\r\n\r\nâ€¢	To examine the effects of various management approaches on the IT industry.\r\nâ€¢	To analyse how leadership affects IT companies \'  ability to inspire and direct their employees and shape their culture.\r\nâ€¢	To investigate how IT industry managers respond to and adapt to the difficulties they experience.\r\nâ€¢	To explore the connection between strong leadership and IT company success.\r\n\r\n\r\n\r\nGap: \r\nThere is a lack of a thorough qualitative study of secondary data in the current literature on the effect of leadership on management in the IT industry. While quantitative studies might reveal interesting trends, qualitative research can help shed light on the subtleties of leadership and its impact on IT management styles. This dissertation seeks to address this void in the literature by performing a qualitative research using secondary data to provide a more nuanced view of the effect leadership has on IT management.\r\n\r\nMethodology:\r\nThis dissertation will use a qualitative research approach to examine how leadership affects management in the IT industry. Academic articles, industry reports, and case studies will make up the bulk of the study \' s secondary data sources. Key insights and patterns addressing the impact of leadership on several facets of IT management will be retrieved through a systematic review and thematic analysis of the gathered data. The qualitative method will deepen our awareness of the interplay between IT leadership and management and enrich our understanding of this topic.\r\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-11 00:00', '22500', '', '03-08-2023 20:25:46', 'team_member_1', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1900, 1900, 'Academic Writing', 'Topic:  analysis on impact of digital marketing on costumer engagement in hospitality sector', 'Aim: The aim of this dissertation is to use secondary data and qualitative analysis to examine the effect of digital marketing on customer engagement in the hospitality sector.\r\n\r\nObjectives:\r\n\r\nâ€¢	To analyse the state of digital advertising in the hospitality industry currently.\r\nâ€¢	To examine many factors that influence customer engagement in the hospitality industry.\r\nâ€¢	To investigate the connection between digital marketing initiatives and customer engagement in the hospitality sector.\r\nâ€¢	To identify the main difficulties and possibilities of digital marketing in the hospitality sector.\r\n\r\nResearch questions-:\r\n\r\nâ€¢	What are the most frequent digital marketing methods used by hospitality sector?\r\nâ€¢	How does the use of digital marketing affect the engagement of hotel customers?\r\nâ€¢	What possibilities and threats does the hospitality industry face in adopting successful digital marketing tactics to boost consumer engagement?\r\n\r\n\r\n\r\nResearch Gap\r\nExisting research on how digital marketing affects consumer engagement in the hotel industry leans heavily on empirical study and primary data collecting. However, studies investigating this link via secondary data and qualitative analysis are few and far between. Therefore, the purpose of this study is to fill this knowledge vacuum by using secondary data and qualitative analysis to the topic of digital marketing \' s effect on consumer engagement in the hotel industry.\r\n\r\nProposed Methodology\r\nThis study will use a qualitative analysis of secondary data as its technique of choice. Data on digital marketing strategies and guest participation will be culled from industry publications, case studies, and the aforementioned literature. Qualitative methods, such as theme analysis, will be used to analyse the data acquired to better understand the connection between digital marketing and consumer participation. The study will use an interpretivist approach, digging deep into the thoughts and feelings of hospitality patrons and workers alike.\r\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-10 00:00', '22500', '', '03-08-2023 20:30:21', 'team_member_1', '3', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
