(1909, 1909, 'Academic Writing', 'Last Mile Delivery Techniques in India: Comparative Study of Jio-Mart and Flipkart Case Studies', 'Tentative Methodology\r\nAim: 	The present study aims to compare two e-commerce businesses JioMart and Flipkart in terms of their last mile delivery services in India. For an empirical study, a preliminary literature review was conducted that helped in identifying five key indicators last mile delivery services in regard to which the comparison between the two companies will be performed.\r\nResearch Objectives:\r\nâ€¢	To study the scope of last mile delivery techniques in India.\r\nâ€¢	To gain an understanding of Flipkartâ€™s last mile delivery system in India.\r\nâ€¢	To gain an understanding of JioMartâ€™s last mile delivery system in India.\r\nâ€¢	To conduct a comparative analysis between Flipkart and JioMartâ€™s last mile delivery services in India.\r\nHypothesis \r\nH1: There is a significant relationship between last mile delivery service indicators for Flipkart. \r\nH2: There is a significant relationship between last mile delivery service indicators for JioMart.\r\nH3: There is no difference between Flipkart and JioMartâ€™s last mile delivery services on account of perceived ease of use. Suggesting perceived ease of use is a strategy used by both Flipkart and JioMart on a similar level.\r\nH4: There is no difference between Flipkart and JioMartâ€™s last mile delivery services on account of delivery time and methods. Suggesting JioMart and Flipkart uses similar strategy for delivery time and methods for their last mile deliveries.\r\nH5: There is no difference between Flipkart and JioMartâ€™s last mile delivery services on account of acceptance of delivery methods. Suggesting Flipkart and JioMart receives similar level of acceptance of their delivery methods for their last mile delivery services.\r\nH6: There is no difference between Flipkart and JioMartâ€™s last mile delivery services on account of tracking of parcel. Suggesting Flipkart and JioMart uses similar strategies for tracking of parcel as part of their last mile deliveries.\r\nH7: There is no difference between Flipkart and JioMartâ€™s last mile delivery services on account of returning of parcels. Suggesting Flipkart and JioMart uses similar policies for returning of parcels as part of their last mile deliveries.\r\n\r\nResearch Design: In the present study, it is proposed to follow an exploratory research methodology incorporating quantitative research approach. The present study proposes to conduct a survey with help of a self-reported questionnaire. The data collected through the survey will be subjected to quantitative analysis which will aim on highlighting the difference in efficiency of Last Mile Delivery Techniques between Flipkart and JioMart in India. \r\nData Collection: The present study proposes to collect primary data by administration of self-reported questionnaire. The study would primarily focus on quantitative data that will help in determining whether there is a difference in the efficiency of Last Mile Delivery Techniques of Flipkart and JioMart.\r\nSample and Sampling: The present study proposes to perform purposive sampling for selecting of total 100 participants. Employees working in different departments of both companies Flipkart (n= 50) and JioMart (n=50) will be enrolled in the study to determine their perception for their respective companies performance of last mile delivery services.\r\nVariables: Five key indicators of last mile delivery services are to be studied in the current research. The effectiveness of last mile delivery services of two companiesâ€™: Flipkart and JioMart will be compared on basis of employeesâ€™ perception on the following five key indicators; perceived ease of use, delivery time and conditions, acceptance of delivery methods, tracking of parcels, and returns of parcels.\r\n\r\nPreliminary Literature Gap\r\nQuality of deliveries heavily impacts the success of e-commerce businesses that aim to attract audiences for enlarging their consumer base; this is a pertinent point why user experience is a key component of last mile delivery services around the world (Vrhovac, et al., 2023). However, the techniques used by different e-commerce giants to gain advantage in delivery strategies are still an unexplored area in Indian market. Companies such as Flipkart, Amazon, Jio, have revolutionized online shopping in India and their strategies for deliveries have gained much popularity especially after the pandemic (Sudhakar, & Syed, 2016). \r\nAccording to a research conducted by Kalakata, Anand, and Saxena (2022) Flipkart like most companies had to face tremendous of challenges during pandemic, where nationwide lockdowns made it difficult for Flipkart last mile delivery partner eKart to deliver goods to consumers with closing down of their warehouses, however, the findings of research suggests that Flipkart employees believe that changes in companyâ€™s logistics for last mile delivery and attempt at technology innovations in their delivery system helped the company overcome the challenges. Nevertheless, there is still less knowledge of how deep the impact of last mile delivery services of Flipkart has on consumers.\r\nMoreover, many scholars have addressed aspects such as online retailing, consumer satisfaction, inventory and logistics management and even e-facilities, yet a lot is unknown about the delivery system, including Last Mile Delivery System of recent times (Sharma, Prakash, & Singh, 2022). \r\nSimilar gap in literature was found for JioMart, a company that uses different ways to fulfil their last mile deliveries. JioMart make use of small local vendors as their virtual storefronts, and offer its consumers various modes of payments and deliveries to choose from that impact their overall business (Reardon, et al., 2021). However, there is a persistent gap in how e-commerce businesses such as JioMart conduct their delivery fulfilment in Asia (Reardon, et al., 2021). \r', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-31 00:00', '28800', '', '03-08-2023 21:14:18', 'team_member_1', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1910, 1910, 'Academic Writing', 'Study of analysis on the best forecasting methods in FMGC industry in UK', 'Write 12000 words dissertation as discussed in whatsapp group and meeting following the guidelines.\n\nBackground\r\nFast-moving consumer goods (FMCG) are goods that are bought and sold frequently and for little money. Non-durable products like packaged foods, drinks, toiletries, over-the-counter medicines, and other consumables are examples. The FMCG sector is a cornerstone of the UK economy, making a sizeable contribution to annual GDP and providing thousands of jobs across the country.\r\nEffective demand forecasting, or the prediction of future product demand, is one of the key components of success in this industry. Because it enables FMCG companies to optimize their production and supply chains, lower storage expenses, cut waste, and ultimately boost profitability, accurate demand forecasting is essential. Accurate forecasting is difficult due to the wide range of unpredictable factors that affect the demand for FMCGs, including changes in consumer behavior, shifting economic conditions, and emerging trends. As a result, there is an increasing need to research and pinpoint the best demand forecasting techniques that can boost the effectiveness of the FMCG sector in the UK. In addition, despite the strategic significance of demand forecasting, extensive research that examines the various forecasting methodologies employed in the UK FMCG industry appears to be lacking. The industry \' s capacity to benchmark and adopt best practices may be hampered by this gap in the literature, which would reduce its efficiency and growth potential.\r\nTherefore, the goal of this study is to evaluate various demand forecasting methodologies in order to identify the most effective ones for the UK \' s FMCG industry. By taking into account the special context of the FMCG sector, it seeks to comprehend the benefits and limitations of each methodology and offer insightful information to both practitioners and academics.\r\nHR specialists from UK-based FMCG companies will also be included in our study. Most studies concentrate on supply chain managers or executives, so this is a novel approach. We think HR professionals can offer a wider organizational perspective on the choice-making process regarding the adoption of particular forecasting techniques because of their strategic role in these companies.\r\nMethodology\r\nTo help the UK \' s Fast Moving Consumer Goods (FMCG) industry, we analyze various demand forecasting methodologies in this study. A mixed-methods strategy integrating both qualitative and quantitative methodologies will be used to thoroughly understand and effectively address the research question.\r\nOur research \' s preliminary stage entails a thorough literature review. This will entail a thorough analysis of scholarly works, research reports, and trade publications that have concentrated on FMCG demand forecasting. We can comprehend the variety of forecasting techniques that have been applied in the past and comprehend the trends and factors influencing their success or failure by studying the literature. Setting specific inclusion and exclusion criteria, such as date of publication, relevance to the FMCG sector, and focus on the UK market, will be part of the methodology for carrying out this review. Next, we will list important databases and conduct a thorough search of each one using predetermined keywords. After locating the pertinent articles, we will analyze them to determine the most effective forecasting methods as demonstrated by the literature.\r\nThe second stage of our study focuses on gathering primary data, which entails interviewing HR specialists working in the UK \' s FMCG industry. The key informants for our study were HR professionals because they play a strategic role in these businesses and have valuable insights into organizational decision-making. We \' ll use both closed-ended and open-ended questions in our survey. Quantitative information on the usage and frequency of various forecasting techniques in the industry will be given by closed-ended questions. These will be simple-to-answer questions that will ease the burden on respondents and facilitate quick statistical analysis.\r\nOn the other hand, open-ended inquiries will enable us to delve deeper into the factors that led to the preference of one forecasting method over another. It will make it easier to comprehend why some businesses do not favor the technique that our literature review determined to be the \"best.\" We intend to use descriptive statistics and thematic analysis methods to analyze our survey data after it has been collected. To analyze quantitative data and identify any trends or commonalities in the application of forecasting methods, descriptive statistics will be used. On the other hand, thematic analysis of the qualitative responses will give detailed insights into the variables influencing the selection of forecasting methodologies in various FMCG companies. While our suggested methodology is thorough, it is also adaptable, taking into account that changes may be necessary as the research develops. The collection of data will be done ethically, protecting the privacy of participants and their personal information.\r\nIn the end, our research methodology will present a thorough understanding of demand forecasting in the UK FMCG sector. We aim to provide recommendations that can improve forecasting accuracy and thereby contribute to the industry \' s overall improvement by integrating insights from both the systematic literature review and primary data collection.\r\n\r\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-31 00:00', '30000', '', '03-08-2023 21:20:58', 'team_member_1', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
