(1913, 1913, 'Academic Writing', 'Analysing the Significance of Digital Marketing through Facebook on Consumer Purchase Intentions: A Case Study of the Indian Retail Industry', 'Write 12000 words dissertation as per the whatsapp group discussion.\n\nProposal submitted:\nMethodology \r\nAim: The present study aims to understand the significance of digital marketing on consumersâ€™ purchase intentions by using Facebook as the social media site. The present study explores the scope of digital marketing usage on Facebook and its impact on consumersâ€™ purchase intentions by highlighting the Indian retail industry.\r\nObjectives\r\nâ€¢	To study the scope of digital marketing on Facebook.\r\nâ€¢	To assess the role of digital marketing on consumers â€˜purchase intentions among retail consumers of India.\r\n\r\nHypothesis\r\nH1: There will be no significant relationship between userâ€™s demographics (gender, age and education) with scope of digital marketing on Facebook.\r\nH2: Digital marketing through Facebook has a positive impact on consumers purchase intentions of Indian retail industry..\r\n\r\nResearch Design\r\nThe present study proposes to be an exploratory research design focusing on quantitative approach for research. A primary research is proposed to be conducted in order to explore the objectives of the current study. A survey will be conducted with the help of self-designed questionnaire. \r\nSampling \r\nThe present study proposes to conduct purposive sampling for collection of a sample of 100 participants (50 males and 50 females) between the ages of 18-45 years. The participants will be selected through purposive sampling based on certain characteristics including knowledge of Indian retail industry, consumer of retail business in India and also the employees of retail business of the nation.\r\nData Collection\r\nA set of quantitative data will be collected through primary sources, i.e., participants of enrolled for the study. The present study also proposes to collect secondary data from various sources such as newspapers, magazines and online reports to support the analysis presented via primary data.\r\nData Analysis\r\nBoth inferential and differential statistics will be used for data analysis. \r\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-25 00:00', '27000', '1047Postgraduate Dissertation Module Handbook 2022-23_final.pdf_$_', '03-08-2023 21:32:01', 'team_member_1', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1914, 1914, 'Academic Writing', 'Topic: A study on impact of social media marketing on consumer buying behaviour in India: A case study on Mamaearth', 'Write a 8000 words dissertation following the guidelines and the things finalised on the whatsapp group .\n\nResearch Objectives\r\nâ€¢	To examine the social media marketing strategies employed by Mamaearth in India.\r\nâ€¢	To understand the impact of Mamaearth \' s social media marketing on consumer awareness and perception.\r\nâ€¢	To analyze how social media marketing influences consumers \'  purchase decisions regarding Mamaearth products.\r\nâ€¢	To explore the role of social proof and user-generated content in shaping consumer buying behavior for Mamaearth products.\r\nâ€¢	To assess the relationship between customer engagement through social media and brand loyalty for Mamaearth.\r\nResearch questions\r\nâ€¢	What social media marketing strategies does Mamaearth use in the Indian market?\r\nâ€¢	How has Mamaearth \' s social media marketing affected consumer awareness and perception of the brand?\r\nâ€¢	To what extent does Mamaearth \' s social media marketing influence consumers \'  purchase decisions?\r\nâ€¢	How does social proof and user-generated content on social media impact consumer buying behavior for Mamaearth products?\r\nâ€¢	Is there a significant correlation between customer engagement on social media and brand loyalty towards Mamaearth?\r\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-20 00:00', '23000', '', '03-08-2023 22:02:51', 'team_member_1', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
