(1917, 1917, 'Academic Writing', 'Entrepreneurship innovation report', 'As per the discussion on email\r\n\r\nAssignment Weighting:  10 Credit - 67%\r\n\r\nWord Count: 2,750 words \r\n\r\nLearning Outcomes Assessed in CW2:\n1.	Critically apply concepts of innovation and entrepreneurship in the context of new and existing companies.\r\n2.	Iteratively develop skills, behaviours and attitudes to lead entrepreneurial and innovation activities within rapidly changing environment.\r\n3.	Critically assess various data sources, relevant to the global study of innovation and entrepreneurship in order to manage risk and encourage creativity.\r\n4.	Systematically review and evaluate different types of innovation as sources of entrepreneurial opportunities.\r\n5.	Defend arguments in an effective and convincing style that demonstrates expertise in entrepreneurship and innovation \r\n\nAssignment Guidelines:\nThis assignment is an individual assignment.\n\rBased on the identified organisation in your CW1, evaluate how innovation can be supported and implemented through entrepreneurship practice. This may\r include: the types of innovation evident in the organisation; the process of innovation; the implementation of\r innovation and how / if entrepreneurship is practised. \nThe proposed innovation that you would like to implement should include: \n1.	Background of the organisation and its approach towards entrepreneurship and innovation;\r\n2.	Description of a specific product, process, technology or business model innovation that you would like to implement or proposing to implement;\r\n3.	Critical evaluation of the potential obstacles you may need to overcome as part of the implementation process;\r\n4.	Critical reflection on potential outcomes you are hoping to achieve and a contingency plan;\r\n5.	Use of academic resources and evidence of reading and research\r\nRubric\n\nhttps://culc-coventry-parse-bucket.s3.amazonaws.com/424d87d8c7039536756eaa0f151b06ec7003mhr_cw2_rubrics.xlsx\n\n\nSubmission link\n\nðŸ“ There will be a penalty of a deduction of 10% of the mark (after internal moderation) for work exceeding the\r word limit by 10% or more.\r The word limit includes quotations and citations but excludes the references list.\nðŸ“ Read carefully and follow the CW Structure', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-08-05 14:00', '5500', '8763424d87d8c7039536756eaa0f151b06ec7003mhr_cw2_rubrics.xlsx_$_', '04-08-2023 12:11:51', 'team_member_16', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
