(1922, 1922, 'Academic Writing', 'Title: \"3D Design Technology in New Product Development: An Investigation into Adoption, Challenges, and Economic Impact on Indian Small Fashion Enterprises\"', 'Aim: \"To examine the role and impact of 3D design technology in new product development, addressing the unique challenges and opportunities within the context of Indian small fashion enterprises.\" Write a 15000 words dissertation on the above topic. A primary data and qualitative analysis should be used. Check the guidelines and follow the sample attached\n\nObjectives:\nTo investigate the current new product development tools and practices in Indian small fashion enterprises.\nTo analyze the challenges encountered by these businesses in new product development.\nTo identify the factors influencing the adoption of 3D design technology and the challenges in its effective utilization in small-scale Indian fashion enterprises.\nTo delineate the potential benefits and competitive advantages that can be gained by Indian small fashion enterprises through the use of 3D design technology.\nTo examine the influence of entrepreneurial innovation, with a focus on 3D design technology, on the economic growth of these small-scale fashion enterprises.\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-08-22 14:00', '35000', '87633D Design Technology draft.docx_$_', '04-08-2023 12:52:14', 'team_member_16', NULL, NULL, 1, 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1923, 1923, 'Academic Writing', 'Tiktok marketing strategy for a brand Sole box - report', 'Hi, here \' s the instruction set: \n2000 words (8000 including appendices) \nAs per discussed on email\nWe basically have to come up with a Tiktok marketing strategy for a brand named  \' Solebox \' . This is our uni \' s capstone project so we need to utilise the concepts we \' ve learned through all of our courses so far.\n\nContent and Aims\nThis Capstone Course builds connections between management theory and practice and\nequips students with the skills necessary to succeed in their managerial careers. The\noverarching teaching objective is to apply material learned in MiM courses to create\nmanagerial recommendations that can help a firm improve and defend its competitive\nadvantage both immediately and for its future.\nYouâ€™ll draw on what youâ€™ve learned in core courses, such as:\n Managerial Economics \nâ— Develop a deeper understanding of a client companyâ€™s business problem based on underlying\neconomic and strategic issues\n Business Analysis\nâ— Explore quantitative data to give insight into managerial decisions; use data to justify\nrecommendations\n Organisational Behaviour\nâ— Identify issues with recruitment, retention, or advancement; propose solutions to these issues\n Marketing Management\nâ— Use knowledge of consumer needs and wants to make suggestions about product design,\npricing, distribution, or promotion\n\n Financial and Management Accounting for Managerial Decision Making\nâ— Advise on product costing and pricing; propose performance-measurement metrics\n Managerial Finance\nâ— Take the firmâ€™s perspective on financial decisions; give reasoned advice about potential\ncourses of action such as mergers and acquisitions and initial public offerings; offer a basis\nfor valuation of firm assets\n Business in the Global Environment\nâ— Consider international differences in regulations or industries; generate advice about success\nin the global economic context\n\n*Written Project Report*\nThe report should be a maximum of 2,000 words, excluding tables, appendices, and figures.\nIt should broadly consist of the following sections, although youâ€™re free to use different\nsection headings as is appropriate to your specific project:\nâ— Problem Definition: Brief background on the challenge\nâ— Research Approach: How did you approach the challenge? What methods did you\nuse?\nâ— Data Analysis and Results: What quantitative or qualitative data did you analyse?\nWhat did you learn from it? Include visualisations as appropriate. (Use Appendices\nfor details as needed.)\nâ— Recommendations & Conclusions: In light of what you did and what you learned,\nwhat would you suggest to the company? What are the next steps?\nThe quality of your report will be assessed on the following grounds:\na) Appropriate applications of theories, frameworks, and tools\nb) Appropriate and rigorous research approach\nc) Clearly formulated recommendations and conclusions\nNote that it is important that the report be clearly written and logically consistent. Your\nrecommendations and conclusions should flow from your assessment of the problem and\nyour analysis of the data.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-08-04 14:07', '15000', '8763THE CORRECT ONE FINAL.pdf_$_', '04-08-2023 13:10:26', 'team_member_16', NULL, NULL, 1, 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
