(1937, 1937, 'Programming', 'Financial Transaction Modelling for Personal Banking Assistants', 'â€¢	booking_date: The date when the booking was made which has transactions from 2006 to 2019.\nâ€¢	pseudo: A column that contains vendor names represented as pseudonyms in the format of \"what-three-words.\"\nâ€¢	amount_zm: The transaction amount after zero summing. It appears that the dataset contains both positive and negative values.\n\nTask is to predict which vendor is gonna have a transaction in the next month and on which dates based on previous historical data of transactions.\n\nI would advice you to first bucket the transactions into 3 categories Regular, recurring and discretionary vendors.\n\nRegular Vendors: These vendors have frequent transactions without a specific pattern or interval. You could identify regular vendors as those with a high number of transactions spread evenly over time. For eg: you going to groceries and getting it every month.\n\nRecurring Vendors: These vendors have transactions at consistent intervals. You could identify recurring vendors by looking for patterns in the timing of transactions. For eg: a phone bill which is renewed every month on a fixed date or any loan payments for the same\n\nDiscretionary Vendors: These vendors have infrequent or irregular transactions. Discretionary vendors can be identified through anomaly detection, as these transactions might be less predictable and vary more from the customer \' s usual spending behaviour.', NULL, 'Masters', '[\"Software\"]', NULL, '2023-08-10 00:00', '10000', '9841fd.csv_$_', '04-08-2023 23:31:56', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
