(1950, 1950, 'Academic Writing', 'Annotated Biblography', 'Length: 2000 words (+ or - 10%) - all inclusive. You are required to demonstrate an ability to keep within the word limit while still providing a comprehensive piece.\n\nBasic format (see further details below):\nFont and spacing: Size 12 font (Arial or Times New Roman) and 1.0 or 1.5 line spacing.\nUse APA 7th referencing style â€“ check iLearn for details.\n\nWhat is an annotated bibliography?\nAn annotated bibliography is generally based on a specific topic or question. You then source a list of references relevant to the topic or question and accompany each reference with a brief description and evaluation of it. This latter part reflects the  \' annotation \'  part of an annotated bibliography. \n\nAnnotated bibliographies have a very specific structure that must be followed - see the structure to be followed in this unit outlined below. \n\nPurpose and aim of this assessment\n\nThis annotated bibliography aims to:\nStrengthen your research skills and confidence in searching for quality sources of evidence, focused to a particular topic\nStrengthen your ability to succinctly summarise and evaluate the sources of evidence that you identify\nDeepen your knowledge on a particular topic covered in this unit\nSet you up for success in your remaining assessment pieces, as sourcing, evaluating, and integrating evidence is critical to all the work you will do at university and beyond!\n\nThe topic of our annotated bibliography \nYou must source articles on the following topic: \"What are the benefits and drawbacks of gig work, for the workers that do it?\"\n\nStructure and length of our annotated bibliography\n* To help you start your annotated bibliography, you can follow this template structure. *\n\nThis structure is adapted from Macquarie University \' s StudyWise site. Follow this link to see an example of an annotated bibliography and each of the 6 sections.\n\nFull reference - Begin with the full reference for the source you \' re annotating using the APA 7th referencing style.\nIntroduction - Your first sentences are your introduction. These should provide a broad overview of the topic of the text or a brief summary of the main arguments, ideas or findings presented by the author. \nMethod and Scope - Provide more detail about the method and scope of the research: What was being researched? How did the researcher(s) choose their subject or sample? How was the research undertaken? Did the researcher(s) decide to exclude anything or anyone from the study for a particular reason?\nFindings - Detail the findings of the research, analysis, or investigation.\nLimitations and Quality of the Reference - Explain any limitations you \' ve identified in the author \' s work. Include a statement/s reflecting on the quality of this reference. E.g., \"this source offered useful insights, but ...\"\nEvaluation of usefulness - Include a statement/s detailing the relevance and/or usefulness of this source to the topic - this is like a critical evaluation. Remember, not every source may inform the topic well, it may not offer a balanced argument, etc. Make those points here. E.g., \"overall this article only ..., it lacks ...\"\nSteps 5 and 6 are critical! This assessment is not just about describing each piece of research - you need to analyse and critically evaluate it too.\n\nEach annotation should be around 250-350 words in total. This means roughly a single paragraph. The length will obviously depend on the type of reference you are annotating - e.g., scholarly references are generally longer than other types of references, so their annotations may be at the upper bound of the suggested words.\n\nYou must include a minimum of three (3) scholarly references in your annotated bibliography - this includes sources like academic journal articles and book chapters. Outside of this requirement, you can incorporate more scholarly sources, as well as non-academic sources, such as websites or reports. However, you should be incorporating relevant and quality non-academic sources.\n\nOverall, you should aim to include around 5-7 references, and their annotations, in this assessment piece (exactly how many will depend on whether you are at the upper or lower bound of words for each annotation). DO NOT use references provided in the readings for the Gig Work topic - the aim is for you to undertake independent research on the focal topic.\n\nTo conclude your annotated bibliography, you must also include a concluding paragraph that briefly evaluates how well your entire collection of references informs the topic of the annotated bibliography. This should just be a short paragraph, roughly 150-200 words.\n\nHow to start \nLook at the topic for your annotated bibliography, start searching for relevant references, keeping in mind the guidance given above\nUse the Library \' s MultiSearch function or Google Scholar to particularly search for scholarly sources\nWider web searching can also direct you to other relevant and quality non-academic sources \nStart constructing your annotations, per the guidance above - don \' t forget there is a template to use up above!\nDon \' t forget your concluding paragraph! See guidance above.\n\n\nMOST IMPORTANT THINGS TO BE INCLUDED IN THE ASSIGNMENT ARE :\n\nYou have used at least 3 scholarly sources (peer reviewed)\nYou have between 5-7 annotations PLUS a concluding paragraph\nYou \' ve followed the annotation structure\nYou \' ve used APA 7th referencing\nYou \' re within the word limit\nYou \' ve checked your Turnitin originality report and you \' re assuring us that what you submit is your work', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-08-18 00:00', '3000', '2312Annotated bibliography template_6051-6008 (1).docx_$_2312reference-guide.pdf_$_', '09-08-2023 14:46:24', 'student', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
