(1974, 1974, 'Academic Writing', 'CRITICAL ANALYSIS OF MARKETING CONCEPTS AND  THEIR APPLICATIONS', 'Assessment Guide: A3 Critical Analysis of Marketing Concepts and Their \nApplications (Individual)\nLearning Outcome 2: Critically analyse marketing concepts and their application.\nLearning Outcome 3: Analyse marketing activities driving product/service consumption.\n\nWord Count: 1,500 (+ or â€“ 10%)\nWhy should I complete this task?\nThis assessment provides you the opportunities to showcase your \nunderstanding of marketing concepts, and to apply your knowledge in real world \nenvironment.\nWhat do I have to do?\nYou will have a choice of ONE of the following topics: \nTHE MARKETING \nCONCEPT\nEXAMPLES/EVIDENCES (NOTE: PLEASE ONLY USE/ANALYSE \nTHE FOLLOWING BRANDS/EXAMPLES IN YOUR ASSESSMENT)\nBrand Loyalty Sport (all forms and Teams), 7 Eleven, Coca Cola, Mercedes, Qantas\nBrand Extension Virgin Group, Dyson, Google, Apple, Amazon.\nReseller Markets Woolworths, Bunnings, Amazon, Grays Online, Dell, Harvey Norman, \nColes, Pfizer, JB HiFi\nYou are to define, explain, compare, and analyse the assigned concept. \nFormal academic writing style is required and careful proof reading (spelling, grammar) is \nessential.\nThe recommended structure\nIntroduction: An overview of the marketing concept including recent developments \nand works on the topic.\nTheory in practice: in this section, you need to discuss the following:\nâ€¢ The relevance and limitations of the concept in the marketplace. Analyse the \nstrengths (minimum: three) and weaknesses (minimum three) of the concept \nwhen it is applied in real world environment.\n3\nâ€¢ Analysis of relevant examples/evidence: your lecturer will inform you about the \nrelevant examples/evidence for your assigned marketing concept on iLearn. \nFirst, you need to explain whether the examples/evidence hold well in the \nmarketplace or not. Minimum two examples/evidence MUST be discussed \nwhere the concept holds well in the marketplace and minimum two\nexamples/evidence when it does not. Then, provide explanations /reasons why \nit works (minimum three in total) and why it does not (minimum three in total).\nConclusion: Provide three practical recommendations for marketing managers as to\nhow they can/should apply the concept in their organisations successfully.A minimum\nof Five references (e.g., scholarly peer-reviewed journal papers, industry sources, \ntextbook, etc) must be included in this report. There is no \"ceiling\" regarding the \nnumber of references (only the \"floor\") but go for quality / credible references. Please \nsee the marking rubric.\nSome examples â€œscholarly peer-reviewed journal papersâ€ and â€œindustry sourcesâ€ and how to \nincorporate these references:\nâ€œScholarly peer-reviewed journal papersâ€ (or in short academic journals): You can cite these \nresources when you are making a theoretical / conceptual argument. In A3, the most \nrelevant sections where you should cite academic journals include:\nâ€¢ Introduction: When you are providing an overview of the marketing concept including\nrecent developments and works on the topic.\nâ€¢ Theory in practice, when you provide your justification â€œas why it (the marketing \nconcept) holds, or notâ€ in practice.\nâ€¢ Recommendation: When you need a theoretical argument to support the\nrecommendations you are making.\nAcademic journals that are most relevant to MKTG6096 are listed in the Unit Guide. To \naccess (download) the academic journal articles while you are outside the Uni, go to the \nMacquarie Library Website. The MQ library has multiple online support services if you \nneed any assistance. Please visit the Library website for more information.\nâ€œIndustry sourcesâ€ are most suitable when you are analysing some examples for how the \nmarketing concepts is applied in practice, and any industry trends including data and \nstatistics. Industry sources could include resources such as:\nâ€¢ Government / government agencies: Reports or information from the official \nwebsites of ABS, Australia Communications & Media Authority, ACCC etc.\nâ€¢ Industry Reports: Examples include IBIS World, Euromonitor (accessible via MQ\nLibrary).\nâ€¢ Industry publications such as: â€œTrend Watchingâ€, Marketing Magazine, B&T, \nAdNews etc.\nâ€¢ Other sources: Credible News websites, company websites etc\nâ€¢ It is impossible to provide an exhaustive list here but the above should give you \nsome ideas\n4\nFormat: Maximum 1500 words (+/-10%); 1.5 line- spaced; 12-point font. This limit includes \nany tables, diagrams and appendices but excludes reference list. \nAppendices are not recommended. \nExecutive summary and table of contents are NOT needed. \nBoth PDF and Word formats are fine. Mac Users: If you are using \"Pages\", please convert \nyour work to PDF before submission. \nYou can use sub-headings. All headings and sub-headings are included in your word count.\nPenalties will be applied for extra wordcount (10% of total available mark from total awarded mark \nfor every 100 extra words or part thereof).\nCover Page: Please include your name, student ID number, day/time of workshop, the title \nof the assessment, the marketing concept you have chosen, total word count (excluding \ncover page, table of contents and reference list). If not included, 5% penalty applies.\nReferencing style: In-text scholarly citations and reference list are required with consistent APA \nreferencing. Only APA 7\nth will be accepted.\nOnline Submission: An electronic copy is required to be uploaded to Turnitin by the due\ndate. No hardcopy submission is required.\nWhat other important information should I be aware of?\nLate submission\nLate submissions must also be submitted through Turnitin (please DO NOT submit via email).', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-09-23 00:00', '2499', '2312A3 Critical Analysis of Marketing Concepts Assessment Guide LC updated 22.08.2023 (1).pdf_$_', '06-09-2023 04:12:24', 'student', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
