(1988, 1988, 'Academic Writing', 'Case Study Report', 'Length: 2000-2500 words. You must remain in the range of this word count, there is no + or - 10% of the total for this assessment. Aim for somewhere between 2000 -2500 words, not including: references and the reference list; any tables/graphs/diagrams used; and any appendices. You are required to demonstrate an ability to keep within the word limit while still providing a comprehensive analysis of the case.\n\nDue date: See your assessment table for the due date\n\nAssessment criteria: Please see the marking rubric below\n\n\n\nSubmission methods: Via Turnitin\n\nFeedback provided: Yes\n\nBasic format (see further details below):\n\nYou may use a Table of Contents and/or Executive Summary if that assists in orienting your reader to your work (neither will count towards the word count and neither are compulsory).\nFont and spacing: Size 12 font (Arial or Times New Roman) and 1.0 or 1.5 line spacing.\nUse APA 7th referencing style â€“ check iLearn for details.\nYou must use a minimum of five (5) scholarly references in your report. You may use more, and also include non-academic sources.\n\nWhat is a case study report?\nA case study report is a formal piece of writing that brings together research and analysis of issues or challenges facing a company and proposes evidence-based recommendations to address them.\n\n\nOverview of our case study report\n\nA case study report targets your thinking, research, and analysis to a particular organisation.\n\nFocusing on a single case study in this way helps us to analyse what the positives and/or challenges that a specific organisation is facing. By applying relevant theories and frameworks, we can better understand why the organisation is experiencing those things, which can involve looking at not just what is happening within the organisation, but also what is happening in its external environment.\n\nYou will be exposed to topics in this unit that organisations are almost always and universally grappling with â€“ motivating staff, job design, flexible work, etc. Analysing a case organisation through the lens of at least two topics in this unit will help you develop best practice insights into effective workforce management.\n\n\n\nPurpose and aim of this assessment\n\nThe case study report will build your skills in research, critical thinking and analysis, and generating insights (recommendations) based on assessing the workforce management practices of a targeted organisation.\nWhere will you ever use these skills? Everywhere!\n\nDeveloping these general skills, and being able to apply them to a specific area, is likely something youâ€™ll be asked to do throughout your working life.\n\nOur case study report structure\nThe case study has four sections. Use headings in your report to differentiate each section.\n\nBackground - briefly identify your focal organisation and the general situation/context of your case study.\nKey Issues - identify the major problems/issues/positives - there may well be lots of problems or issues that could be explored in your case. Or, your organisation could be managing its people very well, so a lot of positives could be explored in your case. Here, you need to identify and justify what you will be focusing on and why. For example, does the organisation have poor staff satisfaction and high turnover (problems), or flexible work practices and good working conditions (positives). Just aim to focus on 2-3 key issues.\nAnalysis - this is relevant theory application - discuss and apply theories/concepts/ frameworks from at least 2 topics in this unit to help analyse the issues/problems/positives that you have identified.\nRecommendations - here, identify possible solutions/recommendations - given your analysis, identify and justify recommendation/s on what you think should be done differently (or continue to be done) in your case organisation.\n\nHow to start\n\nYou will identify an organisation that is of interest to you AND for which you are able to examine, through research, its work-related management strategies, practices, processes and outcomes and be able to analyse and assess these in relation to at least two topics discussed in the unit. If you \' re unsure of appropriate topics or would like to discuss your choices, contact your teaching team.\n\n\nStep 1: Decide on a company\nIdentify a case study organisation â€“ you choose! Make sure itâ€™s one you can get information on.\nPointers:\n\nYour case organisation can be in any sector, be of any size, and operate anywhere in the world. To research this company you will need to use general web searching and other Library databases that we \' ll discuss in the support workshop for this assessment. You generally will not find information about your company and its issues in academic sources (you will use those sources to support your analysis and recommendations sections), so general web searching for the first two steps is fine. Maybe your case organisation is where you currently work. Using a range of sources to learn more about your chosen company is a good idea.\n\nStep 2: Identify key issues\nWhat are the workforce/people management challenges in this company? What are the good things they are doing? REMEMBER â€“ you can analyse what they do well, what they do not so well, or both. Again - use web searching to find this information. Are there news stories, reports, job review sites, etc that can give you insights into how the company manages its people?\nPointers:\n\nREMEMBER â€“ this isnâ€™t a marketing report, or a general strategy report, or a finance report. You must focus on issues relevant to this unit and relevant to the topics in this unit.\nDonâ€™t identify too many issues/positives to analyse! Two or three is fine â€“ too many means you have little time (or words) for meaningful and insightful analysis.\nStep 3: Start writing!\nStart writing into the case study report sections (see above), bring in your research through referencing.\nRemember, the main sections of your case study report are: Background; Key Issues; Analysis; Recommendations (detailed above); and finally you will have a Reference List (where you use APA 7th style to identify all the sources you have referenced in the text of your report).\nFor your background section - this can be brief. Just orient the reader to your company. This is descriptive only, analysis is where the marks are! You still need to reference in the text of your report here - show us where you are getting this information from, it might be websites, news stories, company reports, etc.\nFor your key issues section - donâ€™t identify too many issues/positives to analyse. Two to three is fine â€“ too many means you have no time for meaningful and insightful analysis. This section is also succinct - just identify your key issues and explain them for us. Again, you need to be citing references here - otherwise we do not know how you know these are issues the company has. Again, you will probably use similar sources to those you use in your Background section.\nFor your analysis section - this is where you apply theory from our unit to the key issues you \' ve identified. For example, if one of your issues is about poor staff retention because of poor pay, can you apply a motivation theory to explain why that might demotivate staff and encourage them to leave? Or, if one of your key issues is about the sorts of tasks people do, can you apply a job design theory? The analysis section is also where you will particularly reference scholarly material to explain and help apply your chosen theories to your key issues. REMEMBER - intext referencing looks this ... Smith et al. \' s (2021) study suggests that the allocation of repetitive tasks to workers leads to little variety in the use of their skills, which contradicts one aspect of Hackman and Oldham \' s (1976) job characteristics model. Focus your attention (and words) on the analysis section. This section touches on every criterion you are marked on â€“ research, analysis, etc (see the case study report marking rubric).\nFor your recommendations section - these need to be targeted, succinct and evidence-based. They also need to link to your analysis. Add sources of evidence (references) to support what youâ€™re suggesting. Remember â€“ you are evidence-based practitioners in this unit, donâ€™t suggest a course of action and offer no justification for it.\nOther pointers:\n\nResearch (and its integration into the report) is a critical part of this assessment piece, meaning referencing is required. You must undertake research independently and draw on academic source material and integrate it into your report. You need to use at least 5 scholarly references (these include academic books, book chapters, journal articles). Other non-academic source material, e.g. published reports, are also acceptable but should not form the majority of your references. You need to assess and demonstrate the quality of the material you cite â€“ do not just rely on news stories, blogs, general websites, etc.\nYou can use Ulrichsweb in the University Library site to check if a source is academic or not\n\n\nMOST IMPORTANT POINTS \nYou have used at least 5 scholarly sources\nYou have analysed your case using at least 2 topics from this unit\nYou \' ve followed the report structure\nYou \' ve used APA 7th referencing\nYou \' re within the word limit\nYou \' ve checked your Turnitin originality report and you \' re assuring us that what you submit is your work', NULL, 'Masters', '[\"Case Studies\"]', NULL, '2023-09-29 00:00', '3000', '', '18-09-2023 15:45:47', 'student', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1989, 1989, 'Academic Writing', 'The role of data analytics in brand operations within the IT sector in India', '1. Write a dissertation using an acceptable academic style and structure.\n2. Apply relevant theories and concepts to the topic under investigation.\n3. Provide a coherent and structured argument that links the objectives of the\nwork, the findings, and the wider academic context.\n4. Defend a methodological approach to research.\n5. Critically evaluate primary and/or secondary data on a specific topic in order to\npresent well- substantiated findings using argument and evidence, drawing\nreasoned conclusions.\n6. Synthesise data from a wide variety of sources having due regard to issues of\ngeneralisability, validity and reliability, or other criteria for quality.\n7. Consider ethical issues when conducting research investigations, presenting\nfindings and drawing conclusions.\n8. Understand the limitations and weaknesses that can affect a research\ninvestigation and provide reasoned solutions in an attempt to mitigate such\nobstacles.\n9. Manage own time to achieve objectives over an extended period.', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2024-01-05 12:00', '35000', '1914Literature summary framework (1).pdf_$_1914Doing a literature review (University of Leicester) (1).pdf_$_1914Development of literature review grid (1) (2).docx_$_1914Dissertation formatting.pdf_$_1914BMGT7050_Feedback + Marking Criteria.pdf_$_1914BMGT7050 Module Handbook 2023-24_JanuaryCohort.pdf_$_', '21-09-2023 14:52:02', 'student', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
