(1997, 1997, 'Academic Writing', 'Global Trade and Economic Interdependence research paper', 'Abstract: 250 - 300 words approximately, summary of entire research paper (Purpose, Methodology, Findings, Any other important aspects of your Research Paper)\nKeywords: Important repeatedly used words (4 â€“ 6 words)\nIntroduction- Author needs to establish the context of the problem. Mention the aspect / problem / issue / opportunity / challenge, which you have considered for your paper, why it is important to address the problem. Define the concept, present the scenario of the problem taking into account past and present situations and also highlight consequences and close introduction by stating clear purpose behind doing this research. \n1. 500-800 words (one page approximately)\n2. Divide your introduction into 4-5 paragraphs.\nExample- Impact of COVID-19 on the insurance sector in India-\nparagraphs can be the background of COVID, insurance sector, relationship between COVID and Insurance and finally the purpose of the study \n3. Each paragraph should have in-text citation in APA format.\nReview of Literature: Take reference from previously published research papers, in the similar area and try to highlight that the issue has not been addressed so far, irrespective of many attempts that have happened in the past. And then clearly mention what are your specific research objectives. \n1. Download at least 8 - 10 research papers from the area of research (Both direct and indirect topics related to research)\nExample- Since COVID-19 is a relatively new topic, you can use relevant information from previous pandemics such as Ebola, SARS, etc\n2. Make use of the Research Paper Reviews to summarize your ROL (title of study, how did they perform the study and the results of the study)\n3. Each study should be summarized in one paragraph. NO COPY-PASTE allowed, read the study and write in your own words. No Numbering of paragraphs.\n4. Always mention the source of the information with in-text citations (between paragraphs) and references (end of the paper)\n(Use APA format only for in-text citations) \nResearch Methodology\nOne paragraph (approx 300 words)\nPoints to be mentioned in Research Methodology Section \nFirst tell about the approach of the study (Whether Quantitative or Qualitative)\nDate Source (Primary or Secondary or Both)\nIf it is Primary (Include Details about Questionnaire, Location of Study, Details of Respondents, Sample Size, Time Period, etc.)\nIf Secondary Data (Already Published authentic Data can be taken from websites, books, journals, reports, news articles, govt. / private research data, time period for which data has been considered, location of literature taken, no. of articles reviewed, keywords searched to gather information), names of any prominent websites or reports etc.\nApproach of data analysis \nAnalysis and Discussion (Approximately two pages)\nFor secondary data- use websites, charts, graphs, info from journal etc (mention source- in text citation and references)\nWrite 3-4 sentences for each picture (no hyperlinks are allowed)\nFor primary data- use questionnaire\nConclusion (300-350 words)\nFindings of study, results, implication, scope of study etc\nReferences (Atleast 15 in total, which you have used in the paper)\nWrite all references in APA format (Alphabetical order) \nUse Microsoft Word for referencing each source. \n', NULL, 'Bachelors', '[\"Research Paper\"]', NULL, '2023-10-05 12:00', '1000', '2068Research Paper Writing.pdf_$_', '03-10-2023 12:04:08', 'student', '16', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
(1998, 1998, 'Academic Writing', 'Business Intelligence ', 'The central theme in MG5601 is to study theories and practices for Business Intelligence. Methods and theories have been introduced in this module to help you understand the relevant issues. This coursework is designed to help you develop your understandings of the theories and practices in business intelligence and apply the related techniques for resolving problems. The assessment/coursework provide opportunities to  \r\n \r\nâ€¢	To demonstrate a knowledge of the business intelligence application \r\nâ€¢	To show an understanding of the material taught and related theory and techniques on the module â€¢ 	To apply theory and material taught on course in practice \r\nâ€¢	To demonstrate team work  \r\n \r\n \r\nCoursework title: Developing a business intelligence system for decision support for a real-life business \r\n \r\nDescription of the Assessment: The tasks and assessment for this coursework involves one part: (1) Individual Essay (100% weight). \r\n \r\n(1) Individual Essay (100%): \r\nWrite an essay of up to 3000 words (inclusive of references, tables, figure captions, footnotes, and endnotes). All submission will be checked for inclusion of any AI-generated content without appropriate acknowledgment. \r\n \r\nThe essay presents the design of a business intelligence system for decision support for a real-life business, based on common assumptions for its operations, including: \r\n \r\nâ€¢	Demonstrate essential business processes and data flow; \r\nâ€¢	Discuss a few real-life challenges that the business face;      \r\nâ€¢	Discuss methods or techniques of business intelligence analysis (such as statistical/regression/time series/data mining) can be applied to support business decision making. Examples can be presented for illustration. \r\n \r\n \r\nThe following aspects can be considered: \r\n \r\nâ€¢	Purpose, objectives and background to the business  \r\nâ€¢	Business offering (product and/or service) \r\nâ€¢	Features of new functions, illustration/demonstration can be considered \r\nâ€¢	Business strategy (including business model and research & development) \r\nâ€¢	Operational strategy (including principal risks and problems, resource requirements and staff core competencies) \r\n \r\nHere are some basic questions your pitch should try to answer: \r\nâž¢	What is innovative about the business idea? \r\nâž¢	What business analytics approach is used to implement it? \r\nâž¢	Who is the customer?  \r\nâž¢	What customer need does the product/service meet? \r\nâž¢	What are the competitive advantages of the new product/service?  \r\n', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-11-23 17:49', '6000', '3893MG5601 Coursework Brief 2023-24.pdf_$_', '03-10-2023 22:20:18', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
