(2014, 2014, 'Academic Writing', 'principles of business', 'Compile a review report (approximately 1000-1200 words) that:\nâ€¢ describes the purpose, importance and role of business analytics in creating strategic value and\ncompetitive advantage.\nâ€¢ defines the analytics ecosystem (descriptive, predictive, prescriptive and exploratory analytics)\nand illustrates how they are adopted by various industries in their key business functions ranging\nfrom strategy, marketing and sales, operations (production), customer services, etc.\nâ€¢ illustrates how the data analytics lifecycle can be implemented and in particular, challenges in\nimplementing business analytics and artificial intelligence in an agile business environment.\nâ€¢ demonstrates how Big Tech (Facebook, Apple, Microsoft, Google and Amazon) are leveraging\nanalytics and artificial intelligence to generate organisational value for internal and external\nstakeholders\nIdentify key descriptive statistics of the property price found in the first\ndataset given\n: Perform linear correlation analysis using Excel on the second dataset given\n', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-10-15 00:00', '5700', '7277BUS5PB-Workshop 1 Tools Setup.pdf_$_7277BUS5PB-Workshop 1 Tools Setup (1).pdf_$_7277BUS5PB-Lecture10.pdf_$_7277BUS5PB-Lecture7.pdf_$_7277BUS5PB-Lecture6.pdf_$_7277BUS5PB-Assignment2-S2-2023.pdf_$_', '14-10-2023 14:59:39', 'student', NULL, NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2015, 2015, 'Academic Writing', 'principles of business analytics', 'PropertyExperts, a recently formed real estate buyerâ€™s advocacy firm is looking to enter the Melbourne\nproperty market. The senior management is keen to capitalise on large volumes of historical real estate\ndata to generate insights into various aspects of this booming market. The firm has acquired a relatively\nlarge dataset of real estate sales in Melbourne, over 2000 records from 2019. You have been hired as a\nbusiness analyst to demonstrate the application of descriptive analytics techniques using Excel, in the\ncontext of real estate buyerâ€™s advocacy. You will be working on two sanitised subsets of data.\nâ€¢ Task 2.1 (8 marks): Identify key descriptive statistics of the property price found in the first\ndataset given \nPerform linear correlation analysis using Excel on the second dataset given\n', NULL, 'Masters', '[\"Report Writing\",\"Literature Review\"]', NULL, '2023-10-15 00:00', '5700', '4501BUS5PB-Workshop 1 Tools Setup.pdf_$_4501BUS5PB-Workshop 1 Tools Setup (1).pdf_$_4501BUS5PB-Lecture10.pdf_$_4501BUS5PB-Lecture7.pdf_$_4501BUS5PB-Lecture6.pdf_$_4501BUS5PB-Assignment2-S2-2023.pdf_$_', '14-10-2023 15:14:51', 'student', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2021, 2021, 'Programming', 'COMP1005 Assignment simGarden ', 'You will be simulating a cross-section of a garden â€“ including soil and sky. The simulation will include ants and butterflies moving through the above and below-ground space. The simulation will include the ants (all one size, and can dig tunnels), butterflies (various sizes and colours), terrain (soil surface and sub-surface tunnels), plants and food sources, and hazards (such as rain/water). This will be plotted as a side-view of the activities. The model can be assumed flat/2-D â€“ there are bonus marks for 3D, but not required.\nWe will provide some sample code to start this assignment, and additional code showing a range of approaches to assignments from previous semesters. For the assignment, you will develop code to model the ships using objects, and to add features to the simulation (e.g. more interaction between animals, graphics). Your task is to extend the code and then showcase your simulation, varying the input parameters, to show how they impact the overall simulation.', NULL, 'Bachelors', '[\"Software\"]', NULL, '2023-10-18 12:00', '1800', '6540yebbleLife_base.py_$_6540swampLife.py_$_6540pasciroExample(1).py_$_65402023 S2 FOP Assignment - v1.01.pdf_$_', '17-10-2023 13:05:38', 'student', '14', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
