(2030, 2030, 'Academic Writing', 'Issues impacting aviation industry', 'Identify the operational aspects necessary to establish a new airline.\n\nÂ· Consider two recent geopolitical influences (e.g. Russia-Ukraine war), and analyse how these would affect your identified operational aspects and the establishment of the new airline.\n\nÂ· Provide recommendations for the best way to mitigate the influence of similar geopolitical events for the airline moving forward.\n\nÂ· Ensure you fully research both the operational aspects facing airlines and the relevant geopolitical issues. Use current case studies (e.g. Bonza) and relevant literature to support your analysis.', NULL, 'Bachelors', '[\"Report Writing\"]', NULL, '2023-10-29 12:00', '5000', '5337SCA Report Writing Exemplar v2 (1).pdf_$_5337Assignment 1.docx_$_', '24-10-2023 16:58:04', 'student', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2031, 2031, 'Academic Writing', 'Individual critical reflection on the Impact of global issues on my aviation career prospects.', 'This assessment is a 1500-word critical reflective essay investigating the global issues examined over the course of this unit, their impact on the global aviation industry, and the impact you expect them to have on your future career. You will need to:\n\nÂ· Identify the macro environmental issues, together with the resulting micro environmental issues, which are currently affecting the aviation industry. Include Covid-19 as one of the major disrupters to the industry.\n\nÂ· Discuss the current impact of these issues on the global aviation industry, and analyse how they are likely to change the industry in future. Use current examples from scholarly literature to support your analysis.\n\nÂ· Reflect on how these current and future impacts are likely to impact your future career in the aviation industry.', NULL, 'Bachelors', '[\"Report Writing\"]', NULL, '2023-10-29 00:00', '4998', '5337Assignment 2.docx_$_', '24-10-2023 16:59:26', 'student', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
