(2033, 2033, 'Academic Writing', 'Digital marketing - 3000 words', 'TARGET AUDIENCE (Choose one (1) target audience only) \n\n5.1 Demographics, Psychographics, Behavioural and Geographic characteristics: What are the identifying characteristics of your target audience? Consider age group, gender, where they live, singles/families/couples etc. What motivates them? What are their interests? What will appeal to them? How do they use social media? Support with well researched information. (approx 400-500 words)\n\n5.2 Persona Development: Based on the information you had outlined in section 5.1, use the Persona Template provided in class (and in the attached Excel file) to develop one (1) persona for the â€˜typicalâ€™ target audience for this campaign. This section should be one (1) page in length, well researched and supported with references.\n\n6.0 CAMPAIGN PURPOSE, OBJECTIVES & KEY MESSAGE (approx 600 words)\n\n6.1 Campaign Purpose: What is the primary purpose/ aim/ outcome sought by this campaign? Tip: how will this campaign align with the business strategy and business objectives for this brand?\n\n6.2 Objectives: What are the objectives of the campaign? These must be in the S-M-A-R-T format. Tip: refer to lecture notes on setting SMART objectives.\n\n6.3 Key Message: What is the key message that this campaign will communicate to the target audience? How will you position the brand â€˜top of mindâ€™ for your audience? What is the hashtag for this campaign? Briefly outline the message and describe in some detail the reasoning behind it.\n\n7.0     SOCIAL MEDIA MARKETING STRATEGY: CHANNELS & TIMELINE (approx 700-800 words)\n\nIdentify the key social media marketing platforms/channels which you propose to use for this campaign and explain why you recommend these platforms/channels (Tip: these need to align with your target audience and your objectives).\nUse the SMM Schedule template (provided in the Excel file) to develop a schedule showing social media channels and dates for this campaign.\nIncorporate paid, organic and company-owned social media activity.\nExplain your strategy in detail and support your strategy with researched insights.\n8.0    CONCLUSION (approx 100 words)\n\nA clear and concise conclusion, summarising the main points of the report should be provided. This is your last opportunity within your report to convince this brand that yours is the winning campaign.\n9.0   REFERENCE LIST (not included in word count)\n\nPlease reference all your sources thoroughly so that you cannot be accused of plagiarism. If you are unsure about the referencing process then you must seek some advice from the ECU Library Student Services and the ECU Referencing Guide.\nA minimum of 15 references (including a min. 5 academic sources) must be cited to pass this assessment.\nAll references must be cited (in-text and in the Reference List) in APA format and references should only appear in the Reference List if they are cited in the body of the report.\nTo achieve a high grade in this assessment, a range of references from credible sources must be sourced. This should include a variety of academic literature, industry and media sources.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-10-27 16:00', '7000', '7771Group Project Assignment 2 Social Media Marketing Campaign Plan Aliasger Zakir 10562394 Delano Chiaberta 10537164.docx_$_', '25-10-2023 16:42:19', 'team_member_16', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
