(2035, 2035, 'Academic Writing', '1500 words reflective assignment   Assignment brief + Vdo and material on spatium simulation exercise on moodle  +  1) Make in 1st person 2) make it section wise  Like - Intro (to have very short introduction of spatium simulation exercise then the event as a whole)  Then main Body paras (explaining significance; being personally critical; use only 2 or max 3 aspects which were more important specific and relevant.  Then conclusion ( like what would you do differently if done again ; analysis, interpretation and evaluation)  3) not more references as it is based on own experience but 3-5 references to give evidence or prove points and show connectionsâ€¦   4) 2-3 points or instances or events of soft skills which shapes the reflection or the reflective write up â€¦   5) can include critical thinking, conflict resolution, dependability , leadership, , communication, active listening, time management, budget, creativity, positive attitude, flexibility, decision making, organisation, mediation or division of work etc type of skills', 'The SPATIUM  exercise was a group task. We were 5 in the team. It was based on gaming type of format. There were set question bank given and there were answers given by the officials or different stakeholders as well.\nContractors, consultants, bankers, investors, directors, etc all were in the system. In given time we had to complete the construction of the project. Within the said budget.\nâ€¢	Budgetary & Finance allocation\nâ€¢	Within time limit of 24 months\nâ€¢	Planning, Designing, contractors, vendors.\nâ€¢	Bank loan process\nâ€¢	Different stakeholder handlings\nâ€¢	Soft Skills\nâ€¢	Decision Making\nâ€¢	Team Dynamics \nâ€¢	Critical Thinking\nâ€¢	Over coming technical Glitches \nWriter can use below link to understand the project better for writeup.\nhttps://www.prendo.com/simulation-workshops/spatium/\ngenerally the reflective write up â€¦on the basis of Spatium simulation â€¦ on basis of 2-3 aspects and the soft skills involvedâ€¦.', NULL, 'Masters', '[\"Essay Writing\",\"Case Studies\"]', NULL, '2023-10-27 16:00', '4200', '', '25-10-2023 16:47:02', 'team_member_16', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
