(2037, 2037, 'Academic Writing', 'Develop a new IMC Campaign Strategy and Costed Media Schedule for the Blenheim Palace Adventure Play Experience Campaign for  April 2024 to March 2025', 'Each student will work individually on this LIVE BRIEF. Over the following weeks through your homework, lectures, and seminar exercises you will apply key principles of brand and marketing communications theory to help create a new Integrated Marketing Communications (IMC) campaign strategy and costed media plan for Blenheim Palaceâ€™s Adventure Play Experience. Each student will submit a written report based on their reading, research, and analysis. Critically apply IMC principles, theories and frameworks from the lectures, seminars, and your reading. You are also expected to develop a creative idea for your campaign that is based on your analysis of the brand and the primary target audience. The report format and assessment criteria are provided below. You will write an individual report based on your work as outlined above. The individual report should specify a new campaign idea and IMC STRATEGY for Blenheim Palace. Your campaign will be launched in the UK in April 2024.\n\n\nItâ€™s time to meet your client Blenheim Palace is home to the Duke of Marlborough and is one of the most popular heritage attractions in the UK. With the opportunity to experience the beauty of one of Britainâ€™s Greatest Palaces, over 300 years of history including the birthplace of Winston Churchill, and a landscape that offers some of the finest views in England, visitors come from all around the UK and from overseas. Paying visitors provide revenue which is essential to the upkeep and continuous restoration of the Palace and Park, preserving its cultural legacy for generations to come. For that reason, one of the strategic goals of Blenheim is to grow total paying visitors to more than 750,000. Pre-pandemic, total paying visitors had grown to c. 600,000 and Blenheim Palace was on-course to achieving this result. Of course, the disruption of the pandemic interrupted this progress, but in the year Apr â€™22 to Mar â€™23, numbers had returned to these pre-pandemic levels. [Note that published visitor numbers here include approx. 200,000 non-paying visits â€“ which reflects the Annual Pass ticket that Blenheim offer, allowing repeat visits over the year free of charge, which many local visitors choose to buy.] To help focus the Blenheim Palace marketing strategy, Palace visitors have been categorised into segments â€“ based on motivational characteristics. Regular visitor surveys provide data on the ratio of visitors in these segments (see Exhibit 1). In addition, web traffic analysis gives an insight into the geographical spread of all people purchasing tickets and consuming content on the www.blenheimpalace.com site (see Exhibit 2). Based on this study, it is also known that The Cotswolds â€“ the beautiful countryside within which the Palace is nestled â€“ attracts seven million day visits and 1.8 million staying visits annually. These holiday-makers and UK staycationers could represent one market segment that could be further developed.\n\n\n\nThe Adventure Play experience There are a number of fun things for families and children to enjoy at Blenheim Palace, and the Christmas Lights event is extremely popular. Nevertheless, from the visitor motivational analysis, it is estimated that families who visit for â€œFun for Childrenâ€ reasons represent only 5% of annual paying visitors, in the year Apr â€˜22 to Mar â€™23. To invest further in the appeal to this â€œFun for Childrenâ€ segment, and so grow the total number of paying visitors, The Adventure Play experience was opened in Apr â€™23, initially with a lowlevel of marketing support while the new experienceâ€™s appeal for regular visitors could be tested and benchmarked. Exhibit 1: Motivational Segments for FY Apr â€˜22 to Mar â€™23 (ALL BLENHEIM PALACE VISITORS) Segment name Motivation description Estimated % of Paying Visitors â€œTicking the Boxâ€ Typically coming for a one-off visit, which adds to their repertoire of â€˜must-seeâ€™ destinations 32% â€œSpecial Eventsâ€ May have visited before, now returning for a temporary special exhibition, either historically-themed, or possibly contemporary art, or a music / theatre event. 18% â€œBroadening Horizonsâ€ Interested in expanding their knowledge, will often choose guided tours and use the experience as an educational opportunity. 12% â€œFun for Childrenâ€ With a light touch of cultural enrichment, the visit provides space to play and entertaining places for kidsâ€™ imaginations to run wild. 5% â€œStroll and Chatâ€ A fresh-air and beautiful palatial place to wander and meet with friends for a social, wellbeing â€“ and possibly dining â€“ experience. 25% â€œAdventure Seekersâ€ Here for an adult â€˜playgroundâ€™ â€“ somewhere to cycle, run or walk-to, and roam around for a gently thrilling day out.\n\n\n\nExhibit 2: Geographical Spread of UK Visitors, based on online ticket purchases (FOR ALL BLENHEIM PALACE VISITORS) Area / region % Greater London 39% Oxford and Oxfordshire 10% Other â€“ within 2.5hrs 17% Other â€“ beyond 2.5hrs 34% The green bounded area represents an area of 2.5hrs drive to / from Blenheim Palace.\n\n\n\n\nThe Task Overall Marketing Objective Based on numbers so far, in the current year, it is projected that The Adventure Play experience will have attracted c. 85,000 new paying visitors, with an initial Â£100K level of â€˜new productâ€™ marketing support targeted to the local Oxford area. Now for the FY Apr â€™24 to â€˜Mar 25 we want to develop a dedicated marketing communications plan, with the overall marketing objective to attract 200,000 paying visitors who will have come for the â€œFun for Childrenâ€ motive, with the appeal of The Adventure Play experience central to their reason for visiting.\n\n\n\n\nAudiences Adventure Play is attractive to new audience sub-segments, who might not previously have seen Blenheim Palace as relevant to them. An example of those sub-segments â€“ as well as other insights â€“ are here. [there may be other audience targets you identify, beyond these.] Competition It is a competitive space with â€˜adventurous playâ€™ options for children that include Go Ape and Cotswold Wildlife Park. Although it is also possible that other local attractions focused on children, like the Story Museum, in Oxford, and the â€˜Harry Potterâ€™ tours, might be complementary to a visit to the Blenheim Palace Adventure Play. Channels Blenheim Palace marketing communications have taken a multi-channel approach, including: ï‚· OOH / outdoor advertising ï‚· Radio advertising ï‚· Social media paid-for advertising (Facebook, Youtube etc) ï‚· PR in national, local and lifestyle media and broadcast media ï‚· Influencer marketing ï‚· Co-branding / licensed arrangements (e.g. with â€˜Paddington bearâ€™) ï‚· PPC / Google Ads For the purposes of this brief, you may consider some of these channels, as well as any other communications channel that you think may help you achieve the overall marketing objective. Challenge The challenge is to develop an IMC Campaign Strategy and Costed Media Schedule for Apr â€™24 to Mar â€™25, to achieve the overall marketing objective, that considers: ï‚· Geographical reach (and the scale and frequency of that reach) ï‚· Mix of channels ï‚· Tactics and integration within those channels ï‚· The weighting of audience segments / sub-segments for the communications media spend Inevitably, pricing and promotional offers will form part of the marketing tactics, but for this plan we want you to disregard these and focus on the IMC Campaign Strategy. Budget The dedicated annual budget for Adventure Play Marcomms for the FY 24/25 is Â£200,000.\n\n\n\n\nYou need to include in your report the following: ï‚· A concise summary of the Blenheim Palace brand, considering their vision, mission, and values ï‚· Based on secondary data, an analysis of key competitors, market trends, and the target audience(s) of the Blenheim Palace Adventure Play ï‚· Based on your analysis, develop and justify a big communications idea (BCI) ï‚· Fully explain and justify your marketing objective, marketing communications objectives, targeting, positioning, IMC strategy and tactics to be used ï‚· A fully-costed media schedule [estimated costs are sufficient]\n\n\nPlease note that general production costs for your campaign do not need to be specified within the report unless you are planning an activity such as organising an event. If in any doubt, please check with the module/seminar leader.\n\n\n\n\nIn your report, present only one central campaign message. Critically justify how the plan will integrate a mix of at least 5 marketing communications channels/platforms (traditional and digital). Suggest concrete ways in which the campaign will meet its specific IMC objectives to your fully defined target audience.\n\n\n\n\nIMPORTANT You are NOT allowed to contact Blenheim Palace or Bottle PR or any of their competitors for the purpose of this coursework. Also, you are NOT allowed to contact any of Blenheim Palaceâ€™s visitors/clients/customers. All inquiries regarding Blenheim Palace and The Adventure Play must go via the module leader. Breaking this rule may lead to a referral to the academic conduct officer and might lead to a deduction of marks. Furthermore, you are required to keep this live client project completely confidential. None of the client-related information provided during this module should be shared with anybody else who is not enrolled on this module. Additionally, you should not share any of the ideas/content you develop for this work with anybody else. Furthermore, where students use generative artificial intelligence (AI) and AI-assisted technologies in the writing process, students should only use these technologies to improve readability and language. Students should not use AI tools to seek or select resources, draw insights from materials collected (except when instructed for segmentation analysis) or to assist in writing any parts of the assignments. If in any doubt please check with the module leader.', NULL, 'Masters', '[\"Report Writing\",\"Essay Writing\"]', NULL, '2023-12-14 01:00', '-2', '5097coursework brief brand and marketing management .pdf_$_', '26-10-2023 02:16:06', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2038, 2038, 'Academic Writing', 'Data Analysis', 'report should consist of sections with the following headings, which should always be presented in this order:\n1.	Introduction\n2.	Methods\n3.	Results\n4.	Discussion\n5.	References\n6.	Appendices\n\nDevelop a series of hypotheses that can be tested using the different types of statistical tests. â€¢	Select two categorical variables that are of interest to you and perform 5 appropriate univariate statistical test (out of the 5 tests - 2 should be chi square tests and 1 T-Test)', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-07 12:00', '1111', '8964Data Analysis Excel sheet.sav_$_8964DA ASSIGNMENT Instructions.docx_$_', '26-10-2023 16:00:08', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
