(2040, 2040, 'Academic Writing', 'Reflective Journal', 'Length: 2000 words (+ or - 10%). Not including: references and the reference list; any tables/graphs/diagrams used; and any appendices. You are required to demonstrate an ability to keep within the word limit while still providing a comprehensive reflection.\n\nDue date: See your assessment table for the due date\n\nte in first person for this piece - it is a set of personal reflections.\n\nWhat is a reflective journal?\nReflective learning journal writing is different from other forms of academic writing. It is a piece of flexible, personal, semi-informal writing. Reflective writing requires that you think deeply and write about a learning experience. This involves writing about:\n\nWhat happened (positive and negative).\nWhy it happened, what it means, how successful it was.\nWhat you (personally) learned from the experience.\nWhen you are writing your reflective piece (and pieces of it over the course of this unit), I generally suggest following the DIEP structure outlined below, in conjunction with thinking about the above questions.\n\nOverview of our reflective journal\n\n \' We do not learn from experience...we learn from reflecting on experience. \'  John Dewey\n\nResearch shows us that one of the best ways to apply what we learn in places like university is to explicitly and critically reflect on what it all means for us in our personal and professional lives. Critical reflection is not just description, it is a hugely important skill in the workplace. That is, to be able to look back on a project you \' ve done, a particular piece of work you \' ve completed, a meeting you facilitated, or a difficult discussion you had and ask yourself questions like  \' what did I learn from this? \' ,  \' why did things go well/not well? \' ,  \' what can I do differently next time? \' , etc.\n\nFor our reflective piece you will go even further. You will be exposed to some really exciting and cutting-edge management topics in this unit (we hope you agree!). This reflective journal is about you identifying those topics that resonate most with you, explaining why they do, and then critically reflecting on how these topics (by integrating your own research on them) are developing you as a management practitioner and leader now and into the future.\n\n\nPurpose and aim of this assessment\n\nThe purpose of this assessment is to challenge you to critically and deeply think about how your learnings in this unit are developing your knowledge and skills around the nature of work and your ability to lead and manage people in organisations. More broadly, this assessment also asks you to reflect on how these learnings are contributing to your professional and personal development.\n\nThe aim is to make you an active and engaged participant in your learning, continually reflecting on how and why your learning is relevant to your interactions in the wider world, not matter what sector or capacity those interactions occur in. In this assessment you will construct a reflective journal that identifies your learning and development over the course of this unit, identifies which areas are most important to you and why, and demonstrates your critical thinking, analysis and questioning skills to link what you are learning to your development as a management practitioner and leader.\n\nOur reflective journal structure\nThe DIEP structure was developed through RMIT in Melbourne and is a helpful way to structure your reflective thinking:\n\nDescribe (objectively what you learned)\nInterpret (the insight)\nEvaluate (what you have learned)\nPlan (how this learning will be applied in practice)\nRemember, reflective journals are flexible pieces of assessment - don \' t feel overly constrained by structure, but remember that you need to be reflecting critically (not just describing things) and incorporating theory (i.e., discussing the theory and frameworks from the unit), and evidence (references).\n\nThe DIEP structure is a starting point - adapt it as you need to, but ensure you cover the key areas it identifies.\n\nHow to start\n\nSee guidance on using the DIEP reflective writing process here, including example reflections -> https://emedia.rmit.edu.au/learninglab/content/writing-academic-reflection\nEach week, think about whether a module and its related activities particularly interested you. Did something make you stop and think â€˜hey that helps explain something Iâ€™ve experienced!â€™. Or did it make you think more deeply about an experience youâ€™ve had, a news story youâ€™ve read, or something youâ€™d like to do in the future? Or did something frustrate you or was there something you didn \' t like - this is ok too! Note these points down â€“ they are the start of a written reflection\nDo further research â€“ what more can you learn about this topic since it has piqued your interest? Draw from materials in the unit, but also your own wider research.\nThe best way to capture your reflections is IN THAT MOMENT! Take notes, even dot points, as you reflect on what youâ€™re learning. These seeds will develop into your reflective journal, but donâ€™t lose the seeds because you didnâ€™t note them down!\nBuild your reflective writing using the DIEP process.\nMOST IMPORTANT POINTS\nYou have used at least 5 scholarly sources\nYou \' ve been guided by the DIEP structure\nYou \' ve used APA 7th referencing\nYou \' re within the word limit\nYou \' ve checked your Turnitin originality report and you \' re assuring us that what you submit is your work\n', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-02 00:00', '3000', '', '28-10-2023 13:00:18', 'student', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
