(2061, 2061, 'Academic Writing', 'Question 1: Analysing a commercial   The purpose of this assessment is to give you an opportunity to apply the consumer behaviour principles and theories discussed in the module and the corresponding chapters in the textbook to evaluate an actual marketing commercial. Students will choose one of the five possible commercials and analyse the different consumer behaviour aspects that contribute to the commercialâ€™s (lack of) success.   Please choose one of the five commercials and analyse the use of (some of) the theories and principles of consumer behaviour (e.g., Motivation, ability, & opportunity; Exposure, attention, & perception; Categorizing & comprehending information; Forming & changing attitudes; Forming & retrieving memories; The decision-making process; Psychographics; Marketing, ethics, and social Responsibility):   Commercial #1 (Fiat 500X): https://www.youtube.com/watch?v=kCM2X9ToLlg Commercial #2 (Direct TV): https://www.youtube.com/watch?v=4kfVpVpw7Uo Commercial #3 (Berlitz): https://www.youtube.com/watch?v=xZ9nvYCDUUw Commercial #4 (Amazon Prime): https://www.youtube.com/watch?v=r6XKV1RSQOY Commercial #5 (BMW): https://www.youtube.com/watch?v=ACMHwzy_Xzk', 'This assignment consists of one question. Your answer should be no more than 2500 words (including everything except the References/Works Cited/Bibliography). The Individual Final Project is due on 22nd December, 15:00h, and needs to be uploaded on QMplus. Your answers will be graded based on the following criteria:\n \nâ€¢ Relevance and correctness of information used\nâ€¢ How well is this information integrated\nâ€¢ Extend of in-depth analysis\nâ€¢ Evidence of learning from lectures, seminars, and required readings\nâ€¢ How well structured and balanced is the answer\nâ€¢ Appropriateness of examples given', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-12-15 00:00', '50000', '', '05-11-2023 02:41:46', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL,