(2068, 2068, 'Academic Writing', 'How and why may inequality and discrimination at work affect performance? Critically discuss this question.', ' Assessment Instructions\n\n\n\nEssay formatting guidelines \nThe essay is to be of length not exceeding 1,800 words, including footnotes, but excluding any contentsâ€™ page and appendices/annexes/reference lists. It should be\n\na)         Submitted via Turnitin in A4 format;\n\nb)         Font: Times New Roman, Size 12;\n\nc)         Line spacing: 1.5;\n\nPlease reference throughout and provide a full reference list at the end according to the Harvard referencing system.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-11-11 00:00', '3600', '9406ass8.pdf_$_9406ass7.pdf_$_9406ass6.pdf_$_9406ass5 .pdf_$_9406ass4.pdf_$_9406ass3 .docx_$_9406ass2 .pdf_$_9406ass1 .pdf_$_', '05-11-2023 19:14:00', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2069, 2069, 'Academic Writing', 'CRM Plan of Costa Coffee UK', 'Every student has given their own data set to use in some of the excel files and individual industry. Have to make the crm plan according to that. I \' ll provide all the data set and dataset generator and excel files. \n\nThere is one individual assignment, a CRM Plan of 4,000 words which is worth\n100% of the module mark. You must research secondary data about a brand of\nyour choice, apply the theory, analyse and evaluate the results of the CRM and\nanalytics models and frameworks discussed in the lectures and seminars by\nfollowing the template provided here below which provides a clear structure for the\nCRM plan and the models and theories to use. The CRM plan will be based on a\nlogical sequence of Application, Analysis and Evaluation of frameworks in order\nto address areas of potential improvement and Creation of solutions to possible\nthreats in the chosen case (please see Bloom taxonomy of learning).\nAt the beginning of the module each student will be assigned to one industry/sector\nand will have to choose one Brand/Firm/Organisation (possibly different from their\nclassmates) that operates within the assigned industry/sector and will research and\nwork during the module activities on that Brand/Firm/Organisation both individually\nand as a group. Students are assigned to ONE of the following four industries/\nsectors (see Mintel reports in the following pages):\n- Sustainability in Travel - UK â€“ 2023\n- Sustainability in Foodservice - UK â€“ 2023\n- Fashion and Sustainability - UK â€“ 2023\n- Sustainability in Technology - UK â€“ 2023\nIf students want to change the assigned Industry it must be agreed with their\nSeminar Leader before week 3, which is also the latest deadline for choosing the\nindividual Brand/Firm/Organisation.\nn the Summative assessment students will analyse in detail the\nBrand/Firm/Organisation of their choice following the provided template (see The\nSummative Assessment structure).\nThe industries/sectors are presented with a link to a Mintel report (in the following\npages), students are supposed to:\n1. Read their assigned industry/sectorâ€™s Mintel report.\n2. Download the relevant Databook and work on those data.\n3. Look into Market, Consumer and Brand/companies details so that a good\nBrand/Firm/Organisation for their assessment can be chosen.\n4. Summarise the industry/sector overall state and how the chosen Brand/Firm/\nOrganisation fits into the industry.\n5. Research for further data, brand case studies in order to apply the theories learnt\nin the module to your specific Brand/Firm/Organisation.\nOther important sources of data and information\na. OBBS Library for journals and academic articles,\nb. Databases: Mintel, MarketLine, IBISWorld, Passport, Statista, WARC â€“ all\naccessible for free via the library website\nhttps://www.brookes.ac.uk/library/resources-and-services/course-resourcehelp/business/how-to-use-industry-markets-and-consumer-research\nc. Use Brandwatch to research your topic and specific brands, this tool is free for\nOBBS students and is a powerful first class marketing analytics research platform.\nd. There are many open access databases available, for example (but not limited to thisâ€¦):\nhttps://ckan.publishing.service.gov.uk/dataset/\nsome SAGE publication accessible with OBBS access\nBrand/Firm/Organisation within the\nassigned sector [ you work on that one!]\nassigned industry/sector\nfour industries/sectors\n(Mintel reports)\n16\nPostgraduate Module Handbook 2023-24\nThe Summative Assessment structure\nThe student is individually requested to develop a 4000-word CRM plan with the\nfollowing content sequence template:', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-29 00:00', '7000', '9632MARK7002 Module Handbook_23-24 R03_Moderated.pdf_$_', '05-11-2023 22:46:29', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2070, 2070, 'Academic Writing', 'Traditional costing techniques', 'Main Question - Discuss traditional costing techniques, such as absorption, standard and marginal costing. Provide definitions, outline the methods, give some examples, compare/contrast with each other.\n\nSome of the key points to be covered which the lecturer discussed in the workshop â€“\n\nWhich costing is superior or suitable (It depends on the purpose). How do the methods vary from each other? Provide the difference between the methods.\n\nWrite a 250 words essay excluding references - Harvard style referencing to be used.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-11-11 00:00', '500', '1633895N1_lecture_4.ppt_$_1633Managemnet accounting Assignment 3-Work shop notes.pdf_$_', '05-11-2023 22:55:31', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
