(2080, 2080, 'Academic Writing', 'Research on Swarovski Foundatjon ', 'Their values , commitments and ethos along with brand external and internal Markwttinh environment factors and consumer trends. \nTo undertqnd the current mark segennts of Swarovski foundation and to analyse a market segment that would be interested in seeing the values of the SF be brand integrated in an innovative way with Swarovski retail and Marketting environment. \nTo implement a feasible Marketting mix by addressing either a new product service or experience and place and develop an innovative Markwttinh communication campaigns  with the aim to create an emotional connection with the foundation suitable for todays diverse responsible and considerate consumer who is expectuinb authenticity diversity. ', NULL, 'Masters', '[\"Essay Writing\",\"Report Writing\",\"PPT Making\"]', NULL, '2023-11-20 00:00', '5000', '9637UNIT 2 Assignment - Luxury Fashion Marketing.pdf_$_', '07-11-2023 20:42:44', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2081, 2081, 'Academic Writing', '2000 word critical essay ', 'Select on luxury brand for this research essay. Discuss the business stragies undertaken by this brand in order to grow annual revenues , sales which include Branding , Marketting , PR, Social media and culture. Identify how social media digital impacts on what different strategies , the brand adopts , considering how content creation impacts on the choices. \nPS : You can choose any brand. \nNot Dior , Gucci , Lv , Chanel , Hermes. ', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-11-20 00:00', '5000', '9637878EB83D-5A85-4CDC-A75E-3F820548266D.jpeg_$_', '07-11-2023 20:46:24', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2082, 2082, 'Academic Writing', 'Operations management ', 'You must prepare and submit an original business report addressing the tasks \nidentified later in this section, but summarised below.\nâ— Your report must analyse and evaluate the operations management of an \norganisation, or of a specific business unit/division, and draw conclusions over \nthe extent to which its operational capability supports its corporate strategy and \nprovides competitive advantage.\nThe Organisation\nYou must select one focal organisation as the subject of your assignment. Where the \norganisation has different divisions or a disparate product/service offer, you may have \nto select one specific area of the organisation for study (i.e., you will need to define \nthe scope to be covered in your report). You may also find it appropriate to select \nby geographical region, or if the organisation has disparate operations, one of these.\nThe organisation selected should meet the following criteria:\nâ— It should be a well-known business â€“ you will find more data/information on \nlarge well-known businesses;\nâ— It must have a website that is available in English and produce annual reports \nin English;\nâ— It is recommended that your selected company be publicly listed/publicly traded \non the stock market â€“ you will find more data/information available on such \norganisations.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-23 09:00', '5500', '6797downloadfile.pdf_$_', '07-11-2023 22:23:19', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL);
