(2085, 2085, 'Academic Writing', 'Research Methods for IBM', 'In your mid-module summative assessment, you should address the following brief:\nWith reference to academic literature, discuss the issues to be considered\nwhen collecting data in an academic research project.\nIn your response, you must draw on and cite at least two methodological journal\narticles and one empirical journal article on a topic relevant for your programme of\nstudy:\nâ–ª Methodological journals include Organizational Research Methods , Journal of\nMixed Methods Research and Qualitative Research (see the module \' s  \' Library\nReading list \' ,  \' Journals - Methodology and Methods \'  section for more journal\ntitles)\nâ–ª Articles that report academic research projects are to be considered as\nempirical; examples of journals that include such articles are vast, but include\nThe International Journal of Human Resource Management ; Journal of\nInternational Business Studies ; Work, Employment and Society ; Organization\nStudies ; and Academ y of M anagement Journa l . For more journal titles that\nrelate to your programme of study see the  \' Module Handbook \'  or draw on\nempirical journal articles used in other modules on the programme\nâ–ª To assist you in accessing articles and constructing your essay, the Library\nhave produced this excellent blog > â€˜Finding empirical and methodological\narticlesâ€™\nIn completing your Assessment, you must engage with recent research - that is:\nâ–ª methodological articles that have been published in the past 10 years\nâ–ª empirical articles that have a publication date in the last 7 years', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-11-13 10:00', '20', '53652023-24 - NBS8327 - Research Methods for IBM - Summative assessment - Mid Module - FINAL (1) (1).pdf_$_', '08-11-2023 21:13:41', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2086, 2086, 'Academic Writing', ' 1.	Critically assess the evolution of crimes against humanity in the jurisprudence of International Criminal Courts and Tribunals.', 'â€¢	Word limit: No more than 4000 words in total (including footnotes).\nâ€¢	Do not exceed the word limit.\nAdd case laws \ncitations and footnotes to be included ', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-12-25 00:00', '5000', '', '09-11-2023 06:01:33', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2087, 2087, 'Academic Writing', 'Consumer behaviour ', 'INDIVIDUALLY WRITTEN COURSEWORK (4000 WORDS)\nDeadline:  Friday, 8th December 2023 (end of week 10), 100% of coursework, with two formative (optional) assessments in week 6 and week 7.\n\nFrom the very beginning of this module, you are asked to choose and dedicate part of your everyday life to a behavioural change project which continues for several weeks in parallel to the course.\n\nHere are the brief specifics:\n\nâ€¢             To challenge your critical reflection skills and demonstrate how difficult it is â€“ for yourself as a consumer and as marketers - to change behaviour, students are asked to engage in a personal behavioural change project.\n\nâ€¢             This may relate to various aspects of your life and those around you, for example and by no means limited to the following ideas of past projects:\n\n-          buy more consciously, ethically or focus on sustainability (or simply switch off the light more often, stop using elevators, reduce/zero waste, no clothes shopping, etc.)\n\n-          to stop procrastinating on social media  \n\n-          give up smoking\n\n-          eat better or follow a different diet to what you are used to (which has in the past linked to reducing calories, no sweets, no chocolates, no sugar, no meat, no caffeine, 5/2 diet etc.)\n\n-          engage in more sports, no sports, practice calming activities such as mindfulness\n\n-          join a club (dance, yoga, karate, pilates, drama)\n\n-          go to the theatre or engage in creative activities more often (i.e. play an instrument, start knitting/drawing/creative writing, etc.)\n\nCovid may restrict some of your choices, but then again, maybe now more than ever, you find yourself in position where there are some things you would like to change.\n\nâ€¢             The journeys will all be very personal, depending on your own choice, and the main focus is on reflecting on the changes you notice and linking these to each weekly topic. Projects differ in that some of you will â€˜stopâ€™ doing something, and others will â€˜startâ€™ doing something, and some of you will do both, i.e. stop doing something and replace it with something new. There also tends to be a difference in whether you are starting or stopping something entirely, or gradually, and whether this behaviour is entirely new or already familiar to you. Whatever it may be, itâ€™s worth spending some time thinking about WHAT and WHY you would like to embark on this project, as it should be something that sincerely motivates you.\n\nâ€¢             You may also note that a lot of previous projects had a very individualised focus rather than change to benefit someone else; this is NOT the brief! You can very well choose to support or join a community; you may also choose to help someone in need. However, while observing the change that takes place within the group and the activities you engage in, the â€˜unit of analysisâ€™ or source of data will always be your experience of change via descriptions and reflections (i.e. how you describe events and notice your perceptions, motivations, attitudes, opinions and beliefs change as well as the routines and practices you engage in).  \n\nâ€¢             NOTE: It does not have to be something directly linked to consumption! Students had some great projects in the past about stopping to constantly â€˜say sorryâ€™, or stopping to bite nails, or keeping a straight back. Another great project was to start walking stairs and avoid elevators at all times! When you start off you may think these have little to do with consumption, but over time, you will realise how much consumption matters â€“ within the behaviour we have learned, how we are looking to change it, and why we are looking to change (to name a few ideas). And sometimes what seemed most unrelated created great ideas! For example, our student who wanted to stop biting nails found an entire product line of nail polish that make nails taste rotten so that people would stop biting them. So hey, not biting nails was a real market!\n\nâ€¢             Overall, this exercise means you are more likely to personally engage in and experience the importance of perception, motivation, learning, attitudes, routines or practices (and how this forms part of personal or inter/national cultures), self (control), identity, communities, which are of course all linked to consumption.\n\nâ€¢             To make sure you can gather your reflections and develop â€˜good dataâ€™ throughout this project, we recommend you set up a blog or maintain a diary/keep detailed notes. Projects where students maintained blogs or kept notes have been of much better quality compared to students who did not. Setting up a blog also allows you to store pictures or videos and link them to activities or experiences. Itâ€™s easily and quickly done via a host of different blog providers (see power point presentation for ideas). Also, some students have kept their blogs after the project and some even turned them into an activist campaign (to save a local pub).\n\nâ€¢             Students have until midnight, 11th October 2023, to consider their own personal â€˜change projectsâ€™, set up their blog where they write their â€˜change commitmentâ€™, and post this blog entry in the discussion forum where it will be signed off by the module convenor and tutors. If your project is too personal, email us your title and â€˜change commitmentâ€™. If you would like to share your blog address with fellow students, we encourage this via the discussion forum.\n\nÂ·       Change commitment: in your first blog post, it is advised you define the reasons for choosing your particular change project and explain your motivations for embarking on this change; to help you achieve this change, it is also advised to set up a set of goals and (gradual?) mechanisms to implement this change. However, this depends entirely on the change project you choose. For example, previously students chose to cut out all kinds of waste, or to change their daily routine by getting up at 5am. It may be tricky to create a gradual mechanism for these changes.\n\nâ€¢     Starting from the 12th October â€“ 29th November, you are asked to record and monitor your (change in) actions, practices, routines, general behaviour, thoughts, emotions, general insights and, importantly, those of people around you (i.e. not just your own behaviour but also how your environment is changing) using a blog.. The purpose of your entries is mainly for you to understand the habituated nature of your behaviour and apply the concepts that we are studying in class to your own behaviour, and hopefully your change.\n\nâ€¢            It is recommended that you regularly review, reflect and, if necessary, revise your goals to enable you in your monitoring. Goals should not be about quantifying your change â€“ as some students have thought in the past (i.e. if they reach their goals and reduce XYZ amount of calories during each week they will do well in this assignment). That is clearly not the case. But setting goals are part of rational processing of our behaviour and switches on our motivations, though (as you may observe) they may often diverge significantly from what we actually end up doing!\n\nÂ·                To aid learning and help with extensive readings, students are encouraged to establish reading groups; in these groups you can share summaries and reflect how they may relate to change; feel free to use the discussion forum for this purpose too and we can also help in setting up reading groups for you.\n\n \n\nÂ·                Reading groups can also be your seminar groups. Consider them as a sounding board â€“ a therapy group for this module! We hope you look forward to talking about your change project and share your insights with the group every week and relate it to the theories and readings from each week. \n\n \n\nÂ·                To help you gain feedback: you are asked to prepare a poster within a small group (2-3 students from your seminar groups) to jointly analyse - contrast and compare - your experiences and relations to theory in your seminar session in week 6. Please also post this poster in the discussion forum on the 8th November or soon thereafter. You will receive extensive formative feedback for your final assignment submission!\n\n \n\nâ€¢             Beside a poster presentation, please submit a 500 word abstract of your individual project in the discussion forum, highlighting your approach to analysis and identification of key literature by the end of week 7 (17th November 2023). Some minor feedback on these abstracts will be provided prior to full project submission at the end of week 10.\n\nâ€¢             Note: both posters and abstracts are FORMATIVE assessments, so non-compulsory and optional. That said, we do encourage you to complete them so you gain feedback and advice on your project, since it forms 100% of your final mark.\n\nÂ·                Your final assessment should be an analysis of your behavioural change project. This analysis should consist of a description of the journey of your change project, relevant data extracts (from your blog for example, or photos, videos, social media, etc.), and links to relevant theories and readings. In its conclusion it should also discuss how these insights relate to consumer behaviour, marketing practices, strategy or a critique of current marketing practices more generally.\n\nThe following marking criteria (in addition to standard criteria) may help in considering an appropriate structure and content for your analysis essay:\n\n-          Structure and referencing  \n\n-          Originality and topic creativity\n\n-          Detail of description of chosen phenomenon, and presentation of some data or insights to showcase how change was recorded;\n\n-          Clarity, appropriateness and depth of analysis (choice, range and depth of theories)\n\n-          Engagement with theory relevant to the personal change\n\n-          Critical argumentation, discussion and reflection â€“ both in terms of theory and practical change\n\n-          Consideration of how insights/experiences may relate to consumer behaviour more widely, marketing practices, strategy or critique of current marketing practices', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-12-08 11:59', '5000', '2714Cb eg4.pdf_$_2714Cb eg3.pdf_$_2714Cb eg2.pdf_$_2714Cb eg1.pdf_$_2714Poster presentation template (1) cb3.pptx_$_2714bf4eb203-3732-48a3-8ca1-c0f130ac50e6.jpeg_$_2714Cb2.pdf_$_2714Cb1.pdf_$_', '09-11-2023 07:21:47', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2088, 2088, 'Academic Writing', 'Brand management ', '*Brand management coursework*\n\nThe module is assessed based on a 3,500 words report on a brand audit. Please engage with all the resources below helping you develop your coursework.  Dedicated activities in each branding topic will also help you apply  the theories you have learned to the coursework\n\n1. General assessment information\nAssessment components\n\nThis module is assessed by a 3,500 words coursework worth 100% of the module grade. The submission deadline is Friday 8 December 2023, 18:00 via Moodle.\n\nLate submissions of Work for Assessment \n\nAny work that is submitted for formal assessment after the assessment deadline will be subject to a penalty mark, unless a Mitigating Circumstances claim is accepted.  \n\nDetails of the procedure for submitting Mitigating Circumstances claims and details of this procedure, including the Mitigating Circumstances form to complete, can be found at:  https://www.bbk.ac.uk/downloads/registry/policies-2020-21/covid-19-mit-circs-student-guidance.pdf\n\nIf you think that you may be unable to meet an assessment deadline for reasons outside your control but you are not sure whether you should apply for Mitigating Circumstances, please raise an ASK query via MyBirkbeck to the student administration. Your module teacher might be able to provide some advice, but the decision does not rest in his hands.\n\n2. Brief\nYour mission\nA new marketing director has just arrived in the company. They have asked you to send him an audit of the brand you work on, to help them decide where to take the brand next. They want your audit to go beyond a description of the brand and its current performance: they want your analysis to be an argument leading to detailed recommendations about how to further develop the brand in the future. They asked for a 3,500 words report.\n\nIn this fictional scenario, you should focus on one of those four brands:\n\nBarbie\nBen & Jerry \' s\nIKEA\nTesla\nReports are expected to apply relevant branding frameworks and concepts explored in the module. Students are welcome to leverage more advanced branding theory if helpful. Branding frameworks and concepts should be applied with the aim of enhancing the depth of analyses and insight into the brandâ€™s dynamics.\n\n\nReport Format\nThe finished reports must be written in a report format so headings, subheadings, summary tables, diagrams, bullet points, and signposting are expected. \n\nThe report is expected to be 3,500 words long, plus or minus 10%. The word count should be on the front page or it will be assumed that it was not respected, leading to penalties. Figures and charts do not count towards the word limit but should not exceed 3,500 words. The executive summary, the table of content, the references, and appendices do not count toward the word limit. \n\nThe report should be spellâ€checked, grammatically correct, and justified. The report must be typed in 12 point, doubleâ€spaced with 1 inch margin in the font of your preference.  References should be properly cited using the Harvard style. \n\nFor those using Mac or Open Office, please submit the document in a format compatible with Microsoft Word or Adobe PDF reader.\n\nReports are expected to cite seven academic sources as a minimum.\n\n3. Report structure\nReports are designed to be easily and quickly absorbed by readers. Headings are therefore typically used to separate the different sections of the document. Reports have a title page, an executive summary, a table of content, an introduction, various sections in the middle, and a conclusion. In your case, the conclusion section could be labelled something like â€œRecommendations for the Future Management of the brandâ€, since the report aims to develop recommendations for the future management of the brand. Quality reports also typically have a list of references at the end, allowing the reader to check the validity of statements made in the report, and to go further if they wish. Beyond these basic principles of report writing, you are free to structure the rest of your analysis as you deem fit, given the particular problem that the brand is facing. \n\nStudents often feel unsure about how to structure their report though. I therefore offer below a suggestion of outline, that often helps students find what works best for their brand.\n\n \n\nTitle Page â€“ should be informative, use two or three lines if necessary. Indicate word count.\n\nExecutive Summary (200â€250 words) â€“ The executive summary gives the reader an overview of the reportâ€™s content. It summarizes briefly the takeaways of the different sections of the report. It will therefore include a clear statement of the problem faced by the brand, the analyses conducted, the diagnostic you got to and the recommendations you offer. The marketing director will have no interest in reading an executive summary which is a rewriting of the table of content. An executive summary for a report of this size is typically written in a single paragraph.\n\nContents list â€“ shows the main sections and, if appropriate, subâ€sections of the report, alongside the pages on which the reader can find them.\n\n1. Introduction (350 words)â€“ tells the reader in a few words what is discussed in the report and why it is important. It could, inter alia, a) provide a brief overview of the brand b) defines briefly the industry and context in which the brand operates c) presents with some level of detail the most important branding problem(s) or questions the brand is facing d) provide a brief overview of the dataset you collected to investigate the problem e) outline how your analysis will allow you to respond to such problem(s).\n\n2. Brand audit â€“ The branding concepts and theoretical frameworks learned in the module in class or via independent readings will be particularly relevant here. When applying them, try to systematically draw conclusions from your analyses, explaining how it helps understand and resolve the problem outlined in the introduction. The main analysis will be divided in different sections with potential sub-headings within. You are free to organize it as you deem fit. However, it is typically relevant to discuss the following topics, in which ever order suits your purpose best:\n\n2.1. Brand concept: What are the brandâ€™s promise? What are the brandsâ€™ identity and positioning?  And have they evolved overtime? Does the brand have a strong heritage? And how rich is the brandâ€™s identity? Can you describe the specifics of all this? If you develop a systematic comparison of competitorsâ€™ POPs and PODs, keep this comparison for an Appendix, so the main text remains focused on your main narrative or  argument.\n\n2.2 Consumer-based brand equity: How much value has the brand for consumers? What level of awareness of the brand do they have and is it adequate? What image of the brand do they have? Is it a strong image and is it the right image? Does the brand resonate with consumers and should it? Is the brandâ€™s equity dispersed, with different segments having different images of the brand? Is the brandâ€™s equity polarized, with a doppelganger brand image emerging? Does the brand suffer from negative equity?\n\n2.3. Brand elements: What are the elements characterizing the brand? Which ones convey the brandsâ€™ identity and positioning well and which ones do not? Which ones are designed effectively and which ones are not? Try and articulate the criteria used to assess the elements. You can use a table for this, which allows you to leverage the main text to (1) explain where you gathered the information to assess the brand elements and (2) develop a short synthesis explaining what is right and wrong about the elements and why. If you do not have anything interesting to say about the brand elements, given the particular problem/question you presented in the introduction, consider keeping this section short. Or maybe even describe them briefly in the introduction, when giving a brief overview of the brand, or draw from it when analyzing the brandâ€™s identity. However, if you chose not to have a section on brand elements, explain briefly in the introduction why you will not analyze them in-depth in the main body of the text and provide more details in an Appendix.\n\n2.4. Marketing mix: How fit or unfit is the marketing mix, given the particular problem the brand is facing? Does it enact the brand concept adequately? Does it take the brandâ€™s positive and/or negative equity into account? If relevant in your particular case, you might want to focus on only a few aspects of the marketing mix, or only marketing communications. However, if you do so, you should explain the rationale for it in the introduction or the introduction of the section.\n\nIt is also often relevant to integrate discussions of brand dynamics (reinforcement, expansion, rejuvenation) within the topics listed above. This could involve for example discussing: does the brand have some history/heritage which belongs to its identity? Does the brandsâ€™ resonance create opportunity to expand? Or is the brand losing relevance? If so, is it due to its narrow and shallow identity? Or to its outdated positioning? To its marketing mix choices or to the management of its portfolio?\n\n3. Recommendations (750 words) - this section starts with a brief, concise and clear summary of the evaluations/conclusions you came up with in the report. It often involves repeating statements that have appeared in previous sections, but the reader will not want to go back and find these. Rather, they will want them all clearly set out in the same place. It must also include explicit recommendations. The recommendations should be clearly linked to the problem identified and build on the conclusions you came to when evaluating the brand. Otherwise, it will seem as if the whole audit was useless. Be very detailed, precise and structured in the recommendations you make.  based on your analysis and assessment of the brand.\n\nRecommendations will be unique to your brand and project. However, it is often useful to consider organizing your recommendations in terms of high-level strategic recommendations vs more applied tactical recommendations (brand elements, marketing mix).\n\nIf you struggle to define a strategic direction in your recommendations, you will likely find the last three topic of the module helpful:\n\n-       Brand portfolio: Would the brand benefit from an extension and why? If so, in which product category? With which architecture? How will you mitigate the risks and ensure this is a success? Is the brand part of a larger portfolio? If so, should the brand review the portfolioâ€™s architecture?\n\n-       Brand iconicity: Is the brand culturally relevant and why? What could the brand do to enhance or maintain its cultural relevance?\n\n-       Brand activism: Would the brand benefit from playing up its social purpose and why? If so, how should it go about it?\n\n 4. List of References â€“ you need to list the sources you have used and cited in the report. You should list the books and journal articles you cited but also the reports, the websites, the blogs and the various social media pages you have used. The recommended format is as below. To help the marker cross-check references, you are welcome to have a separate references list for each section of the report.\n\nÂ·  BOOKS: Surname, name initials, (date of publication), Title of book (italics or underlined), publisher, place of publication, chapter number.   Example: Kotler, P., Armstrong, G., Saunders, J. and Wong, V. (1996) Principle of Marketing, European Edition, Prentice Hall, Europe.\n\nÂ·  ARTICLES: Surname, Name initials, (date of publication), â€œTitleâ€, name of journal (italics), issue, page numbers. Example: Houston, F. S. (1986) â€œThe Marketing Concept: What It Is and What It Is Notâ€, Journal of Marketing, 50,  (April), 81-Â­â€87.\n\nÂ·  REPORTS: Surname, Name initials. (date of publication). â€œTitleâ€. Series Number. City: Publisher, p.Pages Used. Available at: http://Website URL [Accessed Date Accessed].\n\nÂ·  WEBSITE: Surname, Name initials, or Website name (date of publication) â€œPage Titleâ€. Available at: http://Website URL [Accessed Date Accessed].\n\n5. Appendices â€“information which is not central to the argument developed in the report but supports in some ways may be included in the appendices. Appendices can be useful to cut down the descriptive parts in the main body of the report.\n\n4. Marking criteria\nThe reports will be assessed based on the following criteria:\n\n1. Quality of the argument: Development of an in-depth analysis of the brand leading to relevant and convincing branding recommendations. Provision of new insights or original ideas based on independent thought or creative thinking.\n\nReports being genuinely analytical and evaluative will be marked up while merely descriptive reports will be marked down. A description tells you how something is. An analysis breaks down the thing into pieces. An evaluation says if the way the thing is used or built is right or wrong. Analysis and evaluation require writing argumentatively. Anything taking the reader away from the argument should be cut or taken in appendix.\n\n2. Use of research and examples: The breadth and quality of sources identified to do the coursework and their meaningful use to analyse the brand.\nA good report will demonstrate some initiative in searching out a wide range of relevant sources and information about the brand. Corporate publicity and advertising, company and industry reports, independent market research, case studies and academic research articles are all relevant sources when gathering information about the brand. Reports, which lean too heavily on a very narrow range of sources typically receive lower marks. \n\n3. Depth of knowledge and critical understanding: Depth of knowledge of relevant literature and ability to use complex concepts and ideas.\n\nAll reports should also leverage academic theory. A good report will take every opportunity to appropriately apply the concepts, models and techniques encountered in the module and its associated reading. This commonly involves applying analytical frameworks to organize and interpret the sources characterizing the brand. It also involves building from concepts to help you interpret some particular aspects of the data collected, or to help you develop branding recommendations. \n\nStudents are welcome to read academic sources behind the textbook and use any academic knowledge relevant for the particular brand chosen. \n\n4. Structure and presentation: A logical arrangement of the work into sections (introduction, main points, conclusion) with appropriate signposting and transitions. Putting across ideas clearly, succinctly and without grammatical and spelling errors. In the case of oral presentation, ability of the presenter to engage the audience is also important.\n\n5. Referencing and bibliography: Acknowledgement of sources using appropriate citation conventions in text and in the list of references at the end.\n', NULL, 'Masters', '[\"Report Writing\",\"Essay Writing\"]', NULL, '2023-12-08 18:00', '5000', '2714Brand management eg1.pdf_$_2714Brand management eg4.pdf_$_2714Brand management eg2.pdf_$_2714Brand management eg5.pdf_$_2714Brand management eg3.pdf_$_2714Brand management eg1.pdf_$_', '09-11-2023 07:35:20', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
