(2099, 2099, 'Academic Writing', '1800 words organizational behaviour essay', '2. Assessment Instructions\n\n\n\nEssay formatting guidelines \nThe essay is to be of length not exceeding 1,800 words, including footnotes, but excluding any contentsâ€™ page and appendices/annexes/reference lists. It should be\n\na)         Submitted via Turnitin in A4 format;\n\nb)         Font: Times New Roman, Size 12;\n\nc)         Line spacing: 1.5;\n\nPlease reference throughout and provide a full reference list at the end according to the Harvard referencing system.\n\nEssay submission guidelines\n\n\nDeadline: 3pm on November 14th 2023 as above.\n\nChoose ONE of the following options for your essay:\n\n \n\n(a)   To what extent can organisations affect employeesâ€™ motivation? Critically discuss this question.\n\n (b)   Should leaders take personality into account when creating teams at work? Critically discuss this question.\n\n (c)   How and why may inequality and discrimination at work affect performance? Critically discuss this question.\n\n (d)   What is a psychological contract and why should managers know about it? Critically discuss this question.\n\n (e)   ------- You may construct your own essay title; however, this will need to be approved by the module convenor by November 3rd. ---------\n\nYou are encouraged to combine theory, empirical research as well as practical examples in your essays.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-11-13 09:00', '3800', '4542Pre-class version week 6 BUSM069 Groups and Teams at work.pdf_$_4542BUSM069  full slides week 5 Diversity.pdf_$_4542Post lecture slides week 1 BUSM069 Session 1A Introduction and personality KZ.pdf_$_4542week 3 BUSM069 full post class slides Power and Leadership.pdf_$_4542week 2  full slides BUSM069 Motivating People.pdf_$_4542BUSM069 Sample Essay 1 Emotions.pdf_$_4542BUSM069 Sample essay 2 Leadership.pdf_$_', '11-11-2023 15:40:18', 'team_member_1', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
