(2101, 2101, 'Academic Writing', 'Dissertation ', 'No hardcopies are to be submitted. You therefore do not need a cover sheet is - a title page is sufficient. Students can format their title page as they deem fit. \n\nPlease upload the dissertation itself in part 1 of the portal. \n\nIf you have large appendices that cannot be included at the end of the dissertation please upload them in the other parts (part 2-5). \n\nIf the files you would like to submit are so large that they cannot be uploaded in the portal, we advise you to email them directly to your supervisor.', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2024-01-10 23:59', '15000', '7524IMG_1408.png_$_7524IMG_1407.png_$_7524IMG_1406.png_$_7524IMG_1405.png_$_7524IMG_1404.png_$_7524Corrections to the feedback.pdf_$_7524PG Dissertation - marking rubric for Moodle.docx_$_7524dissertation proposal .pdf_$_7524Postgraduate Dissertation Module Handbook 2022-23_JANUARY final.pdf_$_', '12-11-2023 10:42:05', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
