(2111, 2111, 'Programming', 'CSC8327 Assignment - Design of a bacterial load stress induction and monitoring systemCSC8327 Assignment - Design of a bacterial load stress induction and monitoring system', 'Prerequisites\n\nBefore you attempt this assignment please make sure you have watched the video on bacterial stress and load from Dr. Wendy Smith. Also, please make sure you have watched the videos for the two practicals for this module linked from the Canvas pages, DNA designs using Benchling and DNA Parts finding. You should also complete the entire module 1 of the course and the lectures on Parts, Systems and Devices and Standards.\n\nBackground\n\nWelcome to your new job! You have been employed as a Synthetic Biology consultant by a biotechnology company who wishes to improve the yield of an enzyme that they current produce from a recombinant strain of Bacillus subtilis 168. The company produces the recombinant xylanase enzyme by overexpressing the gene encoding it on a plasmid pHT01, an Escherichia coli/Bacillus subtilis shuttle vector (see figure 1 and https://www.addgene.org/vector-database/5885/Links to an external site. and http://subtiwiki.uni-goettingen.de/wiki/index.php/PHT01). The gene encoding the enzyme has been inserted into pHT01 downstream of the IPTG inducible P grac promoter on the plasmid at the Bam HI site.\n\nPlasmid pHT01\n\nFigure 1: pHT01 plasmid\n\n \n\nThe overexpressed product is secreted outside of the cell wall into the cell medium using the Bacillus cell type 2 secretory system. The company purifies the enzyme by filtering away the cells and then extracting the enzyme from the supernatant.\n\nThe company have asked you to design a system for them that will allow them explore the level of load stress that the cell is experiencing during the batch growth of the strain in a bioreactor that is used to produce the protein. The company also want you to develop a system that will allow them to apply a load stress to the strain and to monitor its behaviour.\n\nSystem requirements\n\nThe company has captured the requirements for the system more formally as follows:\n\nThe system must be tailored for operation in Bacillus subtilis\nThe system must have a reporter system (the monitor) that can produce green fluorescent protein (GFP).\nThe level of expression of GFP in the monitor must be proportional to the amount of free resources available for transcription and translation in the cell.\nThe monitor must exist as a single copy number\nThe system must include a load generator that allows a load stress to applied to the cell by the expression of a gene encoding a xylanase enzyme.\nThe load generator should also express red fluorescent protein (RFP) proportionally to the induction of the expression of the xylanase gene.\nThe load generator should be inserted into the shuttle-vector pHT01 as the company is familiar with this vector.\nThe company is unwilling to release the sequence of the xylanase gene it uses and so requires you to provide to use a publicly available sequence of your choice.\nThe deliverables\n\nThere are two deliverables to be submitted to the NESS system:\n\n1) A non-weighted practical report. Deadline Friday 10th November 2023 at 16:30PM.\n\nTo complete this part you must start to think about how you will design and build the system that meets the requirements stated above for the assignment. Talk to the lecturer or demonstrator about your plans for the design and get some feedback. This doesn \' t need to be very detailed at this stage. Just some rough ideas will suffice. \n\nPlease upload the feedback you received from the demonstrator on your system design during the practical and details of any fixes you carried out as a result, if any. A simple document with a short paragraph of text will suffice. \n\nThis component of the assessment is marked with a pass fail mark. The component must be passed but does not contribute to the mark for the module. \n\n2)  A practical report that is marked (total 100), which will make up the total mark for the module. Deadline Friday 17th November 2023 at 16:30PM.\n\nArmed with the requirements for the system presented above your task is to provide a design for a system to detect and apply load Stress in Bacillus subtilis 168 that conforms to the requirements above. The design must be detailed enough for the company to build the system. Specifically, you must produce four sections in this report.\n\nA verbal description of the behaviour of the system you have designed, once it has been built (10 marks total, 1000 words max)\nProvide a visual overview of the design (using a visual standard) and a textual description of the genetic structure. Provide justification for your design choices (10 marks, 1000 words max)\nLists the parts used, their types, sources and function ( \' role \' ) (5 marks)\nList the sequences of the parts in Fasta format.  ** Put the sequences in a separate document ** (10 marks)\nProvide a Benchling project with the design represented in it (15 marks). Share your Benchling designs for the project with Anil. To do this search for the user  \' naw3 \'  and set them as a collaborator. Failure to share the project by the deadline will score 0 for this section. DO NOT LEAVE THIS STEP UNTIL LAST - IT CAN TAKE A WHILE.', NULL, 'Masters', '[\"Software\"]', NULL, '2023-11-17 11:00', '1500', '1294Assignment description_ An Introduction to Synthetic Biology - CSC8327.pdf_$_', '15-11-2023 20:34:49', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
