(2130, 2130, 'Academic Writing', 'law of Contracts Assingment', 'CONTRACT LAW (LA4015) ASSESSMENT TASK 2023/4-TERM 1 \nCoursework Assessment Details and Instructions\nModule Code: LA4015 Module Title: Contract Law\nPercentage Contribution to Overall Module Mark: 100% \nWord Count: 3,000 Words in Total (1,000 Words Per Question); In-Text \nreferences in the Harvard Style does count, but Footnotes in Oscola Style and \nBibliography do not count. ONLY 10% more or less is allowed. Breach of this \nlimit either way is most likely to affect your score', NULL, 'Bachelors', '[\"Case Studies\",\"Question & Answer \"]', NULL, '2023-12-03 00:00', '4500', '1683LA4015 Assignment Task 2023-24.pdf_$_1683LA4015 Module Guide 2023-2024.pdf_$_', '23-11-2023 22:06:30', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
