(2133, 2133, 'Academic Writing', 'financial accounting \' ', 'Together the  tasks account for 100% of the marks for this module.\nIn the calculations task (20%) you will demonstrate how to calculate and prepare basic management accounting information using budgeting, ratio analysis and investment appraisal techniques\nIn the report-writing task, (80%) you will demonstrate how to interpret the numbers to make the information useful for managers and investors. \nBoth tasks encourage research and financial analysis. They also develop and demonstrate an understanding of the decisions based on budgeting, investment appraisal techniques and ratio analysis.\n', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-30 09:00', '4400', '', '24-11-2023 18:43:53', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2134, 2134, 'Academic Writing', '4000 words resit assignment ', 'Hi ,  I have reviewed your paper and unfortunately you haven \' t met the learning outcomes of this module. See  feedback below and  improve your paper for resit-\n \nIntroduction -  Give executive summary before the table of contents. Good introduction but company profile need more facts about company and citations of sources\n \nMain discussion - You need to apply OB approaches and theories covered in this module, specially. For example in EDI you could apply Loden \' s model, various motivation and engagement models covered in week 3 and 4 in class.  Same for leadership and change management, see lecture slides for theory. You need to produce  critical discussion by adding more evidence from the company to support your claims around the topics as well as justify them by linking them back to theories.   \n \nConclusion -  You gave some recommendations but they need to be justified with reference to theory with appropriate  citations. \n\nReflection and LO- You have not met the learning outcomes. Give  self-reflection on your learning journey  from the  module \' . You could include your learning outcomes from various classroom activities as well as group works etc\n \nPresentation and referencing-  Improve the structure and layout. Provide in-text citations in all paragraphs in the main body. . Follow APA references guide and use wide range of academic sources to understand about best practices and apply them to your analysis. \n \nGood luck!', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-30 12:00', '8200', '77717008MHR Assessment Brief- May2023.docx_$_', '24-11-2023 23:46:22', 'team_member_16', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
