(2137, 2137, 'Academic Writing', 'RESIT OB assignment of Google ', 'Organisational behaviour resit assignment\nCompany name : google \nWords : 4000\nReferences: APA\nMaking assignment as oer professor \' s feedback\n\nI have reviewed your paper and unfortunately you haven \' t met the learning outcomes of this module. See  feedback below and  improve your paper for resit-\n  \nIntroduction -  No executive summary provided. Poor introduction and company profile includes no fact about the company elated to the topic. \n \nMain discussion - You need to apply OB approaches and theories covered in this module. For example in EDI you could apply Loden \' s model, various motivation and engagement models covered in week 3 and 4 in class.  Same for leadership and change management, see lecture slides for theory. You need to produce  critical discussion by adding more evidence from the company to support your claims around the topics as well as justify them by linking them back to theories.   \n \nConclusion -  You gave a list of recommendations but they need to be justified with reference to theory with appropriate  citations. \n\nReflection and LO- You have not met the learning outcomes. Give  self-reflection on your learning journey  from the  module. You could include your learning outcomes from various classroom activities as well as group works etc\n \nPresentation and referencing-  Improve the structure and layout. Provide in-text citations in all paragraphs in the main body. . Follow APA references guide and use wide range of academic sources to understand about best practices and apply them to your analysis. \n \nGood luck!', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-11-30 00:00', '8200', '63547008MHR Assessment Brief- May2023.docx_$_', '27-11-2023 11:54:55', 'team_member_14', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2139, 2139, 'Academic Writing', 'Introduction to marketing ', 'ï‚· A1 Background: Provide a brief background of the brand. You can use non-academic resources\nin this section. This section should give a general background of the brand (providing some\nfacts and figures would be useful). Support your arguments with reliable resources, facts, and\nfigures.\nï‚· A2 SWOT Matrix: 3-4 points per cell would be enough. You must support your claims with\nreferences. Simply saying â€œStrong brand imageâ€ as a strength is not enough (even if the brand\nis well-known). Facts and figures? Statistics? Reliable reports? Evidence? Unreferenced claims\nare not acceptable.\nï‚· A3 Brand Personality: In this section, the student is expected to discuss/identify the\npersonality of the selected brand (see Aakerâ€™s brand personality framework). A brief literature\nreview of â€˜brand personalityâ€™ is needed. Support the identified personality with some pieces\nof evidence (e.g. advertisements, marketing campaigns, pricing, videos, design, logo, package,\noffering, communication channels, sponsorship, or ANY other marketing element/activity).\nPut screenshots and explain/interpret your evidence and claims. Donâ€™t leave your screenshots\nand evidence without explanation and interpretation. For instance, if you put a screenshot\nfrom a video, briefly explain the video, then provide your interpretation and analysis of how\nthis video creates/strengthens the identifies brand personality. What elements or messages\nin the video align with the identified brand personality?', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-12-19 00:00', '4500', '', '27-11-2023 22:52:43', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2144, 2144, 'Academic Writing', 'Problem and Solutions Scenario', 'To complete this assessment effectively you need to\nâ€¢	Visit the assigned business\nâ€¢	Get a feel for the business\nâ€¢	Take some pictures â€“ you can use these in your paper\nâ€¢	Read extensively about the business & the sector â€“ there will be articles in reliable press articles and blog posts \nâ€¢	INTRODUCTION â€“ tell us about the business factually â€“ ownership / size / price where applicable / sector in which it operates â€“ competitors where appropriateâ€¦(reference to the businessâ€™ website and press articles)\nâ€¢	SERVICE PACKAGE â€“ look closely at the material from Week 2 and apply it to the businessâ€¦if you are working on a hotel or visitor attraction you might want to focus on just one area e.g.a guest room or food & beverage area or reception or one exhibit area\nâ€¢	INDUSTRY PROBLEM â€“ all hospitality and tourism businesses will be dealing with sustainability / technology / supply chain / recruitment & retention / diversity / expanding into new areas so location decisions / delivering new services / quality management to name just a fewâ€¦Pick one & research it from a theoretical and industry perspective\nâ€¢	HOW DOES YOUR BUSINESS DEAL WITH IT â€¦\nâ€¢	CONCLUSION & 3 RECOMMENDATIONS â€“ What should they do more or less ofâ€¦Be specific â€¦ if you talk about training training whom in what?\n\n\nImp Note- My company is Markus brothers restaurants. \nI can visit the one in spitalfields.\nhttps://brothermarcus.co.uk/\n', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-12-12 12:00', '6000', '34707023MFH 23-24 Assessment Brief (4).docx_$_', '28-11-2023 12:39:17', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
