(2152, 2152, 'Academic Writing', 'Investigating the impact of student engagement and satisfaction in hybrid learning in Indian educational settings: Secondary qualitative study using case examples', 'In terms of hybrid learning in Indian educational environments, the goal of this research is to perform a thorough examination of student involvement and satisfaction. This study aims to discover best practices in instructional design and delivery, investigate the variables affecting student involvement and satisfaction, and evaluate the effects of sociocultural and pedagogical variables on the efficacy of hybrid learning in India. This study intends to provide insightful contributions to the continuing discussion on improving educational techniques in the digital era, with a particular focus on the educational system in India, through thorough research and empirical evidence.', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-12-14 00:00', '28981', '7486Template title page.docx_$_7486Dissertation declaration form.docx_$_7486BUSM100 Module Outline - MSc Dissertation | MyQMUL.html_$_7486IMG_6613.HEIC_$_7486Dissertation Induction Meeting LS Feb 2022. UpdatedLSpdf 1.pdf_$_7486BUSM100 Module Outline - MSc Dissertation | MyQMUL.html_$_', '30-11-2023 19:38:35', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
