(2156, 2156, 'Academic Writing', 'Evaluation of Export Incentive Schemes in India: A Qualitative Study on the Role of Consulting Services in Maximizing Benefits', 'The research is to be done to study the role of consultancy services in maximising benefits to exporters in India. I have to do qualitative research through secondary data research. I have been thinking of going further with a systematic literature review.\n\n**Overview of the Dissertation Topic: \"Evaluation of Export Incentive Schemes in India: A Qualitative Study on the Role of Consulting Services in Maximizing Benefits\"**\n\n**I. Introduction:**\n   - **Background and Context:** Contextualize India \' s export incentive schemes.\n   - **Research Objectives:** Outline study goals and questions.\n   - **Rationale for Qualitative Approach:** Justify the qualitative method choice.\n   - **Dissertation Structure:** Briefly outline the organization.\n\n**II. Literature Review:**\n   - **Export Promotion Schemes:** Review literature on MEIS, SEIS, and EPCG.\n   - **Effectiveness Studies:** Explore existing research on scheme impact.\n   - **Consulting Services:** Discuss the role of consulting services.\n   - **Theoretical Frameworks:** Introduce key theoretical perspectives.\n\n**III. Research Design:**\n   - **Qualitative Approach:** Explain the qualitative methodology.\n   - **Data Collection:** Outline interview and focus group plans.\n   - **Sampling Strategy:** Justify purposive sampling.\n   - **Ethical Considerations:** Address ethical considerations.\n\n**IV. Data Collection:**\n   - **Data Collection Process:** Describe the detailed approach.\n   - **Questioning Strategy:** Emphasize the use of open-ended questions.\n   - **Recording and Transcription:** Explain recording and transcription procedures.\n\n**V. Data Analysis:**\n   - **Thematic Analysis:** Outline thematic analysis methods.\n   - **Coding and Categorizing:** Describe coding process.\n   - **Analysis Software:** Specify software use if applicable.\n\n**VI. Findings:**\n   - **Qualitative Presentation:** Showcase key themes with illustrative quotes.\n   - **Discussion:** Engage in a detailed discussion of findings.\n\n**VII. Discussion:**\n   - **Interpretation:** Provide an interpretation of findings.\n   - **Comparison with Literature:** Relate findings to existing research.\n\n**VIII. Conclusion:**\n   - **Summary:** Summarize key qualitative findings.\n   - **Concluding Remarks:** Conclude with reflections.\n\n**IX. Recommendations:**\n   - **Policy Recommendations:** Offer policy insights.\n   - **Practical Suggestions:** Provide suggestions for stakeholders.\n\n**X. Limitations and Future Research:**\n   - **Limitations:** Acknowledge study limitations.\n   - **Future Research:** Suggest areas for future investigation.\n\n**XI. References:** Include comprehensive reference list.\n\n**XII. Appendices:** Attach supporting materials.', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2023-12-12 00:00', '27000', '5999Dissertation Induction Meeting LS Feb 2022. UpdatedLSpdf 1.pdf_$_5999BUSM100 Module Outline - MSc Dissertation _ MyQMUL.pdf_$_', '01-12-2023 19:08:38', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
