(2160, 2160, 'Academic Writing', '4 core themes critical reflection ', 'You should provide a 2,000 words critical reflection of *4 core themes covered* on the module that had the most influence on developing your entrepreneurial mind-set. \nâœ”ï¸ This should include class activities (some of which may include but is not limited to company visits, guest lectures and pitch activities) and topics covered on the module. The 4 themes MUST include a reflection of your learning whilst working\nâœ”ï¸ It is important to use a wide range of appropriate entrepreneurial theories and concepts, with academic literature to support \nthemes discussed.\nâœ”ï¸ This should contain a good range of creative photos that would chronicle your learning journey on the module.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2023-12-04 00:00', '4000', '59087020-03 Entrepreneurial Identity.pdf_$_59087020-01 Module Introduction.pdf_$_59082dd50fad595424e5a34f6fa7dc7945b47020_09_family_entrepreneurship.pdf_$_59087020-06 Business Startup Challenge.pdf_$_59085f7193a5771419f3c1ec3dfaaebd0bd27020_08_international_context.pdf_$_5908dff0137b21c000564cb203f783e54d437020_04_lean_startups.pdf_$_5908a5961888b981e37c763c1479315c929d7020_10_business_success.pdf_$_59087020-05 The Art of Pitching.pdf_$_5908a891fea326394a1208c3b6646d74b62a7020_07_sustainable_entrepreneurship.pdf_$_59087020-02 Historical Overview.pdf_$_', '03-12-2023 20:04:55', 'team_member_14', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
