(2162, 2162, 'Academic Writing', 'Ipr laws & cyber law assignment', 'Ipr & cyber law assignment\nSubjects                                                  Topics \n1.Research methods  :-  Preparing legal research report \n2.  Law and justice in Globalising world :- Pil and administration of justice \n3.Ipr law    :- Trade related aspects of intellectual property rights (TRIPS) \n4.Cyber law & IT Act :- legal aspects of e commerce  \n5.Law of copyrights :- The design act , 2000 An introduction\nYou don \' t have need for checking plag and all. Just need doing cut copy paste in clear and efficient way \nYou doing 5 assignment with above mentioned requirements thank you. ', NULL, 'Masters', '[\"Literature Review\",\"Review Article\"]', NULL, '2023-12-12 05:26', '1000', '6379Screenshot_2023-12-04-10-43-56-752_com.miui.notes.jpg_$_6379Assingment  Format-1.docx_$_', '04-12-2023 10:48:08', 'student', '14', NULL, -1, -1, -1, -1, -1, -1, 1, NULL, NULL, NULL, NULL, NULL),
(2163, 2163, 'Academic Writing', ' Business Report assessing the application of Corporate Strategy principles of GSK', 'you will write a business report on the same FTSE100 Corporation that you addressed in Assignment 1. Your target audience for your business report can be assumed to be a UK-born and educated executive of an investment firm reviewing their investment in the FTSE100 Corporation you are assessing. Note: any similarities among papers for the same FTSE100 Corporation, if any arise, will be readily apparent to markers and subject to UCL Academic Misconduct processes.\nThis assignment is designed to test your understanding and application of corporate strategy concepts taught in the module applied to a real-life corporation (you cannot use concepts not taught in this module). You are to research and assess these various components of corporate strategy for your FTSE100 corporation (as it is currently, not a historical account, although the administrative heritage of a corporation is certainly relevant to some of its competencies and positioning in its market today). Based on your assessment, write a concise, logically-structured business report about the mid- to long-term prospects of your FTSE100 Corporation to create value for its shareholders. Offer at least three impactful recommendations for enhancing the corporate strategy of your FTSE100 corporation, consistent with the content of this module.\nRemember, this is a business report (not an academic paper), where your target reader is a senior business executive. To promote stronger structured logical thinking and communication to concisely convey your argumentation, it is recommended that you follow a business writing technique such as Minto Pyramid Principle. This technique was highlighted in Session 1, covered in some depth in Session 4, embedded in illustrative reports provided on Moodle for Assignment 1, outlined in a number of our case study discussions, and links were provided on multiple occasions to two videos explaining the approach. You can also use Generative AI tools to explore the technique further.', NULL, 'Masters', '[\"Report Writing\",\"Case Studies\"]', NULL, '2023-12-07 13:00', '3500', '1872ASSIGNMENT DETAILS.pdf_$_1872MSIN0080_Team 17_GSK.pdf_$_', '04-12-2023 11:40:23', 'student', NULL, NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
