(2176, 2176, 'Academic Writing', ' Big Data Management', 'Follow the marking guidelines provided in the Management School Student\nHandbook. Your assignment will be assessed according to the following\ncriteria:\n1. A good knowledge and understanding of the academic and\ntheoretical material\n2. A good knowledge and understanding of different business cases\n3. The ability to support your argument by reference to academic and\npractitioner sources\n4. A logically organized, clear and well-structured report\n5. Wider reading, beyond the material delivered in class\n6. Evidence of critical thinking relating to both the business cases and\nthe academic and theoretical material\n7. Good use of English and use of the Harvard method of referencing\n(this should be correct, consistent and thorough)\nPage 3 of 4\nThese are the criteria set out in the brief and these will be used to assess\nyour work. There is guidance to critical thinking and referencing in your\nModule Handbook that is available on CANVAS. Please be aware â€“ there\nis no â€˜one best wayâ€™ for achieving criteria 1-6 above, it is about you using\nyour judgment and discernment in problem-solving activities.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2024-01-04 00:00', '35', '6336Big data .pdf_$_', '05-12-2023 22:42:21', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2177, 2177, 'Academic Writing', 'PLANNING FOR RISK, UNCERTAINTY, AND COMPLEXITY', 'Use typical academic assignment structure, using a brief\nâ€œIntroductionâ€ with description of the context and scope of the\nstudy. Then, provide structured answers (using titles of sections\nand subsections) in tackling each of the questions above. Instead\nof a â€œConclusionsâ€ section, use a brief â€œPersonal Reflectionâ€\nsection where you summarise what you have learned from this\nassignment. Use academic references throughout the report to\nsupport your arguments.\nLength: Limit your report to 2500 words maximum. The minimum\nrequired is 2000 words. The cover page, introduction, tables,\nfigures, captions, formulas, titles, appendixes, references and\nPersonal reflection are NOT included in the word count.\nReferences: Use Harvard referencing method. If in doubt, refer to Journal\npapers, such as IJOPM, IJPM for appropriate format.\n(http://libguides.liverpool.ac.uk/referencing/harvard)\nReferencing: Use original thought, critical review and analysis methods in\nsubstantiating your arguments. ONLY include appropriate\nreferences (up to ten references are recommended) and you\nMUST ensure that these are CITED correctly and adequately in\nthe main body of the report.\nNote: Extensive referencing MUST NOT be used and you\nMUST understand that paraphrasing is considered a form of\nPLAGIARISM and these are NOT ACCEPTABLE. Make sure\nyou comply with the Academic Integrity Policy adopted by the\nEBUS534 - PLANNING FOR RISK, UNCERTAINTY, AND COMPLEXITY ACADEMIC YEAR 2023/24\nASSIGNMENT\nPage 2 of 9\nUoL (https://www.liverpool.ac.uk/media/livacuk/tqsd/code-of-\npractice-onassessment/appendix_L_cop_assess.pdf).\nFormat: Use DOUBLE LINE SPACING, font size 12', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2024-01-10 00:00', '35', '6336EBUS534_Assignment_Autumn202324.pdf_$_', '05-12-2023 22:43:52', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
