(2180, 2180, 'Academic Writing', 'Management in globalised context ', 'Case Study:\nFor Part A you are required to choose your own business ethics case study. You can use one that we have covered in class, or one that you have found yourself. Please check with your tutor if you are using your own case study. Your task is to produce a brief report for the relevant company identifying the ethical problem and making three specific recommendations, justified with reference to an ethical theory covered in class.\nTopic-Walmart ', NULL, 'Masters', '[\"Report Writing\",\"Case Studies\"]', NULL, '2023-12-07 11:00', '2300', '7173MGT4161 Management in a Globalised Context Assignment.pdf_$_7173MGT 4161 Lecture 3 ( Theories of Ethics).pptx_$_7173MGT 4161 Lecture 2 (Contextualising Business Ethics).pptx_$_7173LW10 Applying Theories to Case Studies (1).pptx_$_', '06-12-2023 17:08:50', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
