(2183, 2183, 'Academic Writing', 'Sustainable Shopping: Analyzing UK Millennial Urban Consumers \'  Ethical Choices, Influenced by Climate Change, Using Rokeach \' s Value Theory, and Shaping the Future of Marketing.\"', 'Using personal values theory, identify an ethical problem and evaluate its influence on the contemporary consumption behaviour of consumers. \nDevelop conclusions from your evaluation. \nUse these conclusions to develop a â€˜future imaginationâ€™. \nYour future imagination should identify and explain how consumers and their behaviour will evolve in the future to help address your ethical problem. It should include how marketing can support them to achieve this. \n\nIn addressing the above question, you should make the following choices:\n1)	Choose a specific consumer segment who engage in a specific consumption behaviour occurring in response to an ethical problem. You can phrase this as a problem or opportunity. Here are some suggestions to help you to develop your own ideas. You do not need to choose from any of them. You can chose anything that will enable you to answer the assignment question. Please ask your tutor if you are unsure:\nï€­	Climate change and sustainable development, e.g. sustainable consumption; consumption reduction (e.g. shifting lifestyles to sharing/leasing not buying, pre-owned/recycled/ repurposed consumption choices); consumer activists and anti-consumption. \nï€­	Ethics of artificial intelligence in consumption choices. Examples include designing AI to inform consumerâ€™s decision-making (e.g. online shopping â€“ getting purchasing right first time to prevent waste). Developing positive body image Chabotâ€™s to promote a healthy body image among younger consumers to address negative body-image problems.\nï€­	Ethics of dietary choices. For example, in response to food/water insecurity, biodiversity, and animal welfare considerations. This has supported shifts to â€˜different lifestylesâ€™ including vegan, flexitarian, anti-meat, artificial food (e.g. lab-made â€˜meatâ€™).\n2)	Focus on one consumer segment pertinent to your topic and country/sector choice. You should develop a profile of this segment, providing as much pertinent information as you can, e.g. using socio-demographics, psychographics. Please present visually, or in table format, fully referenced.\n3)	Focus on one country for your essay. Having this focus will make it a lot easier for you to identify and evaluate the evidence within the word limit specified.\n4)	While you are required to use personal values theory for your essay, you MUST focus on a specific model or framework within it. For example, Rokeach, Schwartz, VBN model, etc. Choose ONE of these. Do NOT include multiple values frameworks/models in your essay because this will undermine the depth of analysis you can achieve within the 3000 word count limit.\nOnce you make the above choices, you are required to investigate research evidence from academic articles, news from legitimate sources, industry reports etc. to critically analyse how consumer behaviour has changed in response to the ethical problem you have identified. Building from this appraisal, you will explain, evaluate and apply your values framework/model to your chosen issue. This will enable you to develop evidence-based analytical conclusions, from which you can create your future imagination.\n\n\nUse of AI (important)\nWhere students use generative artificial intelligence (AI) and AI-assisted technologies in the writing process, students should only use these technologies to improve readability and language. Students should not use AI tools to seek or select resources, draw insights from materials collected, or to assist in writing any parts of the assignments. \n\n', NULL, 'Masters', '[\"Research Paper\"]', NULL, '2023-12-11 01:00', '5', '8904consumer behaviour handbook.docx_$_', '07-12-2023 12:51:54', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
