(2194, 2194, 'Academic Writing', 'BUSINESS ANALYTICS', '\nAn important aspect of business analytics is good communication. You are asked to produce a 2,500-word report to address the above two cases formally as a business analyst covering the below issues:\nï‚· The role of analytics\nIntroduce the role of analytics in helping cosmetics companies and restaurants grow. Specifically, what goals such businesses try to achieve via analytics? How are such goals achieved? What problems those industries usually face? You may wish to use market research to highlight how analytics can be used to achieve business goals.\nï‚· Data sources and available software\nApart from collecting their own data and using Excel to drive their decisions, where can Kevin and Helen source their data from? Are such external sources trustworthy? Do they pose any problem in terms of accessibility, quality and ethics? Give examples of such datasets and aim to integrate them with the datasets you have leading to more informative analyses.\nHighlight any software available that are suitable to analyse the data and how those would differ to Excel.\nï‚· Understanding the Dataset\nUsing the dataset â€˜glam_marketing.xlsxâ€™ found on Moodle, describe the data types used in this case and possible methods of data analysis. What metrics/KPI would you seek from such analysis?\nFor the dataset â€˜hatts_restaurant.xlsxâ€™ found on Moodle, explain how the data should be organised based on its type justifying your decision.\nï‚· Data Summarisation / Visualisation\nCreate summary statistics and tabular summaries for variables in both of the two datasets. You may want to show how two variables interact with each other. Produce Visualisation charts to support your background story and provide a data-driven context for the two businesses â€“ Glam Marketing and Hatts Restaurant.\nï‚· Modelling & Analysis\nFor Glam Marketing data, compute confidence intervals for means and proportions and analyse the sampling errors (assuming 95% of confidence). Explain how a larger sample size would help in obtaining more precise estimates. Also, propose the analytics type that would give meaningful insights to Kevin and run such analysis.\nFor Hatts, run a sales forecast for the 4th year and explain what the model say to Helen.\nï‚· Decision-Making\nIn light of the background, summary, graphical representation and modelling results, recommend decisions within both businesses of Kevinâ€™s and Helenâ€™s.\nï‚· Ethical Consideration\nHighlight any possible breach of the ethical data usage as well as any privacy concerns. Also, reflect on the impact of data analytics within both industries on sustainability in light of any sustainability guidelines/frameworks.\nï‚·\n- -\n- -\n- - -\nPresentation of the report\nYour report should have an executive summary, which summarises the whole report in a few words (usually about ~200 words)\nYour report is expected to use Harvard Referencing style and a minimum of 15 references from a mix of web articles, academic papers, industry reports and books should be cited.\nAim to include tables, figures and graphs whether produced from the datasets or sourced from another secondary source.\nDo not exceed 4,000 words (excluding title page, table of contents, references and appendix)\nUse Arial font with size 12, 1.5 spacing and justify your lines.\nAdd a table of contents for section headings and sub-sections.\nUse simple explanations and avoid jargon whenever possible.\nWhile performing the above tasks, document your steps of answering the questions by using screenshots of the functions you are applying in excel. Add those to the appendix section. You are expected to submit an analytical report and, at least, two worked Excel files with your solutions in them.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-12-20 13:00', '4000', '1914Hatts.xlsx_$_1914glam_marketing.xlsx_$_1914BMGT7074 Assessment 2 brief 2023-24.pdf_$_1914BMGT 7074 Module Handbook 2023-24 v2.pdf_$_', '09-12-2023 08:11:53', 'student', '4', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
