(2198, 2198, 'Academic Writing', 'Financial mapping of England and wales cricket board', 'You will be required to give advice to the Board of Directors for a specified case study (i.e., a sport organisation of your choice), based on a number of key financial and non-financial matters.  This will take the form of an individual, 20-minute pre-recorded presentation.\nAs we will be using Gymshark, Manchester United, England Hockey, Warwickshire County Cricket Club, Exeter Chiefs Rugby Union Club, and Pure Gym as case studies during the module, you cannot use these organisations for your assessment.\nThe assessment will be summatively assessed by the submission of a video recording of your presentation.\nThis assessment will be based on a 20-minute pre-recorded presentation prepared by each student.  The recommended software for your presentations is â€˜Screencast-o-maticâ€™, although other MP4 software can be used.\nBelow is the required structure for your presentation:\nâ€¢	Introduction â€“ Overview of the purpose of the presentation, relevant context and methods.\nâ€¢	Financial health of your organisation - Establish the financial position and performance of the organisation using financial ratio analysis.\nâ€¢	Organisational challenges - Critically evaluate the problems faced by the organisation and consider potential solutions that are realistic and achievable.  These challenges will be short-term (i.e., within one year) and longer-term.  \nâ€¢	Recommendations - Provide a clear and prioritised set of recommendations that are consistent with the evidence provided.\nYour presentation should be referenced using the APA 7 Referencing system.  A reference list should be included at the end of the presentation.\nThere is no specific word count for this assessment.\nSlides should be around 20-25 slides.', NULL, 'Masters', '[\"PPT Making\"]', NULL, '2023-12-13 03:00', '3000', '3612Example assessment - Bristol City Financial Health Analysis.pdf_$_', '10-12-2023 22:06:53', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
