(2211, 2211, 'Academic Writing', 'CASE STUDY: COATS INDONESIA-LEADERSHIP CHALLENGES IN AN UNFAMILLIAR CULTURE', 'Using relevant cross-cultural theories, analyse the information found in the case study from a cross-cultural perspective and supplement it with relevant wider reading and external research. Based on your analysis, write a report to Anrag Bhatt (AB), Managing Director (MD) of Coats Indonesia in which you address the following questions:\n\n1.	How is the national culture in Indonesia, where the operations are located, different from the national culture of United Kingdom, where the company is headquartered, and from the national culture of India, to where Anurag Bhatt belongs and has developed his personal leadership behaviour? (Your answer should also include the implications of such cultural differences on employee and managerial behaviour). \n\n2.	What is inhibiting the Indonesian managers from accepting the senior position/role on offer, and rather than enthusiastically making a strong case for their own candidacy for the position of Head of Procurement, they are suggesting the suitability of the other candidates?\n\n3.	What are the short-term and long-term recommendations to be provided to Anurag Bhatt to get out of this impasse and find a Head of Procurement recruit. (Justify your recommendations).\n\n', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-12-14 16:30', '1502', '771000. NBS8061-ndividual Assignment (80%)_2023_24.docx_$_7710COATS Indonesia Case Study_DR Baddar Alhusan (1).pdf_$_', '11-12-2023 22:14:24', 'student', NULL, NULL, 1, 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2212, 2212, 'Academic Writing', 'Impact of Influencer Marketing on Consumer behaviour: A comparative Study with Traditional Marketing in Indiaâ€™s Small Businesses  ', 'This research seems to be rationale in terms of evaluating the access to different types of influencers on promotional posts. According to the opinion of Chopra et al. (2021) influencer marketing has its own antecedents of consumer behaviour, which attracts differently on consumers. For example, the customers fall within the category of millennials, responses differently being influenced by influencer marketing. On the other hand, Belanche et al. (2021) claims about the crucial role of congruence between influencers and the users that positively effects on consumersâ€™ attitude. In this respect, influencers offer facts, information, creates content on products, or services to be provided using innovation to increase followers on social media platforms like Instagram pages, Facebook pages, which is mainly influenced by small cafÃ©, and cloud kitchen businesses opened over the past two years in metro cities of India as well (Masuda et al. 2022). These also impacts on consumers and make presentable from influencer marketing, which is not included in traditional marketing promotions.\n\nThe rationale of conducting this research would be explore key marketing tactics, which is followed by influencer marketers and how it impacts on consumer behaviour in broader scale (MartÃ­nez-LÃ³pez et al. 2020). In addition, it would identify and examine the area of any brand credibility on social media, which impacts on consumersâ€™ trust level (Lee and Kim, 2020).\n', NULL, 'Masters', '[\"Dissertation Writing\"]', NULL, '2024-01-03 00:00', '30000', '1280Dissertation Marking Criteria BUSM106.pdf_$_1280BUSM106 Module Outline - MSc Dissertation | MyQMUL.pdf_$_', '12-12-2023 00:42:13', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2213, 2213, 'Academic Writing', 'Understanding consumer behaviour individual project', 'This assignment consists of one question. Your answer should be no more than 2500 words (including everything except the\nReferences/Works\nCited/Bibliography). The Individual Final Project is due on 22nd December, 15:00h, and needs to be uploaded on QMplus. Your answers will be graded based on the following criteria:\nâ€¢ Relevance and correctness of information used\nâ€¢ How well is this information integrated\nâ€¢ Extend of in-depth analysis\nâ€¢ Evidence of learning from lectures, seminars, and required readings\nâ€¢ How well structured and balanced is the answer\nâ€¢ Appropriateness of examples given\nYou are expected to use the literature that we discussed during the semester, what was presented in lectures and seminars (goes beyond course textbook!) and additional articles that were specified in the module handbook as\n\"Required Readings\". For the question, you are required to use at least 8 scientific sources (e.g., articles, books, chapters). Non-scientific websites, blogs, and related social media content do not count towards this limit and should be avoided, if possible. References should be correctly cited in the text and also listed in the Reference/Bibliography section at the end of each answer. Question 1: Analysing a commercial\nThe purpose of this\nassessment is to give you an\nopportunity to apply the consumer behaviour principles and theories discussed in the module and the corresponding chapters in the textbook to evaluate an actual marketing commercial. Students will choose one of the five possible commercials and analyse the different consumer behaviour aspects that contribute to the commercial \' s (lack of) success.\nPlease choose one of the five commercials and analyse the use of (some of) the theories and principles of consumer behaviour (e.g., Motivation, ability, & opportunity; Exposure,\nattention, & perception;\nCategorizing & comprehending information; Forming & changing attitudes; Forming & retrieving memories; The decision-making process; Psychographics; Marketing, ethics, and social Responsibility):\nCommercial #1 (Fiat 500X):\nhttps://www.youtube.com/watch?v=kCM2X9ToLlg\nCommercial #2 (Direct TV):\nhttps://www.youtube.com/watch?v=4kfVpVpw7Uo\nCommercial #3 (Berlitz):\nhttps://www.youtube.com/watch?v=xZ9nvYCDUUw\nCommercial #4 (Amazon Prime):\nhttps://www.youtube.com/watch?v=r6XKV1RSQOY\nCommercial #5 (BMW):\nhttps://www.youtube.com/watch?v=ACMHwzy_Xzk\nPlease note that you do not have to include all of the theories and principles!! It is much better to choose one or two of these principles and describe & apply them in detail rather than listing all psychologic core principles and only covering them superficially. In your analysis, you could consider things like:\nâ€¢ How are consumers \'  motivation, ability, and opportunity addressed?\nâ€¢ How are consumers exposed to the product/service/brand?\nâ€¢ How does the commercial try to capture consumers \'  attention?\nâ€¢ How is consumers \'  perception influenced?\nâ€¢ How do consumers understand the message of the commercial?\nâ€¢ How are consumers \'  attitudes shaped or changed?\nâ€¢ How are emotions being manipulated? What is the goal behind that?\nâ€¢ How is the decision-making process influenced?\nâ€¢ How is the commercial related to ethical considerations in marketing?\nâ€¢ How are different psychographics aspects (e.g., values, personality) used?\nMore guidance\nThe most important aspect of the assignment is to correctly apply the course theories. Answers that do not use these theories, or that demonstrate a lack of understanding of the theories (as discussed in class and in the course readings), will be deemed unsatisfactory. Answers that use definitions or conceptualizations of the theories that are inconsistent with the way they were discussed in the course will also be deemed unsatisfactory.\nThe second most important aspect of the assignment is to apply the theories insightfully. This includes understanding the theories well enough to use them in the analysis of the chosen commercial. For example, stating that the commercial attracts consumers \'  attention is not very insightful because most commercials are designed to attract attention. A good answer would demonstrate a deep understanding of the course theories and apply them insightfully as they relate to the unique aspects of your chosen commercial. Ideal answers will include four sections:\n1. Short description of the commercial you are going to analyse. This will help you focus on the most important aspects of the commercial.\n2. Analysis of the commercial from the perspective of the consumer behavior principles. This section should briefly describe the theories and principles that are relevant for your analysis. Then you should use these theories and principles to examine the commercial and explain how they were implemented. Use subheadings to structure your analysis.\n3. Short evaluation of what was good and bad about the commercial. This should be based on your analysis and not only just your personal opinion. It is fine to let your personal opinion and preferences guide your thoughts in this section, but your statements in this section should be backed up by your analysis. Simply saying that you liked it (or did not like it) is not enough. It has to be based on your analysis in section 2.\n4. References/Bibliography. Use formal citation rules (either APA or Harvard).', NULL, 'Masters', '[\"Essay Writing\",\"Report Writing\",\"Research Paper\"]', NULL, '2023-12-13 03:00', '4000', '27254f0b6aae-0772-4cb3-b25f-f494dce37f13.jpeg_$_27254493fc9f-b042-4865-8821-5a845221475d.jpeg_$_2725ec8b20dd-3b8d-4952-9d74-17005dfc8ea3.jpeg_$_2725436eb584-d708-41a5-bf0a-4dd3e7edefa0.jpeg_$_27251a87b063-4f46-48a2-ab50-fb0ee8737194.jpeg_$_2725cefdc8ae-81cf-4969-9b48-efc7c7026062.jpeg_$_', '12-12-2023 22:10:02', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2214, 2214, 'Academic Writing', 'BUSM094 â€“ Introduction to Marketing Theory and Concepts Assessment 1. Individual essay (100%): A 3000-word essay ', 'Marks of up to 5% points will be deducted if you overshoot the word limit. However, you may exceed\nby 10% (i.e. 3300 words).\nGeneral idea: Analysis of a brand and a brand failure.\nYou should select a brand that is different from what you are working on in other modules (because\nof self-plagiarism).\nPart A (Background, SWOT, and Brand Personality)\nï‚· A1 Background: Provide a brief background of the brand. You can use non-academic resources\nin this section. This section should give a general background of the brand (providing some\nfacts and figures would be useful). Support your arguments with reliable resources, facts, and\nfigures.\nï‚· A2 SWOT Matrix: 3-4 points per cell would be enough. You must support your claims with\nreferences. Simply saying â€œStrong brand imageâ€ as a strength is not enough (even if the brand\nis well-known). Facts and figures? Statistics? Reliable reports? Evidence? Unreferenced claims\nare not acceptable.\nï‚· A3 Brand Personality: In this section, the student is expected to discuss/identify the\npersonality of the selected brand (see Aakerâ€™s brand personality framework). A brief literature\nreview of â€˜brand personalityâ€™ is needed. Support the identified personality with some pieces\nof evidence (e.g. advertisements, marketing campaigns, pricing, videos, design, logo, package,\noffering, communication channels, sponsorship, or ANY other marketing element/activity).\nPut screenshots and explain/interpret your evidence and claims. Donâ€™t leave your screenshots\nand evidence without explanation and interpretation. For instance, if you put a screenshot\nfrom a video, briefly explain the video, then provide your interpretation and analysis of how\nthis video creates/strengthens the identifies brand personality. What elements or messages\nin the video align with the identified brand personality?\nGeneral idea of Part B: Part B focuses on a failed marketing activity. The activity can be an\nadvertisement, a marketing campaign, a brand extension project, a product introduction, and etc. As\na result, you should select a brand that had a failure in the past. At first, the failure should be\ndescribed, and then, using one of the frameworks we had in the module (e.g. the 7Ps model, PESTLE,\nSWOT (weaknesses or threats), Porter \' s 5 forces, etc.), the essay should explain/analyse the\nreason(s) of the failure. You do not need to use the whole framework to analyse/explain the failure.\nNormally, the failure can be explained with one or two elements of a framework. Pick only those\nelements that are related to the failure and can explain it. For example, if your selected brand had a\nfailure in an advertisement, the 7Ps model would be a good choice. Then, you may focus on\nâ€œPromotionâ€ part of the 7Ps model (because advertising is a Promotional activity). You do not need to\nuse all the other elements of the 7Ps model in this case. The essay also needs to provide evidence to\nshow that the failure undeniably happened (for instance, a decrease in sales, negative comments on\nsocial media, boycott by consumers, a decrease in market share, significant customer dissatisfaction, being unable to attract customers in the target market, and etc.).\nPart B (Failure Case, Literature Review, Discussion, and Recommendations)\nï‚· B1 Failure Case: The essay should describe what happened (the story of the failure). You must\nprovide evidence to show that the failure undeniably happened (i.e. why do you think that it\nwas a failure for the brand?).\nï‚· B2 Literature Review: This section briefly reviews the literature of the selected framework\n(e.g. the 7Ps model, PESTLE, SWOT (weaknesses or threats), Porter \' s 5 forces, etc.). You should\nnot talk about the brand and its failure in this section. Use this section to review the literature,\nmarketing theories, and concepts. Use of academic resources (i.e. academic articles from\nacademic journals, textbooks) is expected in this section. First, provide a general and brief\nreview of the selected framework (a short paragraph would be enough). Then, focus on the\nliterature of the selected element(s) (e.g. definitions, the importance, different types,\nantecedents, outcomes, relationship with important KPIs, etc.).\nï‚· B3 Discussion: This section discusses why the failure happened by using the literature. Try to\nreason and argue in this section, and support your arguments with the literature. Hence, it is\ntime to link the failure story with the literature/theories/concepts reviewed in the previous\nsection. In fact, you should explain the reason(s) of the failure with an academic language (by\nâ€œacademic languageâ€, we mean the literature you reviewed). You might also want to compare\nyour findings with the findings in the literature. Do you see any consistency or inconsistency?\nï‚· B4 Recommendations: Provide 3-4 recommendations. The first recommendation must be\nrelated to the failure case (explain how they could prevent the failure). Other\nrecommendations can be in any aspect. Taking a look at the weaknesses in your SWOT table\nmight be helpful. You need to be as specific as possible. Support your arguments to show that\nyour recommendations really enhance the brand. General recommendations are normally\nshallow and vague.\nReferences: Lists the papers and the sources you have used (Harvard style).\nAppendices (optional): Use this section if you need to provide any information that you cannot\nmention it in the main body of the essay (maybe tables, graphs, charts, and etc.).\nThe word count for this assessment does not include reference lists and appendices.\nName your file as: BUSM094 [full name] [stu. number] e.g. BUSM094 Johnny Depp 1234567\nThe following table may be informative and help you to have an estimate regarding the length of\neach section. You do not necessarily need to follow this table for your essay.\nParts Sections Words (approximately) Weight\nPart A\nA1 Background 200\n30%\nA2 SWOT 400\nA3 Brand Personality 400\nPart B\nB1 The failure case 300\n60%\nB2 Literature review 700\nB3 Discussion 700\nB4 Recommendations 300\nReferences - - 10% (Ref and writing)\nAppendices - - -\nYou are NOT allowed to select Southwest Airlines Co., Coca-Cola, or Burger King as\nyour brand since the focus of the provided exemplars are on these brands.', NULL, 'Masters', '[\"Essay Writing\",\"Research Paper\"]', NULL, '2023-12-14 00:00', '4000', '2725Assignment Brief BUSM094.pdf_$_2725Week 02 - Lectures - BUSM094.pdf_$_2725Assignment Brief BUSM094.pdf_$_2725Week 08 - Lectures - BUSM094.pdf_$_', '12-12-2023 22:17:02', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
