(2227, 2227, 'Academic Writing', '\"Intellectual property law-making at the international level is path dependent with the result that no changes of substance have been produced since the late nineteenth century.\"  Critically discuss.', 'essay of 4000 words in the context of law and the other requirements are stated below..\nA list of research essay topics appears below.  Students may choose an essay topic from this list.  Topics from this list may be answered generally or with reference to a particular case-study.  Alternatively, students may develop their own essay topic in consultation with me.  Students wishing to develop their own essay topic must finalise that topic with me by Tuesday 15 November.  Essays on topics other than those set out below may not be marked if students have not consulted with me as required in this paragraph.\n\n2.      For the purpose of writing this essay, students are expected to consult a range of primary and secondary materials.  The secondary materials consulted must go beyond the range of essential and further sources listed in the module guide.\n\n3.      The essay must be footnoted and all sources must be properly cited.  Failure to observe this obligation may result in the loss of marks.  Students are reminded that the failure to acknowledge sources relied upon may amount to academic misconduct.\n\n4.      A bibliography must be submitted with the essay showing all sources consulted.  The remarks in paragraph 3 in relation to academic misconduct are also pertinent to the obligation in this paragraph.\n\n5.      The word limit for the essay is 4000 words.  This word limit includes discursive footnotes, but not footnotes that only contain a citation to source.  The bibliography is not subject to the word limit. \n', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2024-01-05 00:00', '8000', '1230Assessment Information _ Birkbeck Moodle.html_$_', '15-12-2023 00:55:57', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2228, 2228, 'Academic Writing', 'Individual reflective portfolio ', 'I would need a 2000 word essay in a reflective format which requires a title page with assignment name, module code and name (BEM1023_A_12_202324), name of module leader(chris reedthomas), submission date, word count and should not contain my name as work as anonymous, a breif general introduction, one numbered chapter for each question, each chapter to have its own intro, main body and conclusions, A final conclusion section and references. Rest of the details will be uploaded my me in assignment guidelines section and the deadline is according to UK time. The question 2C requires evaluating peerâ€™s presentation for which here is a link- https://drive.google.com/file/d/1ABs4nQme0lSiJi0I97-eTllFKK9in0MG/view?usp=drivesdk', NULL, 'Bachelors', '[\"Essay Writing\"]', NULL, '2023-12-15 13:00', '2000', '8176IMG_2771.jpeg_$_8176IMG_2770.jpeg_$_8176IMG_2769.jpeg_$_8176IMG_2768.jpeg_$_8176IMG_2771.jpeg_$_8176IMG_2770.jpeg_$_8176IMG_2769.jpeg_$_8176IMG_2768.jpeg_$_', '15-12-2023 01:46:32', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2229, 2229, 'Programming', 'Portfolio project ', 'In this portfolio assignment i have received a dataset named â€˜exam2023-24.csvâ€™. This contains the monthly returns for Fama-french 10 industries portfolio and corresponding financial ratios from January 2000 to December 2022. The file name â€˜ Industry_Financial_Ratio_Manual.pdfâ€™ contains the financial ratios with definitions. The returns are already provided as risk free returns. For part A i have to write the code in rstudio for the in sample data and assess it and write the answer(2-3 lines) to the questions in part A in a word document. Part B is also the same but for out of sample data. The finished assignment should be of 2 files in a zipped directory, first one is of the R code that generated the results and second file should contain the answer to the questions in a .pdf file.', NULL, 'Masters', '[\"Software\"]', NULL, '2024-01-18 09:00', '5000', '7484exam2023-24.csv_$_7484PORTFOLIOASSIGNMENT.pdf_$_7484Industry_Financial_Ratio_Manual.pdf_$_', '15-12-2023 02:44:23', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
