(2231, 2231, 'Academic Writing', 'International Business Strategy ', 'You have recently established a start-up business consulting firm with a group of business professionals and you are currently interested in attracting new clients. In the coming few months, you are planning to identify a multinational enterprise (MNE) that can potentially become your client, and arrange a meeting with its senior management to promote your services. To differentiate yourself from competitors, you will provide the prospective MNE client with a report in which you identify a key challenge, of a strategic and international nature, the MNE is experiencing at the moment and you will offer recommendations for addressing this problem.\nTopic- Gucci \n3000 words', NULL, 'Masters', '[\"Report Writing\",\"Case Studies\"]', NULL, '2023-12-15 20:00', '7000', '1995MGT4100 - Assessment 1 Group Report AY 202324 Dubai.docx_$_', '15-12-2023 13:35:36', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
