(2236, 2236, 'Academic Writing', 'The Individual report', 'The Individual report\nFor the individual report, students will need to select a specific brand or product within the market they\nsegmented in their group project and assess their chosen brand on three elements: targeting strategy,\npricing strategy, and branding strategy. For each of these elements, students are required to discuss the\ncurrent strategy employed by the company and offer suggestions for future improvements. Targeting,\npricing, and branding strategies will be discussed in the class throughout the semester, and students will\nbe provided with appropriate frameworks to these strategies. Additionally, multiple case studies discussed\non each topic will also aid students in evaluating strategies and providing actionable recommendations.\nThe report should include four sections:\nSection A- Brief overview of the brand (Desk research using SWOT or 5Cs)\nSection B- Targeting strategy (current strategy, your recommendations)\nIn this section, students are expected to refer to the segmentation table that created in their group projects\n(include it as an image) and discuss which of those segments the brand is targeting and how (e.g.,\nmultisegment approach, niche targeting, etc.). After explaining the current strategies, they should outline\ntheir evaluations and recommendations for future improvements.\nSection C- Pricing strategy (current strategy, your recommendations)\nStudents are not required to calculate specific prices but rather provide an overall overview of the type of\nthe type of pricing strategy(s) their chosen company is using (e.g., penetration pricing, price skimming,\npremium pricing, bundle pricing, freemium pricing, etc.). After elaborating on company \' s pricing\nstrategy(s), they should outline their own evaluations and recommendations.\nSection D- Branding strategy (current strategy, your recommendations)\nIn class, we will discuss three branding strategies (mindshare, emotional, and cultural). In this section,\nstudents are expected to explain which of these strategies the brand is using and why. After elaborating on\nthe companyâ€™s branding strategy, they should outline their own evaluations and recommendations for\nfuture improvements.\n8\nGeneral Notes on Written Submissions\nWord count\n1. You are allowed to exceed by 10% for each assessment.\n2. Tables, diagrams, and figures copied from other sources will not count toward the word limit\nand can be placed in the appendix section. However, if you use multiple sources and create\nyour own summaries (e.g., summary tables or diagrams), they will count toward the word limit\nand should be included in the main text.\n3. References are not included in the word count.\nFormatting requirements\n1. The cover page must include your name and the selected product and market.\n2. The report should be in PDF format with page numbers on all pages except the cover page.\n3. The report should use a 12-point font.\nReferencing\n1. Referencing is essential for academic integrity. Always attribute other people \' s ideas by\nreferring to the author or source name. Failure to reference or incorrect referencing will result\nin a significant loss of marks.\n2. This module encourages students to use the Harvard Referencing Style, an author-date system.\nPlease refer to this QMplus page, the QMUL Libraryâ€™s Guide to Referencing, and/ or this\nwebpage when you need guidance and resources on proper referencing.', NULL, 'Masters', '[\"Report Writing\",\"Essay Writing\"]', NULL, '2023-12-21 03:00', '3000', '3207BUSM242Assessment Handbook2023Nov16.pdf_$_', '18-12-2023 12:35:19', 'student', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
