(2246, 2246, 'Academic Writing', 'Strategic entrepreneurship ', 'Startup chosen : CRED\n\nAssessment Two: Individual coursework (70%), 2,500 words excluding appendices\n\nSubmission date: 21st Dec 2023 3pm (TBC, Please refer to the QMplus module page)\n\nPart 1 (80%). The length of the report should be no more than 2000 words, excluding references and appendices. Marks may be deducted if you overshoot the word limit. The stated word counts maybe exceeded by a maximum of 10%. Please pay attention to academic writing and referencing style.\n\nChoose a start-up (less than 7 years old) that you find interesting, conduct research, and analyse the start-upâ€™s business model and scalability. It could be a start-up you read in the news or a competitor of your group project start-up. You mustnâ€™t choose a company that is already well established and has scaled significantly, such as Google and Facebook. The report \' s length should be no more than 2,000 words, excluding references and appendices.\n\nThe essay should demonstrate your understanding of the conceptual framework discussed in this module and how the framework might be applied to analyse the chosen start-upâ€™s business model. The coherence of essay structure, clarity in the overall presentation of the argument, and the appropriate use of literature and cases to support your argument are essential.  \n\nPart 2 (20%) - Individual reflection on your learning experience during this module. If you have used AI tools in your learning and group coursework, then your default assignment is option 1. If not, consider option 2 (500 words max). \n\n1)    The usage of AI tools. Please reflect upon how you used these tools in your learning experience. What are the benefits and risks of using these tools. Please be specific about the tools you have used in this module. You are required to include examples of prompts you have used for specific tasks in the appendices (not included in the word count).\n\n2)    Case study learning. What have you learned comparing before and after class? Use one case discussion as an example.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2023-12-21 00:00', '6000', '', '19-12-2023 23:43:50', 'team_member_14', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
