(2269, 2269, 'Academic Writing', 'The artistic versus marketing inter-functional conflict case- Case study', 'The case study, The artistic versus marketing inter-functional conflict case, is for your written assignment of 3,000 words (+/- 10%).\nYou must answer the set questions â€“ and provide clear referenced reasons for your decisions. What is crucial in this assignment is your reasoned arguments through wide reading of academic articles and research. \n \nQuestions to answer\n1. Examine the points of conflict in the case. What are the underlying issues that are driving the tensions?\n2. Are the tensions at the artistic/marketing interface natural and inevitable?\n3. Can steps be taken to improve organizational effectiveness and the relationship between the two functions.\nOne possible way of structuring this analysis of the case study is:\nSituation\nProblems\nPossible solution(s)\nEvaluation\nKey concepts: interdepartmental tension, inter-functional conflict, artistic/marketing interface, artistic administration, marketing, A&R Artists and repertoire (talent scouting and the artistic and commercial development of the recording artist: finding talent, overseeing the recording process, marketing and promotion).\n', NULL, 'Masters', '[\"Report Writing\",\"Essay Writing\",\"Case Studies\"]', NULL, '2023-12-28 00:00', '6300', '', '26-12-2023 10:50:20', 'team_member_4', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
