(2278, 2278, 'Programming', 'Programming for Finance coursework ', 'MN52128 Programming for Finance Coursework\nSubmission format: please submit a .ipynb file in Moodle. The file name should be your student ID. For example, if your student ID is 12345abc, then the file you need to submit is 12345abc.ipynb.\nSubmission deadline: 14:00 Thursday, 4 Jan 2024\nFrom task 11, please use equal-weighted return\nâ€¢ Task 1: Develop a Trading Idea and Data Retrieval\nâ€“ 1.1. Start by formulating a trading idea and identifying the necessary variables for your\nstrategy.\nâ€“ 1.2. Utilize the WRDS package and send SQL queries to download US data from January\n2018 to December 2022.\nâ€¢ Task 2: Data Cleaning and Summary\nâ€“ 2.1. Clean your dataset by retaining common shares listed on the three main stock\nexchanges (NYSE, AMEX, NASDAQ).\nâ€“ 2.2. Summarize the number of observations for each stock exchange in each year.\nâ€¢ Task 3: Predictor Variable Definition\nâ€“ 3.1. Define your predictor variable.\nâ€“ 3.2. Calculate the values for your predictor variable.\nâ€¢ Task 4: Summary Statistics\nâ€“ 4.1. Compute summary statistics for returns, your predictor variable, and market value.\nInclude average, median, standard deviation, minimum, and maximum.\nâ€¢ Task 5: Handling Outliers\nâ€“ 5.1. If there are outliers in your predictor variable, use trimming or winsorizing to\naddress extreme values.\n  1\n\nâ€“ 5.2. Show the summary statistics again after handling outliers. â€¢ Task 6: Portfolio Construction\nâ€“ 6.1. Construct 10 portfolios based on your predictor variable for each month. â€¢ Task 7: Portfolio Characteristics\nâ€“ 7.1. Calculate the average number of stocks and average market value for each portfolio. â€¢ Task 8: Top Holdings\nâ€“ 8.1. List the top 10 holdings in both the long and short portfolios in terms of market value.\nâ€¢ Task 9: Portfolio Returns and Visualization\nâ€“ 9.1. Apply both equal-weighted and value-weighted investment strategies on your\nportfolio.\nâ€“ 9.2. Compute the equal-weighted and value-weighted average portfolio returns for\neach portfolio.\nâ€“ 9.3. Create two bar charts: one for equal-weighted portfolio returns and another for\nvalue-weighted portfolio returns.\nâ€¢ Task 10: Market Data Integration\nâ€“ 10.1. Use the pandas-datareader package to retrieve market return and risk-free rate\ndata from the French data library.\nâ€“ 10.2. Merge this data into your main dataset.\nâ€¢ Task 11: Regression Analysis\nâ€“ 11.1. Perform regression analysis to estimate alpha and beta for each portfolio. â€“ 11.2. Report the t-values for both alpha and beta.\nâ€¢ Task 12: Portfolio Beta vs. Returns\nâ€“ 12.1. Create a scatter plot of portfolio beta against average portfolio returns.\nâ€¢ Task 13: Long-Short Strategy Evaluation\nâ€“ 13.1. Calculate the average of long-short returns.\nâ€“ 13.2. Construct a confidence interval for long-short returns.\nâ€“ 13.3. Test if long-short returns are significantly different from zero using a t-test.\nâ€“ 13.4. Estimate alpha and beta of long-short returns and present the corresponding\nt-values.\n2\n\nâ€¢ Task 14: Cumulative Portfolio Returns\nâ€“ 14.1. Plot the cumulative long and short portfolio returns on the same graph.\nâ€¢ Task 15: Cumulative Portfolio vs. Market Returns\nâ€“ 15.1. Plot cumulative long-short portfolio returns and market returns on the same\ngraph.\nâ€¢ Task 16: Performance Metrics and Risk Analysis\nâ€“ 16.1. Calculate Sharpe ratio, Sortino ratio, and maximum drawdown.\nâ€“ 16.2. Identify the month in which your long-short portfolio had the minimum and\nmaximum return.\nPlease ensure that your Jupyter Notebook or Jupyter Lab document is well-organized with\nclear explanations in markdown cells. Use appropriate headings and formatting for clarity\n\n', NULL, 'Masters', '[\"Software\"]', NULL, '2024-01-04 14:00', '8000', '', '01-01-2024 23:01:20', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
