(2280, 2280, 'Academic Writing', 'Shrm', 'Healthco is a not for profit that provides services to people with mental health issues. They employ 2,000 people in a very wide range of occupations from cleaners to specialist professionals such as psychologists, counsellors and general managers at a number of geographical locations throughout the UK. Staff have been working under enormous pressure thanks to the pandemic.  To date they have never held an attitude survey nor developed a strategy for engagement.  However, they have always considered the staff to consist of primarily highy motivated and committed professionals who believe in their mission and ethos which is â€œWe won \' t give up until everyone experiencing a mental health problem gets both support and respect.â€\nHowever, they are now experiencing problems with rising staff turnover, absence and believe that people may be struggling to stay motivated in the face of rising workloads and more traumatic cases.  They have recently identified two members of staff who they believe may be suffering from post-traumatic stress disorder as a result of dealing with a number of difficult cases over the last 18 months.  \nYour task\nAs a result, they have brought you in as an HR consultant to advise on how they can maintain or even raise employee engagement whilst also maintaining their commitment to clients.\nYou have been asked to prepare a report for the board of trustees suggesting how they might assess engagement levels and what strategies they might employ to address the issues they are experiencing.  Your report should contain the following information.\n1. What is employee engagement and how should it be defined and measured? (25%)\n2. How should Healthco go about developing a strategy for maintaining or increasing employee engagement levels and how should this fit into an overall strategy for HR? (25%)\n3. What specific HR strategies, practices or initiatives would help in creating higher levels of employee engagement within the organisation? (25%)\n4. Critically evaluate the potential risks and benefits for both employees and the organisation in introducing your proposed employee engagement strategy? (25%)', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2024-01-10 15:00', '2000', '7378780N1+-+Courswork+2+%282023%29.docx_$_', '03-01-2024 21:36:15', 'student', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL);
