(2281, 2281, 'Academic Writing', 'Portfolio ', 'The complete portfolio consists of five separate portfolio parts (1 to 5), each with a specified word count limit. Along with the Introduction and Final Summary, these five portfolio parts amount to 2000 words in total.\nYour submission must be made to Turnitin as a complete and single piece of work, made up of a Title Page, the five portfolio entries, along with an Introduction, Final Summary, Reference List and Appendix. The title page, references and appendix are not included in the final word count. Please ensure that your title page includes the title: â€œReflections on the Skills to Develop as a Future HR Professional/Leaderâ€, along with your Sussex candidate number and the word count. Please thoroughly check and proofread your work before submission. You are encouraged to write in prose, using appropriate headings and sub-headings throughout.\nThis is your summative assignment and constitutes your official Coursework 1 submission, worth 70% of your final module mark.\n \n \nThe topics, word count and weighting are outlined below.\nPortfolio Parts\nTopics\nWord Count Limit\nWeighting\n1\nSelf-Awareness & Professional Identity\n400\n20%\n2\nSelf-management: Time and Stress\n400\n20%\n3\nDecision Making, Problem-solving and Conflict Management\n400\n20%\n4\nLeadership and Teamwork\n400\n20%\n5\nManaging Financial Resources\n200\n10%\nFinal Complete Submission\nAll 5 entries, plus:\nIntroduction\nFinal Summary\nReference List Appendix\n \n \nTOTAL SUBMISSION\n1800 (5 entries)\n100 (introduction)\n100 (final summary)\n(no limit for references & appendix)  \n \n2000\n90% (5 entries)\n5% 5% (intro & summary)\n \n \n \n \n100%\n \n \n1. Self-awareness and Professional Identity [20%]\nUsing the appropriate academic literature, reflect on:\nâ€¢ Your personality, values, and your professional identity.\nâ€¢ Your career journey so far as well as your future career goals are and how you intend to meet them.\n2. Self-management: Time and Stress [20%]\nUsing the appropriate academic literature, reflect on:\nâ€¢ The importance of employability skills such as time and stress management.\nâ€¢ How you manage both stress and time pressure. Please provide examples from experience.\n3. Decision Making, Problem-solving and Conflict Management [20%]\nUsing the appropriate academic literature, reflect on:\nâ€¢ Your ability to make important decisions and/or solve difficult problems.\nâ€¢ Your experience of conflict, how you have dealt with it and what you would do differently in the future.\nâ€¢ What you would attend to as a manager in the future to encourage people to make â€˜goodâ€™ decisions and treat colleagues/subordinates respectfully.\n \n4. Leadership and Teamwork [20 %]\nUsing the appropriate academic literature, reflect on:\nâ€¢ Your experience of leading a team and/or being part of a team.\nâ€¢ How you have learnt to lead through direct experience and/or by observing others.\nâ€¢ What you suspect your own dark side to be and how you will try to keep this in check as you enter leadership positions.\n \n5. Managing Financial Resources [10 %]\nDrawing on the workshop activities, reflect on:\nâ€¢ How comfortable you are working with numbers and data.\nâ€¢ What you need to read about/learn more about to feel confident about handling financial data in a professional role.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2024-01-11 14:00', '2000', '7378775N1---Portfolio-(2023-24).docx_$_', '03-01-2024 22:11:30', 'student', '14', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
