(2291, 2291, 'Academic Writing', 'Ppt - Individual pitch ', 'Assignment Title:  Individual Pitch \r\n\r\nSubmission Date: Week 6, Wednesday 28 June 2023, 17:00 UK time\r\n\r\nExpected Return of Feedback and Marked Work:  14 days from submission \r\n\r\nAssignment Weighting:  5 Credit - 33%\r\n\r\nPitch duration: 5 Minutes \r\n\r\nLearning Outcomes Assessed in CW1:\n1.	Critically apply concepts of innovation and entrepreneurship in the context of new and existing companies.\r\n2.	Iteratively develop skills, behaviours and attitudes to lead entrepreneurial and innovation activities within rapidly changing environment.\n\rAssignment Guideline\nThis assignment is an individual assignment.\nThis assignment requires you to identify an organisation â€“ one you know well and preferably have worked in. You are required to prepare a 5-minute video reflection on your enterprising potential and how\r you can make a change in your selected organisations. You can use any video recording software or alternatively, a PPT\r (voice-over slides) is acceptable as well.\nThe video reflection should include the following key areas:\n1.	Succinct self-reflection based on the results of get2test or AULIVE creativity test and Mindwork test;\r\n2.	The innovation / enterprising role that you can play in your selected organisation;\r\n3.	Persuasive presentation, confidence, audience engagement, time management;\r\n4.	Quality of the slides or materials presented to support the pitch;\r\n5.	Evidence of preparation and planning\r\nRubrics\n\nhttps://culc-coventry-parse-bucket.s3.amazonaws.com/8e61f02e6e8eab302b3cbac0987d5c9a7003mhr_cw1.xlsx\n\nSubmission Link\n\nðŸ“ There will be a penalty of a deduction of 10% of the mark (after internal moderation) for work\r exceeding the time limit by 10% or more\nðŸ“ Read carefully and follow the CW Structure', NULL, 'Masters', '[\"PPT Making\"]', NULL, '2024-01-09 00:00', '4500', '', '05-01-2024 15:41:55', 'team_member_16', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2292, 2292, 'Academic Writing', '2500 words critical and peer review ', 'Students are require to submit a 2500 word assignment which shows critical analysis and evaluation of peer reviewed literature on the title below. The assignment forms 100% of the assessment for this module. \n\nCritically appraise the literature surrounding \n\n\"The efficacy and effectiveness of soft tissue massage on muscle recovery in athletic settings\"\n\n\nIntroduction \nA brief introduction to the area of study including muscle recovery and soft tissue massage. \n\nThis should not be a section on the history of massage and where it originated, but an introduction to key terms and concepts to prepare the reader for future discussion. This section should be written with consistent supporting literature.\n\nCritical review:\nBeing the main section, this should take the majority of your word count. This needs to be a critical evaluation or analysis of the CURRENT primary literature surrounding soft tissue massage and its efficacy in recovery, to form a coherent critical discussion. \n\nYou should incorporate the synthesis of theoretical knowledge and clinical reasoning to develop the critique; including where appropriate/relevant anatomical, biomechanical, physiological, research design knowledge (with supporting literature). \n\nConclusion:\n\nA concise summary of the main findings from your main body/discussion. Think of how a concise conclusion is presented in journal articles and follow suit.  Remember to highlight your key signposts that you have made during your essay here. \n\nReference List (not included in word count):\n\nAPA 7th style of referencing and be relevant, contemporary, current primary literature.\n\n\n\n3. Arrangements for submission \n\n\nYour individualised submission deadline will be available through your assessment submission point.  Although the Assessment Brief on the Module Guide includes details of the standard submission deadline, in all cases these become individualised for you, and presented to you through the assessment point itself.  This applies to all forms of assessment, with the exception of exams, where the date and time will be available in MyGlos approximately four weeks in advance, and certain forms of assessment such as presentations and performances, for which these details will be clarified by your tutor. \n\nYour assessment will be submitted online via Moodle in PDF format. Please name the files you are submitting using the convention:\n\nSP7059_STUDENT NUMBER (plus _FILE NUMBER if more than one file is being submitted)\n\nPlease ensure you do not use special characters (e.g. brackets, commas, speech marks, question marks, etc.) in the file name.\n\nThe Maximum file size for uploading is 100MB.', NULL, 'Masters', '[\"Report Writing\"]', NULL, '2024-01-05 00:00', '7000', '', '05-01-2024 16:21:19', 'team_member_16', '16', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2293, 2293, 'Academic Writing', 'Trade and multinational enterprise', 'Country A is considering to sign a free trade agreement with Country B, which would significantly liberalise trade flows between the two regions. You are tasked by the government of Country A to write a report (~2000 words) on the opportunities and threats that such an agreement would entail, including policy recommendations that you think would maximise social welfare.\nA few recommendations:\n1. You-need to ground your arguments in the economic theories we have developed in class.\n2. You may use illustrative examples used in class, the textbook, or from your own readings.\n3. Use data/indicators collected from reliable sources to support your arguments.\n4. The introduction needs to present the issue you are going to address, as well as a summary of your answer, including the policies you recommend.\n5. Develop then your different arguments, each time starting by a summary and then explaining it in detail with the help of an example.\n6. Take into account both the aggregate effects and the distributional ones (who are the winners, who are the losers).\nYou will be assessed on your capacity to apply the concepts and models seen in class in a concrete example, use quantitative indicators and examples to support your arguments, develop logical arguments in an organised fashion, write clearly and concisely.\nCountry A: Pakistan\nCountry B: China', NULL, 'Masters', '[\"Report Writing\",\"Case Studies\"]', NULL, '2024-01-08 21:00', '5200', '4273draft 5.pdf_$_4273draft 3.pdf_$_4273Data Sources for ECS4580 Coursework.pptx_$_4273ECS4580 Module Handbook 2023-24 (Dubai).pdf_$_', '08-01-2024 13:06:28', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2294, 2294, 'Academic Writing', 'land law (law 4006) - summative coursework 2023/2024', 'answer all the questions in a paragraph style plus the word limit is 1500 words which should also include citations which should be in the footnotes in OSCOLA format only ', NULL, 'Bachelors', '[\"Question & Answer \",\"Case Studies\",\"Essay Writing\"]', NULL, '2024-01-10 00:00', '1500', '4764LAW4006 Land Law - First summative assignment Jan 2024.pdf_$_', '08-01-2024 13:46:14', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2295, 2295, 'Academic Writing', 'Trade and multinational ', 'Country A is considering to sign a free trade agreement with Country B, which would significantly liberalise trade flows between the two regions. You are tasked by the government of Country A to write a report (~2000 words) on the opportunities and threats that such an agreement would entail, including policy recommendations that you think would maximise social welfare. \nA few recommendations:\nYou need to ground your arguments in the economic theories we have developed in class.\nYou may use illustrative examples used in class, the textbook, or from your own readings.\nUse data/indicators collected from reliable sources to support your arguments.\nThe introduction needs to present the issue you are going to address, as well as a summary of your answer, including the policies you recommend. \nDevelop then your different arguments, each time starting by a summary and then explaining it in detail with the help of an example.\nTake into account both the aggregate effects and the distributional ones (who are the winners, who are the losers). \nYou will be assessed on your capacity to apply the concepts and models seen in class in a concrete example, use quantitative indicators and examples to support your arguments, develop logical arguments in an organised fashion, write clearly and concisely.\nCountry A: South Africa\nCountry B: Australia', NULL, 'Masters', '[\"Essay Writing\",\"Report Writing\"]', NULL, '2024-01-08 19:30', '5500', '4707draft 3.pdf_$_4707draft 5.pdf_$_4707ECS4580 Module Handbook 2023-24 (Dubai).pdf_$_4707Data Sources for ECS4580 Coursework.pptx_$_', '08-01-2024 15:14:24', 'team_member_14', '14', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2296, 2296, 'Academic Writing', 'Trade and the Multinational Enterprise', 'You will be assessed on your capacity to apply the concepts and models seen in class in a concrete example, use quantitative indicators and examples to support your arguments, develop logical arguments in an organised fashion, write clearly and concisely.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2024-01-08 23:00', '6000', '2303Data Sources for ECS4580 Coursework.pptx_$_2303ECS4580 Module Handbook 2023-24 (Dubai).pdf_$_2303draft 5.pdf_$_2303draft 3.pdf_$_2303IMG_8111.png_$_2303IMG_8112.png_$_', '08-01-2024 15:52:55', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2297, 2297, 'Academic Writing', 'Global Supply Chain Management', '1. Select a multinational company which is famous for Supply chain strategy including outsourcing.\nNote 1: You can find a list of companies at: https://www.gartner.com/smarterwithgartner/the-gartner-supply-chain-\ntop-25-for-2021\n2. Analyse the international business strategy of the company.\nHow the company has evolved its international business strategies over time?\n3. Analyse the supply chain strategy of the company which includes lean/agile/leagile.\nHow does the company balance cost and responsiveness?\n4. Explain the strategies employed by the company to have a competitive advantage.\nHow the company maintained competitive advantage with the help of international supply chain drivers (five\ndrivers)?\nNote: Supply Chain Drivers: Facilities Planning, Outsourcing/Insourcing, Inventory management, Transportation/Distribution,\nInformation sharing.\nNote: Clarify how these five drivers are connected in the global supply chain of company. You should draw your distribution\nnetwork of the company.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2024-01-10 18:00', '5500', '', '09-01-2024 16:08:51', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2298, 2298, 'Academic Writing', '5MG001 The Professional Management and Leadership', 'For this assessment you must submit:\nï‚· 3500-word portfolio submission\nTask 1 â€“ 1500-word essay:\n                 1\n\n     Learning outcomes\nAssessmen t criteria (see rubric below for performanc e criteria)\nCharacteris tics of a good submission\nAdditional instructions\nProfessiona l Body\nFor a workplace of your choice. The organization wants to modernize its approach towards managing people and has asked you to do the following:\nExplore how leadership & management theory can support managers to develop successful professional teams.\nProvide examples from your own experiences and from research.\nTask 2 - 1500-word essay:\nAssess what drives Organizational Change and Evaluate how an Organizational Change model such as Kotterâ€™s 8 steps can support leaders to positively impact the success rate of an organizational change initiative.\nEnsure to use an example which focusses on organizational issues such as Lego, Pollack and Pollack, and XYZ Construction which can be found on the Canvas pages.\nTask 3 â€“ 500-words Critical Reflection:\nHow can the theory and concepts from the module be used to produce a positive workplace culture?\nUse examples and citations and consider the following.\nHow do the theories studied in the module relate to your experience of working with others Which leadership styles would you prefer to work under and why?\nHow has this module influenced the way you believe people should be treated at work?', NULL, 'Bachelors', '[\"Report Writing\"]', NULL, '2024-01-17 19:00', '6500', '23575MG001 The Professional Manager and Leadership Assignment Checklist (3) (1) (1).pdf_$_23575mg001 Assignment brief.pdf_$_23575mg001 Assignment brief.pdf_$_23575MG001 The Professional Manager and Leadership Assignment Checklist (3) (1) (1).pdf_$_', '09-01-2024 16:12:25', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
