(2300, 2300, 'Academic Writing', 'A Study on various factors influencing retirement planning behaviour of working individuals.', 'Minimum 60 pgs blackbook. Primary and secondary both data is compulsory. Primary can be Google forms with min 30 responses.Then its simple quantitative as well as Qualitative analysis has to be done based on data collected.like facts and figures and overall interpretation of responses.Research should contain graphs pie charts visual aids etc.\nPlagiarism max 10%\n\n', NULL, 'Masters', '[\"Black Book\"]', NULL, '2024-02-12 12:00', '20000', '7602GUIDELINES.pdf_$_', '10-01-2024 22:07:11', 'student', '4', NULL, 1, 1, 1, 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2301, 2301, 'Academic Writing', 'ESG investing strategy and portfolio analysis', 'One of your clients wants to invest Â£10,000. This is not the sum total of the investor \' s assets, but it will be invested in a socially responsible portfolio. It is assumed that the time horizon is short-to- medium-term.\nYour client is generally risk neutral but has broad mandate to invest in socially responsible companies. Hence the investment portfolio needs to incorporate ESG criteria i.e., screening for environmental, social and governance issues of the UK listed companies.\nYou are required to formulate an ESG investing strategy for your client and report the insights of your portfolio.', NULL, 'Bachelors', '[\"Report Writing\"]', NULL, '2024-01-15 22:00', '4000', '5016Lecture 8-Coursework Lecture 23-24.pptx_$_', '11-01-2024 16:12:44', 'student', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
(2302, 2302, 'Academic Writing', '1000 words - choice of music ', 'My music choice often depends on your mood. When feeling upbeat, might prefer listening to lively tunes, while during a low mood,Â  may opt for more melancholic songs ( feeling or expressing pensive sadness) .\n\n-During a bad mood, I prefer silence, avoiding conversations. Soft, sad songs offer solace, as talking might lead to tears.\n\n- Life unfolds like music, presenting unexpected twists each day. The future remains uncertain, much like the unpredictability of a melody.\n\n-Music often fills a unique emotional space, adding a depth to life that feels essential. The special feelings it evokes contribute significantly to our overall experiences.\n\n-Absolutely, music plays a vital role in various situations. In weddings or celebrations, it adds an essential element, and in movies, dialogue without music can leave a sense of incompleteness, highlighting the significance of music in enhancing experiences.\n\n- perspective is insightful. Indeed, nature \' s sounds, like a river \' s flow or rustling trees during exploration, are a form of music that connects with every living being. It reflects the idea that music is not just limited to human-made melodies but extends to the harmonies of the natural world.\n\n-On my first day in Singapore, I plan to sleep with soft music in my ears to ease the sense of loneliness. Despite knowing many people, the feeling of not truly knowing anyone can be isolating, as it seems like no one is reaching out.\n\n-During my one-year journey in Singapore, I lean on motivational songs as my companions. In moments of loneliness, I turn to them for solace, occasionally finding comfort in sad songs. I choose to handle my challenges independently, refraining from burdening my family with my struggles to maintain a positive atmosphere. Music becomes my constant source of motivation.', NULL, 'Masters', '[\"Essay Writing\"]', NULL, '2024-01-15 16:00', '2200', '', '12-01-2024 15:05:30', 'team_member_16', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
