(2306, 2306, 'Academic Writing', '3000 - words reflection writing ', '*References to be included from these resources also* \n\n1. Scrum : the art of doing twice the work in half the time / \nTitle: Scrum : the art of doing twice the work in half the time /\nAuthor: Sutherland, Jeffrey Victor,\nPublication Date: 2015.\nPlace of Publication: London :\nPublisher: rh Business Books\n\n2. The scrum fieldbook : a master class on accelerating performance, getting results, and defining the future \nTitle: The scrum fieldbook : a master class on accelerating performance, getting results, and defining the future\nAuthor: Sutherland, J. J.,\nPublication Date: [2019]\nPlace of Publication: New York :\nPublisher: Currency\n\n3. Leadership in the creative industries : principles and practice / \nTitle: Leadership in the creative industries : principles and practice /\nAuthor: Mallia, Karen L.,\nPublication Date: 2019.\nPlace of Publication: Hoboken, New Jersey :\nPublisher: Wiley Blackwell,\n\n4. CORE: Brilliant Agile project management : a practical guide to using Agile, Scrum and Kanban / \nTitle: CORE: Brilliant Agile project management : a practical guide to using Agile, Scrum and Kanban /\nAuthor: Cole, Rob,\nAdditional Person Name: Scotcher, Edward,\nPublication Date: Â©2015\nPlace of Publication: Harlow, England :\nPublisher: Pearson\n\n5. The lean startup: how constant innovation creates radically successful businesses \nTitle: The lean startup: how constant innovation creates radically successful businesses\nAuthor: Ries, Eric\nPublication Date: 2011\nPlace of Publication: London\nPublisher: Portfolio Penguin\n\n6. The project manager \' s guide to mastering agile : principles and practices for an adaptive approach \nTitle: The project manager \' s guide to mastering agile : principles and practices for an adaptive approach\nAuthor: Cobb, Charles G.,\nPublication Date: Â©2015; 2015.\nPlace of Publication: Hoboken, New Jersey :\nPublisher: Wiley\n\n7. Effective project management : traditional, agile, extreme, hybrid \nTitle: Effective project management : traditional, agile, extreme, hybrid\nAuthor: Wysocki, Robert,\nPublication Date: [2019]\nEdition: Eight edition.\nPlace of Publication: Indianapolis, Indiana :\nPublisher: Wiley\n\n8. Agile project management with Scrum \nTitle: Agile project management with Scrum\nAuthor: Schwaber, Ken.\nPublication Date: c2004.\nPlace of Publication: Redmond, Wash. :\nPublisher: Microsoft Press\n\n9. Learning by doing : a guide to teaching and learning methods / Graham Gibbs. \nTitle: Learning by doing : a guide to teaching and learning methods / Graham Gibbs.\nAuthor: Gibbs, Graham.\nAdditional Person Name: Great Britain. Further Education Unit.\nPublication Date: 1988.\nPlace of Publication: London :\nPublisher: FEU\n\n10. Making projects sing : a musical perspective of project management \nTitle: Making projects sing : a musical perspective of project management\nAuthor: Sivaraman, Raji\nAdditional Person Name: Wilson, Chris.,; Brown, Michael,; McCormack, Danny,\nPublication Date: 2016.\nPlace of Publication: New York :\nPublisher: Business Expert Press\n\n11. The Reflective Practice Guide : An Interdisciplinary Approach to Critical Reflection \nTitle: The Reflective Practice Guide : An Interdisciplinary Approach to Critical Reflection\nAuthor: Bassot, Barbara,\nPublication Date: [2023]\nEdition: Second edition.\nPlace of Publication: Abingdon, England :\nPublisher: Routledge\n\n12. CORE READING: Gibbs \'  Reflective Cycle - Helping People Learn From Experience \nTitle: CORE READING: Gibbs \'  Reflective Cycle - Helping People Learn From Experience', NULL, 'Masters', '[\"Review Article\"]', NULL, '2024-01-18 00:00', '6500', '', '16-01-2024 17:13:11', 'team_member_16', '16', NULL, 1, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL),
