(10, 'Krishnaraj Yadav', 8291594017, 'Don Bosco institute of technology ', 'IT', 'Gis technology for traffic analysis in mumbai', 'In this project, we have to collect live traffic data for Mumbai and with the help of that data set we have to do the analysis for traffic in mumbau', '14-10-2023 20:59:26', 0, '', '2023-10-31 00:00', 1, -1, -1, -1, 1, 'Complexity'),
