(16, 'Adnan Shaikh', 8692836650, 'Watumull Institute Of Electronics Engineering And Computer Technology ', 'Other', ' Esp32 Camera Surveillance Car ', 'The primary objective of this project is to create a versatile surveillance system \r\nmounted on a car chassis, capable of navigating diverse environments while \r\noffering real-time pan and tilt control for its cameras. This system will empower \r\nusers to remotely monitor areas of interest, such as public spaces, construction \r\nsites, or large private properties, enhancing security and situational awareness. \r\nThe project will utilize a customized car chassis with motorized wheels, \r\nallowing the surveillance camera car to move both indoors and outdoors. This \r\nmobility ensures coverage of a wide range of locations. \r\n The core of the system is a high-resolution camera equipped with pan and tilt \r\nmechanisms, enabling 360-degree horizontal and vertical viewing angles. Users  will have the ability to remotely control the surveillance camera car through a \r user-friendly interface, such as a mobile application or a web-based dashboard. \r\nThis control includes adjusting the camera \' s orientation in real-time. \r\nThe car will be equipped with wireless communication technology (e.g., Wi-Fi \r\nor cellular) to ensure seamless data transmission between the surveillance \r\nvehicle and the user \' s control interface. \r\nEfficient power management will be implemented to ensure extended \r\noperational hours. Rechargeable batteries and intelligent power-saving \r\nalgorithms will be key components. Recorded surveillance footage will be \r\nstored locally on the car and can be accessed remotely by authorized users. A \r secure and reliable data storage solution will be implemented. \r\nApplications: \r\n â€¢Security and Surveillance: Ideal for enhancing security in public areas, \r\nremote properties, and construction sites. \r\nâ€¢Event Monitoring: Valuable for monitoring large-scale events, exhibitions, or \r\ngatherings from a centralized location. \r\nâ€¢Search and Rescue: Can be adapted for search and rescue operations in \r\nchallenging terrains, providing real-time visual information to rescuers. \r\nâ€¢Environmental Monitoring: Used for environmental research to observe \r\nwildlife or conduct studies in remote locations.', '16-10-2023 18:02:45', 1500, '', '2023-10-31 00:00', 1, 0, 0, 0, 0, NULL),
(17, 'Pranjal ', 9960209632, 'Datta Meghe College of Engineering Airoli ', 'CS', 'Big Data Analytics Mini Project', '', '17-10-2023 19:49:37', 0, '', '2023-10-18 00:00', 1, -1, -1, -1, 1, 'Deadline'),
(18, 'OM KRISHNA HANKARE', 9820724251, 'Vishwaniketan institute khalapur', 'CS', 'SIGN LANGUAGE DETECTION USING AI', 'Sign language (SL) is the main means of communication between hearing-impaired people and other communities and it is expressed through manual (i.e., body and hand motions) and non-manual (i.e., facial expressions) features. These features are combined together to form utterances that convey the meaning of words or sentences. \nBeing able to capture and understand the relation between utterances and words is crucial for the Deaf community in order to guide us to an era where the translation between utterances and words can be achieved automatically.\n', '17-10-2023 19:50:16', 1000, '3062Major Project-format_VII.docx_$_', '2023-11-10 00:00', 1, -1, -1, -1, 1, 'Budget'),
(19, 'Jeevan Medge ', 7977718104, 'Vidyavardhini \' s College of Engineering and Technology ', 'Other', 'Comparative study on the seismic behaviour of Flat slab over Grid Slab using Software ', 'Considering Live project in the nearby region, we have to design conventional Slab, Flat slab and Grid Slab considering Seismic load and we have to compare them on the basis of different parameters such as Seismic behaviour, deflection in the slab, moment in the slab, estimation of project ', '17-10-2023 23:34:58', 4000, '', '2024-01-31 13:00', 1, 0, 0, 0, 0, NULL),
