(24, 'Mohammed Fazil Salim Shaikh ', 9323376246, 'Rizvi College of Engineering ', 'Other', 'Wireless EV charging system', 'Wireless electric vehicle chargingÂ involves the transfer of energy between a charging coil on the ground and a receiver on the underside of the electric vehicle. The charging pad is connected to a power station, and the energy is transferred through magnetic induction', '19-10-2023 00:28:01', 0, '', '', 1, 0, 0, 0, 0, NULL),
