(149, 461, NULL, '[\"Essay Writing\",\"Report Writing\",\"Literature Review\",\"Research Paper\",\"Primary / Secondary Data Analysis\",\"Review Article\",\"Thesis Writing\",\"PPT Making\",\"Case Studies\",\"Question and Answer Based\",\"Statement of Purpose\",\"Other\"]', 'bachelor\'s in business management ', '7PM - 12AM', '[\"Teacher Education,History and Geography,Maths for 11 and 12,Maths Aptitude,CAT - LR and DI,CAT - Logical & Analytical reasoning,CAT - Quantitative Aptitude,CAT - Verbal Ability,IIFT\"]', 'Freelancing ', '', 'https://drive.google.com/drive/folders/1oFnMgce6f7aDW2pE9hfmHwQplnXU5OFF?usp=sharing', 'https://www.linkedin.com/in/chiranjeevsrivastava/', 'I started working as a freelance maths instructor for school pupils during the Covid-19 lockout. I mainly taught algebra, geometry, calculus, and trigonometry to students in grades 10, 11, and 12. The instruction was done online utilising video conferencing capabilities because there were no classes.\r\n\r\nThe switch to online instruction was difficult at first. However, I quickly adapted to the online setting and created an interactive, engaging teaching style. To keep the students interested and motivated, I utilised a mix of lecture-style instruction, group problem-solving sessions, and interactive quizzes.\r\n\r\nThe pupils\' diversions from being at home during the lockdown made it one of my tasks to keep them engaged and focused. To combat this, I promoted involvement, gave frequent feedback, and established a welcoming learning atmosphere where students could ask questions and get answers to their uncertainties.\r\n\r\nAdapting to the various learning demands of the kids presented another difficulty. To make sure that no student was left behind, I had to modify my teaching methods to accommodate pupils with various learning capacities. \r\n\r\nDespite the difficulties, I felt that working with youngsters in a school during a lockdown was tremendously rewarding. It was satisfying to be able to assist pupils in overcoming obstacles and achieving academic success. I was also able to improve my understanding of maths topics and my teaching abilities as a result of the experience.\r\n\r\nIn conclusion, it was both difficult and enjoyable for me to work as a maths instructor during the Covid-19 shutdown. In order to support students in their academic endeavors and help them achieve at a difficult period, I was able to adapt to the virtual environment.', 'sample.docx_$_', 'Copy of Minimalist White and Grey Professional Resume.pdf_$_', '', NULL),
