(176, 502, 'Psychology & Sociology', '[\"Essay Writing\",\"Research Paper\",\"Report Writing\",\"Literature Review\",\"Black Book\",\"Primary/Secondary Data Analysis\",\"Thesis Writing\",\"Review Article\",\"Dissertation Writing\",\"PPT\",\"Questionnaire\",\"Case Studies\"]', 'M.A in clinical psychology', '11:00 am to 5:00 pm', '[\"Psychological Assessment\",\"Psychotherapy - Child, Youth, and Family\",\"Psychological Testing\",\"Psychopathology\",\"Psychotherapies\",\"Psychrometric calculation\",\"A levels Psychology\",\"A Level History\",\"Academic Writing (Research)\",\"Thesis Guidance\",\"thesis\",\"Developmental Psychology\",\"Research in psychology\",\"Research Methodology\",\"Research Methods in Psychology\",\"Research work and article writing\",\"Academic research\"]', '2', '2000-5000', 'www.linkedin.com/in/ kajal-yadav-3929b5152', 'www.linkedin.com/in/ kajal-yadav-3929b5152', 'With a Master \' s degree in Clinical Psychology and 2.6 years of job experience, including freelance academic writing, I possess the necessary skills and knowledge to excel in this role.\n\nThroughout my academic and professional journey, I have gained extensive experience in research, test administration, data collection/interpretation, and administrative support. My strong understanding of research methodology, statistics, cognitive psychology, abnormal psychology, developmental psychology, and related fields enables me to approach academic writing projects with a solid foundation.\n\nCurrently, I am working as a Research Assistant at INCLEN TRUST INTERNATIONAL, where I am involved in the \"DEMENTIA\" project. Within the \"NEURODEVELOPMENTAL DISORDER\" aspect of the project, I have specifically focused on Autism Spectrum Disorder, ADHD, IQ, SQ, and Communication disorder cases. Through my work, I have utilized various assessment tools such as SBIS, VSMS, VAMS, LPT, KABC, BSID IV, CBCL, ASD, ADHD, and GLAD. Additionally, I have successfully led a team of 10 members, overseen data quality checks, conducted training for psychological tests, and managed the entry of over 500 data points.\n\nIn addition to my research experience, I have worked with diverse cultural populations and have exposure to languages such as Hindi, Haryani, and Marathi. These experiences have equipped me with the ability to analyze information sheets provided through data collection and have fostered my understanding of cross-cultural dynamics.\n\nMoreover, my role as a team leader and my involvement with rural Indian children and older adults have provided me with a unique perspective and honed my problem-solving skills. I approach challenges with a well-rounded and empathetic mindset, striving to find effective solutions that cater to diverse needs.\n\nDuring my tenure at Mind Orbit, I had the opportunity to develop a program course for communication skills and contribute content and articles on various projects. This experience further enhanced my ability to write effectively and engage readers in a captivating manner. Additionally, my Master \' s dissertation, titled \"Satisfaction With Assistive Technology: Post Traumatic Growth, Coping, and Affect Among Paraplegic Soldiers,\" allowed me to interact with defense personnel and apply psychological techniques for data collection, evaluation, and drawing meaningful conclusions from the analysis.\n\nAs a freelance psychology academic writer, I am confident in my ability to identify key issues, conduct comprehensive research, and deliver actionable and well-structured content. My passion for research and development fuels my dedication to delivering high-quality work that meets the specific requirements of each project.\n', '5057SAMPLE (2).docx_$_', '6795CV F.pdf_$_', '', '02-06-2023 22:59:43'),
