(256, 432, NULL, '[\"Programming / Coding Assignment\",\"Case Studies\",\"Question and Answer Based\"]', 'Masters in Data science and Big Data analytics', '9AM-9PM', '[\"Statistical Machine Learning,Python Django,Python Basics,SAS,Power BI dashboard,Tableau,Deep Learning, Python, PyCharm,Deep learning with Python programming,Machine Learning,R Statistics\"]', 'GoMechanic', 'https://github.com/manthan281', 'https://www.linkedin.com/in/manthan-deshpande-245230210/', 'During my time as a freelance data analyst, I had the opportunity to work with a variety of clients in different industries, helping them to make sense of their data using tools like Power BI, Python, Tableau, and machine learning.\r\n\r\nOne project I worked on involved creating a Power BI dashboard for a retail company that wanted to track their sales and inventory data in real-time. I built a custom solution that allowed them to monitor key performance indicators like sales by region, top-selling products, and inventory levels, and provided them with actionable insights that they could use to optimize their operations and improve profitability.\r\n\r\nAnother project involved analyzing data from a social media platform using Python and machine learning algorithms to identify patterns in user behavior and sentiment. This involved cleaning and preprocessing the data, running statistical analyses, and using tools like scikit-learn and TensorFlow to build predictive models that could help the client to better understand their users and optimize their marketing campaigns.\r\n\r\nIn addition to these projects, I also worked on several Tableau dashboards for clients in industries ranging from healthcare to finance. These dashboards allowed the clients to visualize complex data sets and gain insights into key trends and patterns, such as patient outcomes, financial performance, and customer demographics.\r\n\r\nThroughout my freelance work, I developed a deep expertise in data analysis and visualization, as well as machine learning techniques and programming languages like Python. I\'m passionate about helping businesses to unlock the full potential of their data and using technology to drive real-world results.', 'movie recommendation system.pptx_$_', 'Manthan Deshpande final res.pdf_$_', NULL, NULL),
