(1323, 1323, 'Commerce', 'ANALYSIS OF THE OPERATIONS MANAGEMENT OF ADIDAS  in terms of Product Manufacturing and Distribution', 'â—	You must prepare and submit an original business report addressing the tasks identified later in this section, but summarised below.\r\nâ—	Your report must analyse and evaluate the operations management of an organisation, or of a specific business unit/division, and draw conclusions over the extent to which its operational capability supports its corporate strategy and provides competitive advantage.\r\n\r\nThe Organisation:\r\nYou must select one focal organisation as the subject of your assignment. Where the organisation has different divisions or a disparate product/service offer, you may have to select one specific area of the organisation for study (i.e., you will need to define the scope to be covered in your report). You may also find it appropriate to select by geographical region, or if the organisation has disparate operations, one of these.\r\n \r\nThe organisation selected should meet the following criteria:\r\nâ—	It should be a well-known business â€“ you will find more data/information on large well-known businesses;\r\nâ—	It must have a website that is available in English and produce annual reports in English;\r\nâ—	It is recommended that your selected company be publicly listed/publicly traded on the stock market â€“ you will find more data/information available on such organisations.\r\n\r\nThe Content of the Assignment:\r\nYou are required to demonstrate your learning from the course material by analysing and evaluating the operations management of your chosen organisation (or business unit/division) in a report containing the following sections.\r\n \r\n1.	A brief introduction to the organisation, including an overview of the environment in which it operates and the pressures that its sector faces. This will give the reader sufficient context to make sense of the report.\r\n \r\n2.	An analysis of the operations of the selected organisation â€“ you must apply the transformation process model and the 4Vs model (and consider the implications) to your selected organization and their operations. In addition to this you should select two further topics/concepts covered in the module or from your wider reading (relating to operations management) this might be (as appropriate to the organisation) â€“ performance objectives and current performance, the types of operating process, the service concept (what the operations systems are designed to deliver), location and layout, capacity management, the scheduling and control of resources, supply chain management, quality assurance or the application of TQM principles, the application of â€˜leanâ€™ principles.\r\n\r\nThis section is likely to represent the largest part of the Report and it is for you to decide which concepts/theories/models you include in this section.\r\n \r\n3.	The identification of the major strengths and weaknesses of the operation â€“ achieved performance against required performance. From your analysis, you should also consider the extent to which the operations functions support the broader business strategy of the organisation, and the extent to which the organisationâ€™s operations capability is used to create competitive advantage.\r\n\r\nPresenting coursework for assessment:\r\nYour assignment when submitted should not include your name â€“ we use a system of anonymous marking to reduce the risk of any unconscious bias. \r\n\r\nThe authentic and essential requirements for this piece of assessed work are:\r\nâ—	The report must contain a reference list. All sources cited must be referenced in the report. The Harvard referencing system must be used. \r\nâ—	You must use at least 10 academic sources other than the set texts (and ideally substantially more). In addition to academic sources, youâ€™re expected to utilise â€˜otherâ€™ sources to provide information, data and insights into your selected organisation and its operations.\r\nâ—	The assignment must be structured and presented as a formal business report.\r\nâ—	Arial font size 12 is recommended for the main body/text.\r\n\r\nThe report length should not exceed 2,500 words.\r\n', 'MSc Management and Business Analytics', 'Masters', '[\"Report Writing\"]', '[\"Operations management\"]', '2023-04-21 13:00', '40 pounds', 'Assignment Brief.docx_$_', '2023-05-22 18:42:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
