(1783, 1783, 'Commerce', 'Influence of social media on one aspect of tourist consumer  behaviour - Essay words -1500', 'Critically assess the extent to which social media (SM) impact on one aspect of tourist \r\nconsumer behaviour (CB). \r\nSM play an important role at different stages of touristsâ€™ planning process, which can \r\nbe defined as pre-travel, during-travel, and post-travel. Tourists use SM to achieve \r\ndifferent goals which may range from finding an inspiration to travel, staying in-touch \r\nwith friends and family whilst in destination, or complaining about a disappointing \r\nexperience. \r\nYou are required to identify one aspect of tourist CB and critically evaluate the extent \r\nto which social media impact upon it. For instance, you may want to focus on one of \r\nthe following aspects of tourist CB: loyalty, satisfaction, motivation to share travel \r\nexperiences, risk perception, or perception of credibility.', 'Digital marketing', 'Masters', '[\"Essay Writing\"]', '[\"Digital Marketing\",\"digital marketing\"]', '2023-06-29 02:00', '3000', '4299Summary and reflection .docx_$_4299summary & reflection W2.docx_$_4299HOTO7028 Module Handbook 2023 S3.pdf_$_', '25-06-2023 14:58:26', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
