(1786, 1786, 'Arts', 'Firdows - Topic: Assessing the effetectiveness of MANDALA ART  in improving selective attention of attention deficit hyperactivity disorder (ADHD) Children.  Objective:  The objective of the study is to determine the effectiveness of  colouring mandala art therapy  in the  improvement of selective attention among children diagnosed  with attention deficit hyperactivity disorder (ADHD).  Research question: What is the effect of colouring Mandalas through art therapy on the selective attention of children with attention deficit hyperactivity disorder (ADHD)?', 'Topic: Assessing the effetectiveness of MANDALA ART  in improving selective attention of attention deficit hyperactivity disorder (ADHD) Children.\n\nObjective:  The objective of the study is to determine the effectiveness of  colouring mandala art therapy  in the  improvement of selective attention among children diagnosed  with attention deficit hyperactivity disorder (ADHD).\n\nResearch question: What is the effect of colouring Mandalas through art therapy on the selective attention of children with attention deficit hyperactivity disorder (ADHD)?\n\nMethod : Quasi-experimental  design.\n\nAnalysis: paired t test', 'Psychology', 'Bachelors', '[\"Research Paper\"]', '[\"Psychological Assessment\"]', '2023-06-27 04:00', '4000', '4299IMG-20230615-WA0003.jpg_$_4299IMG-20230615-WA0004.jpg_$_4299IMG-20230615-WA0005.jpg_$_', '26-06-2023 15:47:09', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
