(1794, 1794, 'Commerce', 'Title- Ethics in fast fashion industry report 2000 words', 'PFA word doc and images of the guidelines which has to be followed to make the 2000 words report by following the structure and also keeping in mind that client has taken the \"group I\" and is acting as an Investor in the stakeholder position.\n\nPlease focus more on Point 3&4(investor point of view) as this will be the main part for their presentation that is due later. There is no sample for this so please make the best quality as per your understanding. \nExpected marks-65/100 minimum', 'International business management', 'Masters', '[\"Report Writing\"]', '[\"Corporate social responsibility\"]', '2023-06-28 02:00', '5000', '4299Screenshot 2023-06-27 at 4.50.12 PM.png_$_4299Screenshot 2023-06-27 at 4.50.03 PM.png_$_4299Screenshot 2023-06-27 at 4.54.24 PM.png_$_', '27-06-2023 23:25:19', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1795, 1795, 'Arts', 'DIGITAL MARKETING AND CONSUMER EXPERIENCE ', 'You are required to identify one aspect of tourist CB and critically evaluate the extent to which social media impact upon it. For instance, you may want to focus on_one of the following aspects of tourist CB: loyalty, satisfaction, motivation to share travel experiences, risk perception, or perception of credibility.\nTo identify the one aspect of CB you will focus on in this assignment you will need to engage in weekly lectures, seminar discussions, and read around the topic independently and with assistance of the reading list on this module. Please note, the reading and writing tasks in week 1 and 2 (please see reading lists for week 1 and 2) will be critical to this stage. Once you make the choice, you will need to identify and critically evaluate literature relevant to this CB concept. The literature should comprise predominantly of academic research papers published in reputable journals such as:\nTourism Management, Annals of Tourism Research, Journal of Travel Research, Current Issues in Tourism, International Journal of Tourism Research, Journal of Vacation Marketing, or Tourism and Recreation Research.\n\nAlthough the number of relevant sources will depend on the concept of choice, it is unlikely your answer will achieve the required depth of analysis and extent of synthesis with less than ten to fifteen sources.\nIn writing your essay, you should assume that you are writing to an audience that is not familiar with the concept of choice. You should make sure that at the outset of your essay you clearly define this concept by synthesising information from a number of sources and highlighting key debates or disagreements in the literature. This part will serve as a conceptual basis for the main discussion of arguments relevant to the influence of SM on the tourist CB concept of your choice. The essay should culminate in a brief summary of the key points regarding the influence of SM on the one aspect of tourist CB.\nPrevious 30 Days', 'international hospitality ,  events and tourism ', 'Masters', '[\"Essay Writing\"]', '[\"digital marketing \",\"Hospitality and Tourism\"]', '2023-06-28 19:00', '3000', '1711Summary & reflection of week 1 .txt_$_', '27-06-2023 23:59:43', '', '4', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1796, 1796, 'Commerce', 'Referred deferred assignment', 'Analysis of estimating the value drivers under three scenarios', 'Finance', 'Masters', '[\"Essay Writing\"]', '[\"Finance & Management Accounting\"]', '2023-06-29 04:00', '7000', '4299Homeserve Plc - Annual Report and Accounts 2022.pdf_$_42997ACCN021W Referred-Deferred Assignment July 2023 (UPDATED 2).docx_$_', '28-06-2023 16:56:37', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL),
(1797, 1797, 'Commerce', 'social and digital marketing ', 'You are required to submit an individually prepared report of up to 3000 words which proposes\nan exciting new Digital Marketing Strategy to your chosen organisation*, in support of their\nbusiness objectives, and proposes the adoption of a digital technology that will assist in the\nimplementation of the proposed Digital Marketing Strategy. This should be based on the same\norganisation as the one used in the Masterclasses and your evaluation should be informed by\npractical work carried out in the Masterclasses and seminars combined with academic and\npractitioner sources arising from classroom teaching and your own research.\nThe Task\nDigital Marketing Strategy: Propose, explain and justify a Digital Marketing Strategy, leading\nto an effective Action Plan, to the senior management of your chosen organisation.\nRecommendations: State, and justify, three aspects of your proposed Digital Marketing\nStrategy that the organisation should adopt immediately.\nProposed Technology: Justify your choice of a digital technology** based on an evaluation\nof its current use, and effectiveness, in Digital Marketing and explain which aspects of the\nproposed Digital Marketing Strategy will be improved through its use. Additionally, analyse its\ndisruptive nature, using theory and market data to support your points.\nInformation Sources: demonstrate your engagement with a wide range of credible sources,\nboth academic and practitioner.', 'MSc Marketing communications management ', 'Masters', '[\"Research Paper\",\"Literature Review\",\"Thesis Writing\",\"Primary/Secondary Data Analysis\",\"Case Studies\"]', '[\"masters\",\"Research\"]', '2023-07-07 00:00', '4400', '5097MARK7001 Module Handbook S3 2022 - 23 (2).pdf_$_', '28-06-2023 17:11:43', '', '16', NULL, 1, 1, 1, 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL);

